(72785, 'zhTW', '貢獻物資：龍金碎礦', '', '', '', '', '', '', '', '', 47187),
(72784, 'zhTW', '支持鈷藍集會', '在鈷藍集會與范希交談。', '$n，你來得正是時候。\n\n你聽過鈷藍集會嗎？這裡曾經是個美妙的地方，住著許多我的同胞。\n\n但是碎裂火焰軍把我們趕出去，佔領了這個地方。\n\n我們一直希望奪回這裡，可是從最新的局勢發展看來，這個希望似乎越來越渺茫。\n\n你可以伸出援手、幫助我們嗎？可以的話，請到鈷藍集會與范希見面。', '', '', '', '', '', '在鈷藍集會與范希交談', 47187),
(72783, 'zhTW', '製作訂單', '和首席辦事員蜜茲‧史拉佐洛交談，了解製作訂單的詳情。', '你從那個泰坦裝置弄到了一個不錯的東西。馬上交出來！\n\n…開玩笑的！我連那個東西要怎麼使用都不曉得，你說是吧？\n\n去和蜜茲‧史拉佐洛談一談。她弄出了一個叫做「製作訂單系統」的東西，可以讓大家更容易找到幫手。\n\n把貨物擺上去，有人就會收走然後幫你做出東西。\n\n很簡單對吧？趕快去找蜜茲！還有別說是我叫你過去的！', '', '', '', '', '', '', 47187),
(72773, 'zhTW', '精妙學習', '在沃卓肯與葛雷茲‧煤指見面。', '有幾位哥布林正在沃卓肯調查一個遺棄的泰坦裝置。\n\n坦白講，他們引起了不小的騷動。有人甚至擔心，他們帶來的壞處可能遠遠大過好處。\n\n要是你能和這些哥布林碰個面、協助他們找出解決辦法，沃卓肯的居民一定會非常感謝你。\n\n…但是請別把我們的城市給毀了。', '', '', '', '', '', '在沃卓肯與葛雷茲‧煤指見面。', 47187),
