(72729, 'zhTW', '大史瓦格蛙', '把生鏽的龍島錢幣帶給雍亞拉平原的大史瓦格蛙。', '一枚在巨龍群島找到的特殊硬幣。\n\n你聽其他的釣友說過，雍亞拉平原有個生物在收集這種東西。', '', '', '', '', '', '', 47187),
(72728, 'zhTW', '世界任務正等著你', '完成10個巨龍群島的世界任務。', '你知道怎樣可以證明你有多厲害嗎？幫助巨龍群島的民眾！\n\n這裡有很多的問題要解決。去幫助他們，讓我見識你有多厲害！', '', '', '', '', '', '', 47187),
(72709, 'zhTW', '資助尋寶活動', '從編目員潔可思那裡購買考古學家文物筆記。', '<編目員潔可思迅速翻開自己的補給袋，拿出一張新繪製的地圖。>\n\n我們的一位考古學家剛剛報告了關於遺失文物的線索，可能就在這個地區。\n\n如果你願意捐贈這些物資來資助考古學家的下一次探險，你就能獲得這張寶藏的線索地圖。', '', '', '', '', '', '', 47187),
(72708, 'zhTW', '巨龍群島補給品', '將巨龍群島補給袋送去給翼息大使館的編目員潔可思。', '<那隻元龍一定是從一個倒楣的龍鱗遠征隊成員手上搶走了這袋物資。\n\n翼息大使館的編目員潔可思會知道要怎麼做。>', '', '', '', '', '', '將巨龍群島補給袋送去給翼息大使館的編目員潔可思。', 47187),
