(72686, 'zhTW', '風暴洶湧', '在元素風暴中擊敗獲得元素注能的生物，收集元素溢流。', '$n，洪荒使者在巨龍群島各地召喚出劇烈的元素風暴。\n\n當這些風暴出現時，請盡速趕過去殺掉灌注了洪荒能量的敵人。\n\n然後收集敵人身上的元素溢流。越是強大的敵人，打敗他們能獲得的元素溢流就越多。\n\n我們絕不能坐視洪荒使者繼續濫用元素的力量。', '', '', '', '', '', '', 47187),
