(72648, 'zhTW', '生命火花：蒼藍高地', '在戰爭模式下，於蒼藍高地收集$1oa個生命火花。', '浪潮襲來，把生命的禮讚帶到蒼藍高地。\n\n這時候就是該陪伴朋友、陪伴家人、享受美食，以及開創新的故事。', '', '', '', '', '', '在沃卓肯和戰地管理員安柏瑞斯交談。', 47187),
