(72585, 'zhTW', '開放導覽', '在每個主要陣營據點完成導覽介紹任務：龍鱗基地、莫魯凱、伊斯凱拉及沃卓肯。', '英雄，你為巨龍群島做出了許多的貢獻。\n\n大家都很感激你的付出，想要歡迎你進一步融入他們的群體。去找他們談談，了解一下每個群體和他們的特長。\n\n我想你會發現，就像你可以為巨龍群島做很多事一樣，這裡有很多人也想要回報你！', '', '', '', '', '', '', 47187),
(72584, 'zhTW', '架設你自己的漁網', '在河口釣魚洞架設捕漁網。', '想要試用看看你的漁網嗎？前往甦醒海岸南部的河口，並找到魚量豐富的地方。那裡應該會有架設漁網的好地點。', '', '', '', '', '', '', 47187),
(72560, 'zhTW', '攀爬', '', '', '', '', '', '', '', '', 47187),
(72525, 'zhTW', '基礎編目裝備', '使用遠征補給工具組來研究編目裝備。', '每個遠征隊記錄員都值得擁有自己的相機！\n\n你不需要幫你的相機取特別的名字，但我非常建議這麼做。這樣更好玩。\n\n總之，探路者傑布應該可以給你所有需要的工具。\n\n我還沒遇過什麼我需要、但他沒帶的東西。他超厲害的！', '', '', '', '', '', '', 47187),
(72524, 'zhTW', '基礎攀岩裝備', '使用遠征補給工具組來研究攀岩裝備。', '<探路者傑布指了指他身旁的補給工具組。>\n\n你會需要補給品才能在外頭生存。\n\n我給你一些攀爬會需要的用具吧。', '', '', '', '', '', '', 47187),
(72519, 'zhTW', '時間兩調', '在亞茲莫洛斯對克羅米及伊特努斯使用時空水晶，阻止他們繼續墜落穿梭時空。', '我知道了…他們墜落時不僅穿越時間，也穿越許多可能性。\n\n快點，我已經定位出時間線中的另一個點，我們有可能趕上他們。那地方…很不尋常，但是，別讓這個世界的古怪現象耽誤了你的行動。克羅諾穆的命運就掌握在你的手中。', '', '', '', '', '', '回去找現在的諾茲多姆。', 47187),
(72512, 'zhTW', '低語微風', '在雍亞拉棲息地靠近雍亞拉。', '<戈多洛托疑惑地歪著頭、朝你點了個頭，然後終於正眼注視著你。但是一會兒之後，她又把目光移向天際…以及莫魯凱旁邊的山峰。你感覺她希望你前往雍亞拉棲息地。>', '', '', '', '', '', '在雍亞拉棲息地靠近雍亞拉。', 47187),
(72488, 'zhTW', '薩爪祖斯進階巡迴賽', '在薩爪祖斯的每個進階賽道飛行。', '又輪到薩爪祖斯了！其中的山峰、低谷與賽道都已經準備好，等著你前去競速。\n\n去找我的青銅龍同事，在進階賽道飛行，完成你巨龍群島巡迴賽的壯舉！', '', '', '', '', '', '', 47187),
(72487, 'zhTW', '薩爪祖斯巡迴賽', '在薩爪祖斯的每個競速賽道飛行。', '薩爪祖斯！守護巨龍之座的所在之地，龍族歷史的重要舞台。\n\n同時也有許多高聳的山峰及深險的溝壑給你飛越！\n\n像之前一樣，在你四處探索的時候，我的青銅龍同事已經設置了競速賽道。\n\n何不試試這些賽道，讓你的巡迴賽資歷更加完整呢？', '', '', '', '', '', '', 47187),
(72486, 'zhTW', '蒼藍高地進階巡迴賽', '在蒼藍高地的每個進階賽道飛行。', '蒼藍高地的進階賽道旨在把你的飛龍騎術技巧磨練到全新的高度。\n\n只要…小心別從那麼高的地方摔下來！\n\n等你準備好就去找我的青銅龍夥伴，在這些賽道盡興飛翔吧！', '', '', '', '', '', '', 47187),
(72485, 'zhTW', '蒼藍高地巡迴賽', '在蒼藍高地的每個競速賽道飛行。', '蒼藍高地的賽道是極為獨特的體驗。有高聳的山峰，連綿的雪地和茂密的森林，形成各式各樣的障礙與挑戰！\n\n當你在蒼藍高地的時候，別忘了去找我的青銅龍同伴，試試他們規劃的賽道！', '', '', '', '', '', '', 47187),
(72484, 'zhTW', '雍亞拉平原進階巡迴賽', '在雍亞拉平原的每個進階賽道飛行。', '進階的賽道會更有挑戰性，但我相信你會有辦法應付的！\n\n我的青銅龍同伴已經在雍亞拉平原安排好進階賽道，飛行途中會出現障礙物和一些小驚喜。然後你也可以挑戰打破你自己的最佳紀錄！\n\n祝你好運！', '', '', '', '', '', '', 47187),
(72483, 'zhTW', '雍亞拉平原巡迴賽', '在雍亞拉平原的每個競速賽道飛行。', '啊，雍亞拉平原。寬闊的開放空間、強勁的風勢、一望無際的美景…以及更多競速賽道！\n\n就和甦醒海岸一樣，如果你找到我的青銅龍同伴，就和他們談談體驗競速賽道的事情吧。', '', '', '', '', '', '', 47187),
(72482, 'zhTW', '甦醒海岸進階巡迴賽', '在甦醒海岸的每個進階賽道飛行。', '既然你已經飛過巨龍群島各處的基礎賽道並證明你的實力，要不要試試新挑戰啊？\n\n進階賽道和你飛過的標準賽道很類似，但大部分都有經過調整的飛行路線或額外的障礙物，更能考驗你的飛行技巧。\n\n我們就從甦醒海岸的進階賽道開始吧！', '', '', '', '', '', '', 47187),
(72481, 'zhTW', '甦醒海岸巡迴賽', '在甦醒海岸的每個競速賽道飛行。', '騎乘飛龍最刺激的活動是什麼？當然是飛龍競速！\n\n我的青銅龍同伴已經在巨龍群島各處規劃了不同的競速賽道。這裡的地形景觀真是多變又豐富，彷彿在求人用最高速度飛越一樣。\n\n如果你碰巧經過我們在甦醒海岸的競速賽道，何不順道試試看呢？', '', '', '', '', '', '', 47187),
(72456, 'zhTW', '信任聖典', '取回黑曜祖譜的書籍，並帶去給怒西昂和賽柏利安的軍需官。', '雖然已經守住了黑曜龍堡的上部堡壘，加拉登部隊依然持續在掠奪中庭。那個地區到處都是無價的歷史紀錄！我們必須盡快行動，保全黑龍軍團血脈的東西。\n\n怒西昂跟賽柏利安都想要這個資訊，所以你可以各為他們取得一本寶典，用來討好他們。\n\n前往堡壘的崩塌高塔。你應該會發現值得取回的東西。', '', '', '', '', '', '', 47187),
(72448, 'zhTW', '保全我們的遺產', '在黑曜龍堡或熔渣泥沼擊殺兩個精良敵人。', '我付出了這麼多、努力了這麼久可不是為了現在失去堡壘！\n\n很不幸的是，新的威脅出現了。我可以仰賴你的協助，讓你處理敵人嗎？\n\n幫忙守住這座區域，找出並消滅兩個最強大的敵人。', '', '', '', '', '', '', 47187),
(72447, 'zhTW', '最大的威脅', '在黑曜龍堡或熔渣泥沼擊殺兩個稀有敵人。', '強大的加拉登和其他生物都會威脅到黑曜龍堡和我軍團的安危。\n\n此事無法容忍。\n\n幫忙守住這座區域，找出並消滅兩個我方最強大的敵人。', '', '', '', '', '', '', 47187),
(72435, 'zhTW', '導覽介紹：伊斯凱拉', '去認識一些擁有寶貴裝備的商人。', '歡迎來到伊斯凱拉，朋友。\n\n你對抗蕨皮豺狼人的戰功已經在我們的人民之間傳遍了。你已經認識了許多我們的族人，也有更多人想要找機會和你交換知識與裝備。\n\n請你花點時間，把自己介紹給伊斯凱拉各處的友好居民吧。我們是個會互相支持的群體，就像你可以為我們做很多事一樣，相對的，我們的許多族人也可以為你做很多事情。', '', '', '', '', '', '', 47187),
(72434, 'zhTW', '晶紅生命聖殿迴圈賽道', '完成晶紅生命聖殿迴圈賽道。', '他們說我還不夠大，有些賽道還不能參加。\n\n但我依然可以看其他人參賽。你應該參賽的！這樣我就可以看你競速飛行。', '', '', '', '', '', '完成晶紅生命聖殿迴圈賽道。', 47187),
(72429, 'zhTW', '導覽介紹：莫魯凱', '在莫魯凱與名望守衛者以及名望軍需官會面。', '<桑索克可汗嘆了口氣，歐奇爾隨即為可汗發聲。>\n\n莫魯克這個民族並不會堅定地反對外來者，但我們確實需要潛在的盟友先證明他們的能耐。在你認識各氏族並協助我們的冒險之後，支持你的消息就會傳開。\n\n在山丘上的可魯塔較低的樓層中，你會找到大可汗瑪托拉的一位女兒，她可以協助你了解你在我們族人之間的定位。記得去自我介紹一下。', '', '', '', '', '', '', 47187),
(72428, 'zhTW', '角蛙囤積者', '從巨龍群島的角蛙身上收集20個刺眼寶石，交給龍鱗遠征隊的諾克林‧異圈。', '這片土地的角蛙對寶石、珠寶和所有閃亮的東西十分癡迷，這不是什麼秘密。噢，我前幾天還在一些角蛙糞便中找到非常稀有的珠寶！\n\n嗯，這項任務可能稱不上吸引人，但角蛙似乎不只有收集貴重物品的習慣，甚至也會把它們吞掉。', '', '', '', '', '', '', 47187),
(72427, 'zhTW', '活化灌注', '從巨龍群島的鞭笞者身上收集13份尖刺之葉，交給莫魯克半人馬的杜瑞娥。', '我今天有個簡單的任務要交給你。\n\n鍊金師現在缺少一種原料，是用來調製一種特別刁鑽的配方的。草藥的取得並不難。你只需要找凶狠的植物來採取樣本就好。你辦得到吧？', '', '', '', '', '', '', 47187),
(72423, 'zhTW', '度過風暴', '從巨龍群島的諾庫德半人馬身上收集12個暴風武裝，交給伊斯凱拉巨牙海民的天納宇。', '啊，你來得正是時候。聽說諾庫德半人馬的武器灌注了風暴附魔，變得十分強大而危險。我們想要拿幾件給我們的附魔師研究看看。\n\n至少，我們把敵人的武器作廢了，拿來做更好的用途。', '', '', '', '', '', '', 47187),
(72410, 'zhTW', '鐮與尖針', '從巨龍群島的鐮螳螂身上收集10個刺刺螯鉗，交給龍鱗遠征隊的諾克林‧異圈。', '我們最近裁縫用的針不太夠了。那些可惡的東西一直斷成兩半！\n\n這個地區的鐮螳螂身上的尖刺部位應該可以當成不錯的替代品。', '', '', '', '', '', '', 47187),
(72406, 'zhTW', '導覽介紹：沃卓肯', '在沃卓肯認識重要的協調者供應商。', '歡迎來到沃卓肯，$p。我是烏納托斯，是沃卓肯協調者的名望守衛者。\n\n你對龍族的援助已經獲得認可，城裡各處的供應商已經獲得授權，要為你提供我們最精良的裝備。\n\n何不花點時間，去熟悉一下他們的位置和裝備呢？', '', '', '', '', '', '', 47187),
(72399, 'zhTW', '隱士的花園', '在暗影斷崖與薩瑞斯說話。', '我們的父母總是說，我們不應該到蓋利奇爾上面的花園去。他們認為園丁很兇又很危險。\n\n不過那才不是真的！他是有點難相處，但其實他人很好！\n\n自從洪荒使者出現後，我們就沒再上去過了。現在那裡太危險了。不過，我希望園丁沒事。因為我們現在不能去了，你可以去看看他好不好嗎？', '', '', '', '', '', '', 47187),
(72397, 'zhTW', '導覽介紹：龍鱗基地', '在龍鱗基地認識重要的供應商。', '歡迎來到駐紮地，$p。\n\n我跟多蒂花了一番功夫才決定出建立營地的完美地點，但我非常滿意我們的選擇。\n\n這裡離遺跡和元龍繁殖地當然還有巨龍軍團都很近。\n\n何不花個幾分鐘探索一下營地，認識一下負責支援遠征隊的供應商呢？', '', '', '', '', '', '到龍鱗基地帳篷與多蒂‧鬍鬚會面。', 47187),
(72394, 'zhTW', '巨龍群島補給品', '', '', '', '', '', '', '', '', 47187),
