(72380, 'zhTW', '團結就能戰勝一切', '返回守護巨龍之座，把在洪荒化身牢獄擊敗菈薩葛絲後發生的事告知雅立史卓莎。', '$n，你必須告訴雅立史卓莎和諾茲多姆發生了什麼事。\n\n卡德加跟我隨後就會到守護巨龍之座與你會合。', '', '', '', '', '', '回去沃卓肯的守護巨龍之座找『生命守縛者』雅立史卓莎。', 47187),
(72374, 'zhTW', '支援協調者：龍禍要塞', '前往甦醒海岸，並圍攻龍禍要塞。繼續在巨龍群島各地協助沃卓肯協調者和他們的盟友。', '隨著我們繼續在群島各地努力，我們的盟友要再次尋求你的協助。沃卓肯城牆內的人們知道你的努力一同塑造了我們的未來，都表示出踏實的寬慰。\n\n現在，來說正事。\n\n一股滯留的加拉登威脅已經轉移到甦醒海岸，就在龍禍要塞深處的悶燃煉獄內。我們必須行動，阻止他們的進攻。\n\n我們靜待你歸來，$n。', '', '', '', '', '', '', 47187),
(72373, 'zhTW', '支援協調者：狩獵開始', '在巨龍群島協助莫魯克狩獵。繼續在巨龍群島各地協助沃卓肯協調者和他們的盟友。', '我們來自雍亞拉平原的盟友傳來了求助的訊息，希望這片土地上所有的獵人伸出援手，協助他們達成目標。\n\n當你在這片群島各處繼續你的工作時，順便去我們盟友的狩獵營地拜訪他們，協助他們完成目標吧。\n\n還有很多事要做。最好盡快動身。', '', '', '', '', '', '', 47187),
