(72354, 'zhTW', '寶庫', '從寶庫取得一件戰利品。', '多年來，守護巨龍和龍族同胞獲取了許多強大的裝備與武器。守護巨龍命人建造一座魔法寶庫，用來存放與看守這些寶物，直到配得上它們的人出現來尋找其中的寶物。\n\n寶庫就在銀行這邊。只要你能證明自己的本領，或許它就會給你守護巨龍的一件遠古寶物。', '', '', '', '', '', '', 47187),
(72338, 'zhTW', '大型黑曜鑰匙', '收集$1oa把組好的鑰匙', '將組好的鑰匙交給我', '', '', '', '', '', '將組好的鑰匙交給黑龍堡壘內的任何陣營。', 47187),
