(72293, 'zhTW', '巨龍群島的冒險', '檢視偵察地圖，選擇巨龍群島的一個地區來提供支援。', '噢，我知道你可以做什麼！\n\n龍鱗遠征隊在附近張貼了一張非常精美的巨龍群島地圖。\n\n要我說的話，他們的繪製十分精準和詳盡。抱歉，你來這不是為了聽藝術評論。\n\n你應該去瞧瞧那張地圖，看看巨龍群島的那些地區需要你的幫忙！', '', '', '', '', '', '', 47187),
(72292, 'zhTW', '令人嘆為觀止的勝利故事', '將你的勝利故事告訴伊斯凱拉的波雅長老。', '那是場磅礡的戰鬥！\n\n伊斯凱拉的波雅長老會有興趣聽一聽那段令人印象深刻的勝利故事。', '', '', '', '', '', '', 47187),
(72291, 'zhTW', '令人難忘的勝利故事', '將你的勝利故事告訴伊斯凱拉的波雅長老。', '那是場不錯的戰鬥！\n\n伊斯凱拉的波雅長老會有興趣聽一聽那段勝利的故事。', '', '', '', '', '', '', 47187),
