(72269, 'zhTW', '薩爪祖斯', '前往沃卓肯，並與『生命守縛者』雅立史卓莎會面。', '『生命守縛者』雅立史卓莎安排了一場守護巨龍之座會議，要討論洪荒使者的威脅。\n\n她發出了呼籲，希望有意願的冒險者都去幫忙。', '', '', '', '', '', '前往沃卓肯，並與『生命守縛者』雅立史卓莎會面。', 47187),
(72268, 'zhTW', '蒼藍高地', '在雍亞拉平原上和『智者』瑪蘇德說話。', '祈倫托會需要所有人的幫忙，來追蹤藍龍誓約石。\n\n有人看見他們的一些法師在雍亞拉平原尋求幫助。', '', '', '', '', '', '', 47187),
(72267, 'zhTW', '雍亞拉平原', '到晶紅鱗哨站與陶拉莎大使會面。', '綠龍軍團需要冒險者的援助。為了達成目標，你必須和平原的半人馬成為盟友。\n\n陶拉莎大使可以協助你。', '', '', '', '', '', '', 47187),
(72266, 'zhTW', '甦醒海岸', '在甦醒海岸與仙卓克絲碰面。', '龍獸仙卓克絲在找人幫忙協助甦醒海岸所有的新來者。', '', '', '', '', '', '', 47187),
(72263, 'zhTW', '騎士精神不死', '學習如何騎乘你的私人沃昆坐騎。', '喚能師！這個地方還是有成群的沃昆！\n\n我成功圍捕了幾隻，在你的翅膀累的時候可以當成坐騎。記得要怎麼騎嗎？\n\n這頭是分配給你的，因為龍隊指揮官一直叫你去各個地方。請你好好照顧它。', '', '', '', '', '', '', 47187),
(72261, 'zhTW', '不只是監牢？', '將遠古牢獄文物交給莉莉安‧明月。', '<這個遠古文物的本質似乎偏向元素。沃卓肯的莉莉安‧明月或許能夠提供更多情報。>', '', '', '', '', '', '', 47187),
(72260, 'zhTW', '牢獄文物', '', '', '', '', '', '', '', '', 47187),
(72259, 'zhTW', '牢獄文物', '', '', '', '', '', '', '', '', 47187),
(72256, 'zhTW', '黑爪兵團', '把龍隊指揮官的命令傳達給寇德西以及黑爪兵團。', '娜蕾迪亞非常熱情，但她是歷史學家、不是士兵。她不了解我們在巨龍群島會面臨的危險。\n\n也不是每個人都得擔心這種事情。畢竟，黑爪兵團會負責保護遠征隊。\n\n我要和厄比西昂以及你們的部落領袖討論任務調度的事情。\n\n我的副手寇德西正在和其他半龍人一起探索這座城市。麻煩你去通報他，我們要在飛艇高塔集合。他會把我的命令轉達給其他人。', '', '', '', '', '', '在奧格瑪城外的飛艇高塔和娜蕾迪亞會合。', 47187),
(72254, 'zhTW', '漁夫丁納克的鬼魂', '', '', '', '', '', '', '', '', 47187),
(72253, 'zhTW', '巨龍群島釣魚', '', '', '', '', '', '', '', '', 47187),
(72252, 'zhTW', '巨龍群島釣魚', '', '', '', '', '', '', '', '', 47187),
(72251, 'zhTW', '巨龍群島烹飪', '', '', '', '', '', '', '', '', 47187),
(72250, 'zhTW', '巨龍群島烹飪', '', '', '', '', '', '', '', '', 47187),
(72249, 'zhTW', '巨龍群島裁縫', '', '', '', '', '', '', '', '', 47187),
(72247, 'zhTW', '巨龍群島珠寶設計', '', '', '', '', '', '', '', '', 47187),
(72246, 'zhTW', '安詳夢境', '和水療中心主管交談。', '歡迎來到安詳夢境水療中心！\n\n非常抱歉。由於某些情況超出我們的控制，因此我們目前無法接待新顧客。\n\n請容我將你轉介給水療中心主管席安‧棘爪。他會負責解答你的所有疑問。', '', '', '', '', '', '', 47187),
(72245, 'zhTW', '巨龍群島鍊金術', '', '', '', '', '', '', '', '', 47187),
(72244, 'zhTW', '巨龍群島銘文學', '', '', '', '', '', '', '', '到翼息大使館與潔莎敏‧史皮茲交談。', 47187),
(72243, 'zhTW', '巨龍群島草藥學', '', '', '', '', '', '', '', '', 47187),
(72242, 'zhTW', '巨龍群島工程學', '', '', '', '', '', '', '', '', 47187),
(72241, 'zhTW', '來自過去的教訓', '與龍隊指揮官安珀莎交談。', '我是安珀莎，半龍人的龍隊指揮官。在我們從漫長的靜滯中醒來後，怒西昂幫了我們，現在換我幫他了。\n\n你對我的族人和我們的歷史感到疑惑是理所當然的。直到最近，我也有相同的疑惑。\n\n但是『永恆之王』諾茲多姆揭露了半龍人失落的真相。他讓我看見了我們的起源…以及我們為何會被封印。\n\n讓我告訴你我所看見的一切。', '', '', '', '', '', '', 47187),
(72240, 'zhTW', '黑曜衛隊', '把龍隊指揮官的命令傳達給德維希安以及黑曜衛隊。', '這位多蒂的熱情真是令人敬佩。希望這不會反過來害她對巨龍群島的危險視而不見。\n\n無論如何，黑曜衛隊會堅守職責，保護遠征隊。\n\n不過，我得先和怒西昂跟總指揮官談談接下來的任務。\n\n我的半龍人同胞正在探索這座城市。去找德維希安，她是我最可靠的副手，通知她我們要在碼頭集合。她會把我的命令轉達給其他的人。', '', '', '', '', '', '把辦好事情的消息告訴暴風港的多蒂‧鬍鬚。', 47187),
(72193, 'zhTW', '阿爾蓋薩學院', '參觀阿爾蓋薩學院。', '我明白阿爾蓋薩學院打算重新向全世界開放它的大門。\n\n很久以前，這座學術聖地只對龍族開放。但是經過了這麼多年，院長也領悟到讓有志向學的人都有機會來此就讀的益處。而且她還要我多推薦一些有資質的新生來就讀。\n\n你是龍族的重要盟友，如果你願意來就讀將是我們的榮幸。要不要註冊入學就交由你決定，但是我相信朵拉苟莎一定會很樂意親自帶你參觀校園。', '', '', '', '', '', '', 47187),
(72192, 'zhTW', '灌注迴廊：從無序到有序', '進入灌注迴廊並擊敗洪荒海嘯。', '洪荒使者企圖讓這個世界陷入元素失序的混沌狀態，而且為了達成目標，他們無所不用其極。\n\n我接獲令人煩惱的消息，指出他們已經潛入提爾堡深處的灌注迴廊，企圖破壞守衛者提爾的努力成果、實現他們的邪惡計畫。\n\n$n，請你務必前往神聖的灌注迴廊，終結洪荒使者的威脅。', '', '', '', '', '', '', 47187),
(72191, 'zhTW', '稀少供應獎勵', '', '', '', '', '', '', '', '', 47187),
(72190, 'zhTW', '蓄水池保留區', '找到祖提奇。', '$C！我知道有人急需你的援助。\n\n提爾堡蓄水池剛剛遭受洪荒使者攻擊。我雖然幸運逃生，但其他人恐怕就沒那麼幸運。\n\n蓄水池就在這裡的北方。去找祖提奇，她能告訴你更多詳情。\n\n要是她還活著的話。', '', '', '', '', '', '', 47187),
(72189, 'zhTW', '花園多樣性', '與古爾佩奇交談。', '你喜歡蝴蝶花園嗎？\n\n你知道，這裡的南方有一個規模更大的花園。負責照料花園的是一個老龍獸，名叫古爾佩奇。\n\n他那裡一直很缺幫手。他有個「助手」，但我從沒真的見過他。我無法想像他能幫上多少忙。\n\n要是你到了那裡，一定要讓他知道是席娜派你去的。', '', '', '', '', '', '', 47187),
(72175, 'zhTW', '美妙的權杖之爭', '為沃卓肯的索拉苟莎製作$1oa把奇觀權杖：火焰和$2oa把奇觀權杖：空氣。', '這週有值得完成的訂單！阿爾蓋薩學院的學生一直在對這些有趣的權杖爭論不休。\n\n你何不贊助幾把權杖呢？', '', '', '', '', '', '', 47187),
(72172, 'zhTW', '精華、裂片和炫彩之塵', '為沃卓肯的索拉苟莎製作$1oa份炫彩之塵。', '我們一直很缺基本材料。精華、裂片…而我們的炫彩之塵庫存更是永遠嚴重不足。\n\n如果你不介意幫助我們，也許我們可以增加庫存量，最好能連續一個星期都不用補貨，而不是一天就用完。', '', '', '', '', '', '', 47187),
(72171, 'zhTW', '在單人隨機中證明', '完成12輪單人隨機玩家對玩家對戰。', '你迫不及待地自行追求衝突，這行為取悅了我。要是你對自己的實力這麼有信心，那就讓我親眼見證，順便找點樂子。\n\n我們來見識一下你的能耐，然後回來找我。', '', '', '', '', '', '', 47187),
(72168, 'zhTW', '在練習戰中證明', '在競技場練習戰中獲得榮譽值。', '你對自己的戰術能力很有自信，對吧？聽說，你們凡人之間會舉行小規模的練習戰。準備出戰，與旗鼓相當的對手一較高下。\n\n讓我們見識一下你的能耐，然後回來找我。', '', '', '', '', '', '', 47187),
(72167, 'zhTW', '在戰爭中證明', '在史詩戰場中獲得榮譽值。', '你渴望「真正的挑戰」，對嗎？那就來吧。我知道有些大規模的衝突就連我也無法輕鬆應付。\n\n我很好奇，你這次究竟會敗…還是勝。我們來看看你能不能向我證明你自己。', '', '', '', '', '', '', 47187),
(72166, 'zhTW', '在戰鬥中證明', '在隨機戰場中獲得榮譽值。', '你們凡人總是喜歡為了地盤爭個頭破血流，那就這樣吧。\n\n至少場面看起來還算有趣，我也樂在其中。我們來看看你到底如何「證明自己」。', '', '', '', '', '', '', 47187),
(72159, 'zhTW', '去鱗', '採集$1oa片閃鱗皮交給沃卓肯的『粗曠者』瑞拉索爾。', '鱗片有許多的用途。它們可以提供保護作用，但有時候也可以拿來當作反射的鏡面。事實上，我們許多高級的鏡子就是鱗片打磨的。\n\n而且這種鏡子的需求也很高。去幫我收集一些帶鱗的毛皮，我就跟你分享我工作的訣竅。', '', '', '', '', '', '', 47187),
(72157, 'zhTW', '大地之重', '收集$1oa個喚醒之土交給沃卓肯的『掘地者』瑟奇塔。', '我手邊有張數百噸洪荒熔鑄合金的訂單，但我的喚醒之土快用完了。我知道這是強人所難，但我可以給你相應的報酬！', '', '', '', '', '', '', 47187),
(72154, 'zhTW', '『丟擊者』斯卡葛', '', '', '', '', '', '', '', '', 47187),
(72137, 'zhTW', '孵化計畫', '', '', '', '', '', '', '', '', 47187),
(72135, 'zhTW', '奈薩魯斯堡：個中奧秘', '從奈薩魯斯堡取回$1oa份奈薩里奧的筆記、$2oa本黑曜日誌和1本研究典籍。', '我們有麻煩了，旅行者。加拉登最初是從奈薩魯斯堡中冒出，這意味著他們一定洗劫了那裡！\n\n奈薩魯斯堡藏有許多寶藏，更重要的是，那裡是知識的寶庫。我們一族的歷史、我們如何失去恩典。賽柏利安和怒西昂一直在尋找更多有關奈薩里奧的生平和計畫的情報。\n\n去吧，看看在加拉登將那裡洗劫一空之前，你能不能有所收獲！', '', '', '', '', '', '', 47187),
(72134, 'zhTW', '冒險者的援助', '使用偵察地圖來選擇你的第一個區域。', '我們發現，我們下方的土地破碎群島各處有許多問題。\n\n我們會從這裡做我們能做的事。我希望你去看附近的地圖，了解一下你可以先援助誰。', '', '', '', '', '', '', 47187),
(72131, 'zhTW', '庫存過剩', '', '', '', '', '', '', '', '', 47187),
(72130, 'zhTW', '遺民獅鷲獸', '', '', '', '', '', '', '', '', 47187),
(72129, 'zhTW', '協助卡德加', '在達拉然的紫羅蘭城塞內與卡德加會面。', '歡迎來到達拉然，$n。看到你安全抵達真好。\n\n在紫羅蘭城塞裡和我說話吧。有很多事要做。', '', '', '', '', '', '在達拉然的紫羅蘭城塞內與卡德加會面。', 47187),
(72128, 'zhTW', '貪婪的恩坎', '', '', '', '', '', '', '', '', 47187),
(72127, 'zhTW', '藍斯船長', '', '', '', '', '', '', '', '', 47187),
(72126, 'zhTW', '『神奇蝸牛』史樂坡', '', '', '', '', '', '', '', '', 47187),
(72122, 'zhTW', '從前的生態學家', '找到任性的生態學家。', '傷患的情況穩定下來了，不過我還有一些煩心事，$n。\n\n有兩個龍裔生態學家跑來哨站這裡研究濕地。自從遭到攻擊以來，我一直沒看見他們的片鱗半爪，讓我非常擔心。\n\n如果你要外出，能不能幫我留意一下，確認他們的安危？\n\n你也要小心一點。據說那些濕地到處都是戈洛克。', '', '', '', '', '', '', 47187),
(72121, 'zhTW', '偉大的可汗龜', '', '', '', '', '', '', '', '', 47187),
(72117, 'zhTW', '文化交流', '', '', '', '', '', '', '', '', 47187),
(72116, 'zhTW', '『光彩奪目』利斯克隆', '', '', '', '', '', '', '', '', 47187),
(72114, 'zhTW', '亞羅索斯', '', '', '', '', '', '', '', '', 47187),
(72113, 'zhTW', '迷霧之外的形態', '', '', '', '', '', '', '', '', 47187),
(72090, 'zhTW', '破壞洪荒使者的計畫', '', '', '', '', '', '', '', '', 47187),
(72089, 'zhTW', '前往天頂觀測所', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(72083, 'zhTW', '我的幸運釣餌', '取回哈伯船長的幸運釣餌。', '$r，你發現我待在下面，並不是因為我死了。\n\n我為了確保殺了我的隊友的那隻野獸已經死透，無法再去殺別人，結果在狩獵的時候死掉。那是再正常不過的事，我爸也會希望我這麼做。\n\n但，問題在於戰鬥結果是我們同歸於盡！\n\n那隻野獸的靈魂真的還在，就跟站在你面前的我一樣真。不過，變成鬼之後，我甚至無法從把我洗劫一空的小動物身上，拿回我的幸運誘餌！\n\n你願意幫幫我嗎？', '', '', '', '', '', '', 47187),
(72079, 'zhTW', '集體盛宴', '', '', '', '', '', '', '', '', 47187),
(72072, 'zhTW', '龍泉降魚', '收集魚來補充釣魚池，然後騎上飛龍把牠們從上面丟下去。', '咬餌的情況應該要更熱烈的，你不覺得嗎？\n\n我跟你說，這讓我有了一個點子。依據傳說，這些湖泊和河流以前是沒有魚的。據說是在上方飛翔的巨龍把魚丟下去，這些水池才會充滿魚！你能相信嗎？\n\n或許你和你的飛龍應該試試看？', '', '', '', '', '', '', 47187),
(72071, 'zhTW', '第二輪開始，死魚！', '殺死莫巧比。', '對了，$n，你想不想釣一下魚？\n\n離海岸不遠的地方棲息著一群餌魚，每當牠們聚在一起，那隻愚蠢的野獸就會發動攻擊，完全忘了自己已經死了。\n\n游到那裡，放置誘餌隨意揮竿，或許盡全力模擬一隻受傷海豹的行動，一定會讓牠上當。', '', '一個深海惡霸。\n\n哈伯船長的獵殺讓他們雙雙死亡，但是，即使死了，仍無法澆熄他對復仇的渴望。', '莫巧比', '', '', '', 47187),
(72068, 'zhTW', '支援協調者：公開盛宴', '前往蒼藍高地的伊斯凱拉並參加集體盛宴。繼續在巨龍群島各地協助沃卓肯協調者和他們的盟友。', '我們的盟友需要你的援助，$n！\n\n你在群島各地的努力我們都看見了。我們在南方的可靠盟友伊斯凱拉巨牙海民想要慶祝你的成就，舉辦最盛大的宴會！\n\n一邊和協調者的盟友繼續工作，一邊前往伊斯凱拉的土地吧。當你抵達南方土地的閃亮水域時，不需要遲疑，放心參加慶典吧！', '', '', '', '', '', '', 47187),
(72067, 'zhTW', '療癒時光！', '前往安詳夢境水療中心。', '嗨，你好！\n\n你看起來好像很累，簡直精疲力盡的樣子，非常需要好好休息一下。交給我！安詳夢境水療中心正是為你量身打造！\n\n體驗我們新推出的瑜伽課，它們真的超棒的！還是海泥面膜療程更合乎你的心意呢？我推薦你最好兩個都做！\n\n水療中心就在出城之後往北走的地方！', '', '', '', '', '', '', 47187),
(72063, 'zhTW', '歸還葉努的玩具船', '將玩具船還給附近的葉努。', '這是葉努的玩具船。能拿回它，他一定會超開心。', '', '', '', '', '', '', 47187),
(72061, 'zhTW', '風暴召喚者維卓菈', '', '', '', '', '', '', '', '', 47187),
(72060, 'zhTW', '特殊療程', '再一次，把太陽眼鏡還給塞爾迪斯。', '<泥面膜對你的來意感到好奇，但它被逼到這根樹枝上了！>', '', '', '', '', '', '', 47187),
