INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(71242, 'zhTW', '支持風暴研究員', '將元素溢流晶叢帶去給沃卓肯的研究員。', '這看起來像來自洪荒風暴的生物的溢流能量晶叢。\n\n在沃卓肯一定有研究員會想要這個的。', '', '', '', '', '', '', 47187),
(71241, 'zhTW', '鴨子、鴨子、陷阱', '在原初山谷重置艾拉格氏族的狩獵陷阱。', '名叫原初山谷的樹林充滿了先代巨龍的魔法。那裡的一種蠍尾飛狐的皮毛在我的族人之間非常珍貴，但它們擅長躲藏，非常難找。\n\n你可以在那個地區找到一些我們的狩獵陷阱，不用親自去追蹤它們。使用附近水鳥的肉來重新設置它們—我會派我們氏族的人去收取陷阱捕到的獵物。', '', '', '', '', '', '', 47187),
(71239, 'zhTW', '迷失在空中', '在藍羽崖找到哈爾琳‧啾諷。', '我需要人幫忙，而你看起來像會幫忙的人。\n\n我的一個老朋友哈爾琳‧啾諷幾天之前應該在城裡和我碰面的。我們約好要一起在晶紅盛宴大吃特吃、找美容師剪髮，然後參觀他們那邊時髦的拍賣場。\n\n可是她沒出現。她常常工作到忘我，但要是能知道她在哪我會比較安心。\n\n到南邊的山區找找看吧。她有提過，她來這兒的時候會順便到那邊看一下。', '', '', '', '', '', '', 47187),
(71238, 'zhTW', '晶紅盛宴！', '在晶紅盛宴和主廚盧米雅史卓莎和莫瑟說話。', '所有積極追尋美食的專家注意了！\n\n你是否渴望品嘗這世界最極致的美味？你在尋找機會來一場偉大探索嗎？你願意為完全不認識的人賭上性命和健康嗎？\n\n如果你是這樣的人，就來找絕頂傑出、世界知名的主廚雙人組：盧米雅史卓莎和莫瑟吧！他們目前正在沃卓肯主辦晶紅盛宴！', '', '', '', '', '', '', 47187),
(71235, 'zhTW', '在現場調查的法師', '在蒼藍高地的蠍尾飛狐危崖附近跟祈倫托法師確認狀況。', '$r，Lok\'tar。\n\n我們有兩名法師正在附近進行現場調查，如果你有時間的話，他們肯定可以用上你的協助。\n\n就算在最美好的時代，這裡仍是個危險的地方。\n\n更不用說現在連美好都稱不上。', '', '', '', '', '', '', 47187),
(71234, 'zhTW', '望角新聞', '前往蒼藍高地的捕鯨者望角。', '那邊的$r。\n\n你看起來歷練豐富。\n\n我的表親瓦雲從捕鯨者望角帶漁獲來的時候，提到說一名…奇怪的傢伙在那裡紮營。\n\n那個人似乎很守規矩，但可以請你去看看瓦雲好不好嗎？\n\n他比較易怒。', '', '', '', '', '', '', 47187),
(71233, 'zhTW', '墜落之水', '在蒼藍高地的三瀑布守望和維拉談話。', '我愛瀑布。\n\n想知道什麼比一座瀑布更棒嗎？\n\n兩座瀑布。\n\n而唯一一個比那更棒的東西就是…嗯，到西邊去看看三瀑布，你就會懂了！\n\n那裡的旅店老闆挺不錯的。', '', '', '', '', '', '', 47187),
(71232, 'zhTW', '巨龍群島的名望', '在沃卓肯和瑟拉澤爾說話。', '巨龍群島還有許多的事情要忙。\n\n我想請你去找澤拉薩爾談談。他有比較詳細的情報，知道哪邊的人最需要幫助。', '', '', '', '', '', '在沃卓肯和瑟拉澤爾說話', 47187),
(71231, 'zhTW', '獵者的呼喚', '在雍亞拉平原和訓練師弗羅尊說話。', '<洛奇在你手上放下通知。>\n\n$n，席卡氏族邀請你參加大狩獵。在雍亞拉平原和訓練師弗羅尊會面。', '', '', '', '', '', '', 47187),
(71230, 'zhTW', '巨牙海民捕魚裝備', '在蒼藍高地的伊斯凱拉和塔維歐說話。', '又見面了，$n。\n\n<洛威一邊觀望四周、一邊哼著歌。>\n\n喔，對了！塔維歐在幫我做新網子的時候說，她也可以幫你做一張。然後她也可以做其他的捕魚裝備，只要你把需要的材料帶去給她。\n\n你應該去找她談談。', '', '', '', '', '', '', 47187),
(71229, 'zhTW', '平原的呼喚', '在雍亞拉平原與哈達利可汗說話。', '<洛奇在你手上放了一個訊息。>\n\n$n，艾拉格氏族聽聞了你的許多優良事蹟。我們誠摯邀請你認識我們氏族，學習彼此的文化。\n\n哈達利可汗', '', '', '', '', '', '', 47187),
(71227, 'zhTW', '空中挑戰', '和一名青銅時空守衛者說話，來了解空中挑戰。', '<振翅靈獸興奮地拍動翅膀，在你的腳邊放下一張字條和一隻燒焦的老鼠。>\n\n乘龍者！你的飛行實力眾所皆知。在巨龍群島各地的空中挑戰中測試你的實力吧。\n\n和任意青銅時空守衛者說話，了解一下狀況吧。', '', '', '', '', '', '', 47187),
(71225, 'zhTW', '吹過風中：拉扎斯特', '', '', '', '', '', '', '', '', 47187),
(71219, 'zhTW', '任性的道路守衛', '找到道路守衛艾薇。', '看來，我們比較年輕的幾個道路守衛最近怠慢了他們的職責。\n\n道路守衛諾莉請我去關心她的妹妹艾薇，她就駐守在時光通道的入口處。顯然，她最近的表現稱不上令人滿意。\n\n如果你往東去的時候碰巧遇見了道路守衛艾薇，請向她提醒她的職責有多重要，並讓她知道她姐姐挺擔心她的。', '', '', '', '', '', '', 47187),
(71212, 'zhTW', '攻擊蕨皮', '', '', '', '', '', '', '', '', 47187),
(71210, 'zhTW', '前往龍禍要塞！', '前往甦醒海岸，加入黑曜流亡者的龍禍要塞攻城行動。', '<振翅靈獸在你掌心放下一個微微燒焦的紙條。>\n\n$n，黑曜流亡者已經聽說了你的英勇事蹟。龍禍要塞是我們之前的家園，但那裡已經落入加拉登族的手中。我們不能就這樣屈服。和我們一起奪回我們的領地吧。\n\n- 首領', '', '', '', '', '', '', 47187),
(71209, 'zhTW', '平原的野獸', '收下莉茲的韁繩。', '我想莉茲準備好要回去當平原的野獸了。雖然她很親近你和我，但我看得出來她很想回到野外。\n\n總有一天，等我成為風之賢者後，我要探索這片溫泉以外的世界。但是，我得先通過學徒的期中考！時間過得真快啊。\n\n我用你收集的羊毛做了鞍具和韁繩。莉茲會很樂意聽你命令的。\n\n請你帶她踏上各種冒險吧，$p。', '', '', '', '', '', '', 47187),
(71205, 'zhTW', '水之巨牙海民', '', '', '', '', '', '', '', '', 47187),
(71202, 'zhTW', '迷你法力惡魔近戰', '在寵物對戰中擊敗亞坎圖斯。', '', '', '', '', '', '', '', 47187),
(71199, 'zhTW', '馴服雷脊蜥蜴', '', '', '', '', '', '', '', '', 47187),
(71198, 'zhTW', '馴服雷脊蜥蜴', '', '', '', '', '', '', '', '', 47187),
(71197, 'zhTW', '馴服雷脊蜥蜴', '', '', '', '', '', '', '', '', 47187),
(71196, 'zhTW', '馴服雷脊蜥蜴', '在巨龍群島各地收集$1oa個螢光液體以及$2oa個巨龍群島補給品。', '莉茲安全又平安地回來真是太好了。\n\n然而，她的傷口癒合速度比想像中慢。我希望讓她受傷的魔法不會造成永久的傷害。\n\n你可以幫我收集一些昆蟲汁液嗎？我知道這聽起來很噁心！但那其實是許多治療藥膏的關鍵原料。', '', '', '', '', '', '', 47187),
(71195, 'zhTW', '馴服雷脊蜥蜴', '到雍伊爾溫泉收集梅倫的綠咖哩，並收集$2oa份巨龍群島補給品。', '我想這應該是莉茲近來最中意的地方。她一直對回家不感興趣。畢竟，她是一隻野生動物。\n\n我得跟你說件事…在我們拯救莉茲後，我還沒和梅倫說過話。我知道她是對的，但我不知道怎麼跟她和好。她似乎不認同我做的任何事。我知道我必須更專注在訓練上才行。\n\n梅倫做的咖哩超級好吃，莉茲一定會喜歡。你可不可以向她討一些咖哩？她通常會在溫泉西邊的雍的小屋工作。', '', '', '', '', '', '', 47187),
(71194, 'zhTW', '火焰之蛙', '教會幾頭角刺蛙迴避冰柱酒。', '我找到一個放置捕漁網的完美地點，但有個問題在困擾著我…那些角刺蛙。只要我離開漁網，牠們肯定會破壞網子。我們該怎麼辦？\n\n…我有個點子。我們會用冰柱酒來加工熔岩捕漁網，讓牠們具有耐熱的功能。我們只需要教會那些角刺蛙遠離這種氣味就好。\n\n把一瓶冰柱酒丟向角刺蛙，然後對牠們造成一些傷害。但是記得別殺死牠，牠們死了就學不到東西，對吧？', '', '', '', '', '', '', 47187),
(71193, 'zhTW', '水底駭物', '在提爾堡釣魚洞使用5個不祥的海螺召喚巨大水底生物，並且帶回牠死亡的證據。', '你看到了嗎？在水底下！巨大的、有甲殼的飢餓動物！只要那怪物還潛伏在底下，我是絕不可能拿網靠近水邊的。如果你想要的話，你可以用一些不祥的海螺把牠引出來，海螺應該不會太難抓。', '', '', '', '', '', '', 47187),
(71192, 'zhTW', '控制掠食者', '放置恐怖塑像。', '你好，朋友！\n\n我一直想在這裡找個好地方架設捕漁網，不過這裡的水鴨密度似乎太密集了，小魚還沒有機會長大，就會被牠們吃光光。\n\n我做了一些塑像，至少可以把一部分的貪吃鳥兒嚇走。這樣，我們就可以維持龍泉這一帶的魚量了。\n\n你可以幫我去放置這些東西嗎？', '', '', '', '', '', '', 47187),
(71191, 'zhTW', '網子的價值', '在蒼藍高地的冰洞中取回格魯夫漁夫的網子。', '哎呀，我的捕漁網被水流沖走了。唉，我不太喜歡像我朋友一樣使用釣魚竿…\n如果你碰巧找到我的捕漁網，請把它帶回來給我。', '', '', '', '', '', '', 47187),
(71182, 'zhTW', '奔放的文獻管理員', '在蒼藍文庫的上文庫和辛德拉苟莎會面。', '聽著，半龍人。\n\n你的兩個族人去了這裡的南方，搜索那邊的文庫。我還沒向他們介紹我自己，有人陪我會很感激的。\n\n如果你有時間的話，我可以在上文庫那裡跟你見面。', '', '', '', '', '', '', 47187),
(71179, 'zhTW', '看向瞰臺', '在蓋利奇爾瞰臺和薩德蘇斯指揮官交談。', '$n，我還有一個任務要給你。\n\n有人回報洪荒使者在蓋利奇爾崗哨附近活動，這會威脅到我們對提爾堡的控制。\n\n去和指揮官薩德蘇斯說話，看看你可以怎麼協助他們。', '', '', '', '', '', '在蓋利奇爾瞰臺和薩德蘇斯指揮官交談。', 47187),
(71178, 'zhTW', '傳送門：林蔭聖所', '在雍亞拉平原的林蔭聖所找到休眠傳送門。', '我們的遠征隊回報，西南邊的蓊鬱山坡那裡有一塊休眠的石頭。那裡有點遠，但它值得我們派出有相關知識的人去調查。', '', '', '', '', '', '', 47187),
(71166, 'zhTW', '最老的蜻蜓', '在寵物對戰中擊敗史瓦格蛙。', '', '', '', '', '', '', '', 47187),
(71165, 'zhTW', '傳送門：紀元邊境', '在薩爪祖斯的紀元邊境找到休眠傳送門。', '在薩爪祖斯另一端的山區中，有一座小小的旅店座落在山腰上。在入口旁邊有一個遭人遺忘已久的休眠石頭。\n\n你怎麼說？要再來場冒險嗎，$n？', '', '', '', '', '', '', 47187),
(71162, 'zhTW', '傳送門：阿爾蓋瑟拉', '在薩爪祖斯的阿爾蓋瑟拉的尖塔上找到休眠傳送門。', '又一顆石頭。又一座高塔。\n\n你最好趕快上路。這次的路程挺遠的。而且據發現它的人說，要到那上面去還蠻危險的。\n\n你要去嗎？', '', '', '', '', '', '', 47187),
(71161, 'zhTW', '傳送門：瓦瑟洛斯', '在蒼藍高地的瓦瑟洛斯的尖塔上找到休眠傳送門。', '我收到了另一個休眠傳送石的報告，指出說它在東南邊的寒冬地區。\n\n在你感到興奮前，要知道那不是很多人會自願去的地方。不過，如果你渴望冒險和死亡風險，這就很適合你！\n\n你被說服了是吧？很好！\n\n穿上你最保暖的服裝。往東走到風的寒意搔癢你的鼻子為止，然後再繼續走。等到開始覺得呼吸困難、骨子發寒時，你就知道你快到了。', '', '', '', '', '', '', 47187),
(71160, 'zhTW', '深水炸彈', '', '', '', '', '', '', '', '', 47187),
(71157, 'zhTW', '傳送門：天頂觀測所', '在甦醒海岸的天頂觀測所找到休眠傳送門。', '根據來自我們一些北方探險者的消息，東北邊的高塔上又有一個這樣的石頭。\n\n聽說要到那麼高的上面去挺困難的，但我敢說你可以找到方法的！', '', '', '', '', '', '', 47187),
(71155, 'zhTW', '蒼藍密庫', '在蒼藍密庫阻止碎裂火焰軍。', '我們有麻煩了，$n。\n\n蒼藍密庫就座落在蒼藍文庫下方。在我的一生中，我把許多重要又危險的魔法珍品存放在那裡面。\n\n一大群碎裂火焰軍已經闖進密庫，深信裡面藏有某種秘密。\n\n拜託，請你到裡面去阻止這場張狂的襲擊，不然他們就會招惹到自己無法理解的危險。\n\n這些小偷根本不知道裡面有什麼。', '', '', '', '', '', '', 47187),
(71153, 'zhTW', '世界任務、額外目標及情境我的天', '完成3項托爾托世界任務。', '完成3項世界任務來協助托爾托人。', '', '', '', '', '', '回去找收藏家卡裘。', 47187),
(71152, 'zhTW', '返回主廳', '在主廳和多蒂會合。', '既然我們已經可以使用覆寫控制臺，我們應該有辦法通過那道屏障。\n\n我們回主廳見，我們可以搞定這件事的！', '', '', '', '', '', '', 47187),
(71151, 'zhTW', '接續傳送門探索', '到甦醒海岸的晶紅鱗哨站和塞林‧暗砧會面。', '<信紙很乾淨清爽，上面有龍鱗遠征隊的徽印。\n\n塞林‧暗砧希望你去見他。>', '', '', '', '', '', '', 47187),
(71150, 'zhTW', '接續傳送門探索', '到甦醒海岸的晶紅鱗哨站和塞林‧暗砧會面。', '<羊皮紙散發出一股令人不悅的霉味。努力再次集中精神後，顯然塞林需要你協助，來找尋一些新發現的答案。\n\n現在剩下的問題，就是如何處理這張令人難以忍受的臭羊皮紙。>', '', '', '', '', '', '', 47187),
(71149, 'zhTW', '接續傳送門探索', '到甦醒海岸的晶紅鱗哨站和塞林‧暗砧會面。', '<令人意外的是，信使這次沒有給你袋子或字條，而是塞林的個人收藏中的一個物品。\n\n近看發現一個塞林捎來的細小訊息，再次尋求你的協助。>', '', '', '', '', '', '', 47187),
(71148, 'zhTW', '接續傳送門探索', '到甦醒海岸的晶紅鱗哨站和塞林‧暗砧會面。', '<你眼前的古怪生物拿出一個字條…上面有龍鱗遠征隊的簽名及徽印。\n\n或許這是一名知名探險者的支援請求。>', '', '', '', '', '', '', 47187),
(71146, 'zhTW', '接續傳送門探索', '到甦醒海岸的晶紅鱗哨站和塞林‧暗砧會面。', '<見習探險者給了你一張堅硬的紙捲。經過檢視，它似乎是來自一位老朋友塞林‧暗砧，要尋求你的幫助。\n\n在跑走之前，你眼前的小生物伸出一支手，彷彿在要點心吃。過了一會，奇妙的生物發出一聲響亮的尖叫，空手生氣離開了。>', '', '', '', '', '', '', 47187),
(71145, 'zhTW', '宗師', '在寵物對戰中擊敗派楚', '', '', '', '', '', '', '', 47187),
(71144, 'zhTW', '聯盟殺手', '在項上人頭遭到懸賞之下，殺死10位聯盟而未死亡。', '對！繼續加油，繼續屠殺那些聯盟狗！\n\n再多殺幾個聯盟，你就有可能締造新紀錄，$c。\n\n不過這可不容易，聯盟已經在懸賞你的腦袋，所以要多加小心！\n\n為了部落！', '', '', '', '', '', '', 47187),
(71143, 'zhTW', '部落殺手', '成為部落狩獵目標之下，殺死10位部落而未死亡。', '哇！繼續努力，士兵！\n\n多殺幾個部落，你就可以在聯盟之間創下新紀錄。\n\n不過這可不容易，部落已經在懸賞你的腦袋，所以要多加小心！\n\n為了聯盟！', '', '', '', '', '', '', 47187),
(71141, 'zhTW', '殃及池魚', '到崖瀝營地殺死入侵者格伯布勒。', '卡迪爾薩很魯莽，但她很懂她的螃蟹。戈洛克太過分了！\n\n我注意到戈洛克凡事都會找格伯布勒。顯然，他就是指示他們捕捉螃蟹的傢伙。為了生命的平衡，以及照顧生命者的安全，我們不能讓這種事繼續下去。\n\n擊敗格伯布勒。別讓他把魔爪伸過這條河！', '', '體型超大的戈洛克？這種傢伙當然存在。', '入侵者格伯布勒', '', '', '', 47187),
(71140, 'zhTW', '成雙成對', '在寵物對戰中擊敗芭胡謝克', '', '', '', '', '', '', '', 47187),
(71139, 'zhTW', '發光的秘法珠寶', '把發光的秘法珠寶帶去給安東尼達斯營地的全知者諾麗可。', '<這個珠寶似乎力量非常強大。它散發出詭譎的光芒。\n\n或許你最好把它拿去給祈倫托，讓他們把它存放在安全的地方。>', '', '', '', '', '', '把發光的秘法珠寶帶去給安東尼達斯營地的全知者諾麗可。', 47187),
(71138, 'zhTW', '傳送門：拉札薩爾之境', '在雍亞拉平原的拉札薩爾之境找到休眠傳送門。', '一名遠征隊成員回報說，他在雍亞拉平原的一座暸望臺上目擊了一個休眠石頭。\n\n要不要來場冒險啊？', '', '', '', '', '', '', 47187),
(71135, 'zhTW', '未完之事', '在蒼藍高地的雪革營地迎戰霜齧。', '要說我在野外學到了什麼，那就是如果你在找到邪惡之物時不處理它。如果你不打斷它的骨頭、挖出它的根，它就會繼續生長。它就會更難殺死。\n\n當我像你一樣，還是個小夥子時，這片山區滿是霜齧存在的痕跡，而在他完全控制雪革部族之後，情況只會更糟。\n\n我很久以前就該處理他了，不過，現在能彌補那個錯誤的人也只有我們了。', '', '該終結霜齧的殘酷統治了。', '霜齧', '', '', '', 47187),
(71097, 'zhTW', '助人之爪', '在鈷藍集會上方的塔樓啟動裝置，監視梵德斯溫的行動。', '好的，你已經幫神器充能了。我們把它打開吧。\n\n…還有，別再用那種眼神看我了。別裝得一副你不好奇它會不會啟動的樣子。\n\n把那東西再搖一下、慢慢後退，然後讓我來完成最後的步驟。', '', '', '', '', '', '', 47187),
(71096, 'zhTW', '確實是利爪', '嘗試啟動神器。', '<梵德斯溫揉揉眼睛，並發出疼痛的哀號。>\n\n好吧。如果你不把它給我，就自己想辦法搞清楚怎麼使用它吧。\n\n我在你忙完之後再把它奪過來就好。必要的話就用蠻力。\n\n所以你請便吧。把它搖一搖之類的。', '', '', '', '', '', '', 47187),
(71095, 'zhTW', '求助的利爪', '詢問梵德斯溫你要如何幫他，並照他的話去做。', '我們來看看能為這個傢伙做些什麼吧！\n\n<海樂絲俯身靠近，低聲說了些話。>\n\n別擔心，我們不會讓他拿走東西之類的。我們好好享樂吧！\n\n已經很久沒有人跑到這上面來關心我們了。我們超無聊的！\n\n<海樂絲對你眨眨眼。>\n\n你何不問他想要什麼呢？', '', '', '', '', '', '', 47187),
(71094, 'zhTW', '助人的態度！', '在鈷藍集會上方的塔樓尋找繃帶，以治療梵德斯溫。', '嗨！\n\n你也是來這幫忙的嗎？你看起來很會幫忙！\n\n<海樂絲指向受傷的半龍人。>\n\n那傢伙在努力飛上來的過程中傷了他的翅膀！他看起來像下面那些壞蛋的一員，可是我不怕他！而且我還是會幫助他，因為這就是我們的處事態度！\n\n<海樂絲挺起他的胸膛。>\n\n我會守著他，你去找一些繃帶吧！', '', '', '', '', '', '', 47187),
(71093, 'zhTW', '提爾的遺產：過往的秘密', '進入荒蕪之地的奧達曼：提爾的遺產，然後取回圓盤。', '為了阻止菈薩葛絲釋放其他的洪荒化身，必須讓守護巨龍恢復原有的力量。\n\n問題在於，泰坦們現在分身乏術，而守護者提爾又逝世已久。\n\n雅立史卓莎女王提出一個計畫。荒蕪之地的地底深處有座泰坦設施，名為奧達曼。提爾的盟友似乎在那裡藏了一塊圓盤，裡面儲存著他的記憶。\n\n但據說那個地方已經被穴居怪佔據。請召集你的盟友前往奧達曼，為紅龍女王取回圓盤！', '', '', '', '', '', '', 47187),
(71091, 'zhTW', '最高榮譽', '', '', '', '', '', '', '', '', 47187),
(71090, 'zhTW', '誠心給予真心', '', '', '', '', '', '', '', '', 47187),
(71089, 'zhTW', '拿起號角', '', '', '', '', '', '', '', '', 47187),
(71085, 'zhTW', '象徵意義', '', '', '', '', '', '', '', '', 47187),
