(71029, 'zhTW', '狩獵戰術：夥伴訓練', '選擇一個要在大狩獵中使用的額外夥伴能力。', '你在莫魯克又再次增加了。由於你的付出，我會教你如何在戰鬥中更有效地指揮你的狩獵夥伴。', '', '', '', '', '', '', 47187),
(71028, 'zhTW', '狩獵戰術：雍亞拉的祝福', '選擇一個要在大狩獵中使用的雍亞拉的祝福。', '你在莫魯克越來越有名望。聽好了，我會教你如何呼喚雍亞拉的祝福，來保護你和你的盟友。', '', '', '', '', '', '', 47187),
(71027, 'zhTW', '懸賞：雷鳴馬拉納', '在原初山谷殺死雷鳴馬拉納，並取回牠的一片鱗片。', '我在找厲害的獵人來獵殺一頭肆虐的野獸！\n\n一頭叫雷鳴馬拉納的雷霆蜥蜴成功從雷脊灌木林抵達原初山谷，對當地的野生動物造成了干擾。牠已經讓水充滿電、撞倒許多樹和破壞了鴨巢。\n\n必須有人阻止這場惡行。殺死牠，並把牠的鱗片拿去給可汗禁衛杰柏泰當作證明。\n\n願雍亞拉指引你。', '', '這頭野獸已經破壞太多鴨巢，驚擾了原初山谷當地的野生動物。', '雷鳴馬拉納', '', '', '', 47187),
(71024, 'zhTW', '混沌與騷動', '協助艾里馬調查守護巨龍之座最底層的事故。', '$n！你聽見那陣噪音了嗎？最底下的樓層發生了事故。\n\n艾里馬是第一個過去的。他是一位可靠的調查員，但是在他查訪人群的時候，他應該會需要有人幫忙收集證據。', '', '', '', '', '', '', 47187),
(71023, 'zhTW', '沃卓肯協調者名人', '在沃卓肯和烏納托斯說話。', '你的表現確實和你來巨龍群島之前流傳的聲望相符。\n\n我希望能提供你額外的補給品來進一步協助你。到沃卓肯來找我。', '', '', '', '', '', '', 47187),
(71022, 'zhTW', '領頭羊的統御', '指揮泰溫去對付羊群頑固的領頭羊。', '既然阿戈利羊似乎不太尊重泰溫，我們接下來應該看看他能不能應付羊群的領頭羊。\n\n他是這裡所有阿戈利羊的首領，而且挺固執的。如果泰溫可以壓制領頭羊，羊群就會開始聽從他的指揮。\n\n你可以在那裡找到他，就在山丘上。祝你好運，泰溫。如果這招不成功，恐怕他就沒什麼希望成為牧羊犬了！', '', '', '', '', '', '', 47187),
(71020, 'zhTW', '洪荒化身牢獄：打破幾顆蛋', '在傳奇難度下，從洪荒化身牢獄的幼龍守衛者戴恩娜身上取得3片巨杖的裂片。', '幼龍守衛者戴恩娜就在這座堡壘內的某處，無疑在她的廳室看守著牢獄。如果你可以取得她的巨杖碎片，我們應該就能直接攻擊她的巢穴。\n\n三片應該就夠。四片就太誇張了。', '', '', '', '', '', '', 47187),
(71019, 'zhTW', '洪荒化身牢獄：打破幾顆蛋', '在英雄難度下，從洪荒化身牢獄的幼龍守衛者戴恩娜身上取得3片巨杖的裂片。', '幼龍守衛者戴恩娜就在這座堡壘內的某處，無疑在她的廳室看守著牢獄。如果你可以取得她的巨杖碎片，我們應該就能直接攻擊她的巢穴。\n\n三片應該就夠。四片就太誇張了。', '', '', '', '', '', '', 47187),
(71018, 'zhTW', '洪荒化身牢獄：打破幾顆蛋', '在普通難度下，從洪荒化身牢獄的幼龍守衛者戴恩娜身上取得3片巨杖的裂片。', '幼龍守衛者戴恩娜就在這座堡壘內的某處，無疑在她的廳室看守著牢獄。如果你可以取得她的巨杖碎片，我們應該就能直接攻擊她的巢穴。\n\n三片應該就夠。四片就太誇張了。', '', '', '', '', '', '', 47187),
(71017, 'zhTW', '娜露琪的信', '把娜露琪的魚頭送去給老厲牙。', '讓我猜猜，阿厲叫你別打開信，對嗎？\n\n看來你有好好聽話。難怪他這麼信任你！\n\n替我把這個魚頭拿給他。他會知道這是什麼意思。', '', '', '', '', '', '把娜露琪的魚頭送去給厲牙。', 47187),
(71016, 'zhTW', '厲牙的姊妹', '將厲牙的信送去給他在伊斯凱拉的姊妹娜露琪。', '最後是我的姊妹。娜露琪。她現在在伊斯凱拉幫忙管理旅店。\n\n把這封信給她就行了。\n\n別打開它。', '', '', '', '', '', '將厲牙的信送去給他在伊斯凱拉的姊妹娜露琪。', 47187),
(71015, 'zhTW', '動手，不要動腦', '在遠古瞰台找到瓦瑟克。', '瓦瑟克會是你見過最強悍的龍獸。也是最笨的龍獸，但他永遠不會承認這點。\n\n他在霜齧之後整個嚇壞了，開始重新評估他的人生…之類的，說他以前都沒有機會研究他的祖先留下來的遺跡。跑去當什麼「學者」。\n\n把瓦瑟克找回來。他絕對不適合那裡！', '', '', '', '', '', '在遠古瞰台找到瓦瑟克。', 47187),
(71014, 'zhTW', '遙遠的熊怪好友', '在長爪島上找到巴斯特。', '巴斯特是我認識最兇悍的熊怪。他之前說，他在一場架中被霜齧的群體打敗了。\n\n據我上次聽說，他跑到伊斯凱拉海岸外的某個島去了，他說這叫什麼「退休」之類的屁話。\n\n跟巴斯特說，回來伸展手腳的時機到了。\n\n噢，還有，別被他說話的樣子給騙了。如果你惹到他的話，他會把你撕成兩半。', '', '', '', '', '', '在長爪島上找到巴斯特。', 47187),
(71013, 'zhTW', '吃飽才能報仇', '在厲牙的藏匿處捕捉$2oa隻凍尾鏢鱸。', '既然我們要繼續一開始的打算，我們必須牙對牙談一談。那個豺狼人霜齧？跟你說過話的那位？\n\n我們和他有些過去的恩怨。\n\n這要花一點時間來解釋。在我說話時，你去抓點魚吧，小傢伙。我們需要餵飽所有人。他們需要精力來面對接下來的事。', '', '', '', '', '', '', 47187),
(71012, 'zhTW', '已招募瓦瑟克', '讓厲牙知道你招募了瓦瑟克。', '看來，以後我自己就有辦法解開這個地方的謎題了。\n\n這件事千萬別跟老厲牙說，好嗎？\n\n我會自己前往他的藏匿處。把我壓抑的侵略性發洩在霜齧身上一定會很不錯。', '', '', '', '', '', '回去找厲牙。', 47187),
(71011, 'zhTW', '懸賞：洪流百合', '找到洪流百合。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找洪流百合，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n遠征隊成員回報，他們在薩爪祖斯的蓋利奇爾瞰臺看到一個強大的洪荒使者，她的領口上別著一朵魔法之花。我們不確定那是不是就是傳說中的洪流百合，但那很適合當成搜索的起點。', '', '薩爪祖斯的一名強大的水之洪荒使者，她的兜帽上別著一朵洪流百合。', '雅蘿拉‧霧風', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(71010, 'zhTW', '懸賞：時間望遠鏡', '找到時間望遠鏡。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找時間望遠鏡，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n遠征隊成員回報，他們在薩爪祖斯南方的旅店中，偶然聽見一名矮人炫耀他的魔法望遠鏡。我們建議你集中搜索那個區域。', '', '薩爪祖斯的一個洪荒使者暸望手，使用時間望遠鏡來計劃他的下一步攻擊。', '瞭望員摩德仁', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(71009, 'zhTW', '初級，我親愛的龍獸', '協助瓦瑟克解開遠古瞰台的謎題。', '厲牙想要再挑戰一次霜齧，是吧？我很不想拒絕他，但我已經放棄那樣的生活，改當學者了。\n\n我想要試著發現歷史—並創造歷史。但在這些遠古遺跡中，我被這個深奧的謎題絆住了。\n\n謎題就是：只要你摸一顆附近的水晶，它就會說「跟著圖形走。」但它的意思我一點頭緒都沒有！\n\n這樣吧。只要你能幫我破解這個謎題，我就去幫忙厲牙解決霜齧，一勞永逸。', '', '', '', '', '', '', 47187),
(71008, 'zhTW', '懸賞：石心的岩石心臟', '找到石心的岩石心臟。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找石心的岩石心臟，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n遠征隊成員回報，他們在蒼藍高地中部的一個洞穴中看過石心。', '', '石心把他的石頭心藏在…嗯，你應該知道我要說什麼了。。', '石心', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(71004, 'zhTW', '懸賞：歐胡納鷹大量束縛圖騰', '找到歐胡納鷹大量束縛圖騰。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找歐胡納鷹大量束縛圖騰，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n遠征隊成員回報，雍亞拉平原的風頌高地有一名特別強大的洪荒使者，他似乎掌握著傳說中這個圖騰所擁有的力量。', '', '雍亞拉平原上的一名強大風之洪荒使者，他掌握著歐胡納鷹大量束縛圖騰。', '普澤拉‧射風', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(71002, 'zhTW', '最棒的法術', '閱讀「法力風暴新手書」並發掘米歐浩斯的秘密法術。', '<這本秘能書籍緩緩漂浮著，並散發出秘法魔法，裡面包含了無數的法術和附魔，都是由米歐浩斯‧曼納斯頓混沌卻美麗的心靈創造出來的。>', '', '', '', '', '', '', 47187),
(71001, 'zhTW', '懸賞：地縛原始核心', '在奈薩魯斯堡找到地縛原始核心。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找地縛原始核心，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n根據最近在黑曜龍堡發現的紀錄來看，它曾經被存放在奈薩魯斯堡的巨龍寶庫中，但它目前的下落不明。', '', '核心據說在奈薩魯斯堡的巨龍寶庫中不見了。', '地縛原始核心', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(71000, 'zhTW', '已招募巴斯特', '讓厲牙知道你招募了巴斯特。', '畢竟我已經答應你了。如果厲牙需要人幫忙殺死霜齧來了結一切，那就算我一個。\n\n我體內的仇恨都是為了霜齧而留的。厲牙有跟你說發生了什麼事嗎？\n\n我們所有和厲牙一起狩獵的人都以為我們所向披靡。直到我們遇見霜齧為止。\n\n霜齧不僅是打敗我們而已。他在藏匿處所有人的面前羞辱了我們。\n\n我們所有人都在藏匿處被打敗了，而且渾身是血、鼻青臉腫。霜齧用我們來殺雞儆猴。\n\n現在我們該報復了。', '', '', '', '', '', '回去找老厲牙。', 47187),
(70996, 'zhTW', '為朋友處理海藻', '在長爪島擊敗野生海藻元素。', '噢，老天，厲牙聽起來真的陷入困境了。我很想說我已經放下大陸上的衝突了，可是…\n\n霜齧和我有私人恩怨。還有一個仇要報。\n\n噢，胡來！不過，我不能讓其他人在這自生自滅…海灘那有個元素生物，它一直在找我們麻煩。我是唯一一個能讓它不要作亂的人。狡猾的傢伙…而且很滑。\n\n這樣吧。如果你願意幫我處理那個元素生物，我就慢慢閒晃到厲牙的營地去吧。\n\n你怎麼說啊，好傢伙？', '', '去吧！', '海藻元素', '', '', '', 47187),
(70995, 'zhTW', '懸賞：菲尼史卓莎的顱骨', '找到菲尼史卓莎的顱骨。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找菲尼史卓莎的顱骨，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n有些遠征隊成員回報，西部山區中有一個被放逐的加拉登，他們看見顱骨就在他的所有物裡，但目前還沒有人可以說服他把顱骨交出來。', '', '一名隱居的加拉登把魔法顱骨展示在他的壁龕上。', '『盲目者』塔金', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(70994, 'zhTW', '排水方案', '在生命寶庫遺跡東邊的洞穴中虹吸$1oa份粼粼流水。', '想不想獲得榮耀，協助世界知名的龍鱗遠征隊首席地質學家啊？沒有錯。我就是你在想的那個人。但我遇到困境了！\n\n我本來在檢視這條河，要找新的沉積物樣本，結果水突然開始跑走，還帶走了最有趣的淤泥！\n\n我這裡有我的專利捕水裝置，但我急需找人去把那些元素生物虹吸進去。\n\n你可以勝任這工作嗎？', '', '', '', '', '', '', 47187),
(70992, 'zhTW', '懸賞：遺失的巨牙海民風箏', '找到遺失的巨牙海民風箏。', '<張貼的告示由優美的字體寫成。>\n\n文獻管理員懇請所有遠征隊成員尋找遺失的巨牙海民風箏，為我們的神器文庫增加收藏。\n\n取得以後，請將它送去給編目員潔可思進行作業並換取報酬。\n\n有些遠征隊成員回報，他們在西部海岸一帶看過這樣的風箏，連接在一艘巨牙海民運輸船上，但沒有人有辦法拿到它，因為運輸船航行時會讓風箏飛在空中，沒人能碰到。', '', '隨著迷失阿維洛移動，風箏在他身後飛揚…', '遺失的巨牙海民風箏', '', '', '回到龍鱗基地和編目員潔可思談話。', 47187),
(70990, 'zhTW', '有羊毛就有辦法', '剃崖蹄阿戈利羊的羊毛。', '雖然我們的羊毛大部分來自我們自己的阿戈利羊群，但在羊群數量減少時，我們還是會需要從自然取毛。\n\n附近的平原是野生阿戈利羊的家—它們比我們氏族的羊群更暴躁。如果你願意把這把刀拿去，剃一些它們的羊毛的話，對艾拉格會有很大的幫助的。', '', '', '', '', '', '', 47187),
(70989, 'zhTW', '犬群的一員', '和泰溫以及狩獵巴卡犬群一起狩獵飢餓飛龍。', '或許你的巴卡犬需要一個同類來教牠狩獵的正確方法。\n\n我們可以借你幾頭受過訓練的巴卡犬。把牠們借去，然後把在這個地區盤旋的飛龍擊落。\n\n我們來看看泰溫在犬群裡表現如何吧！', '', '', '', '', '', '', 47187),
(70987, 'zhTW', '澱粉的精髓', '在甦醒海岸的生命寶庫遺跡和梅麗安‧艾諾拉斯說話。', '在你探險的時候，沒什麼比方便攜帶的餐點更棒的吧？\n\n街頭小吃是世界上各個繁忙城市中的精華。但不是每種餐點都方便攜帶。一道厲害的外帶料理，其核心是在移動時可以維持形狀的澱粉。麵包、馬鈴薯、米飯等等食材，都是這類可以一手掌握的餐點精髓。\n\n我想要把美味介紹給這裡的熊貓人同胞，請他們吃風味十足的植物跳跳玉米。那是莫瑟和我在甦醒海岸的一座泰坦遺跡初次見面時，他介紹給我的。', '', '', '', '', '', '', 47187),
(70986, 'zhTW', '士兵什克紮', '', '', '', '', '', '', '', '', 47187),
(70985, 'zhTW', '孤單的斥候', '在林蔭聖所和林精交談。', '我知道，我知道，這很傻。半人馬和林精，對吧？我們的差異非常大。\n\n可是，在我第一次看見翡翠花園時，我就很想要多了解林精。但我就是沒辦法說什麼或做什麼來引起他們的興趣。\n\n我聽說他們喜歡…植物。還有可愛的小動物。或許還有殺死盜獵者之類的，但我根本不知道從何開始。\n\n拜託，你可以和他們交談對吧？你可以四處問問，了解他們喜歡什麼嗎？這樣我或許就有機會了。', '', '', '', '', '', '回去找斥候桑敦。', 47187),
(70984, 'zhTW', '猛衝破壞者', '', '', '', '', '', '', '', '', 47187),
(70983, 'zhTW', '歐南克‧索岸', '', '', '', '', '', '', '', '', 47187),
(70981, 'zhTW', '風味之海', '在蒼藍高地的捕鯨者望角和瓦雲說話。', '$n，是海的味道！你聞到了嗎？你聞到各種礦物和濃濃的海鹽味了嗎？有嗎？？\n\n在今天的美好餐點中，很神秘地缺少了一種稀有的魚。我曾經在蒼藍高地伊斯凱拉的家園附近嚐過。兩位巨牙海民當時只是很簡單在火烤那種魚，然後整個凍原就瀰漫著無比的香氣。\n\n請你去找一條來給我們吧。賓客一定會和我那天一樣，為大海的美味深深著迷。', '', '', '', '', '', '', 47187),
