(70976, 'zhTW', '偷懶與滑行', '到東南方的島上尋找基奧波。', '你應該知道，伊斯凱拉的兒童通常都很獨立，很小的時候就要學會照顧自己。\n\n許多比較大的孩子會偷跑到西南邊的冰山去，當成是一種成年禮的儀式。基奧波是我們最大的孩子，他人在那邊。跟他說是我叫你去找他的，他就會給你一架我們的雪橇。\n\n啊，想起好多年輕時候的開心回憶…在那邊和朋友們一起玩…', '', '', '', '', '', '', 47187),
(70972, 'zhTW', '我們忠誠、纖瘦的坐騎', '', '', '', '', '', '', '', '', 47187),
(70971, 'zhTW', '每個人都有武器', '', '', '', '', '', '', '', '', 47187),
(70970, 'zhTW', '良好動機', '阻止雅莉亞‧日翔並摧毀瓦烏洛斯。', '我可能知道神器在哪。在你帶回所有的裂片時，雅莉亞正在驚慌地低語。\n\n她一直說到某個「洞穴」，還有蜘蛛似乎會被那地方吸引的事。\n\n我們前面的區域沒有洞穴…所以我相信，廢墟更深處的地方或許會有。\n\n我們會待在這裡，確保你的逃生路線暢通，$n。請你拯救雅莉亞，並摧毀這個受詛咒的神器。', '', '希望我們能及時趕到，不然雅莉亞就要被神器吞噬了。', '瓦烏洛斯', '', '', '', 47187),
