(70958, 'zhTW', '盛宴好菇到', '在薩爪祖斯的時光合流和守望者隊長辛尤彌說話。', '精緻料理的重點自然就是使用最精緻的食材和最精緻的手法。但精緻料理往往有財富的門檻，我們在晶紅盛宴可不允許這種事！\n\n莫瑟跟我說了一種完美的食材，很適合今天的主題。如此稀有、如此精美，它現在甚至…還不存在！很誘人，不是嗎？\n\n青銅龍發現一個了通往危險未來的傳送門。那個未來中有一種風味神秘的黑松露！\n\n你一定要去那裡！', '', '', '', '', '', '', 47187),
(70957, 'zhTW', '西邊的海', '在雍亞拉平原的林蔭聖所和糖枝說話。', '$n，你在享受我們周遭風景的綠意嗎？\n\n這讓我想起一道菜，是一對林精姊妹和她們的樹人朋友做的。她們叫糖枝！就住在平原西部海岸的林蔭聖所。\n\n那是一道混合新鮮草藥、蔬菜和香料的料理。料理的主要材料是你這輩子吃過最好吃的海藻！\n\n什麼？你以前沒吃過海藻？那你一定得找些來試試。還有，拜託你多帶一點回來分享！', '', '', '', '', '', '', 47187),
