(70946, 'zhTW', '不能讓人得到', '說服雅莉亞摧毀瓦烏洛斯。', '根據你找到的線索，聽起來這個神器的力量為所有用過它的人帶來了末日。\n\n過去住在這裡的龍裔為了爭奪此物互相殘殺。碎裂火焰軍似乎也在受到它的影響而腐化。\n\n這不是我們需要取回的神器。在它傷害更多人之前，這是我們必須摧毀的東西。\n\n我們必須說服雅莉亞和卡提加。', '', '', '', '', '', '', 47187),
(70945, 'zhTW', '捕撈更多', '', '', '', '', '', '', '', '', 47187),
