(70941, 'zhTW', '釣魚洞', '在蒼藍高地的伊斯凱拉找能瓦克說話。', '又見面了。你知道我會成為整個村子最棒的漁夫嗎？我有一次抓到一隻想要咬我臉的巨大食人魚。\n\n<洛威分心地四處張望。>\n\n噢，對了！我有一件事要告訴你。伊斯凱拉的能瓦克想要和你說說釣魚洞的事情。', '', '', '', '', '', '', 47187),
(70940, 'zhTW', '巨牙海民勇士的故事', '', '', '', '', '', '', '', '', 47187),
(70939, 'zhTW', '烹飪用具', '', '', '', '', '', '', '', '', 47187),
(70938, 'zhTW', '集體盛宴', '在蒼藍高地的伊斯凱拉和大仔金努克說話。', '你在這啊，$n！湯已經好了！\n\n你最好趕快到伊斯凱拉去。大仔金努克一直在找你。\n\n他有一次叫我拿一條又黏又噁心的棘魚來煮湯，我不想這麼做，所以我大叫：「不要，大廚！」\n\n他當時好生氣，我還以為他要把我丟進湯裡！', '', '', '', '', '', '', 47187),
(70937, 'zhTW', '瓦烏洛斯的過去', '找到關於神器瓦烏洛斯真實用途的線索。', '<多蒂克小聲的向你說。>\n\n我不喜歡這樣。神秘的魔法器物對你許下強大力量的承諾…這聽起來就很有問題。\n\n但我們也不能就此離開…不然碎裂火焰軍就會把它搶去…無論「它」到底是什麼。\n\n我很熟悉類似這樣的廢墟，藍龍通常會留下他們在做什麼的紀錄。睜大眼睛，說不定你會找到線索。\n\n我們可以用你找到的證據來警告雅莉亞和卡提加。', '', '', '', '', '', '', 47187),
(70936, 'zhTW', '遭竊巨牙海民圖騰', '', '', '', '', '', '', '', '', 47187),
(70935, 'zhTW', '捕後放生：島鰭劍魚', '', '', '', '', '', '', '', '', 47187),
(70932, 'zhTW', '香料的一生', '在黑曜王座和格利夫塔說話。', '對很多人來說，真正的一餐少不了肉。可是，真正的肉少不了什麼？\n\n香料！！\n\n這座群島上有一種香料在味道、口感和稀有度上都勝過其他香料。不幸的是，它只能在黑曜城塞深處活動的元素生物身上找到。那個地區現在已經被加拉登佔領了。\n\n或許你可以和一位古怪的食人妖打聽一下，我經過那裡的時候認識他的。我想他的名字叫…格利夫塔。', '', '', '', '', '', '', 47187),
(70931, 'zhTW', '低語碎片', '從碎裂火焰軍手上拿回$1oa個低語碎片。', '我認為瓦烏洛斯正在嘗試透過我們找到的裂片和我們溝通。\n\n我們可以利用它，前提是我們要保護好自己的心靈不受它的影響。\n\n還有，我錯估了碎裂火焰軍的能耐。很不幸的，他們已經收集到好幾塊裂片。\n\n神器的低語宣稱他們就快要找到它的地點了。\n\n在碎裂火焰軍找到神器之前，拿回他們手上的裂片吧！', '', '', '', '', '', '', 47187),
(70930, 'zhTW', '都是茶，沒有影葉', '在顫網谷和麗萊兒‧晨爆說話。', '今天這是一場茶的慶典，有高溫沖泡、低溫冰鎮和其他各種茶！也有奢華的小蛋糕和餅乾。\n\n不過，在島上有一種稀有的食材，我覺得它可以帶來全新層次的風味！在充滿蜘蛛的顫網谷深處有一種灌木叢，上面長著最令人振奮的奇妙葉子，那就是冰鉗箭葉草的葉子。\n\n龍鱗遠征隊最近正在探索那個區域。或許他們之中有人可以幫忙？', '', '', '', '', '', '', 47187),
