(70918, 'zhTW', '逃命的呱呱聲', '將被泡泡困住的小鴨子帶回生態學家的營地。', '<這隻小鴨子驚恐地呱呱叫。要是不快點幫牠，一定會吵到戈洛克！>\n\n<也許生態學家會知道如何幫助它？>', '', '', '', '', '', '將被泡泡困住的小鴨子帶回生態學家的營地。', 47187),
(70917, 'zhTW', '可靠的呱呱聲', '將被泡泡困住的小鴨子帶回生態學家的營地。', '<這隻小鴨子顯得焦躁不安，似乎很想脫離目前的處境。>\n\n<也許生態學家會知道如何幫助牠？>', '', '', '', '', '', '將被泡泡困住的小鴨子帶回生態學家的營地。', 47187),
