(70893, 'zhTW', '集體盛宴', '在集體盛宴進行$1oa項工作。', '我們現在正在舉行集體盛宴！大家都會貢獻材料，並一起煮出最棒的湯。\n\n來加入我們吧！', '', '', '', '', '', '', 47187),
