(70883, 'zhTW', '栽培之手', '在同心花園尋找古爾佩奇。', '你好，凡人。我是替首席園丁古爾佩奇傳話的。他說花園現在一片混亂，但我不太確定那樣算不算不正常。\n\n他和我保證一切都在掌握之中，但其實他是說「都在鏟子掌握之中」，我不確定那是什麼意思，但我相信他一定有辦法給你事情做。請你去找他，他會給你足以應付情況的適當裝備。', '', '', '', '', '', '', 47187),
(70882, 'zhTW', '名望物資', '', '', '', '', '', '', '', '', 47187),
(70880, 'zhTW', '用精品烹飪', '', '', '', '', '', '', '', '', 47187),
(70879, 'zhTW', '回報叛亂者之事', '在守護巨龍之座的頂層和卓萊恩隊長會面。', '我對我們今天的成果很滿意。希望你也同意，$n。\n\n我們成功阻止了這些和洪荒使者聯手的叛亂者策畫的邪惡活動。至少目前是如此。從今以後，我們會需要更密切地關注任何的異議。\n\n請盡速回去找卓萊恩隊長。她會想聽我們的完整報告。', '', '', '', '', '', '', 47187),
(70878, 'zhTW', '火焰之環', '保護瑪爾德菈‧焰舌，讓她可以封印洪荒使者傳送門。', '在餘燼石洞最深處的地方，洪荒使者建立了一個熾炎傳送門，藉此釋放出元素。\n\n我可以封印這個傳送門，但不管另一端是什麼，這一定會引發他們的憤怒，包括那些巨型熔岩。\n\n我會需要你的保護才有辦法阻止他們。', '', '我們必須消滅這個肆虐的烈焰亡魂，不然洪荒使者就要用它來破壞巨龍群島了。', '巨型熔岩', '', '', '', 47187),
(70877, 'zhTW', '及時的呱呱聲', '將被泡泡困住的小鴨子帶回生態學家的營地。', '<這隻小鴨子很沮喪，一邊無聲地呱呱叫，一邊害怕地環視四周。>\n\n<也許生態學家會知道如何幫助牠？>', '', '', '', '', '', '將被泡泡困住的小鴨子帶回生態學家的營地。', 47187),
(70876, 'zhTW', '破壞法器', '在餘燼石洞摧毀$1oa個洪荒法器。', '如果瑪爾德菈所言屬實，叛軍正在餘燼石洞製造爆炸符文石。\n\n還有，考慮到這些東西的特性，製造過程中一定有用上洪荒使者的法器。\n\n摧毀那些法器。你看到的時候就會知道。\n\n不能再讓叛軍製造出更多的毀滅性武器。', '', '', '', '', '', '', 47187),
(70875, 'zhTW', '惡劣至極', '在餘燼石洞殺死$1oa個叛亂者和$2oa個元素生物。', '餘燼石洞的叛亂者對洪荒使者抱有堅定不移的忠誠，因此是對沃卓肯最嚴重的威脅。\n\n消滅他們以及他們釋放的所有元素生物。', '', '', '', '', '', '', 47187),
(70874, 'zhTW', '突破火牆', '接受瑪爾德菈的元素祝福。', '洞窟內的叛亂者都獲得了一道元素祝福，讓他們能夠安全通過烈焰牆。我也會賦予你相同的加持。\n\n不用擔心。我看過他們施展這個法術很多次，應該可以成功複製出來。', '', '', '', '', '', '', 47187),
(70873, 'zhTW', '追逐瀑布', '收取$1oa個落水微粒。', '真正的威脅在餘燼石洞中。他們就是在這裡刻蝕符文石，灌注洪荒火焰。\n\n你應該有看到擋住入口的烈焰牆。我無法消除那道牆，但應該還是幫得上忙。我相信只要使用落水微粒，就可以安全通過。\n\n去從附近的元素生物上收取水微粒。', '', '', '', '', '', '', 47187),
(70871, 'zhTW', '伊斯凱拉漁網', '把材料帶給塔維歐，讓她製作一張伊斯凱拉漁網。', '看來你和村民們相處得不錯。\n\n你說，你想要更了解我們的捕魚方法？那麼首先，沒有人會赤手捕魚。我可以幫你製作一張配得上伊斯凱拉族的堅固漁網。', '', '', '', '', '', '', 47187),
(70867, 'zhTW', '逆鱗要塞', '', '', '', '', '', '', '', '', 47187),
(70859, 'zhTW', '守護者掌握之物', '從腐化的守護者埃達維斯身上取回低語裂片。', '$c，我很感謝你的協助。我是第一位發現這個神器瓦烏洛斯和碎裂火焰軍計畫的祈倫托法師。\n\n取回並研究這個似乎有知覺的強大法器是至關重要的事情，而且應該交由我來負責。\n\n碎裂火焰軍無所不用其極地在找它，不過我已經用魔法為我們找到一條路。\n\n這附近有位腐化的守護者，它擁有的魔法裂片和瓦烏洛斯有某種連結。我可以用它來找到神器其餘的部分。', '', '被瓦烏洛斯的力量腐化的守護者。它握有能找到神器位置的秘密。', '埃達維斯', '', '', '', 47187),
(70858, 'zhTW', '重新上陣', '對雅莉亞‧日翔使用冰冷解毒劑。', '好，解毒劑準備好了。我會穩住雅莉亞。你把那瓶藥倒進她嘴裡。\n\n我希望她能活下來…我們會需要她的魔法來追蹤這個神器。', '', '', '', '', '', '和雅莉亞‧日翔談話。', 47187),
(70856, 'zhTW', '用火焰殺死它', '用火焰槍火炬摧毀$1oa個感染屍體。', '這些邪惡的蜘蛛會在屍體中下蛋。\n\n有時候甚至會找上活人。\n\n我們看過許多碎裂火焰軍的屍體都慘遭它們的毒手。\n\n如果我們想在這活下來並擊敗碎裂火焰軍的話，就不能讓那些蛋孵化。\n\n把這個火炬拿去。火炬裡灌注了空氣及火焰的力量。把它往你想放火的方向指，剩下的交給它就好。\n\n巨牙海民不會輕忽蜘蛛。我準備好才來的。', '', '', '', '', '', '', 47187),
(70854, 'zhTW', '所以情況如何？', '回去沃卓肯的幼鱗托育所找吉哈納。', '你做得非常好，$n。魯賓斯狀況好多了，而且精神很好。\n\n吉哈納一定想知道，快點回去告訴她這個好消息！', '', '', '', '', '', '', 47187),
(70853, 'zhTW', '魯賓斯的朋友', '在甦醒海岸的野生保育區捕捉一隻膽小蜻蜓。', '如同我們討論過的，魯賓斯需要兩個東西：搭檔和對戰。\n\n我想我們可以一次解決。\n\n這個地方是稱為膽小蜻蜓的生物的繁殖地。要是你稍微找一下，應該能在這個地方找到一大堆。\n\n記住，你必須先削弱牠，才能用陷阱捕捉牠。\n\n捉到一隻後，就回來找我。對戰後，可能會受一點傷，不過我有一些戰鬥訓練石，所以馬上就能治好！', '', '', '', '', '', '', 47187),
(70851, 'zhTW', '生來更野', '向漢妮可請教魯賓斯的需求。', '有很多資訊是你要知道的。我們好好談談，再來決定什麼方法對魯賓斯最有利。', '', '', '', '', '', '', 47187),
(70850, 'zhTW', '瑪爾德菈遇到危機', '從歐里昂‧暗水手中拯救瑪爾德菈。', '做得非常好。在你四處進行破壞的時候，我仔細偵察了這座營地，沒想到卻發現了我的老朋友瑪爾德菈‧焰舌。\n\n我知道她失蹤了，而且謠言說她加入了叛亂者。但是根據我的觀察，她是被俘虜了！\n\n我們不能把她留在這裡。從囚禁她的龍裔手中把她救出來！', '', '這個叛亂領袖使用洪荒之水的鎖鏈束縛了瑪爾德菈‧焰舌。', '歐里昂‧暗水', '', '', '', 47187),
(70849, 'zhTW', '這需要專家', '前往甦醒海岸的野生保育區與漢妮可談話。', '魯賓斯現在好多了，但我認為他還需要一點協助。\n\n一陣子之前，我認識了一個超聰明的龍鱗遠征隊探險者，她叫做漢妮可，而且經常處理元龍的事。她也是名寵物訓練師。我敢說她可以幫魯賓斯更多忙！\n\n我想她當時要去甦醒海岸。我敢說你去那裡就能找到她。\n\n能幫上你的忙讓我很高興！\n\n<她開心地揮手>\n\n再見！祝你好運，魯賓斯。', '', '', '', '', '', '', 47187),
(70848, 'zhTW', '失落巨龍紋章', '將東西交給艾沙里亞。', '<艾沙里亞或許想要這東西。>', '', '', '', '', '', '', 47187),
(70847, 'zhTW', '遠古黑曜石符咒', '將這東西交給利爪潛獵者卡薇雅。', '<利爪潛獵者卡薇雅或許想要這東西。>', '', '', '', '', '', '', 47187),
(70845, 'zhTW', '追隨提爾的腳步', '在蒼藍高地找到提爾的第一個挑戰。', '守衛者提爾早已為所有可能發生的事情做好準備。他察覺未來有一天會需要為世界的工匠帶來助力，因此創造了創新引擎。它擁有創造出特殊物質的能力，使物品發揮出超越凡人能力的效用。\n\n為了確保他的引擎不會遭到濫用，他創造了我來觀察所有想獲得這股力量的人。唯有具備資格的人才有辦法使引擎解放出完整潛能。\n\n你配得上這個挑戰嗎？', '', '', '', '', '', '在蒼藍高地找到提爾的第一個挑戰。', 47187),
(70843, 'zhTW', '毀掉符文石', '摧毀炙燃符文石。', '<這個符文石和叛亂者想放在沃卓肯的那顆十分相似。\n\n雖然它尚未完成附魔，你卻看到遠處還藏有不少已經完成的符文石。\n\n要是你摧毀這些符文石，叛軍就沒辦法拿去別的地方使用。>', '', '', '', '', '', '', 47187),
(70842, 'zhTW', '引爆地點', '收集迷霧谷地圖。', '叛亂者應該有留下策劃未來攻擊的記錄。趁他們還沒開始下次的行動，我們必須找出他們想做什麼。\n\n在他們的營地搜索有標記的地圖，就像我們在沃卓肯找到的那張一樣。', '', '', '', '', '', '', 47187),
(70841, 'zhTW', '更多泰坦文物', '', '', '', '', '', '', '', '', 47187),
(70840, 'zhTW', '泰坦文物', '', '', '', '', '', '', '', '', 47187),
(70839, 'zhTW', '尋找泰坦文物', '', '', '', '', '', '', '', '', 47187),
(70838, 'zhTW', '有目標的叛亂', '殺死$1oa名叛亂者及洪荒使者。', '叛軍的駐紮地點…這就是我們一直在找的地方。算我們走運，他們的破壞者因為大意而把我們引來這邊。\n\n我真不敢相信，我的弟兄會墮落到跟洪荒使者合作。我們可不能姑息這種事。殺死叛亂者和他們的洪荒使者朋友，以免他們造成更多混亂。', '', '', '', '', '', '', 47187),
(70837, 'zhTW', '跟隨線索', '在迷霧山谷和調查員艾里馬會面。', '<調查員艾里馬檢視地圖。>\n\n守護巨龍之座上面畫的叉叉意思應該很明顯。\n\n但是迷霧山谷也被圈起來了。說不定是叛軍的下個目標？或者是他們的基地。\n\n也只能實際去看看了。在那裡和我碰面。', '', '', '', '', '', '', 47187),
(70835, 'zhTW', '堅固的遠征隊鏟子', '', '', '', '', '', '', '', '', 47187),
