(70783, 'zhTW', '斯卡拉', '', '', '', '', '', '', '', '', 47187),
(70781, 'zhTW', '突如其藍', '在藍羽崖找到哈爾琳‧啾諷。', '你看到了嗎？\n\n這個長翅膀的生物剛剛從天上掉了下來！我不知道牠是什麼，但牠絕對不是群島的原生種。\n\n等等…我確實記得一個強硬的小哥布林向我問路，她當時要去的藍羽崖就在我們正上方。你覺得她會知道些什麼嗎？', '', '', '', '', '', '', 47187),
(70780, 'zhTW', '雍亞拉旗幟', '', '', '', '', '', '', '', '', 47187),
(70779, 'zhTW', '塔金的故事', '從巨龍群島的強大巨龍和元龍身上，收集$1oa個驚人巨龍顱骨。', '<塔金在和你說話時，依然面向遙遠的島嶼。>\n\n你覺得你配得上加拉登了不起的傳說和歷史嗎？\n\n你比我們武器還要小耶？哼。\n\n我懷疑你沒有能耐傳承我族人的傳統。\n\n你有能力的話，就證明我是錯的吧。去找巨龍，他們是這片群島上唯一可敬的對手。\n\n擊敗最強的龍，然後把戰利品帶來給我，證明你勝利了。', '', '', '', '', '', '', 47187),
(70763, 'zhTW', '『闢地者』阿堤爾', '', '', '', '', '', '', '', '', 47187),
(70754, 'zhTW', '撲滅火之洪荒使者', '將洪荒核心帶去給瑞斯勒希。', '沃卓肯的瑞斯勒希拿到這個一定會很感激的，這對他的洪荒使者研究很有幫助。', '', '', '', '', '', '', 47187),
(70753, 'zhTW', '消散風之洪荒使者', '將洪荒核心帶去給瑞斯勒希。', '沃卓肯的瑞斯勒希拿到這個一定會很感激的，這對他的洪荒使者研究很有幫助。', '', '', '', '', '', '', 47187),
(70752, 'zhTW', '蒸發水之洪荒使者', '將洪荒核心帶去給瑞斯勒希。', '沃卓肯的瑞斯勒希拿到這個一定會很感激的，這對他的洪荒使者研究很有幫助。', '', '', '', '', '', '', 47187),
(70751, 'zhTW', '『虔誠者』泰瑞勞德', '', '', '', '', '', '', '', '', 47187),
(70750, 'zhTW', '支援協調者', '繼續在巨龍群島各地協助沃卓肯協調者和他們的盟友。', '就是你！對，我在和你說話。你在這裡還有看到別人嗎？\n\n<瑟拉澤爾迅速瞥了幾眼路過的人。>\n\n別管他們。他們跟這個請求無關。我只聽說過你，也只想跟你說話！\n\n沃卓肯協調者請我找出已經在巨龍群島打響名號的人，以及想要把我們的盟友和安全確實擺在第一位的人。\n\n去做你最擅長的事，朋友。你會因此而獲得豐厚獎勵。', '', '', '', '', '', '', 47187),
(70748, 'zhTW', '藍眼專屬', '在蒼藍文庫搜尋瑪里苟斯的日誌。', '難怪你的夥伴什麼都還沒找到。\n\n這些書只有藍眼睛能看。\n\n然而，我的存在應該可以讓一些相關的秘典透露它們的秘密。', '', '', '', '', '', '', 47187),
(70747, 'zhTW', '蒼藍巫師', '在安東尼達斯營地和大法師卡德加談話。', '我沒有時間和巫士鬥嘴。\n\n去和這位「大法師」協商吧，$p。好好了解一下，而且還是要保持警覺。他們可能仍是盟友，也可能是敵人…\n\n我們的報告顯示南方有一座大型的文庫建築。\n\n那裡就是我的目的地。', '', '', '', '', '', '', 47187),
(70746, 'zhTW', '藍色之影', '陪伴安珀莎和泰拉許前往安東尼達斯營地。', '那邊的，$p！\n在這一帶看到友善的面孔真好。泰拉許跟我剛剛正在討論關於這區的…新面孔的報告。\n\n<安珀莎壓低她的聲音。>\n\n藍龍。\n\n考慮到我們跟藍龍之間過去的…相處情況，泰拉許跟我認為我們必須親自評估這個情形。\n\n請你加入我們吧。', '', '', '', '', '', '', 47187),
(70745, 'zhTW', '強迫放鬆', '殺死元素召喚者。', '我認為你看到的那些洪荒使者並不像領導階層。只是普通走狗，有什麼好怕的？哈哈！\n\n但是他們提起了「瓦德妮」這個名字，這聽起來就像個首領。她肯定就是召來這些元素的罪魁禍首，所以我們得解決掉她這位召喚師。而且能夠引起這樣的騷動，表示他們應該就躲在附近才對。去看看我們正下方的洞穴，我知道有些愛偷懶的員工會窩在那邊偷懶。', '', '蒸汽與烈焰的召喚者，這名洪荒使者喜歡把敵人活活煮熟。', '瓦德妮‧冷心', '', '', '', 47187),
(70744, 'zhTW', '看看這些骨頭啊！', '清理$1oa個髒汙。', '<要是沒有弄到滿地是血，水療中心主管一定會很感激…>', '', '', '', '', '', '', 47187),
(70743, 'zhTW', '珍貴的寶寶', '找到艾札菈的寶寶。', '那邊那個，$pr！你還算差強人意吧？\n\n你應該沒有什麼急事吧？\n\n很好！\n\n我珍貴的寶寶不見了。馬上去救她。動作快點，在這麼惡劣的環境中，她根本無法照顧好自己。', '', '', '', '', '', '', 47187),
(70742, 'zhTW', '追本溯源', '搜索黑曜觀測所，尋找關於半龍人過去的線索。', '我飛到空中，調查艾錐斯發現的其中一個神器，就在入口的廢墟旁。裡面無疑會有更多。\n\n它們好像被結界保護起來，我需要更靠近一點，才能看得更仔細。這裡的魔法相當古老。\n\n地面看起來什麼都沒有，但等到我們開始調查，這裡一定不會那麼平靜。提高警覺，我們要盡全力調查清楚。', '', '', '', '', '', '', 47187),
(70741, 'zhTW', '一些最喜愛的東西', '收集$1oa件丟失的行囊。', '<看來瑜珈課被打斷了，學生的個人物品散落四處。>\n\n收集這些東西肯定能幫到安詳夢境水療中心。>', '', '', '', '', '', '', 47187),
(70740, 'zhTW', '蒸汽清理', '在下層水療中心殺死$1oa個元素生物。', '席安似乎覺得元素生物入侵我們美麗的水療中心沒什麼，但我們得立即抑制這些忽然冒出來的烈焰和蒸氣。\n\n我們聘請了一些樂師在下層水療中心表演，但是元素摧毀了他們的裝備。這個地方從來沒有這麼嚴重的元素騷動，我懷疑是洪荒使者搞的鬼。\n\n如果你想要幫忙，就幫忙解決下層水療中心東側的元素。那是第一批活動預定舉辦的地點。', '', '', '', '', '', '', 47187),
(70739, 'zhTW', '血脈、甜品和蹄萊', '協助獵人納爾曼，為他的求婚贏得傳統的祝福。', '我曾和可汗並肩狩獵、跑贏我們最快的巴卡犬，甚至徒手和一頭成年的公麋牛搏鬥。以獵人的本領來說，我已經不需要再證明什麼。\n\n然而，以伴侶來說，我還有很多要學的。\n\n雍伊爾氏族的風之賢者達瓦是我的心肝和我的快樂。我希望能證明我配得上他的愛，但我完全不了解這方面的傳統或儀式。我需要向莫魯凱的長者請教他們的智慧之言。', '', '', '', '', '', '在莫魯凱的席卡高地和獵人納爾曼說話。', 47187),
(70738, 'zhTW', '瑜珈課', '找到教練及$1oa名瑜珈學生。', '本來一切都很好，但現在呢？元素生物正在引發一些，呃…溫和的騷動。\n\n客人正在舒舒服服享受這裡的設施，但是突然間，那些元素就都冒出來了！該死的東西打亂了所有的安排，連新的瑜珈教練都受到波及。\n\n是的，瑜珈是一種新型態的拉筋，同時還可以幫助你冥想。我相信老師跟學生應該都超放鬆的、可能壓根沒注意到元素的出現。\n\n不過，還是保險一點比較好。麻煩你去找一下他們。', '', '', '', '', '', '', 47187),
(70732, 'zhTW', '練習賽', '在寵物對戰中擊敗呱許。', '好的！既然你已經把那顆石頭用在魯賓斯上，我們來場練習賽，測試他的能耐吧！\n\n在這裡北邊的海岸，有一隻巨大的角蛙，名叫呱許。呱許很喜歡戰鬥！嗯，其實是玩。他也很擅長跟其他寵物相處！\n\n這會是完美的玩樂時間…我是說戰鬥…對魯賓斯來說啦。', '', '', '', '', '', '', 47187),
(70730, 'zhTW', '席卡贈予者', '協助風之賢者達瓦準備完美的求婚。', '噢，$p。\n\n你在太陽下感到舒適嗎？它明亮的撫觸讓你感到安全嗎？每個新的一天是否都象徵著未來的希望，以及活出夢想生活的機會？\n\n那麼，你和我一樣了解愛。\n\n席卡氏族的納爾曼就是我的太陽。他是我的溫暖、是我的光，是我的希望。\n\n像他這麼優秀的男人值得一場配得上他的求婚。\n\n我們必須向雍尋求指引。', '', '', '', '', '', '', 47187),
(70723, 'zhTW', '粉碎地之洪荒使者', '將洪荒核心帶去給瑞斯勒希。', '沃卓肯的瑞斯勒希拿到這個一定會很感激的，這對他的洪荒使者研究很有幫助。', '', '', '', '', '', '', 47187),
(70722, 'zhTW', '魯賓斯的需求', '在伊斯凱拉與派楚交談。', '我想，我知道我們要做些什麼，$n。\n\n我們先就此聊一聊吧。\n\n在結束後，我甚至還準備了禮物要送你！很好玩，對不對？', '', '', '', '', '', '', 47187),
(70721, 'zhTW', '為愛相「雍」', '協助風之賢者達瓦和獵人納爾曼進行求婚。', '空之鏡旁邊有一個小池塘，那是我和納爾曼在我的學徒訓練期間初遇的地方。\n\n學徒會到上面去，進一步靠近雍亞拉才能感受到風。當初，一陣突然的風使我睜開了雙眼，使我透過水中的倒影看見了他。那是整片平原最美的風景。\n\n那會是我們完美的求婚地點。', '', '', '', '', '', '', 47187),
(70719, 'zhTW', '『斬影者』特拉肯', '', '', '', '', '', '', '', '', 47187),
(70716, 'zhTW', '巨龍崛起 (70) E', '', '', '', '', '', '', '', '', 47187),
(70715, 'zhTW', '巨龍崛起 (70) E', '', '', '', '', '', '', '', '', 47187),
(70711, 'zhTW', '激流賽道 - 進階', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70710, 'zhTW', '激流賽道', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70708, 'zhTW', '空洞', '跟寇爾加喝一杯。', '感覺像過了好多年一樣。又感覺好像只過幾分鐘。\n\n如果你有時間的話，我想找人說說話。\n\n你要幫我們點一輪酒嗎？要什麼就點吧。我請客。', '', '', '', '', '', '', 47187),
(70706, 'zhTW', '傳送門：林蔭聖所', '在雍亞拉平原的林蔭聖所找到休眠傳送門。', '我們的遠征隊回報，西南邊的蓊鬱山坡那裡有一塊休眠的石頭。那裡有點遠，但它值得我們派出有相關知識的人去調查。', '', '', '', '', '', '', 47187),
(70703, 'zhTW', '提爾堡的傳承', '在提爾堡和寇拉諾斯一起調查白銀鱗片。', '守衛者提爾確實喜歡保持神秘。他給我們的禮物顯然有更深層的含意。由於這片鱗片最有可能是他在之前的堡壘鍛造的，或許那裡會是揭開它秘密的關鍵。\n\n和寇拉諾斯一起前往提爾堡吧，$n。他是這片土地最可靠的看守者與顧問，肯定對此事有一番見解。', '', '', '', '', '', '到提爾堡與寇拉諾斯交談。', 47187),
(70702, 'zhTW', '接續傳送門探索', '在甦醒海岸的晶紅鱗哨站和塞林‧暗砧會面。', '<小信使宏亮又尖銳的叫聲吸引了你的注意。牠給了你一張字條就跑走了。\n\n字條是來自塞林‧暗砧的請求，希望能得到你的協助。>', '', '', '', '', '', '', 47187),
(70701, 'zhTW', '巴卡犬夢到的迷路阿戈利羊', '把迷路的阿戈利羊帶回艾拉格氏族。', '氏族的幾頭阿戈利羊又和我們的羊群走散了。\n\n我們周圍的山脊對牧羊人來說太危險，他們無法去找羊。如果你可以帶上一頭巴卡犬，並把阿戈利羊帶回來的話，你就幫大忙了。我們的牧羊人可以為你指點正確的方向。', '', '', '', '', '', '', 47187),
(70698, 'zhTW', '研究員隱翅', '', '', '', '', '', '', '', '', 47187),
(70697, 'zhTW', '專家意見', '在蒼藍高地與派楚談話。', '魯賓斯的傷口或許已經復原，但我很擔心他的自信心受傷了。我想，該叫其他人來幫忙了。\n\n蒼藍高地偏遠地區的西南邊住著一名叫做派楚的寵物訓練師。在這方面，她是全世界最頂尖的專家之一。\n\n請你去找她，她一定可以幫到魯賓斯！', '', '', '', '', '', '', 47187),
(70662, 'zhTW', '待鎬的骸骨', '', '', '', '', '', '', '', '', 47187),
(70659, 'zhTW', '記錄雍亞拉平原', '', '', '', '', '', '', '', '', 47187),
(70658, 'zhTW', '真品還是虛構', '', '', '', '', '', '', '', '', 47187),
(70653, 'zhTW', '冷硬科學', '', '', '', '', '', '', '', '', 47187),
(70652, 'zhTW', '拿一個下來傳', '', '', '', '', '', '', '', '', 47187),
(70648, 'zhTW', '復燃者菲拉瓦', '', '', '', '', '', '', '', '', 47187),
(70647, 'zhTW', '噢，他會在哪呢？', '拯救魯賓斯，並把他帶回沃卓肯的幼鱗托育所給吉哈納。', '$n，真高興能看到你！我超擔心的，很需要你的幫忙。\n\n我最近救援了一頭被棄養的元龍雛龍。我幫他取名叫魯賓斯，因為他非常可愛！我把他帶到這裡來照顧，也希望把他給一個好人家收養當寵物。\n\n可是他現在不見了，我很擔心他會迷路或受傷。我很想親自去找他，但我需要照顧其他的小傢伙。可以請你去找他嗎？', '', '', '', '', '', '', 47187),
(70644, 'zhTW', '馴服野山羊', '', '', '', '', '', '', '', '', 47187),
(70643, 'zhTW', '秘法炸藥', '', '', '', '', '', '', '', '', 47187),
(70641, 'zhTW', '甦醒的誓約', '在晶紅生命聖殿四處和紅龍軍團的成員談話。', '稍等一下，$p。我希望能親自感謝你協助我們找回誓言石。\n\n我之前沒有意識到半龍人的事，直到你在禁忌群島上再次甦醒。現在還不確定你的到來對我們有什麼意義，而你的族類對生命使命會是恩惠還是災禍。\n\n我鼓勵你進一步了解我們的誓言石。在晶紅生命聖殿這裡和我的幾位龍族談話吧。或許你會在我們的故事裡找到熟悉的事。', '', '', '', '', '', '', 47187),
(70640, 'zhTW', '懸賞：首領', '到安東尼達斯營地附近殺死弗利葛魯斯。', '<頁面上的文字發出柔和的藍光。>\n\n元素生物弗利葛魯斯以前是瑪里苟斯最喜歡的玩物，但處於無主狀態已經很久了。\n\n這些聚落過去充滿歡笑，現在卻是一片斷垣殘壁，受到肆虐這片土地的邪惡力量影響，這個粗暴、愛搗蛋的生物也變得乖戾且扭曲。\n\n請務必將其消滅，並且注意安全。\n\n成功之後，請告知管理者辛雷苟斯。', '', '', '弗利葛魯斯', '', '', '', 47187),
(70638, 'zhTW', '破風者', '', '', '', '', '', '', '', '', 47187),
(70634, 'zhTW', '責任鞭擊', '', '', '', '', '', '', '', '', 47187),
(70633, 'zhTW', '為引擎加入燃料', '使用瓶裝精華來為創新引擎提供能量。', '你通過了守衛者提爾留下的第一個挑戰，做得很好。雖然這只是你旅途的第一步，我有信心你會有很好的表現。你為自己贏得了進一步揭開熔爐秘密的機會。\n\n把瓶裝精華倒進創新引擎中，看看會發生什麼事吧。', '', '', '', '', '', '', 47187),
(70632, 'zhTW', '記錄甦醒海岸', '', '', '', '', '', '', '', '', 47187),
(70631, 'zhTW', '淨空天際', '', '', '', '', '', '', '', '', 47187),
(70627, 'zhTW', '冬毛氏族的什麼？', '在塞隆崗哨與索諾瓦‧雪山會面。', '我們是可以加入其他氏族…前提是它要夠安全。\n\n我擔心洪荒使者也誘惑了其他氏族。\n\n這個「龍鱗遠征隊」跟我說，他們在冬毛氏族附近有個爪營。\n\n他們或許已經受到腐化。他們也有可能會聽從我們的警告。無論事實如何，他們都需要我們。\n\n在塞隆崗哨有一位「熊怪專家」叫索諾瓦‧雪山。請去找他詢問他知道的消息。', '', '', '', '', '', '', 47187),
(70625, 'zhTW', '法鑄造物', '', '', '', '', '', '', '', '', 47187),
(70620, 'zhTW', '鱗片升級', '採集$1oa個不滅龍鱗交給沃卓肯的『粗曠者』瑞拉索爾。', '許多人都想知道我怎麼會這麼擅長剝皮，而我都這樣回答：一切取決於鱗片。\n\n你也會好奇、想多學一點嗎？幫我帶一些鱗片來，我就能展示給你看。', '', '', '', '', '', '', 47187),
(70618, 'zhTW', '熔爐的呼喚', '收集$1oa個賽若拜岩礦石交給沃卓肯的『掘地者』瑟奇塔。', '熔爐…她在呼喚我。而她要求了賽若拜岩。那邊的人！把賽若拜岩帶來給我！沒錯，一大堆賽若拜岩！<瑟奇塔開始狂熱地大笑。>', '', '', '', '', '', '', 47187),
(70617, 'zhTW', '全部都是我的礦', '收集$1oa個龍金礦石交給沃卓肯的『掘地者』瑟奇塔。', '龍金礦的用途非常廣泛，可以拿來做很多的東西。它是最完美的礦石，純粹無可挑剔。\n\n帶龍金礦石來給我。我一定要拿到手。你是礦工對吧？那就去採礦！', '', '', '', '', '', '', 47187),
(70613, 'zhTW', '在他們賴皮前給樹皮', '採集$1oa個攀纏樹皮交給沃卓肯的阿格力克斯。', '$p，你是個能幹的草藥師，對吧？附近的鍊金師都在我門前…嗯，我是沒有門啦…找我要更多攀纏樹皮。我們庫存就快賣光啦！\n\n你可以幫我再去多收集一些回來嗎？萬一鍊金師沒辦法做他們需要的藥劑，我很怕他們會開始亂拿我的東西做實驗。', '', '', '', '', '', '', 47187),
(70595, 'zhTW', '裁縫手藝不可或缺', '為工匠聯盟完成裁縫製作訂單。', '嗨嗨嗨，$p！製作訂單一直進來！\n\n要是你在找工作，工匠聯盟有源源不絕的訂單！\n\n你可以看一下我們的公開訂單，或者，如果你有自己的客群，也能接下一些公會訂單或個人訂單！完成越多訂單越好！', '', '', '', '', '', '', 47187),
(70594, 'zhTW', '製皮手藝不可或缺', '為工匠聯盟完成製皮製作訂單。', '嗨嗨嗨，$p！製作訂單一直進來！\n\n要是你在找工作，工匠聯盟有源源不絕的訂單！\n\n你可以看一下我們的公開訂單，或者，如果你有自己的客群，也能接下一些公會訂單或個人訂單！完成越多訂單越好！', '', '', '', '', '', '', 47187),
(70593, 'zhTW', '珠寶設計手藝不可或缺', '為工匠聯盟完成珠寶設計製作訂單。', '嗨嗨嗨，$p！製作訂單一直進來！\n\n要是你在找工作，工匠聯盟有源源不絕的訂單！\n\n你可以看一下我們的公開訂單，或者，如果你有自己的客群，也能接下一些公會訂單或個人訂單！完成越多訂單越好！', '', '', '', '', '', '', 47187),
(70592, 'zhTW', '銘文手藝不可或缺', '為工匠聯盟完成銘文學製作訂單。', '嗨嗨嗨，$p！製作訂單一直進來！\n\n要是你在找工作，工匠聯盟有源源不絕的訂單！\n\n你可以看一下我們的公開訂單，或者，如果你有自己的客群，也能接下一些公會訂單或個人訂單！完成越多訂單越好！', '', '', '', '', '', '', 47187),
(70591, 'zhTW', '工程手藝不可或缺', '為工匠聯盟完成工程學製作訂單。', '嗨嗨嗨，$p！製作訂單一直進來！\n\n要是你在找工作，工匠聯盟有源源不絕的訂單！\n\n你可以看一下我們的公開訂單，或者，如果你有自己的客群，也能接下一些公會訂單或個人訂單！完成越多訂單越好！', '', '', '', '', '', '', 47187),
(70589, 'zhTW', '鍛造手藝不可或缺', '為工匠聯盟完成鍛造製作訂單。', '嗨嗨嗨，$p！製作訂單一直進來！\n\n要是你在找工作，工匠聯盟有源源不絕的訂單！\n\n你可以看一下我們的公開訂單，或者，如果你有自己的客群，也能接下一些公會訂單或個人訂單！完成越多訂單越好！', '', '', '', '', '', '', 47187),
(70586, 'zhTW', '針多廚師', '在沃卓肯製造$1oa個荒紋布主廚帽給芙拉馮。', '要說我擔任裁縫師多年來學到了什麼，$p，那就是太多主廚反倒誤事。\n\n在這裡我是指，我本來想出去喝一杯的，可是臨時來了一個訂單，要買一整櫃的廚師制服。\n\n如果你可以負責縫帽子的話，我能夠自己完成其他東西。', '', '', '', '', '', '', 47187),
(70571, 'zhTW', '來買鼓喲！', '在沃卓肯製造$1oa個兇野皮鼓交給『塑皮者』寇魯茲。', '我們的鼓遠近馳名，半人馬的製鼓技藝已經傳承了不知道多少個世紀。不幸的是，這也代表我們的鼓最近有點供不應求。\n\n我看得出來，你的技術也很不錯。說不定你可以幫我們的店家做幾面鼓？', '', '', '', '', '', '', 47187),
(70569, 'zhTW', '為崔斯可做工具', '在沃卓肯製造$1oa個草藥師的花籃給『塑皮者』寇魯茲。', '我有很多優秀的顧客，崔斯可是其中我最喜歡的。他最近來找我幫忙，因為他弄破了他的草藥師袋子。\n\n我答應會為他做幾個籃子來取代他之前的袋子。\n\n你可以幫我完成這些工作嗎，$p？崔斯可一定會非常感激的。', '', '', '', '', '', '', 47187),
(70567, 'zhTW', '給巴卡犬骨頭時', '在沃卓肯製造$1oa個骨鍛之弩給『塑皮者』寇魯茲。', '原本我有好幾把做工精美的骨製弓箭，結果根本沒派上用場就被巴卡犬咬壞了。巴卡犬最喜歡啃咬骨頭，不管它們是不是被做成了弓箭…反正現在全都毀了！\n\n你可以幫我製作幾副新的嗎？', '', '', '', '', '', '', 47187),
(70565, 'zhTW', '飽和襯托', '在沃卓肯製造$1oa個火燒屁股墜飾交給圖魯拉多米。', '噢，珠寶設計師，你喜歡我的項鍊嗎？\n\n你當然喜歡啦。可是，除非有東西讓它襯托，不然我無法好好炫耀它。\n\n我知道了，不如你做幾個簡單的墜飾，讓市場飽和吧。等到大家都在戴你設計的作品時，我的項鍊就會是比其他項鍊都耀眼的精品！', '', '', '', '', '', '', 47187),
(70564, 'zhTW', '嘆為觀止', '在沃卓肯製造$1oa個裂紋黑瑪瑙放大鏡交給圖魯拉多米。', '珠寶設計師，有一個展覽即將到來，而我很擔心少了適當的放大鏡，客戶會沒有辦法看到每個切割點的美。\n\n你不需要拿華麗的成品來，只要做幾副能讓我們的顧客看清楚的放大鏡就好。', '', '', '', '', '', '', 47187),
(70560, 'zhTW', '最有力的工具：良好記錄', '在沃卓肯製造$1oa個探險手冊綱要交給塔仁達菈。', '我的雕銘學徒啊，你今天準備好要寫字了嗎？龍鱗遠征隊帶來了他們在冒險中寫下的大量筆記，並請我們把他們的鬼畫符筆記彙整成合適的綱要，以利隨時在野外檢視。還有啊，我的手今天恰好沒辦法勝任這個任務。我可以再依賴你完成這個工作嗎？', '', '', '', '', '', '', 47187),
(70559, 'zhTW', '幫忙弄點羽毛筆來，好嗎？', '在沃卓肯製造$1oa個雕銘師的牢固羽毛筆交給塔仁達菈。', '我的雕銘學徒啊，看到你真好。今天稍早的時候，有幾個新手來試了一下銘文學。他們寫字都太用力，還把羽毛筆尖都弄斷了！我很不想麻煩你，但我可以請你多製作幾支羽毛筆當作我們的庫存嗎？', '', '', '', '', '', '', 47187),
(70557, 'zhTW', '沒有瞄準鏡', '在沃卓肯製造$1oa個青銅龍軍團煙火交給叮噹點‧碎爆。', '好零件，工程師，我今天有項大任務要交代你！\n\n顯然，獵人之間流行起了煙火風潮。他們想發射煙火來把鴨子嚇到空中。我猜鴨子應該很聰明，不會吃這套，但我們還是能藉此大撈特撈！你要不要來幫忙完成工作呀？', '', '', '', '', '', '', 47187),
(70550, 'zhTW', '歡迎來到集會', '在鈷藍集會和薩文交談，了解可在該處使用什麼能力。', '我們需要你的幫忙。\n\n碎裂火焰軍已經控制了大部分的鈷藍集會。\n\n請幫我們一起對抗碎裂火焰軍。我們雖然勢單力薄，但還是能提供你一些協助。', '', '', '', '', '', '', 47187),
(70542, 'zhTW', '蒼藍高地拉力賽道', '', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70541, 'zhTW', '狩獵戰術：夥伴', '選擇在大狩獵中要和巴卡犬還是歐胡納鷹一同戰鬥。', '你在莫魯克越來越有名望。你現在或許能跟頑強的巴卡犬或迅捷的歐胡納鷹夥伴一起狩獵。', '', '', '', '', '', '', 47187),
(70540, 'zhTW', '工程師最好的好朋友', '在沃卓肯製造$1oa個萬用工具交給叮噹點‧碎爆。', '嘿，工程師，你有看到我的…\n\n呃…幫我拿…\n\n我決定了！我們應該在店裡擺出更多更多工具，你懂我的意思嗎？', '', '', '', '', '', '', 47187),
(70533, 'zhTW', '藥劑，得加些油', '在沃卓肯製作$1oa個攀纏火油交給康芙拉苟。', '你知道攀纏火油是用來為藥劑收尾的絕佳材料嗎？我知道，而且我手上的油用完了。沒有充足的火油庫存，我沒辦法工作。拜託，$p，幫我補充一下實驗室庫存吧。', '', '', '', '', '', '', 47187),
(70532, 'zhTW', '襲擊支援', '在沃卓肯製作$1oa瓶提神治療藥水交給康芙拉苟。', '噢，$p，真高興能看到你。好幾名勇士在上一次和洪荒使者作戰時受了傷。我們急需治療藥水。你身為冒險者，自己也會帶著好幾瓶藥水才對，我們則是需要非常多。', '', '', '', '', '', '', 47187),
(70531, 'zhTW', '法力市集', '在沃卓肯製作$1oa個充氣法力藥水交給康芙拉苟。', '這週的法力藥水需求已經大幅上升，$p。我會需要你的協助來完成客戶的訂單。像你這樣熟練的鍊金師一定沒問題的，對吧？', '', '', '', '', '', '', 47187),
(70526, 'zhTW', '雍亞拉平原拉力賽道', '', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70501, 'zhTW', '狩獵執照', '完成大狩獵訓練任務。', '啊，終於準備好要證明你的狩獵能力了？你要記得，這可不是跑來跑去、狩獵任何會動的生物那麼簡單。席卡的狩獵是有目的的。我們狩獵是為了氏族提供食物及衣物、向強大的敵手證明我們的力量以及平衡自然。\n\n我們不會狩獵到土地枯竭，在狩獵過程會撒下種子來成就未來更多的大狩獵。證明你有能力遵守這些規範，我們就會讓你加入。\n\n我不太敢說你那個朋友會成功就是了。', '', '', '', '', '', '', 47187),
(70450, 'zhTW', '水獺驚嚇', '嚇走討厭的巨獺', '嗨，朋友。這些巨獺一直在偷我的漁獲！\n\n要我決定的話，我會把牠們炸飛，可是我們的巨牙海民朋友似乎不太贊同。我做了這個巨獺趨避裝置MK-SH4RK，可是…我不是很擅長游泳。\n\n你看來很擅長，能不能幫所有人一個大忙，啟動這裝置、游啊游到那邊去，把牠們嚇走？', '', '', '', '', '', '', 47187),
(70446, 'zhTW', '個人歷史', '在黑曜觀測所和安珀莎會面。', '分析過文庫中的收藏後，我找到一些線索，指出黑曜觀測所有個對大地守護者非常重要的地方。我只能猜測，裡面可能藏有關於我們軍團歷史的知識。\n\n安珀莎對此很感興趣，我已經把我的發現告訴她。希望我沒做錯。\n\n她已經先進去調查了。拜託，請去盯著她。她是個強悍的士兵，但這個話題實在…不好處理。誰知道到底會找到什麼真相。', '', '', '', '', '', '', 47187),
(70444, 'zhTW', '殘暴野地', '在殘暴野地與葛爾薩克會面。', '給最勇敢的席卡人！\n\n做好萬全準備，然後前往殘暴野地吧。你可以獲得最勇猛之人的頭銜！\n\n證明你的能耐。展現你最強的戰鬥實力！\n\n另有條款及細則。', '', '', '', '', '', '', 47187),
(70442, 'zhTW', '盛宴戰鬥', '', '', '', '', '', '', '', '', 47187),
(70438, 'zhTW', '飛魚', '收集魚來補充釣魚池，然後騎上飛龍把牠們從上面丟下去。', '咬餌的情況應該要更熱烈的，你不覺得嗎？\n\n我跟你說，這讓我有了一個點子。依據傳說，這些湖泊和河流以前是沒有魚的。據說是在上方飛翔的巨龍把魚丟下去，這些水池才會充滿魚！你能相信嗎？\n\n或許你和你的飛龍應該試試看？', '', '', '', '', '', '', 47187),
(70437, 'zhTW', '前往提爾堡', '在守護巨龍之座與雅立史卓莎會面。', '軍團上次造訪提爾堡已經是好久、好久以前的事。\n\n不過，我們必須去一趟，調查誓言母石是否仍可正常運行。\n\n來吧，到守護巨龍之座來找我。我們必須查清楚，會在提爾昔日的要塞遭遇那些危險。', '', '', '', '', '', '到提爾堡與雅立史卓莎會面。', 47187),
