(70414, 'zhTW', '震動之地', '放置粉碎圖騰來釋放受困的穴石元素。', '以卡茲格羅斯之名啊，這裡怎麼回事？\n\n這股熔岩有自己的意志，從底下吞噬這些穴石元素。造成這個的不只是巧合而已…我打算發掘真相！\n\n把這些粉碎圖騰放到受困的元素生物旁來釋放它們！', '', '', '', '', '', '', 47187),
(70412, 'zhTW', '飛龍競速 - 野生保育區彎道', '', '', '', '', '', '', '', '', 47187),
(70377, 'zhTW', '被遺棄的時尚', '找到太陽眼鏡的主人。', '<一副沾滿黏液、噁心的太陽眼鏡。但是它看起來非常昂貴。\n\n肯定是某個人弄丟的東西。這個風格現在非常流行。>', '', '', '', '', '', '', 47187),
(70376, 'zhTW', '提爾的第二個挑戰：力量', '在雍亞拉平原完成提爾的第二個挑戰。', '<隨著你靠近，雕像上的銘文發出微弱的光。>\n\n「駕馭守護者的力量，展現出堅強不屈者的無畏決心。」', '', '', '', '', '', '', 47187),
(70374, 'zhTW', '受祝之人希米亞', '擊敗元素。', '元素主張自己擁有這片土地，而且不歡迎我們的入侵。\n\n噢，元素啊，你忘記了我們的保衛者—空氣！無形，卻又無所不在，為生命所依賴！遭到遺忘，就像你呼吸一樣簡單。在對上我之後，你永遠不會再忘記。', '', '', '', '', '', '返回蹄拉凱去找長者娜祖恩。', 47187),
(70373, 'zhTW', '死亡之翼咕嚕咕！', '搭上飛行艇並擊敗死亡之翼咕嚕咕！', '死亡之翼咕嚕咕！\n死亡之翼咕嚕咕！\n死亡之翼咕嚕咕嘟嘎噗！！\n\n嘎嗚嗚嗚母啪嘎嘎！！\n\n<你不需要翻譯，就知道他們希望你能打倒魚人版的死亡之翼。在你接受或拒絕之前，機械引擎的轟隆聲朝你逼近！>', '', '死亡之翼咕嚕咕！\n死亡之翼咕嚕咕！\n死亡之翼咕嚕咕嘟嘎噗！！', '死亡之翼咕嚕咕', '', '', '', 47187),
(70371, 'zhTW', '死亡之翼咕嚕咕！', '搭上飛行艇並擊敗死亡之翼咕嚕咕！', '死亡之翼咕嚕咕！\n死亡之翼咕嚕咕！\n死亡之翼咕嚕咕嘟嘎噗！！\n\n嘎嗚嗚嗚母啪嘎嘎！！\n\n<你不需要翻譯，就知道他們希望你能打倒魚人版的死亡之翼。在你接受或拒絕之前，機械引擎的轟隆聲朝你逼近！>', '', '死亡之翼咕嚕咕！\n死亡之翼咕嚕咕！\n死亡之翼咕嚕咕嘟嘎噗！！', '死亡之翼咕嚕咕', '', '', '', 47187),
(70370, 'zhTW', '專業檢驗', '接受赫菲思塔的個性測驗來得知你的理想專業。', '哈囉！你想不想和工匠聯盟合作，來賺取豐厚的酬勞，並為艾澤拉斯各地的客戶提供寶貴的商品和服務啊？\n\n太棒了！你受過哪兩種技能的訓練？\n\n…嗯？你只有一種專業？真是太可惜啦！\n\n<赫菲思塔沉思了一會。>\n\n我知道了！我要問你一些和你的個性有關的問題，我們再一起想出哪一個第二專業和你的第一專業最能互補！聽起來怎麼樣？', '', '', '', '', '', '', 47187),
(70368, 'zhTW', '專業檢驗', '接受赫菲思塔的個性測驗來得知你的理想專業。', '哈囉！你想不想和工匠聯盟合作，來賺取豐厚的酬勞，並為艾澤拉斯各地的客戶提供寶貴的商品和服務啊？\n\n…嗯？你沒有專業？真是太可惜啦！\n\n<赫菲思塔沉思了一會。>\n\n我知道了！我要問你一些和你的個性有關的問題，我們再一起想出你最適合哪個專業！聽起來怎麼樣？', '', '', '', '', '', '', 47187),
