(70352, 'zhTW', '爬得更高', '和托瑞琪一起殺死角蛙和衛地元龍。', '那邊的外來者！你以前殺過元龍，對吧？\n\n合理來說，把你的經驗加上我的狩獵實力，我們就可以獵到不少！這附近有些噴泉，會吸引龍類野獸。\n\n幫我一起向我的另一半證明，我才是比較優秀的獵人。', '', '', '', '', '', '', 47187),
(70351, 'zhTW', '花園派對', '在晶紅生命之池與阿蔻菈談話。', '我已經照顧這個花園很多年，準備好總有一天要接受我的天職。而這一天已經來臨了！\n\n我非常喜歡所有花草樹木，就連藏身其中的蟲子也喜歡。當我照顧花園時，我可以感知到自然之靈「偉大龍魂」。\n\n現在只剩下一件事要做。我要喚醒偉大龍魂，就像傳說中的那樣。\n\n<阿蔻菈露出燦爛的笑容>\n\n到下面的花園找我，就在她的骸骨安息的池邊。我會在那裡進一步解釋。', '', '', '', '', '', '', 47187),
(70341, 'zhTW', '應得的勝利', '回到沃卓肯的創新引擎去。', '最小的東西也可能蘊藏最偉大的寶藏。\n\n把精華拿到創新引擎那裡去。', '', '', '', '', '', '', 47187),
(70339, 'zhTW', '提爾的腳步：雍亞拉平原', '在雍亞拉平原找到提爾的第二個挑戰。', '雖然你在第一項挑戰中表現得很好，請別認為你可以輕易地超越所有人。守衛者提爾只願意把創新引擎開放給配得上它、能夠明智地使用它的人。\n\n如果你沒有遇到困難，你可以在雍亞拉平原找到下一個挑戰。我很期待能夠測試你的能耐，冒險者。', '', '', '', '', '', '在雍亞拉平原找到提爾的第二個挑戰。', 47187),
(70338, 'zhTW', '幼狐被帶走了', '拯救幼狐。', '如果希爾薇這麼悲傷，那一定表示她的幼狐就在那裡面！\n\n在她染病的時間，那些巨人一定綁架了她的幼狐，但她卻太過虛弱，無法去救牠們。\n\n這個年紀的幼狐非常有活力，希望牠們跑得夠快，順利逃脫巨人的魔掌…\n\n拿去，利用我的隱形符咒。你必須快點去救牠們，別讓牠們被吃了！', '', '', '', '', '', '', 47187),
(70337, 'zhTW', '餘燼守望', '將雍伊爾風鈴帶去餘燼守望', '你好，外來者。\n\n風跟我說了有一群人在餘燼守望廢墟避難的事情。他們似乎只對過去有興趣，而我們半人馬則選擇活在當下，活在雍亞拉的恩典中。\n\n儘管如此，他們依然是我們的來客。我已經為他們製作了這些風鈴，讓他們可以聽見雍亞拉的存在。希望這能為他們的爐火帶來歡樂及安慰。', '', '', '', '', '', '', 47187),
(70335, 'zhTW', '簡單挖掘工具', '', '', '', '', '', '', '', '', 47187),
(70319, 'zhTW', '勒加祖萊', '將巨獺之心、岩牙腿骨、角行鳥鱗片以及禿鷹的砂囊帶去給木階哨站的慕克‧雨觸。', '我的叔叔跟我講過許多他和一隻叫勒加祖萊的角行鳥的戰鬥故事。他跟我說過，在牠尋找獵物時，紫紅色的鱗片會穿梭在平原的丘陵之間，也提過牠無比尖銳的利爪和有毒的撕咬。\n\n當我在外狩獵時，我看見了這樣的閃光，但已經太遲了；牠在我的肩上留下了嚴重的咬傷。牠和我叔叔描述的一樣恐怖，但我活著逃離了。\n\n我需要清理這個咬傷的感染。拜託，請收集我需要的材料。現在分秒必爭。', '', '', '', '', '', '', 47187),
(70299, 'zhTW', '龍族防禦', '在風暴裂口殺死洪荒使者。', '我聽說外來者正在和諾庫德氏族結盟，想要擊敗我們的巨龍鄰居。這些洪荒使者為我們祖先的平原帶來災禍。\n\n殺死他們，再把他們操控的元素的核心拿來給我。', '', '', '', '', '', '', 47187),
(70279, 'zhTW', '巨龍之血', '殺死卡基丹。', '你一定已經看到了，這片土地上住著超越正常尺寸的生物。\n\n我們認為這些野獸帶有原野諸神的祝福，它們被獵人視為光榮的目標，可以用來證明自己的力量。其中一頭這樣的野獸被稱為卡基丹，它就在附近。如果你成功打倒它，我會非常佩服的。', '', '', '', '', '', '', 47187),
(70268, 'zhTW', '重生的回憶', '把日記交給維利提斯塔茲。', '你找到一本部分受損的日記。它似乎是從一名年輕黑龍女子的觀點寫成的，而且時間點是在腐化之前。\n\n雖然後半部已經徹底無法辨識，但是在快速翻閱前半部的時候，你發現了一個名字：維利提斯塔茲。', '', '', '', '', '', '在晶紅聖所把日記給維利提斯塔茲', 47187),
(70244, 'zhTW', '諾庫德不會有好下場', '和大可汗瑪托拉‧薩列斯一同進入村莊，並把它從諾庫德手中奪回來。', '幾千年來，蹄萊族一直都守衛著德魯沙之角，這是我們最神聖的聖物。巴拉卡洗劫這座村莊的行徑已經背叛了莫魯克人的一切信仰。他現在已經不容赦免了。\n\n在巴拉卡摧毀號角前，我們必須把它奪回來，然後拯救還活著的蹄萊人。我要跟你一起去，並親手制裁那個墮落的可汗。諾庫德族會知曉大可汗瑪托拉的憤怒！', '', '', '', '', '', '', 47187),
(70242, 'zhTW', '死後生命', '在晶紅生命聖殿向特雷萊取得靜止容器。', '我可以感知到，他的朋友帶著很深的傷痛。這裡有某個東西再次喚醒他的傷痛，或許這樣一來就有機會讓他徹底康復。\n\n所以，現在換寇爾加接受治療了。\n\n在我們上方的露臺，你可以看到我的朋友特雷萊正在與附魔師一起工作。告訴他，我需要一個他工作用的容器。他應該會直接給你。', '', '', '', '', '', '', 47187),
(70241, 'zhTW', '痛苦的終點', '把巴索拉斯帶去找杜洛茲和寇爾加。', '剛剛發生了出事了。，我…他原本在睡覺，我分心了，結果就…我們每天都會回來這裡，他只是想和幼龍坐在一塊，我不知道他…\n\n<寇爾加的臉上有明顯的淚痕。他用手背揉他的眼睛。>\n\n不對，我也知道會有這種事。但我不知道該怎麼做。我該怎麼辦？\n\n你可以…你可以去找巴索拉斯嗎？', '', '', '', '', '', '', 47187),
(70240, 'zhTW', '減緩痛苦', '收集$1oa個乳白金魚草、$2oa個綻放的睡蓮，以及裝滿的生命水瓶。', '你當時把他帶來這裡是正確的做法。雖然他忍得很好，我看得出他承受很大的痛苦。時機來臨時，我們所有人都得這麼做。\n\n他不適的原因恐怕不是疾病，而是老化，但我可以減輕他受到的折磨。\n\n你願意幫我從附近的花園採些金魚草和睡蓮，再收集一點純水嗎？只要有足夠的數量，我可以用這些材料製作止痛藥。', '', '', '', '', '', '', 47187),
(70239, 'zhTW', '沒說的遺憾', '和杜洛茲及寇爾加一起走去尋求協助。', '杜洛茲又老又病，而且像孩子般頑固。沒人能阻止他登上開往這裡的飛船。我能做的只是跟來當他的拐杖。\n\n我在戰場上看過太多次他受苦的樣子，很清楚他什麼時候在忍痛。他在這裡的情況一天比一天糟。你可以幫我帶他去找藥水師嗎？啤酒現在已經沒用了。\n\n你能幫我們拿武器的話，我可以協助他走路。', '', '', '', '', '', '', 47187),
(70236, 'zhTW', '脫落的龍眼', '將東西交給艾蜜莉亞‧貝勒克。', '<這可能是艾蜜莉亞‧貝勒克正在找的東西。>', '', '', '', '', '', '', 47187),
(70235, 'zhTW', '修復帳單', '在沃卓肯製作$1oa個賽若拜岩修復錘給『塑鋼者』古若珂。', '巨龍群島好幾千年沒有經歷這樣的衝突了。我們的工作和紛擾無關，不過任何優良的護甲都經不起這樣的頻繁使用。我接了一個賽若拜岩修復錘的大訂單，需要盡量找人來幫忙完成。如果你幫忙的話，我會提供給你更多資訊，來提升你的巨龍群島鍛造技能。', '', '', '', '', '', '', 47187),
(70229, 'zhTW', '秘法師波庫', '在蹄拉凱找到波庫。', '秘法師幾天前被召喚到嶺水靜地去了，不過有一位秘法師留了下來。他的名字是波庫。你可以在丘陵上的雍亞拉聖壇找到他。\n\n他只是學徒，但他應該有辦法和雍亞拉通靈並取得她的祝福。只要雍亞拉站在我們這邊，我們就有可能在這場戰爭開始前獲勝。', '', '', '', '', '', '在蹄拉凱找到波庫。', 47187),
(70221, 'zhTW', '展現你的精神', '', '', '', '', '', '', '', '從湯瑪斯‧布萊特手上接過工匠精神。', 47187),
(70220, 'zhTW', '林蔭聖所', '和護衛長亞蘿玟、薩里奧莎、『治癒者』席卓拉以及維藍尼克斯交談。', '我們必須通知綠龍軍團的其他人，說遠古枝幹的屏障受到威脅了。我和蓋瑞瑟斯有許多事情要談。\n\n$n，我會為你標上我的印記。其他看到印記的龍會知道你是我信任的信使。\n\n去集結我的軍團吧。他們必須了解眼前的戰鬥並著手準備。', '', '', '', '', '', '', 47187),
(70215, 'zhTW', '好奇心是關鍵', '在安東尼達斯營地與躍傳法師德蘭卓拉談話。', '我對討論這些符號有所遲疑，不是因為我不相信你，而是因為這些符號以及符號所在的石頭的未知特性。\n\n是的，石頭。事實上，很多。散落在群島各處。\n\n<躍傳法師德蘭卓拉望向你的方向。她的眉宇間出現一絲好奇及興奮的神情。>\n\n你不知道。\n\n很好。你的堅持和願意來找我的舉動顯示你很積極想了解你最近的發現。或許我們該詳細討論這件事了。', '', '', '', '', '', '', 47187),
(70213, 'zhTW', '哈爾金‧葛林史東', '', '', '', '', '', '', '', '', 47187),
(70212, 'zhTW', '潘納布魯斯', '', '', '', '', '', '', '', '', 47187),
(70210, 'zhTW', '不忘的傳統', '在永恆墓塚放置薰香並清除鬼魅野獸。', '我們待在這個營地時有一個對艾拉格的傳統，我們的成員會到永恆墓塚去朝聖，祈求旅途平安，不會和我們的祖先遭遇到同樣的下場。諾庫德族的存在讓這趟朝聖之旅變得危險。\n\n如果你不介意的話，我想請你為我們延續這項傳統。', '', '', '', '', '', '', 47187),
(70209, 'zhTW', '呱呱和攻擊', '', '', '', '', '', '', '', '', 47187),
(70207, 'zhTW', '尾巴碎片', '將東西交給艾蜜莉亞‧貝勒克。', '<這可能是艾蜜莉亞‧貝勒克正在找的東西。>', '', '', '', '', '', '', 47187),
(70204, 'zhTW', '黃金爪', '將東西交給艾蜜莉亞‧貝勒克。', '<這可能是艾蜜莉亞‧貝勒克正在找的東西。>', '', '', '', '', '', '', 47187),
(70203, 'zhTW', '捕後放生：時光龍頭魚', '', '', '', '', '', '', '', '', 47187),
(70202, 'zhTW', '捕後放生：天藍棘魚', '', '', '', '', '', '', '', '', 47187),
(70201, 'zhTW', '捕後放生：副翼海蛾魚', '', '', '', '', '', '', '', '', 47187),
(70200, 'zhTW', '捕後放生：千咬食人魚', '', '', '', '', '', '', '', '', 47187),
(70199, 'zhTW', '捕後放生：鱗肚鯖魚', '', '', '', '', '', '', '', '', 47187),
(70198, 'zhTW', '巨龍群島的呼喚', '在杜洛塔和娜蕾迪亞‧河光會面。', '我們的盟友在杜洛塔集合。這是令人激動的時刻！\n\n加入我們吧，$n！出發前往巨龍群島的時間到了！', '', '', '', '', '', '', 47187),
(70197, 'zhTW', '巨龍群島的呼喚', '到暴風港與多蒂‧鬍鬚會面。', '你準備好踏上永生難忘的冒險了嗎？我知道我準備好了！\n\n我們的盟友已經招募完成，補給品也打包裝船了。那你還在等什麼？\n\n到暴風城碼頭和我集合。啟程前往巨龍群島的時間到了！', '', '', '', '', '', '', 47187),
(70196, 'zhTW', '修剪保護區', '', '', '', '', '', '', '', '', 47187),
(70195, 'zhTW', '風暴來襲', '救援亞坦並找尋關於外來者的線索。', '根據報告顯示，諾庫德族身邊有一名使用前所未見的魔法的外來者。這位外來者像風暴一樣橫掃我們的士兵。\n\n如果諾庫德族有能夠造成大量破壞的盟友，我們必須想辦法了解他們。\n\n我已經派出我的歐胡納鷹亞坦去找這名外來者，但她還沒有飛回來，這讓我很擔心。$n，你可以去尋找關於這名外來者的線索和亞坦的下落嗎？', '', '', '', '', '', '', 47187),
(70194, 'zhTW', '專精秘密：裁縫', '', '', '', '', '', '', '', '', 47187),
(70193, 'zhTW', '專精秘密：剝皮', '', '', '', '', '', '', '', '', 47187),
(70192, 'zhTW', '專精秘密：採礦', '', '', '', '', '', '', '', '', 47187),
(70191, 'zhTW', '專精秘密：製皮', '', '', '', '', '', '', '', '', 47187),
(70190, 'zhTW', '專精秘密：草藥學', '', '', '', '', '', '', '', '', 47187),
(70189, 'zhTW', '專精秘密：珠寶設計', '', '', '', '', '', '', '', '', 47187),
(70188, 'zhTW', '專精秘密：銘文學', '', '', '', '', '', '', '', '', 47187),
(70187, 'zhTW', '專精秘密：工程學', '', '', '', '', '', '', '', '', 47187),
(70186, 'zhTW', '專精秘密：附魔', '', '', '', '', '', '', '', '', 47187),
(70185, 'zhTW', '神秘野獸', '找到並殺死野獸，再把證據帶給斥候托姆爾。', '<你在深陷的沙中發現巨大獸掌印。你環顧四週，附近的生物都沒有獸掌，更別提那麼大的尺寸了。\n\n如果你獵捕這頭巨獸，或許半人馬會刮目相看。>', '', '', '', '', '', '把康胡拉的毛皮帶去給斥候托姆爾。', 47187),
(70184, 'zhTW', '專精秘密：鍛造', '', '', '', '', '', '', '', '', 47187),
(70183, 'zhTW', '專精秘密：煉金術。', '', '', '', '', '', '', '', '', 47187),
(70182, 'zhTW', '勝利的甜美滋味', '回到沃卓肯的創新引擎去。', '小東西裡也有大潛能。瓶裝精華感覺起來輕如鴻毛，但它握有龐大的力量。\n\n把它拿到創新引擎那裡去。', '', '', '', '', '', '', 47187),
(70181, 'zhTW', '提爾的第一個挑戰：技法', '在蒼藍高地完成提爾的第一個挑戰。', '<隨著你靠近，雕像上的銘文散發出微弱的光。>\n\n「駕馭守衛者的力量，帶著它的光帶領我們所有人走向更好的未來。」', '', '', '', '', '', '', 47187),
(70180, 'zhTW', '迅速啟動？迅速啟動！', '協助葛雷茲為神秘裝置補充能量。', '城市裡的一些傢伙主張這個裝置是由傳說中的泰坦看守者提爾創造的。\n\n問題是我們不知道怎麼啟動它！一般的方法我們都試過了：拆解、旋轉還有輕微的電擊。除了觸電沒有任何效果。其實…我想到一個超棒的點子。\n\n看到那裡的旋翼機了嗎？搭上它，我們來看看能不能給這個泰坦東西一點…活力。', '', '', '', '', '', '', 47187),
(70179, 'zhTW', '一舉兩得', '從當地的土元素身上獲取建築材料。', '冒險者，你好！話說，你看起來很有能力，你可以幫我點忙嗎？\n\n阿茲克拉和我負責看守這座塔，我目前稱它處於「翻修前的刺激狀態」。問題是，在我們開始修復時，當地的土元素就攻擊了我們！\n\n於是我想：「哲芙蘭，不如一邊處理土元素一邊收集一些建築材料吧？」這種時候就得靠你了！你可以幫忙嗎？', '', '', '', '', '', '', 47187),
(70175, 'zhTW', '斷掉的飾環', '將東西交給艾蜜莉亞‧貝勒克。', '<這可能是艾蜜莉亞‧貝勒克正在找的東西。>', '', '', '', '', '', '', 47187),
(70174, 'zhTW', '席卡族', '和桑索克可汗會面。', '桑索克可汗是我們氏族最高明的獵人。雖然她聽不到，卻已經一次又一次地證明了自己身為獵人及領袖的能耐。\n\n她是我們所有人的精神導師、受人信任的領袖，也是莫魯克的勇猛保衛者。\n\n能跟她說話是你的光榮。', '', '', '', '', '', '', 47187),
(70171, 'zhTW', '快樂的意外插曲', '找到哈德森最後的畫作。', '<蘭恩皮塔神情失落。>\n\n是因為我嗎？他會沒有靈感，都是因為我嗎？\n\n他說他愛我，但是…你也知道不畫畫對他來說是什麼感覺。\n\n我一直都希望他好。如果這樣他會比較好…那我會離開。\n\n他丟掉的畫作還有最後一幅。在他放棄之前，最後嘗試要畫的東西。\n\n我不能眼睜睜看著它從世上消失。我把它藏在我們家裡。求求你…把那幅畫交給他…就當作是紀念吧。', '', '', '', '', '', '', 47187),
(70170, 'zhTW', '祛除心中的魔鬼', '從灌注迴廊、阿爾蓋薩學院、蒼藍密庫及奈薩魯斯堡等地城的最後首領身上，取回哈德森遺失的畫作。', '可惜他有時候非常頑固。\n\n但我就是無法放著他不管。我們只能再試一次了！\n\n外面還有更多他丟掉的畫作。不過那些畫作都在更加危險的地方，所以我希望你準備好迎接挑戰了！', '', '', '', '', '', '', 47187),
(70169, 'zhTW', '樹也需要朋友', '與勞羅斯交談。', '我知道你和蘭恩只是想幫忙。\n\n我不認為這樣會有用，我的靈感…對繪畫的堅定意志…就是消失了。\n\n不過蘭恩是對的，我欠你很大的人情，我會試試看。\n\n帶你的新銳畫家朋友來見我。', '', '', '', '', '', '', 47187),
(70168, 'zhTW', '悲傷的意外插曲', '從晶紅生命之池、諾庫德進攻據點及蕨皮谷等地城的最後首領身上，取回哈德森遺失的畫作。', '你大老遠跑來，我很抱歉…\n\n我親愛的哈德森以前很喜歡畫畫。畫畫曾是他的生命！不知道他遇上了什麼瓶頸。\n\n幾週前，他外出畫畫，在回來的路上，他一怒之下，把所有還沒完成的畫作全丟了。\n\n求求你，旅人，如果你不介意…你能找回那些畫作嗎？它們或許能再次點燃他需要的靈感。\n\n哈德森總是喜歡深入險境，尋找最美的風景。希望你做好萬全準備。', '', '', '', '', '', '', 47187),
(70166, 'zhTW', '繪畫之樂', '將勞羅斯的自薦畫作交給哈德森。', '你喜歡我的收藏嗎？這些都是哈德森的作品，他是史上最出色的畫家。\n\n它們很稀有，而且八成很值錢。他是名隱士，而且好一陣子沒有畫畫了。噢，但我很想認識他…或者是跟他學畫畫！\n\n你…似乎膽子很大。你願意幫我去找他嗎？來！順便帶上我的幾幅作品。或許能讓他眼睛一亮！\n\n或是讓他覺得我很爛…噢天啊。', '', '', '', '', '', '', 47187),
(70164, 'zhTW', '新手運', '在生命寶庫遺跡和時間術師弗希卓及希伯莉‧拍頁說話。', '$p，你有空嗎，我快要有突破性進展了！\n\n在育所崩塌之後，我失去的不只是我的戰鬥能力。我也失去了身為半龍人的認同。或許你可以明白。\n\n我喜歡拼湊和拆解東西，所以我加入了遠征隊。可是這個東西讓我遇到麻煩了。\n\n你可以請弗希卓和希伯莉看一下我的筆記嗎？我想要證明我是個有能力的工匠…向他們還有我自己證明。', '', '', '', '', '', '', 47187),
(70163, 'zhTW', '洞穴穿梭賽道 - 進階', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70161, 'zhTW', '洞穴穿梭賽道', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70159, 'zhTW', '家的滋味', '在龍鱗基地到處問問部落成員，看他們能不能借你所需的原料。', '啊，終於！又一個可以出手幫忙的半龍人。\n\n我跟我兄弟想要煮一點糧食吃，可是…\n\n<斯卡勒許比了比周遭。>\n\n這裡的一切都好不一樣。很難找到我們以前煮飯會用的同種材料。\n\n但我們可以隨機應變。去問部落有什麼可以讓我們用來代替蔬菜、蛋白質還有乳化液。這樣我們就可以煮一餐了。', '', '', '', '', '', '', 47187),
(70158, 'zhTW', '花園遊覽賽道 - 進階', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70157, 'zhTW', '花園遊覽賽道', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70156, 'zhTW', '古老的覺醒', '為傳送門提供能量。', '傳送門就坐落在我身後。誰都說不準這容器上漸漸削弱的魔法何時會退去，或發生更糟的情況：破裂。\n\n那麼大量的不穩定能量被釋放會是場災難。\n\n我們繼續吧？', '', '', '', '', '', '', 47187),
(70155, 'zhTW', '看、聽和呼吸', '和斯雷施瑞一起釣魚。', '你好，$r。很少人會來打招呼，更不用說待上一會了。大部分人都忙著前往下一個目的地。\n\n你想要跟我一起釣魚嗎？', '', '', '', '', '', '', 47187),
(70154, 'zhTW', '某處的傳送門', '跟隨躍傳法師德蘭卓拉到傳送門的位置。', '附魔會保護我們不受裡面不穩定的能量影響。\n\n我會開啟通往最近的石頭的道路。\n\n在你通過之後，要跟緊我。抵達後，啟動裝置時我會需要你的協助。', '', '', '', '', '', '', 47187),
(70152, 'zhTW', '釣魚狂亂！', '', '', '', '', '', '', '', '', 47187),
(70148, 'zhTW', '漫無目的', '到翼息大使館尋找泰隆‧以色希。', '我能耽誤你一點時間嗎？\n\n另一個通過這裡的半龍人讓我有點擔心。他問了我和我同事一大堆問題，不過我們的回答似乎讓他有點…失望。\n\n他自稱「泰隆‧以色希」。我想以你們的標準，他的年紀應該不是很大吧？\n\n我覺得他可能需要一些幫助，你願意幫我照顧他一下嗎？\n\n我看到他在那裡跟寇爾瑪談話。', '', '', '', '', '', '', 47187),
(70146, 'zhTW', '高地駁斥', '', '', '', '', '', '', '', '', 47187),
(70139, 'zhTW', '有結界的地方，就有道路', '在提爾堡蓄水池評估結界石受到的傷害。', '這個蓄水池過去受到提爾放置的三個結界石保護。\n\n它們原本用來穩定遍及整個巨龍群島的元素魔法。\n\n當你喚醒我時，我感應到西邊的結界出現損壞。洪荒使者恐怕已經破壞了所有結界。\n\n不過，我們必須評估整體損壞情形，才能決定下一步該怎麼做。', '', '', '', '', '', '', 47187),
(70136, 'zhTW', '沒時間喊痛', '在薩爪祖斯的浮動森林中，取回時光行者法杖、時光行者筆記，並殺死瘋狂熊王。', '呃…等一下…\n\n我的第一項任務…不穩定的時空能量滲入森林中…影響野生動物…需要評估影響，為時光行者收集那股魔法…\n\n<澤拉搖了搖頭。>\n\n我當時在觀察一群沃昆，結果就被癲狂的熊給攻擊…它散發出滿溢的時間魔法。我當時毫無防備，差點沒逃過一劫。\n\n$c，你願意為我找到弄丟的裝備嗎？呃，你可能也得對付那頭熊才行。', '', '', '', '', '', '', 47187),
(70135, 'zhTW', '入侵的元素', '到翼息大使館殺死$1oa個洪荒元素生物。', '龍鱗遠征隊的工匠、技師和探險者根本無力接受戰火的洗禮。\n\n但你和我並非如此，$p。\n\n我們人在巨龍群島，就用那股力量，保護那些無法保護自己的人。\n\n清除從北邊入侵的元素生物，讓遠征隊能夠專心追求他們崇高的目標。', '', '', '', '', '', '', 47187),
(70134, 'zhTW', '回憶', '取回維利提斯塔茲的時空膠囊。', '謝謝你聽我說話，年輕人。我還有一事相求。\n\n別擔心，不會再說故事了。\n\n當我們離開這裡的時候，我留下一個…類似時空膠囊的東西。你是否…能幫我找到它呢？我記得把它藏在晶紅生命聖殿底下、其中一根柱子的後面。\n\n我用一個魔法符印把它藏了起來。你只要啟動符印，應該就會看見我的時空膠囊。', '', '', '', '', '', '', 47187),
(70132, 'zhTW', '稍坐片刻', '在這裡坐一會兒，欣賞風景。', '<在你靠近時，老矮人對你的出現沒有做出反應。他凝望著遠方，臉上表情眉頭深鎖。這裡視野很好，休息一下欣賞風景或許是不錯的點子。>', '', '', '', '', '', '', 47187),
(70129, 'zhTW', '『駭人』趾塞', '協助洛威殺死『駭人』趾塞。', '你說得對，我不夠厲害…沒辦法獨自對上那個雪人！\n\n幸好有你在！\n\n那個邪惡雪人『駭人』趾塞的巢穴就在前面。那個洞穴…很大。但不可怕！也許有一點吧。\n\n你可以進去裡面，先稍微削弱他嗎？我…我會跟在你後面補刀！', '', '', '', '', '', '', 47187),
(70126, 'zhTW', '完美收場', '說服米蓋爾的客人將日後的製作訂單委託給他。', '啊，$p，很高興看到你。\n\n你為工匠聯盟、湯瑪斯還有我本人做出莫大的貢獻，謝謝你。\n\n身為工匠，還有一件你應該知道的事，而且這能讓你與客人的關係更加融洽。\n\n我今天完成了一個客人的製作訂單，你能不能代替我去見見他？說服他日後都找來我製作物品。記得提醒他，如果想取得高品質的東西，需要親自來找我。', '', '', '', '', '', '', 47187),
(70125, 'zhTW', '怒西昂在哪裡？', '詢問仙卓克絲，其他巨龍何時會抵達。', '嗯…不知道怒西昂在哪裡。\n\n他說會陪同群龍之后、『生命守縛者』雅立史卓莎的使者，一起在這裡等我們。\n\n巨龍通常不會無故違背承諾。\n\n算了，至少這裡有個熱情的龍獸來迎接我們。你去問一下，其他的龍什麼時候會到？', '', '', '', '', '', '', 47187),
(70124, 'zhTW', '練習材料', '收集$1oa片洪荒元龍幼龍鱗片。', '這裡的元龍跟我之前看過的完全不同。\n\n牠們的鱗片似乎具有天然的抗火特性，比鋼鐵強韌，而且加工後不會失去彈性。真是驚人。\n\n工匠都吵著想要拿到幾片龍鱗來加工看看。\n\n先從幼龍著手，小鱗片應該會比較容易處理，對於精通這種加工技巧也幫助。', '', '', '', '', '', '到翼息大使館與塞林‧暗砧會面。', 47187),
(70123, 'zhTW', '洪荒害蟲', '在荒野海岸殺死$1oa隻洪荒元龍。', '<埃祖拉瑟充滿戒心地瞥向在他身後山脊上悄悄移動的元龍。>\n\n我敢發誓我每次一轉身，那些元龍都會更加靠近營地…\n\n那些不是怒西昂邀請我們來這裡見的龍。\n\n元龍是殘忍的掠食者，而且根本無法溝通。所以我們也無須對它們手下留情。\n\n削減牠們的數量，才不會讓牠們的野心太過膨脹，否則這場遠征在還沒開始之前就會結束了。', '', '', '', '', '', '在翼息大使館與龍隊指揮官埃祖拉瑟會面。', 47187),
(70122, 'zhTW', '遇險的探險者', '在荒野海岸拯救3名龍鱗遠征隊成員。', '$p，別把遠征隊對學術的追尋誤認為是膽小。\n\n我們不是只會待在高塔上念書的隱士。\n\n我們是冒險者，去到艾澤拉斯的各處追尋第一手的知識！\n\n這一股冒險的熱情往往讓我們陷入危險的處境，也有幾名遠征隊成員高估了自己的能力…\n\n不過，嘿，有危險才更有樂趣！', '', '', '', '', '', '到翼息大使館與多蒂‧鬍鬚會面。', 47187),
(70112, 'zhTW', '熊怪威脅', '', '', '', '', '', '', '', '', 47187),
(70110, 'zhTW', '記錄薩爪祖斯', '', '', '', '', '', '', '', '', 47187),
(70100, 'zhTW', '記錄蒼藍高地', '', '', '', '', '', '', '', '', 47187),
(70079, 'zhTW', '記錄雍亞拉平原', '', '', '', '', '', '', '', '', 47187),
(70070, 'zhTW', '可是…我是鴨子英雄', '找到火鴨，並確保他回到葛瑞克斯身邊。', '等等…好像有點…\n\n<葛瑞克斯環顧四周>\n\n火鴨！那孩子一定又順著河往下了！不管我跟他說過多少次，他每次都想去找角蛙玩！\n\n你可以去確認他沒事嗎？希望這次他別再被吞了。', '', '', '', '', '', '和葛瑞克斯說你看到的東西。', 47187),
(70069, 'zhTW', '其他人叫我馴鴨人', '餵食$1oa隻小鴨子並回去找葛瑞克斯', '時間越來越少…但職責還沒結束。\n\n鴨群應該都在小溪邊。我把牠們留在那裡，希望牠們能夠變得獨立些。很快地，牠們就要學會自力更生了。\n\n今天呢，牠們則要依賴你。請把你抓到的食物帶去給牠們，然後把小鴨子帶來給我。要留意機長，她很喜歡從高處往下跳。', '', '', '', '', '', '', 47187),
(70068, 'zhTW', '鈷藍大災難', '', '', '', '', '', '', '', '', 47187),
(70067, 'zhTW', '給諾庫德族的消息', '', '', '', '', '', '', '', '', 47187),
(70062, 'zhTW', '有人叫我捕蟲人', '收集$1oa個空棲甲蟲塊', '啊，年輕的$r，我需要你的幫忙。我在這裡孕育了好幾代的生命。\n\n而我最喜愛的就是我的小鴨子。可是我的身體已經又老又衰弱…那可阻止不了生命的循環。\n\n我需要你為牠們找食物來。', '', '', '', '', '', '', 47187),
(70061, 'zhTW', '訓練幼龍', '指導幼龍消滅$2oa個激動的嫩草、$3oa個入侵的幼小刺獸和$4oa個無情狂風。', '$p，巨龍離開巨龍群島太久了。老實說…一代又一代傳承下來，我們的一些能力都退化了。\n\n這群幼龍應該很容易教，但我們在管教牠們這方面遇到問題。\n\n對了。\n\n我發現就連管理者瑟利思特拉都很信任你，願意把最重要的任務交給你。你願意助我們一臂之力，幫幫我們的幼龍嗎？', '', '', '', '', '', '', 47187),
(70060, 'zhTW', '學院爬升賽道 - 進階', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70059, 'zhTW', '學院爬升賽道', '滑行通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(70058, 'zhTW', '逐漸康復的朋友', '在晶紅生命聖殿各處收集$1oa根柔軟的晶紅羽毛、$2oa塊布料碎片和$3oa顆玻璃珠，幫忙修補快樂鴨。', '我們飛回家的時候，快樂鴨受傷了…\n\n<莉莉史卓莎指了指她頭上破損的鴨子玩偶。>\n\n他裡面的棉花都掉出來了！羽毛也變得很雜亂！還有一顆眼睛不見了！不！\n\n你看起來很勇敢，也很聰明。你能修補快樂鴨，對不對？', '', '', '', '', '', '', 47187),
(70055, 'zhTW', '風暴符印', '將風暴符印交給暴風城的風暴獵人威廉。', '<擁有豐富魔法知識的人或許會有興趣研究這種東西。>', '', '', '', '', '', '將風暴符印交給暴風城的風暴獵人威廉。', 47187),
