(70050, 'zhTW', '追逐風暴', '在暴風港與風暴獵人威廉交談。', '所以，那位帥氣的傢伙要派你去冒險一下？\n\n沒問題。反正遠征隊也沒辦法啟程，除非有人能夠平息那些元素風暴。\n\n去找風暴獵人威廉談一談。他正在安排人手調查這些異常的風暴，而且應該可以幫你配發需要的裝備。\n\n\n剩下的準備工作交給我來處理就行了，這段時間你就去盡情享受吧。\n\n就當你欠我一次，哈哈！', '', '', '', '', '', '在暴風港與風暴獵人威廉交談。', 47187),
(70049, 'zhTW', '平定風暴', '在卡林多和東部王國各地的洪荒風暴，從敵人身上收集$1oa個原始能量微粒。', '這些洪荒使者真是不死心，不斷濫用元素之力在東部王國和卡林多各地搞破壞。\n\n你也必須展現一樣的決心，$n。這是阻止他們的唯一辦法。\n\n找出他們下一個侵略地點，除掉洪荒風暴區域內的敵人，把握機會破壞他們的行動。\n\n我們一定要保護艾澤拉斯！', '', '', '', '', '', '', 47187),
(70048, 'zhTW', '洪荒威脅', '在卡林多和東部王國各地的洪荒風暴，從敵人身上收集$1oa個原始能量微粒。', '菈薩葛絲正在不遺餘力，培植她的洪荒大軍。\n\n祈倫托在卡林多和東部王國的各個要地，都偵測到規模龐大的風暴。\n\n洪荒使者利用元素生物壯大自己的勢力。他們似乎不只打算在巨龍群島製造混亂，還想危害聯盟和部落的地盤。\n\n找到敵人，研究他們的手法。我們必須阻止這些危險的對手，以免後悔莫及。', '', '', '', '', '', '', 47187),
(70047, 'zhTW', '冰獄', '', '', '', '', '', '', '', '', 47187),
(70042, 'zhTW', '商機無限', '為潛匿的維斯撿取多件物品。', '你嚇到我了，不過我也被抓到了！\n\n看看這些準備去征服巨龍群島的勇敢探險者…包包裡面塞滿各種工具和設備。\n\n我們可以在這裡發大財！\n\n到處走走，看看你能不能撿些東西，我可以幫你賣錢。', '', '', '', '', '', '', 47187),
(70041, 'zhTW', '噬風者之怒', '騎乘卡德加的飛行圓盤，抵抗洪荒使者部隊。', '菈薩葛絲打算破壞這座塔的所有秘法魔法，這樣她才能摧毀它！\n\n卡雷苟斯正在盡全力阻止她，而我則會用我的魔法嘗試補充地脈能量。\n\n我們恐怕撐不了太久。在我們說話的同時，已經有更多洪荒使者要上來壓制我們。\n\n把我改造的秘法圓盤拿去。抵抗前來的洪荒使者…然後讓我們祈禱奇蹟發生吧。', '', '', '', '', '', '在瓦瑟洛斯的底部和卡雷苟斯交談。', 47187),
(70040, 'zhTW', '穿梭時間之中', '召集你的盟友，並和諾茲多姆交談。', '當青銅龍與恆龍的魔法互相碰撞時，它讓克羅諾穆和伊特努斯失控地墜進時間之流。\n\n隨著他們失控墜落，他們撕裂了時光的紋理結構，在不同的時間與空間激起無數的漣漪。我們必須趕緊找到他們，把他們帶回來，阻止破壞進一步擴大。而你就是阻止克羅諾穆繼續墜落的人。\n\n我想請你召集需要的盟友來拯救克羅諾穆，然後我得專心鎖定她的魔法。', '', '', '', '', '', '召集你的盟友，並和諾茲多姆交談。', 47187),
(70035, 'zhTW', '盧里克的激流泛舟', '', '', '', '', '', '', '', '', 47187),
(70034, 'zhTW', '工匠補給品：薩曼瑟螈鱗片', '將薩曼瑟螈鱗片交給晶紅生命聖殿的赫菲思塔。', '剝皮師，你在找工作嗎？工匠聯盟請我幫他們的客人收集薩曼瑟螈的鱗片。\n\n我是個工匠，才不是他們的跑腿仔！\n\n不過…啊，你或許能找到鱗片？', '', '', '', '', '', '將薩曼瑟螈鱗片交給晶紅生命聖殿的赫菲思塔。', 47187),
(70033, 'zhTW', '工匠補給品：先鋒皮甲長靴', '將先鋒皮甲長靴交給晶紅生命聖殿的赫菲思塔。', '製皮師，你在找工作嗎？工匠聯盟請我幫他們的客人製作一些長靴。\n\n很明顯，他們不明白我多受歡迎。你知道今天有多少探險者跑來抱怨他們的鞋子破洞嗎？\n\n拿去，要是你有時間的話，這是量好的尺寸。說不定這個工匠聯盟是你一展長才的舞台。', '', '', '', '', '', '將先鋒皮甲長靴交給晶紅生命聖殿的赫菲思塔。', 47187),
(70032, 'zhTW', '工匠補給品：珠寶匠眼鏡', '將裂紋黑瑪瑙放大鏡交給晶紅生命聖殿的赫菲思塔。', '珠寶設計師，你在找工作嗎？工匠聯盟請我幫他們的客人製作一副眼鏡。\n\n我欸！以為我時間很多嗎！\n\n你會做眼鏡，對吧？', '', '', '', '', '', '將裂紋黑瑪瑙放大鏡交給晶紅生命聖殿的赫菲思塔。', 47187),
(70031, 'zhTW', '工匠補給品：廚師的光滑桿麵棍', '將廚師的光滑桿麵棍交給晶紅生命聖殿的赫菲思塔。', '雕銘師，你在找工作嗎？\n\n有家叫做工匠聯盟的公司發了訂單給我。\n\n工作內容似乎相當簡單，像你這樣的學徒都能應付。', '', '', '', '', '', '將廚師的光滑桿麵棍交給晶紅生命聖殿的赫菲思塔。', 47187),
(70030, 'zhTW', '工匠補給品：品質保證的光學鏡', '將一組品質保證的光學鏡交給晶紅生命聖殿的赫菲思塔', '啊，有個工程師！來得正好。\n\n我有些結構圖需要修正，不過有個高個子的女士過來訂了一組光學鏡。\n\n你知道怎麼做光學鏡，對吧？\n\n做好之後，把光學鏡送去晶紅生命聖殿，我記得她說過自己是工匠聯盟的人。', '', '', '', '', '', '將一組品質保證的光學鏡交給晶紅生命聖殿的赫菲思塔。', 47187),
(70029, 'zhTW', '工匠補給品：符文賽若拜岩節杖', '將$1oa個符文賽若拜岩節杖交給晶紅生命聖殿的赫菲思塔。', '你似乎有魔法天分，附魔師。你可以協助我完成一個訂單嗎？\n\n工匠聯盟為一個客人訂購了幾根用賽若拜岩做的節杖，不過附魔棒不太算是我的專長。\n\n如果你願意的話，晶紅生命聖殿的赫菲思塔會為你的時間和勞力提供報酬的！', '', '', '', '', '', '', 47187),
(70028, 'zhTW', '工匠補給品：鹽礦', '將$1oa個鹽礦交給晶紅生命聖殿的赫菲思塔。', '礦工，你在找工作嗎？\n\n我跟赫菲思塔聊過，她說工匠聯盟正在幫客人收集鹽。\n\n算了，我自己來，還是不了，我懶得動。\n\n兄弟，你去幫他們採鹽，好嗎？', '', '', '', '', '', '將$1oa個鹽礦交給晶紅生命聖殿的赫菲思塔。', 47187),
(70027, 'zhTW', '工匠補給品：勘測員布甲手環', '將勘測員布甲手環交給晶紅生命聖殿的赫菲思塔。', '裁縫師，你在找工作嗎？工匠聯盟請我幫他們的客人製作一對腕環。\n\n儘管我很感激這些探險者正試著為紡織事業做出貢獻，但我真的沒時間應付這類要求。\n\n也許你有興趣接手這份工作？', '', '', '', '', '', '將勘測員布甲手環交給晶紅生命聖殿的赫菲思塔。', 47187),
(70026, 'zhTW', '工匠補給品：熔岩甲蟲', '將$1oa隻熔岩甲蟲交給晶紅生命聖殿的赫菲思塔。', '草藥師，你在找工作嗎？工匠聯盟請我幫他們的客人收集一些甲蟲。\n\n這片土地非常豐饒，但我不太可能他們一要求，就要幫他們跑腿。\n\n不過，要是你有事出去，說不定可以順路收集一些甲蟲？', '', '', '', '', '', '將$1oa隻熔岩甲蟲交給晶紅生命聖殿的赫菲思塔。', 47187),
(70025, 'zhTW', '工匠補給品：龍金鐮刀', '將龍金鐮刀交給晶紅生命聖殿的赫菲思塔。', '你看起來遊手好閒，要不要打工啊？\n\n我有工匠聯盟的訂單需要完成，訂單內容是製作龍金鐮刀。雖然我自己動手很快就能完工，但你身為學徒，我想應該給你一點表現的機會。\n\n製作鐮刀，完成後把它送去晶紅生命聖殿，名叫赫菲思塔的德萊尼會付錢給你。', '', '', '', '', '', '將龍金鐮刀交給晶紅生命聖殿的赫菲思塔。', 47187),
(70016, 'zhTW', '療癒土地', '', '', '', '', '', '', '', '', 47187),
