(69992, 'zhTW', '風暴符印', '將風暴符印交給杜洛塔的風暴獵手蘇菈卡。', '<擁有豐富魔法知識的人或許會有興趣研究這種東西。>', '', '', '', '', '', '將風暴符印交給杜洛塔的風暴獵手蘇菈卡。', 47187),
(69991, 'zhTW', '重返殘暴野地：來自火山的敵人！', '', '', '', '', '', '', '', '', 47187),
(69984, 'zhTW', '飾金龍牙', '將東西交給艾沙里亞。', '<你發現一具死亡巨龍的遺骸。艾沙里亞應該想看看這東西。>', '', '', '', '', '', '', 47187),
(69983, 'zhTW', '焰雕之骨', '將這東西交給利爪潛獵者卡薇雅。', '<骨頭上刻著神秘的加拉登符文。利爪潛獵者卡薇雅應該想看看這東西。>', '', '', '', '', '', '', 47187),
(69981, 'zhTW', '顧客滿意度', '詢問工匠聯盟的客戶對於重製訂單的成品是否滿意。', '$c，有時間幫個小忙嗎？\n\n有些重要的客人透過工匠聯盟下了重製訂單，但我們一直沒得到他們的回音。\n\n要是你遇到他們，可以幫忙問一下他們對成品滿不滿意嗎？我們得讓客人心滿意足才行！', '', '', '', '', '', '將裝備帶去給叉河路口的馬赫拉‧彎樹者。', 47187),
(69979, 'zhTW', '夠格的狩獵', '殺死『老公牛』千里。', '智慧不會從天而降，而是需要努力求取。你要是想證明自己的價值，就必須效法我們一族的做法，以我們的方式學習。\n\n找到並獵殺『老公牛』千里，我們好幾代人都在狩獵他，每次都被他順利逃脫。\n\n你將會從中得到你尋求的智慧。', '', '『老公牛』千里從一代又一代的獵人手中逃脫，或許你就是順利抓到他的那個人。', '千里', '', '', '', 47187),
(69976, 'zhTW', '芬元', '', '', '', '', '', '', '', '', 47187),
