(69965, 'zhTW', '品質管理', '為工匠聯盟在附近的晶簇上測試赫菲思塔的工具。', '$c，你在找工作嗎？\n\n我是貿易公司工匠聯盟的代表，我們公司剛成立不久，專門透過製作訂單網路，為工匠和客人牽線。\n\n龍鱗遠征隊透過我們，訂購了一些附魔採礦工具。工具已經製作好了，不過在交貨之前，我們想先測試一下。\n\n當然，我們會付你酬勞的。', '', '', '', '', '', '', 47187),
