(69946, 'zhTW', '技藝精湛的大師', '尋找卡丁大師，向他學習專業知識。', '當我在平原上遊歷的時候，我在北邊的洞穴中遇到一個半人馬老者。他顯然擁有高深的製作技術，並且相當睿智。\n\n在他的幫助下，我逐步了解我在巨龍群島獲得的知識。\n\n如果你對自己專業技能的專精有任何疑惑，可以去向這位大師求教。他的名字是卡丁，來自蹄萊氏族。', '', '', '', '', '', '在卡丁的洞穴與卡丁談話。', 47187),
(69944, 'zhTW', '追逐風暴', '在飛艇站和風暴獵手蘇菈卡交談。', '哇，那位法師很清楚怎樣登場最能吸引目光，你說是吧？\n\n反正我們也辦法啟航，除非有人可以平息那些元素風暴。\n\n去找風暴獵手蘇菈卡談一談。她正在安排人手調查這些異常的風暴，而且她應該可以幫你配發需要的裝備。\n\n剩下的準備工作交給我來處理就行了。這樣我也可以把握機會，在出發前再多讀幾本跟龍族歷史相關的書。', '', '', '', '', '', '在飛艇站和風暴獵手蘇菈卡交談。', 47187),
(69938, 'zhTW', '釣魚狂亂！', '', '', '', '', '', '', '', '', 47187),
(69936, 'zhTW', '札布爾，受死吧', '擊敗監督者札布爾。', '做得好。那些褻瀆者再也無法強迫我的祖先為他們而戰。但需要處理一下那個對他們大呼小叫的野蠻人。\n\n就是他們的監督者札布爾。必須有人阻止他。\n\n幹掉他。', '', '', '監督者札布爾', '', '', '', 47187),
(69934, 'zhTW', '泣血之心', '交付醫療補給。', '藥水準備好了，快點送過去吧。\n\n把一箱藥水送到我們下方的峽谷的一個小山洞。沒人會在那裡收貨，不過那些藥水一定會有用。\n\n再把另一箱送到蓋利奇爾崗哨的醫護站，有個老朋友正在那裡照料傷患。\n\n我…發現你其實沒必要這麼做，當然我也是在多管閒事。不過，你真的幫了不少忙，這些藥可以救人一命。', '', '', '', '', '', '', 47187),
(69933, 'zhTW', '好奇的代價', '切一段頑固藤蔓來。', '看看峽谷的另一側，$r。洪荒使者幾天前攻擊了蓋利奇爾崗哨，現在戰鬥仍在進行當中。\n\n那裡的人需要藥膏和縫合用品。我可以幫他們製作，但我的材料嚴重不足。既然你選擇踏進我的家，就當作你是自願幫忙好了。\n\n去我的花園一趟，找到最大的藤蔓，把它連根拔起，然後帶來給我。', '', '', '', '', '', '', 47187),
(69932, 'zhTW', '每條命都珍貴', '收集原料來替換小噴流的敷料。', '幫蓋利奇爾做藥水，就代表我沒有時間做其他的工作。\n\n有隻鴨子跑進我的花園，牠的肋骨斷了。我已經處理好牠的傷，不過需要時常幫牠換藥。既然你這麼想幫忙…\n\n<薩瑞斯將材料清單塞進你手裡。>\n\n你會需要這個。把其餘的材料帶來給我。', '', '', '', '', '', '', 47187),
(69931, 'zhTW', '急襲擒拿', '', '', '', '', '', '', '', '', 47187),
(69930, 'zhTW', '巴斯里隆', '', '', '', '', '', '', '', '', 47187),
(69925, 'zhTW', '平定風暴', '在卡林多和東部王國各地的洪荒風暴，從敵人身上收集$1oa個原始能量微粒。', '這些洪荒使者真是不死心，不斷濫用元素之力在東部王國和卡林多各地搞破壞。\n\n你也必須展現一樣的決心，$n。這是阻止他們的唯一辦法。\n\n找出他們下一個侵略地點，除掉洪荒風暴區域內的敵人，把握機會破壞他們的行動。\n\n我們一定要保護艾澤拉斯！', '', '', '', '', '', '', 47187),
(69924, 'zhTW', '烈焰力量塔', '', '', '', '', '', '', '', '', 47187),
(69923, 'zhTW', '洪荒威脅', '在卡林多和東部王國各地的洪荒風暴，從敵人身上收集$1oa個原始能量微粒。', '菈薩葛絲正在不遺餘力，培植她的洪荒大軍。\n\n祈倫托在卡林多和東部王國的各個要地，都偵測到規模龐大的風暴。\n\n洪荒使者利用元素生物壯大自己的勢力。他們似乎不只打算在巨龍群島製造混亂，還想危害聯盟和部落的地盤。\n\n找到敵人，研究他們的手法。我們必須阻止這些危險的對手，以免後悔莫及。', '', '', '', '', '', '', 47187),
(69919, 'zhTW', '天降神兵', '詢問艾思蕾有關接下訂單的事情。', '你似乎是技術純熟的工匠，你要不要為冒險者同伴接點製作訂單，一起發大財啊？\n\n我會跟你說明和工匠聯盟合作的規則，之後你就可以在巨龍群島的所有製作站承接製作訂單！', '', '', '', '', '', '', 47187),
(69918, 'zhTW', '撼動我們的基礎', '殺死毀石者朵卡菈、『研磨者』茉爾卡，以及他們釋放的元素生物。', '加拉登的縛石者打算動搖堡壘的基礎！非阻止他們不可！\n\n我們甚至還沒有機會奪回堡壘，它現在卻可能變成腳下的一堆瓦礫。我們不能讓他們得逞。\n\n請盡你所能，$n…我的意思是殺光他們！', '', '茉爾卡和毀石者朵卡菈一樣，非常擅於操控堡壘下方堅硬的黑曜石。', '『研磨者』茉爾卡', '', '', '', 47187),
(69915, 'zhTW', '受到覬覦的廣告', '從叉河山羊或愛管閒事的山羊取回3張傳單。', '嗨嗨嗨！你在找工作嗎？\n\n我們全新的製作訂單服務開幕了，正在進行盛大促銷活動，想要引起大家的注意！…不過我的傳單被風吹跑了，有些當地的山羊紛紛追了過去。\n\n你可以幫我找回傳單嗎？', '', '', '', '', '', '', 47187),
(69914, 'zhTW', '加拉登已醒', '接收管理者瑟利思特拉的命令。', '真希望我們有時間可以好好的自我介紹。不過，我們畢竟不是克羅諾穆，你說對吧？\n\n我是瑟利思特拉，群龍之后、『生命守縛者』雅立史卓莎的管理者。\n\n雅立史卓莎女王請我向各位致上最誠摯的敬意，然後護送你們去生命之池見她。\n\n但是在我們出發去見她之前，我恐怕需要先請你們伸出援手。\n\n我們古老的死敵加拉登原本在地底沉睡，如今卻甦醒過來，開始攻擊附近的哨站！', '', '', '', '', '', '到翼息大使館與仙卓克絲會面。', 47187),
(69912, 'zhTW', '人生中的第一個緊急事件！', '說服仙卓克絲發射緊急信號彈，提醒巨龍你們的到來。', '<仙卓克絲一臉困惑。>\n\n我認識的管理者是不會遲到的，更何況是面對這種大事還遲到這麼久，那就更不可能了。\n\n情況非常不對勁…\n\n<仙卓克絲靈機一動。>\n\n我可以發射緊急信號彈，提醒他們訪客來了。那麼他們就會立即趕來迎接你們！\n\n不過，我以前從沒發射過緊急信號彈…', '', '', '', '', '', '到翼息大使館與怒西昂會面。', 47187),
(69911, 'zhTW', '百廢待舉', '協助菲斯塔茲大使復原大使館。', '我真希望自己能更懂一些待客之道、好好歡迎你們來到巨龍群島。不過，我畢竟只是一個哨衛。\n\n<仙卓克絲指向她身後的塔樓。>\n\n建議你們去找訪客中心的菲斯塔茲大使。在巨龍抵達之前，他或許能幫你們解答一些疑問。\n\n記得小心腳下，我剛剛還看到他在清理瓦礫。', '', '', '', '', '', '', 47187),
(69910, 'zhTW', '怒西昂在哪裡？', '詢問仙卓克絲，其他巨龍何時會抵達。', '這可真不尋常。\n\n厄比西昂說，怒西昂會陪同群龍之后、『生命守縛者』雅立史卓莎的使者，一起在這裡迎接我們。\n\n巨龍不會無故違背承諾。\n\n至少這裡有個熱情的龍獸來接待我們。能不能請你去問一下其他的龍何時會到？', '', '', '', '', '', '', 47187),
(69904, 'zhTW', '極不尋常的寂靜', '到安東尼達斯營地找諾麗可的學徒。', '$p，可以給我一分鐘嗎？我有兩個學徒名叫斯克朗比和塔基，我已經有段時間沒有他們的消息了。\n\n這令人擔憂。\n\n我派他們去拿旅店要用的補給品，現在早該回來了…\n\n請去找他們，不過我要提醒你一點，他們…有點難搞。', '', '', '', '', '', '', 47187),
(69902, 'zhTW', '理論實作', '協助提爾岡進行治療。', '$n，我需要你的協助…\n\n我希望沒有人以為我可以同時做東西、管束幼龍、還有治療和教導這些小東西！同時做這麼多事只會害我過勞死。\n\n好，你可以先用那些花，我需要幾分鐘來做好治療幼龍的準備。\n\n希望孩子們能從這個意外學到一點教訓。', '', '', '', '', '', '', 47187),
(69901, 'zhTW', '專家接手', '收集$1oa個日光之花。', '伊亞莉有提到這頭生物受傷多久了嗎？如果它傷得太重無法進食，我們就必須趕快治療它。\n\n一般來說，龍鱗遠征隊會有我幫助這頭幼龍所需的一切用品，不過在巨龍群島這裡，要把補給品弄到「前線」來比較棘手。我們的補給供應出現了顯著的延誤。\n\n不過別擔心。我們可以就地取材！只要你把日光之花帶來給我，我就可以做出讓飛龍冷靜下來的舒緩軟膏，好讓我治療它。', '', '', '', '', '', '', 47187),
(69900, 'zhTW', '辨識源頭', '到野生保育區殺死正在進行實驗的洪荒使者。', '從孩子們剛剛說的話來判斷，可能有洪荒使者潛伏在野生保育區。\n\n我們需要立刻去調查一下。\n\n其他的研究發現，洪荒使者喜歡偷走龍蛋和幼龍，對牠們注入力量，並且腐化牠們。那些無法適應轉化過程的，就會慢慢死去…但洪荒使者根本不會在意牠們的死活…\n\n我們需要把他們趕出保護區。這件事交給你了，我會試著讓孩子們冷靜下來。絕不能讓孩子們知道這些事情。', '', '', '', '', '', '', 47187),
(69899, 'zhTW', '秘密研究', '幫助伊亞莉和她的朋友。', '我知道…我表現得很奇怪。我很抱歉！\n\n你大概猜到我沒有說實話。\n\n你想聽的話…我可以跟你說我的秘密。但你必須發誓不會跟大人說！', '', '', '', '', '', '', 47187),
(69898, 'zhTW', '科學肉研究', '收集$1oa塊超美味河獸肉。', '那個，我，呃，還有更多功課…提爾岡教授的課超難的！他想要我們去研究元龍幼龍，呃，都吃什麼！對啊…\n\n我已經知道答案了！是河獸肉！\n\n你可以幫我帶一塊河獸肉來嗎？一些河獸肉一定可以讓我的個人研究充滿「視覺震撼」。\n\n可是必須是非常好的肉塊，知道嗎？像是…胖乎乎的河獸身上的肉。像元龍媽媽會餵給幼龍，讓它們長大的那種，因為，呃，這樣提爾岡先生會很高興的。', '', '', '', '', '', '', 47187),
(69897, 'zhTW', '行為分析「功課」', '輕拍$4oa隻沉睡幼龍，然後向伊亞莉回報。', '我得找個了解元龍幼龍的專家談談。像是住在野生保育區的那些生態學家！\n\n牠們會跟成年元龍一樣暴躁嗎？牠們會咬人或朝你吐火嗎？\n\n要是我…呃…你摸元龍幼龍的話呢？牠們會知道你沒有惡意，只是想幫牠們嗎？\n\n當然，我問這些都是為了科學研究。提爾岡一直告訴我們，要去測試我們的家…夾…加！加說…呃！理論！\n\n我覺得牠們應該喜歡被拍拍，牠們會覺得很舒服。你可以幫我測試一下嗎？', '', '', '', '', '', '', 47187),
(69896, 'zhTW', '災難性繞路', '到生命寶庫遺跡與元素師泰暘會面。', '我知道加入龍鱗遠征隊就意味著深入危機四伏的地方。但我沒想到居然還要跟元素生物作戰！\n\n我們之前的工作地點是生命寶庫遺跡，那裡已經一團混亂！石像巨怪拔地而起！我們請了元素師當顧問，但我認為她需要各方面的協助。\n\n或許你能幫她的忙？我們的營地就在河的另一邊。', '', '', '', '', '', '', 47187),
