(69870, 'zhTW', '有意義的照片', '在滿溢急流附近和編目員亞昆達及砲手芙蘭會面。', '$p，照片能讓大家聚在一起。\n\n安全起見，我們的編目員通常是兩人成行，看到不同陣營和背景的人在這座奇妙的群島上一起合作，共同追求知識，真是一件令人高興的事。\n\n有一組積極的隊伍目前正在記錄甦醒海岸的一條中央河流。\n\n如果你想要協助我們的工作，就去和他們一起記錄那邊的野生生物吧。', '', '', '', '', '', '到滿溢急流附近與編目員亞昆達及砲手芙蘭會面。', 47187),
(69869, 'zhTW', '編目員的天堂', '在龍鱗基地和編目員柯拉莉談話。', '<南納斯博士大口喘著氣把一封信交給你。這封信邀請你回到龍鱗遠征隊營地接受訓練。他急切地想要跟你解釋。> \n\n仁慈的精靈。驕傲的小傢伙。很多照相機？\n\n<南納斯博士興奮地點頭，等著你的回應。>', '', '', '', '', '', '在龍鱗基地和編目員柯拉莉談話。', 47187),
(69868, 'zhTW', '育織者亞拉茲涅', '', '', '', '', '', '', '', '', 47187),
(69866, 'zhTW', '弗利普', '', '', '', '', '', '', '', '', 47187),
(69865, 'zhTW', '覓鱗者梅澤力', '', '', '', '', '', '', '', '', 47187),
(69864, 'zhTW', '被遺忘的造物', '', '', '', '', '', '', '', '', 47187),
(69862, 'zhTW', '拯救蠍尾飛狐', '找出希爾薇難過的原因。', '既然我們已經治好她，我想希爾薇有東西想讓我們看。\n\n我們的工作還沒完成，$n！讓我們看看她為什麼不開心吧。', '', '', '', '', '', '', 47187),
(69861, 'zhTW', '崔瓦若斯‧編識者', '', '', '', '', '', '', '', '', 47187),
