(69855, 'zhTW', '攀爬者的呼喚', '在龍鱗基地和探路者傑布談話。', '<南納斯博士大口喘著氣把一封信交給你。這封信邀請你回到龍鱗遠征隊營地接受訓練。他急切地想要跟你解釋。> \n\n大傑布說的。好朋友。要去爬了？\n\n<南納斯博士興奮地點頭，等著你的回應。>', '', '', '', '', '', '在龍鱗基地和探路者傑布談話。', 47187),
(69854, 'zhTW', '蘇列瑟斯的墓碑', '', '', '', '', '', '', '', '', 47187),
