(69668, 'zhTW', '『噴火者』煙霧史瓦格蛙', '', '', '', '', '', '', '', '', 47187),
(69667, 'zhTW', '汽鰓', '', '', '', '', '', '', '', '', 47187),
(69097, 'zhTW', '寶庫解封', '在龍鱗基地與編目員潔可思交談。', '<南納斯博士大口喘著氣把一封信交給你。這封信邀請你回到龍鱗遠征隊營地。他急切地想要跟你解釋。> \n\n很吵的矮人。很嚴肅的精靈。準備好了在等你？\n\n<南納斯博士興奮地點頭，等著你的回應。>', '', '', '', '', '', '在龍鱗基地與編目員潔可思交談。', 47187),
(69096, 'zhTW', '泰溫的使命', '試著安撫半人馬孤兒戚梅。', '你看到那個小朋友了嗎？就是獨自坐在水岸旁那個。\n\n<她指向東北方，你看到那裡有個年輕的半人馬正在凝視水面。>\n\n諾庫德進攻時，戚梅失去了她的父母。我已經治好她身體的傷，但自從我們發現她，她一直不吃不喝，也什麼話都不說。只是坐在那裡，盯著水面。\n\n這已經超出我的專業，我完全不知道該怎麼辦。$n，你願意跟她聊聊嗎？', '', '', '', '', '', '', 47187),
(69095, 'zhTW', '回家的獵犬', '騎乘泰溫回到莫魯凱去。', '我們讓大家的情況都穩定下來了，多虧了你和泰溫，不過很多村民還需要在莫魯凱治療一陣子。\n\n你們兩個何不先帶一些人回去？畢竟你們都是今天的英雄！', '', '', '', '', '', '', 47187),
(69094, 'zhTW', '拯救半人馬', '在達魯坎村落拯救受傷的半人馬。', '諾庫德氏族的背叛完全不講道義！達魯坎村莊中只有工匠，他們絕對抵抗不了劫掠者。\n\n我們急需你的幫助，$n。諾庫德的人還在附近，而且我們必須照料傷患！\n\n請搜索村莊，一找到生還者，就帶回來我這裡。我們要盡全力搶救傷患，穩定他們的情況！', '', '', '', '', '', '', 47187),
(69093, 'zhTW', '新的謎團', '在龍鱗基地和娜蕾迪亞‧河光談話。', '<南納斯博士大口喘著氣把一封信交給你。這封信邀請你回到龍鱗遠征隊營地。他急切地想要跟你解釋。> \n\n封起來的門。泰坦的秘密？\n\n<南納斯博士興奮地點頭，等著你的回應。>', '', '', '', '', '', '在龍鱗基地和娜蕾迪亞‧河光談話。', 47187),
(68799, 'zhTW', '返回晶紅生命聖殿', '回到晶紅生命聖殿。', '這只是你的飛龍騎術旅程的起點！\n\n張大眼睛在巨龍群島各地尋找新的冒險和經歷，同時記得到我們的任何據點拜訪我們。\n\n現在，請回去找雅立史卓莎，繼續探索這片土地。', '', '', '', '', '', '到晶紅生命聖殿向雅立史卓莎回報。', 47187),
(68798, 'zhTW', '龍之雕紋與你', '在天頂觀測所取得龍之雕紋，再跟莉薩苟莎交談來使用天賦。', '很明顯，投注心力在些冒險者的不是只有我和葛蘭瑟拉。莉薩苟莎也很想快點幫你磨練你的飛龍騎術，而你也已經見過賽洛姆了，這點很棒。\n\n巨龍群島各地散落著一些雕紋，可以讓你學會更多飛龍騎術的技巧和技能。事實上，天頂觀測所這裡就剛好有一個。\n\n等你找到它，莉薩苟莎可以教你如何使用！', '', '在巨龍群島找找，這些雕紋能讓你學到飛龍騎術的更多技巧和技術。', '龍之雕紋', '', '', '', 47187),
(68797, 'zhTW', '煥然一新', '與葛蘭瑟拉交談，使用外形調整台自訂飛龍的造型。', '就像凡人一樣，我們龍族也非常在意自己的外貌。根據你發現的東西和你的經歷，你的飛龍也能改變造型。\n\n到外形調整台找葛蘭瑟拉說話，自己親眼看看吧！', '', '', '', '', '', '', 47187),
(68796, 'zhTW', '天頂觀測所', '前往甦醒海岸的天頂觀測所。', '那就是騎乘飛龍的基本技巧！你做得非常好！\n\n現在，我想向你介紹參與這次冒險的其他夥伴。我們的住所在天頂觀測所上方。\n\n賽洛姆可以幫忙指引你過去。等你準備好要飛上天空時，就和他說話吧！\n\n我們到時候見！', '', '', '', '', '', '到天頂觀測所找安德斯塔茲領主。', 47187),
(68795, 'zhTW', '飛龍騎術', '到晶紅生命聖殿與安德斯塔茲領主交談。', '關於這個地方，你可能已經發現一件事：巨龍群島非常遼闊。\n\n有些龍興致勃勃地想探索巨龍群島的每個角落，以及各種秘境，甚至是那些無法輕易從地面抵達的地方。他們渴望有第二雙眼睛陪伴他們冒險，因此很樂意載騎手一起穿過這片大地。\n\n請與晶紅生命聖殿的安德斯塔茲領主交談。他會進一步說明他們的意圖。', '', '', '', '', '', '到晶紅生命聖殿與安德斯塔茲領主交談。', 47187),
(68794, 'zhTW', '巨龍盟友', '到沃卓肯的守護巨龍之座，與雅立史卓莎交談。', '$n，你對巨龍群島的貢獻，大家有目共睹。\n\n做為獎勵，生命守縛者想讓你看點東西，感謝你為龍族效命。\n\n請你到塔頂找她談話。所有的守護巨龍都在等著你。', '', '', '', '', '', '到沃卓肯的守護巨龍之座，與雅立史卓莎交談。', 47187),
(68644, 'zhTW', '糖、香料還有所有美好的事物', '協助治療希爾薇。', '好了！終於集齊希爾薇的解藥所需的材料！\n\n而且時間還來得及。我很懷疑她還能維持這樣的狀態多久。\n\n但…我需要有人來幫我。我雖然可以找嘉里，但…你介意再幫我一次嗎？\n\n等你準備好了，就跟我說一聲，$n。', '', '', '', '', '', '', 47187),
(68643, 'zhTW', '維生素與礦物質', '收集$1oa個礦泉水瓶。', '我覺得，要是我請你去跟動物戰鬥，很可能會讓史黛莉亞感到難過…\n\n想要進行研究，當然有其他方式。\n\n帶著這些瓶子，收集附近的冰晶滴下的水。\n\n根據我的推論，裡面應該含有注入脈能水晶能量的礦物，或許正是這裡瘟疫爆發的最大推手。', '', '', '', '', '', '', 47187),
(68642, 'zhTW', '脊刺說法', '收集$1oa根含有秘法能量的毛刺', '我想幫助希爾薇，但我也不想再耽誤嘉里了。\n\n為了幫希爾薇做出解藥，我需要晶脊豪豬身上含有秘法能量的毛刺。如果你只拔幾根的話，牠們應該不會介意的！\n\n記得留意巴卡犬！牠們以晶脊豪豬為食，看到你動牠們的食物，牠們可能會發狂。如果你不得不自我防衛，你也可以從牠們身上收集一些脊刺。\n\n但是…最好能免則免，拜託。', '', '', '', '', '', '', 47187),
(68641, 'zhTW', '苔癬製藥', '收集$1oa個龍苔簇', '可憐的女孩…\n\n她一定是吃了被污染的東西才會生病。\n\n幸好，我的祖母是位德魯伊，也教過我如何治療秘法相關疾病。\n\n我現在身上還缺了一些材料，不過可以在附近找找看有沒有替代材料。\n\n首先，我需要一些龍苔。那是一種只會長在龍骨上的稀有地衣。', '', '', '', '', '', '', 47187),
(68639, 'zhTW', '潛行北極掠食者', '殺死$1oa隻感染的寒皮熊。', '我們被派來這裡研究寒皮熊這個物種。\n\n牠們的狩獵場被地脈污染了。秘法能量滲入飲用水、植物…甚至是像蠍尾飛狐這樣的底層物種。\n\n但跟其他生物體不同，寒皮熊撐過這個侵入過程，還從中獲得力量。\n\n牠們也變得更有攻擊性，這就是問題所在。跟一些寒皮熊交戰，我會把牠們的力量和侵略行為記錄下來。\n\n我的報告有助於祈倫托決定如何處置牠們。', '', '', '', '', '', '', 47187),
(68087, 'zhTW', '達魯坎的危險', '和蹄萊信使談話，來了解瑟別克的緊急請求。', '除了叫你和泰溫回去莫魯凱，好像也沒有別的事好做了。\n\n等等…那是誰？一直往這邊過來…不是吧?!又來一個帶著巨大巴卡犬的陌生人！', '', '', '', '', '', '', 47187),
(68085, 'zhTW', '訓練牧羊犬', '在馬拉克訓練泰溫放牧阿戈利羊。', '你希望我訓練你的巴卡犬牧羊？那確實是我們在這的工作，不過我從來沒訓練過這麼大隻的…\n\n不過阿戈利羊並沒有被他嚇到。牠們是很會觀察環境的，相信我。\n\n我願意給他一個機會，不過巴卡牧犬需要的特質不只溫馴，還得非常聰明。還有，如果牧犬沒辦法控制羊群，阿戈利羊就不會乖乖服從。說起來容易，做起來卻很難！去試試看吧，我會在一旁看著。', '', '', '', '', '', '', 47187),
(68084, 'zhTW', '溫柔的巨人', '將泰溫送去給馬拉克的牧人特瓦泰，以接受訓練。', '如果泰溫真的跟加達爾說的一樣「不兇猛」，或許牠比較適合成為巴卡牧犬！\n\n艾拉格氏族是阿戈利羊的牧羊專家，也沒驕傲到需要華麗的禮物才願意幫助其他氏族。\n\n請把泰溫帶去馬拉克給牧人特瓦泰，地點就在西南邊的兩座丘陵之間，是他們訓練巴卡犬之地。\n\n雍亞拉，請讓這計畫成功吧。如果失敗，我就想不到辦法了。', '', '', '', '', '', '', 47187),
(68083, 'zhTW', '再試一次，泰溫！', '回到莫魯凱找治療者瑟別克，傳達這個壞消息。', '回去找蹄萊族，跟他們說就連我都沒辦法訓練泰溫成為獵犬。牠就是沒有這方面的天分。\n\n牠是我見過最不兇猛的巴卡犬，我敢說如果我們允許的話，牠甚至會想跟野生動物做朋友！哈！', '', '', '', '', '', '回去莫魯凱找治療者瑟別克', 47187),
(67921, 'zhTW', '獵犬', '與泰溫一起狩獵危險的野獸，證明他有訓練的價值。', '帶你的巨大巴卡犬去狩獵附近的野獸吧。越大的越好。我會從這裡觀察，並決定牠配不配得上席卡人的訓練。\n\n先跟你說一聲，我只接受最棒的巴卡犬。', '', '', '', '', '', '', 47187),
(67772, 'zhTW', '泰溫的麻煩', '協助治療者瑟別克讓泰溫能夠接受訓練。', '哈囉，朋友。歡迎回到莫魯凱。我是瑟別克，蹄萊氏族的治療者。\n\n$n，你擅長和動物相處嗎？或許我所需要的正是新面孔的影響力。\n\n這是泰溫，他雖然是非常好的夥伴，但對我的氏族已經逐漸成為一個負擔。要是我們不能讓他派上用場，恐怕就不得不把他送走。你願意幫我嗎？', '', '', '', '', '', '', 47187),
(67742, 'zhTW', '文庫境域賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67741, 'zhTW', '文庫境域賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67724, 'zhTW', '火焰防禦', '收集$1oa個顫網蛛絲。', '卡提加和我來這裡是為了證明我們的實力，要阻止碎裂火焰軍並找回瓦烏洛斯。\n\n結果現在我們被困在這裡，照顧這個被冰蜘蛛咬了幾口的精靈。我們根本還沒跟碎裂火焰軍戰鬥過，而且可能在開打前就被這些蜘蛛害死！\n\n我們得阻止它們作亂。\n\n幸好，有種天然的方法可以驅趕它們。焚燒蜘蛛繭的絲會產生一種氣味，讓蜘蛛不敢靠近。\n\n去拿些絲來，讓我把它們丟到火裡。這樣它們就不會靠近了！', '', '', '', '', '', '', 47187),
(67700, 'zhTW', '前往巨龍群島！', '從暴風城搭乘堅忍龍鱗號前往巨龍群島。', '$p，好消息！我們派遣的第一支探險隊已經登陸巨龍群島。\n\n謝謝你和其他龍鱗遠征隊成員的努力，我們已經在巨龍群島建立一個安全的登陸地點，並且成功聯絡到龍族的使者。\n\n你是否已經準備好跟我們展開新的旅程，前往巨龍群島？', '', '', '', '', '', '在巨龍群島的海岸與多蒂‧鬍鬚見面。', 47187),
(67606, 'zhTW', '林精安慰法', '取得美味的幼雛點心，然後送給沮喪的小鴨子。', '你不在的時候，有隻夢兔告訴我，這裡有隻小鴨子心情低落到不行。幸好，我完全知道如何治好它！\n\n每當我心情低落的時候，我就會吃些美味的甜食！身為可愛動物的專家，我知道這個原則也絕對適用在這裡。\n\n這一隻小鴨子很喜歡當地的一種甜點，名字叫美味的幼雛點心。你何不找到這種甜點，然後送給那個可憐的小傢伙？畢竟，這是一件很有林精風格的事！', '', '', '', '', '', '', 47187),
(67605, 'zhTW', '雷霆平原', '取得阿揚加的角。', '有頭風暴巨獸這片山脊上四處遊蕩。許多席卡獵人試過要獵殺它，但都因為它的凶狠沒有成功。\n\n如果你追求狩獵的榮耀，你可以試著獵殺那頭巨獸。把它的角帶回來當作貢品。', '', '一頭兇狠的雷霆蜥蜴，嗜好是摧毀半人馬營地。', '阿揚加', '', '', '', 47187),
(67566, 'zhTW', '霜原飛掠賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67565, 'zhTW', '霜原飛掠賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67564, 'zhTW', '工匠的信差', '將工匠聯合團請款單拿去給湯瑪斯‧布萊特。', '冒險者，你要去生命聖殿嗎？\n\n你願意把這個請款單拿給湯瑪斯‧布萊特嗎？他訂購了幾個特製瓶子，吹玻璃的工匠總算帶著材料價目表回來了。\n\n沿著那條路走，應該就能看到他，他沒事就喜歡誇他丈夫有多厲害，那些聽眾真可憐…\n\n他一定會支付你酬勞的。', '', '', '', '', '', '將工匠聯盟請款單拿去給晶紅生命聖殿的湯瑪斯‧布萊特。', 47187),
(67299, 'zhTW', '飛龍走開', '使用秘法火炮來擊敗$1oa頭元龍。', '洪荒使者一直不停地用他們的飛龍攻擊我們的營地！\n\n我們目前成功用我們的護盾跟他們抗衡，但我們也需要更多援助，來把他們從天上打下來。\n\n用我們的火炮把那些飛龍打下來吧！', '', '', '', '', '', '', 47187),
(67298, 'zhTW', '世界奇觀', '找出湯瑪斯如何獲得工匠的鑑賞力。', '我的丈夫湯瑪斯在這一大片古老土地四處遊歷，因此獲得許多智慧。\n\n跟隨他走過的路，或許也能帶給你類似的啟發？', '', '', '', '', '', '', 47187),
(67297, 'zhTW', '伊斯凱拉遊覽賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67296, 'zhTW', '伊斯凱拉遊覽賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67295, 'zhTW', '那是我的專長', '和米蓋爾‧柔心討論專業技能的專精相關事項。', '聽說，你已經掌握一項專精了，是吧？能具備一項拿手的技藝是一件很棒的事。\n\n身為工匠聯合團的一員，我很樂意協助你在專精的路上更加精進。\n\n你有沒有時間聽我幾句智慧之言？說不定能讓你學到什麼在冒險中有用的智慧。', '', '', '', '', '', '', 47187),
(67222, 'zhTW', '轉暗的雲', '在風頌高地剷除洪荒使者的勢力。', '洪荒使者已經用他們的胡言教誨感染了風頌高地。我們的親人竟然傻到會聽取他們的理念。\n\n如果我們幫忙把他們從這片神聖之地剷除，或許其他氏族在危急之時會前來協助我們。你覺得你可以幫忙嗎？', '', '', '', '', '', '', 47187),
(67221, 'zhTW', '金屬之材', '在灰燼裂片地層內收集$1oa個晶化龍金。', '為了完全發揮大地守護者的熔爐的潛力，你必須學會製作黑曜灼燒合金的基礎知識。唯有這樣，你才能追隨奈法里安最偉大的鐵匠的腳步。\n\n把一塊晶化龍金帶來給我，你可以在灰燼裂片地層的深處找到它。然後我就會把你想學的知識教導予你。', '', '被其中的龍金之力活化，非常危險。', '晶化碎鋼', '', '', '', 47187),
(67178, 'zhTW', '白眼，青龍', '幫助尤馬多姆擊敗賽托苟莎。', '$PC，可以請你幫忙，盡可能維持比賽的公平性嗎？\n\n賽托苟莎經常會用對自己有利的方式曲解規則。\n\n我不想看到尤瑪多姆因為有人作弊而輸掉比賽。', '', '', '', '', '', '', 47187),
(67177, 'zhTW', '懸賞：吞食者', '殺死吞食者並取回牠的角。', '如果你想要跟巨牙海民同行，你最好幫個忙！\n\n最近，有一頭野獸已經在附近定居下來了，我們都叫牠吞食者。\n\n看來牠有更多的同類正在遷移到這個區域來。我們可以利用這點。\n\n殺死吞食者，然後把牠的角帶來給我。我們可以用來當作建築材料，好好擴建這個哨站。', '', '遠離牠正常的狩獵場的巨大野獸。', '吞食者', '', '', '', 47187),
(67175, 'zhTW', '如何阻止會爆炸的玩具船', '和圖爾克的母親談話，然後修復玩具船。', '我很不想從小孩手中把玩具拿走，不過要是祈倫托可以研究它為什麼會吸收這麼多秘法的話，這項研究會非常有貢獻。\n\n另一方面…我又不想虧待我們新的巨牙海民盟友。我確實有根可以驅散魔法的魔杖…\n\n我們去和圖爾克的母親談談，再決定要怎麼做吧。', '', '', '', '', '', '', 47187),
(67174, 'zhTW', '秘法偵測', '在庫禮的釣魚點調查巨牙海民物品，偵測是否有秘法魔法的存在。', '你好！我是蜜娃‧星眼，我在這一帶執行秘法調查。\n\n蒼藍高地各地都有魔法。其中某些是良性的…而有些可能會帶來危險。\n\n我的任務是確保巨牙海民擁有的東西裡面都沒有秘法能量。\n\n我們已經在安東尼達斯營地經歷了一場意外，一個魚箱竟然開始自燃！\n\n你可以把我的偵測器拿去，然後檢視幾個這裡的東西嗎？我得待在這繼續和茱兒克談談。', '', '', '', '', '', '', 47187),
(67173, 'zhTW', '偷竊的豺狼人', '', '', '', '', '', '', '', '', 47187),
(67167, 'zhTW', '決鬥時間到！', '向$1oa名半龍人發起《爐石戰記》賽局挑戰。', '拿回套卡後，我就能專心為俱樂部招募新成員了！而且我想召募一些半龍人…\n\n喔，那正是另一個需要你幫忙的地方，$n！\n\n為了勸說其他巨龍加入，我會變得有點忙，但我又真的很希望半龍人也能共襄盛舉。\n\n你願意幫我勸說他們嗎？提醒你一下，他們很多人之前都沒玩過。', '', '', '', '', '', '', 47187),
(67154, 'zhTW', '混亂殘餘', '從時光沙地的生物身上收集$1oa個玻璃沙。', '在實體穿越時間之道時，時間之沙有時候會在實體身上堆積。\n\n通常這種沙子很快就會消散—不過有時候，時間旅行固有的混亂波動會使這種沙結晶化。在這種情況下，它會變得比較難清除掉。因為這樣，我已經毀了好幾雙上好的鞋了。\n\n對我們的工作來說，玻璃沙是強大的物質。如果能想辦法回收這種沙，對我們會很有幫助。', '', '', '', '', '', '', 47187),
(67143, 'zhTW', '交出真心', '以任意製作專業技能製作一個瓶中心臟 |A:Professions-Icon-Quality-Tier3-Small:20:20|a。', '既然我們已經收集到元素精華了，你可不可以幫忙放到這個瓶子裡？\n\n這個配方很簡單，做法跟其他配方一模一樣。\n\n如果你把材料弄丟了，或者用光高品質的試劑了，隨時可以去角蛙谷找元素生物拿。', '', '', '', '', '', '將禮物拿去晶紅生命聖殿給米蓋爾‧布萊特。', 47187),
(67142, 'zhTW', '蟲蟲食物', '從餘燼之流的地殼潛伏者身上收集熔烤血肉。', '無論是守護黑曜龍堡，或是為它而戰，都是很耗體力的工作，而且龍的食量又特別大。我們需要補充儲備的糧食。\n\n在硬化的熔岩下方，藏著一種非常美味的蟲，牠們會在岩漿之中蠕動。這對你可能毫無吸引力，但對飢餓的龍來說，牠們可是美食。\n\n帶上我們的僕從古爾恰克，利用他來指引到熔岩裡有動靜的地方去，他就會引來那些蟲供你捕捉。', '', '', '', '', '', '', 47187),
(67137, 'zhTW', '專業裝備', '與馬赫拉‧彎樹者交談。', '聽赫菲思塔說，你的工匠技藝也十分不錯。\n\n我們想提供你一些專業裝備，完全免費。這就是生意夥伴存在的意義，對吧？\n\n去和我們的裁縫師馬赫拉‧彎樹者談話，他會為你處理。', '', '', '', '', '', '在晶紅生命聖殿與馬赫拉‧彎樹者談話。', 47187),
(67111, 'zhTW', '遇到難題的學徒', '收集$1oa個冰凍的毒囊', '這個任務從一開始就是個錯誤。雅莉亞‧日翔來請求我們協助，要阻止碎裂火焰軍取得一個危險的神器。我們一路追蹤它到這些遺跡來。\n\n但碎裂火焰軍搶在我們之前趕到了，而這地方還充滿了冰蜘蛛。雅莉亞中了嚴重的毒，要是沒有解藥，我怕她撐不了多久。\n\n解藥我可以做，但我需要從附近的蜘蛛身上取得毒腺。我不敢離開她身邊。你可以幫我找一些來嗎？', '', '', '', '', '', '', 47187),
(67100, 'zhTW', '給米蓋爾的禮物', '和湯瑪斯討論東西的品質，然後在角蛙谷附近收集$2oa個火焰之靈以製作米蓋爾的禮物。', '$p，你可以幫我一個忙嗎？\n\n我想要幫我的丈夫米蓋爾準備一份禮物。\n\n他對我來說很重要，可是我最近實在太忙，沒時間做東西給他。\n\n你可以幫忙我做一個品質優異的東西給他嗎？', '', '', '', '', '', '', 47187),
(67099, 'zhTW', '龍之眼', '在附近的區域和麥瑞迪安、瑟法利安及伊沃瑞安交談。', '我們知道加拉登會直接攻擊攻擊我們，但其他的危險也同樣讓我擔心。有些危險並非那麼明顯。\n\n我派了三頭龍去勘查鄰近的地區，找出任何潛在的威脅。\n\n去和他們見面，然後為我收集他們的報告。收集到情報後，馬上回來找我，讓我們為加拉登的計畫做好萬全準備。', '', '', '', '', '', '', 47187),
(67096, 'zhTW', '浮動森林飛行賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67095, 'zhTW', '浮動森林飛行賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67094, 'zhTW', '林精的工作永無止境', '協助索蘭卓拉餵食沃卓肯眾多的小動物。', '看到沃卓肯再次充滿生機真是太好了，可是經歷了成千上萬年的疏於照顧，有很多東西仍然處在困境中，其中最重要的是這些城市小動物！哎呀，我們的林精數量不夠，沒辦法照顧牠們全部。\n\n怎麼樣，你想不想擔任榮譽沃卓肯林精啊？這座城市最可愛的小朋友已經太久沒有吃到牠們喜歡的點心了。你願意協助我照顧牠們嗎？', '', '', '', '', '', '', 47187),
(67093, 'zhTW', '異常的聖壇', '想辦法收集藏在流沙聖所裡面的聖物，然後到沃卓肯的守護巨龍之座把它還給諾茲多姆。', '我的研究團隊在附近發現了一個奇怪的聖所。我們成功辨識出一些外牆上的文字，具體來說，是泰坦符文，我們認為符文好幾處提到了泰坦的領袖：至高之父阿曼蘇爾。\n\n我們本想更靠近去檢視，但那八成觸動了聖所的防禦機制。一隻巨大的沙聚合體擋住了我們的去路，我們千鈞一髮才逃出來。\n\n我們不太確定它在保護什麼，但那東西一定很重要。你可以去調查嗎？', '', '', '', '', '', '返回沃卓肯找諾茲多姆。', 47187),
(67084, 'zhTW', '白銀之用', '將遠古泰坦鍛鋼錠放入熔爐，完成提爾留下的任務。', '<提爾的回音因你的到來而啟動。>\n\n你的任務近在眼前，我的朋友。\n\n將鑄材送入烈火當中，然後啟動熔爐。那些必要的流程我都幫你準備好了。\n\n設計圖就儲存在鱗片裡。它會向你揭曉它存在的理由。', '', '', '', '', '', '到提爾堡與雅立史卓莎交談。', 47187),
(67081, 'zhTW', '灌注的材料', '到灌注迴廊取回$1oa個遠古泰坦鍛鋼錠，並擊敗洪荒海嘯。', '<提爾的影像再次說話。>\n\n你們已經重新啟動了熔爐，但是下一個任務會更加困難。\n\n刻錄在鱗片當中的是一份設計圖，你們必須將成品鑄造出來。我交代了一位看守者，伊力篤斯，負責保管必要的材料。這些材料來源特殊，僅存的數量極為稀少。\n\n到灌注迴廊去找伊力篤斯，希望在他的細心監督之下，設施依然井井有條地運作。', '', '', '', '', '', '', 47187),
(67080, 'zhTW', '工匠補給品：龍之鍊金溶液', '在晶紅生命聖殿使用取回藥劑配方，為赫菲思塔製作$1oa瓶龍之鍊金溶液。', '鍊金師，你在找工作嗎？\n\n工匠聯盟聯絡我，對我的鍊金溶液發出「製作訂單」。我跟隔壁的龍人一樣好奇，想知道其中的運作原理，不過我實在太忙了。\n\n學徒啊，這或許是你的大好機會，製作鍊金溶液，然後交給赫菲思塔，照著順序處理就對了。', '', '', '', '', '', '', 47187),
(67079, 'zhTW', '捨命封鎖', '在提爾堡中取回主要安全圓盤和次要安全圓盤。', '熔爐的保全系統比提爾堡內的其他區域都還要森嚴。這對我們將會是一大挑戰，$c。\n\n只有堡壘裡的某些特定單位才能繞過這道安全機制，而且解鎖的程序需要不只一組密碼，以免出現資料毀損。\n\n這些單位不會就此交出它們的超控權限，你需要強行奪取才行。小心一點，$n。', '', '', '', '', '', '', 47187),
(67078, 'zhTW', '臨別指示', '將白銀鱗片放在提爾堡的熔爐。', '<回音用一種年代悠久的聲音說話。>\n\n致我親愛的朋友，我為突然離開感到抱歉。\n\n不過，我發誓，我不會任你們自生自滅。我明白你們正經歷最需要幫忙的時刻，然而，為了確保這份禮物不會遭到濫用，我必須請你們執行一系列的任務。\n\n第一個任務很簡單：重新啟動提爾堡的熔爐。白銀鱗片就是關鍵。', '', '', '', '', '', '到提爾堡與寇拉諾斯交談。', 47187),
(67077, 'zhTW', '過往的回憶', '與諾茲多姆交談，見證過往的回憶。', '這是我們最後一次見到提爾的地方。\n\n我們當時不明白他必須離開的緣由，只知道是為了某件重要的事。\n\n雖然這可能會讓我們的心難以承受，我認為火花呼喚我們來這裡，是為了再次見證那段時光。有了諾茲多姆的協助，我們就可以重溫那個時刻，看看提爾是否留下了其他的線索給我們。', '', '', '', '', '', '', 47187),
(67076, 'zhTW', '火花大探索', '在提爾堡中調查泰坦火花。', '雖然這個火花的來源很古怪，我卻有種熟悉感。我不確定它的用途，但我相信，它可以帶領你踏出揭露謎團的下一步。\n\n跟隨它，看看你能不能進一步了解它的用途。在此同時，我也會調查看看還能發現什麼。', '', '', '', '', '', '在提爾堡與卡雷苟斯交談。', 47187),
(67075, 'zhTW', '埋藏的魔法', '在提爾堡各處引出埋藏在控制臺中的魔法，揭開白銀鱗片的秘密。', '非常有趣。這座堡壘藏有許多謎團，或許除了守衛者提爾本人之外其他人都無法全盤了解。假如我們想進一步揭開謎團，就必須繼續探索提爾堡。\n\n而且我相信這個鱗片能引出藏在這個地方的秘密。\n\n不過，有個小問題。提爾堡的守護者依然…不太穩定。他們可能會把你的探索視為干擾，並試著出手干預。請帶著這個導體。要是守護者造成麻煩的話，它會幫助你的。', '', '', '', '', '', '', 47187),
(67074, 'zhTW', '白銀贈禮', '與雅立史卓莎交談，見識提爾的贈禮。', '在守衛者提爾過世的不久前，他把一片用最純粹的白銀鍛造的龍鱗賜給了我們。當我們準備離開的時候，我們把它存放在沃卓肯的寶庫中，但我相信再次分享它的時候已經來臨。\n\n雖然我們不明白這個紀念物的用途，但它對我們來說一直是個團結與友誼的象徵。作為龍族真正的盟友，我們願意把它和你分享。等你準備好了，就告訴我一聲，$n。', '', '', '', '', '', '', 47187),
(67073, 'zhTW', '紅色黎明', '找到雅立史卓莎。', '我們就要恢復力量了…但假如菈薩葛絲在我們的力量回復之前，就取得成功的話，整個艾澤拉斯的時間之道都會往黑暗的未來前進。\n\n$n，我們絕對不能讓這件事發生！\n\n快點，去找雅立史卓莎並且協助她，不然就來不及了！', '', '', '', '', '', '', 47187),
(67067, 'zhTW', '調查玉米叢', '收集$1oa個野生跳跳玉米。', '沃卓肯有個龍廚師？真的嗎？我得請她試試我的弧光海鮮濃湯！那是我的家傳食譜。\n\n我知道你在說的植物。它就長在小溪邊，但那裡最近有點麻煩。\n\n跳跳玉米的稈叢似乎是甲蟲和小蠑螈的天然覓食場，而它們則是角蛙的天然獵物。如果它們都在空地上，一眼就能看見的話，就沒問題。但這裡有些非常擅於潛伏的傢伙。\n\n我要是你的話就會小心。', '', '', '', '', '', '返回沃卓肯的晶紅盛宴找盧米雅史卓莎。', 47187),
(67066, 'zhTW', '值得探究的美味', '收集一條可口的變異粗鰭魚。', '盧米和莫瑟？\n\n天啊，那是好久以前的事了。和龍與鴨主廚雙人組一起吃魚，這聽起來像是波雅長老對年輕人講故事時會用的開頭。這種事情一定很難忘！\n\n那種魚是可口的變異粗鰭魚，是巨牙海民的最愛！它們很稀有，不過可以在這裡的海岸找到。\n\n我先警告你：現在是蒼藍牙鯊的繁殖季節。要是你想碰它們最愛的點心，那些嗜血的惡魔絕對會把你的肉咬一塊下來。', '', '', '', '', '', '返回沃卓肯的晶紅盛宴找盧米雅史卓莎。', 47187),
(67065, 'zhTW', '未來保鮮蘑菇', '在洪荒使者未來捕捉7個經時光洗禮的松露。', '美味的蘑菇？平行未來可不是讓你找食材來做上午茶點的櫥櫃。\n\n不過啊…要說我從沒夢想過再吃到盧米和莫瑟的料理，那也不是實話。\n\n好吧！我准許你通過這道傳送門，雖然我建議你找其他人和你同行。\n\n我的守望者以前和我提過這些暗色蘑菇。它們從來不會在同一個地方待太久。你自己看著辦吧。', '', '', '', '', '', '返回沃卓肯的晶紅盛宴找盧米雅史卓莎。', 47187),
(67064, 'zhTW', '蔓生美味', '收集$1oa個微光蔓生海藻球莖。', '噢，盧米雅史卓莎！我和林精姊妹瑟琳娜與菲莉娜之前煮過菜給她吃，那是個美好的夜晚。\n\n我們吃的海藻是一種叫微光蔓生海藻的獨特品種。飾鰭魚群會在沿岸吃這種海藻。要是你把牠們的食物從海底拔走，我保證你會被牠們攻擊。\n\n等你回去見主廚的時候，請替我送上最真誠的問候。隨時歡迎他們到聖所來。', '', '', '', '', '', '返回沃卓肯的晶紅盛宴找盧米雅史卓莎。', 47187),
(67063, 'zhTW', '炙烤10,000年', '收集$1oa份嗆辣熔岩香料。', '香料？噢！你一定認識那個龍族老廚師。頭上有一隻小鴨廚師的那個。\n\n加拉登族會從下面的熾炎元素身上收集一種粉末，叫做嗆辣熔岩香料。\n\n別用那種眼神看我！那是加拉登族取的名字，不是我！\n\n祝你在下面好運。假如我是你的話，就不會單獨過去。', '', '', '', '', '', '返回沃卓肯的晶紅盛宴找盧米雅史卓莎。', 47187),
(67053, 'zhTW', '給和平一個機會', '向部落代表自我介紹。', '願聖光與你同在，$p。\n\n這場遠征受到了部落與聯盟雙方的保護。我們收到的指示很明確，要協助龍鱗遠征隊的任何成員，不管他們效忠哪一邊。\n\n部落代表， 督軍布瑞卡‧嚴斧和她的女兒秀嘉，在營地的另一邊守衛。\n\n我和督軍布瑞卡‧嚴斧一起打過天譴軍團。她是可敬的人，對這場遠征會很有助益。\n\n去對她表示你願意協助。讓她知道聯盟會遵守當初的承諾。', '', '', '', '', '', '在翼息大使館與督軍布瑞卡‧嚴斧交談。', 47187),
(67050, 'zhTW', '霜齧：因與果', '在蒼藍高地放置圖騰，解救受困的巨牙海民獵人。', '元素依然住在這些圖騰中，$r。釋放它們，把困住巨牙海民好友的冰打破吧。', '', '', '', '', '', '', 47187),
(67047, 'zhTW', '驅走寒顫', '收集$1oa片冰鉗箭葉草的葉子。', '我相信你在找的植物有著細長的莖，上面長滿紅色的葉子。\n\n不過在你收集花的時候，應該很難不碰到那些卑鄙的蜘蛛。我建議你能閃就閃，閃不掉的話，就拿好尖銳的武器吧。\n\n記得提醒你的龍朋友，下次我進城的時候，他們可以用幾杯這東西的茶來回報我。', '', '', '', '', '', '返回沃卓肯的晶紅盛宴找盧米雅史卓莎。', 47187),
(67039, 'zhTW', '一趟驚奇之旅', '尋找走丟的動物。', '氏族上次搬遷營地時，有幾隻寵物不小心在途中走丟了。它們並不會狩獵，所以我不認為它們在外面能好好照顧自己！\n\n可以請你去找它們嗎？它們或許不是狩獵時的良伴，但它們還是氏族重要的一份子！', '', '', '', '', '', '', 47187),
(67036, 'zhTW', '祈倫托之怒', '使用秘法火炮協助卡德加擊敗洪荒使者。', '我已經組好你回收的組件。\n\n把它放在卡德加身邊，用它趕走洪荒使者！\n\n我們只需要撐一下子，等到卡雷苟斯來就好。', '', '', '', '', '', '', 47187),
(67035, 'zhTW', '保存知識', '尋找散落在安東尼達斯營地的$1oa本遠古典籍。', '你好，$r。我是艾薩努斯。真希望能找個好一點的場合跟你結交。\n\n在洪荒使者發動攻擊前不久，我們正在協助祈倫托研究這個地方的歷史。\n\n現在恐怕還有一些典籍流落在外，隨時都可能在這場可怕的攻擊行動中永遠佚失。\n\n求求你，務必找回這些典籍。萬一典籍被毀，這個地方的歷史也會不複存在。', '', '', '', '', '', '', 47187),
(67034, 'zhTW', '風與水', '到咆哮龍泉收集施法材料。', '東邊有個很大的龍泉，那裡是野生風鷹的築巢地。羽毛從它們身上掉下後，上面的魔法仍會維持一段時間，可以用在許多儀式中。\n\n那個地方也聚集著狂怒的元素之靈，它們的核心同樣有用。\n\n請分別幫我收集一些 - 記住，風鷹是聖獸，收集羽毛時，請不要傷到它們。', '', '', '', '', '', '', 47187),
(67033, 'zhTW', '重建防禦', '回收$1oa個秘法火炮組件。', '自從祈倫托來到蒼藍高地後，洪荒使者一直在追殺我們。他們痛恨我們運用秘法魔法。\n\n我已經派人去請卡雷苟斯先從蒼藍文庫出來。在此同時，我們不能讓洪荒使者越雷池一步。\n\n他們一開始的攻擊，似乎破壞了我們主要的秘法防禦工事。把組件帶回來給我，我可以重新組裝起來。', '', '', '', '', '', '', 47187),
(67032, 'zhTW', '瓦瑟洛斯爬升賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67031, 'zhTW', '瓦瑟洛斯爬升賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67027, 'zhTW', '死亡之影', '', '', '', '', '', '', '', '', 47187),
(67015, 'zhTW', '鑄造答案', '', '', '', '', '', '', '', '', 47187),
(67007, 'zhTW', '文物建檔協助', '到沃卓肯文庫與柯莫拉交談。', '<以優美的筆觸寫成的文字既俐落又簡潔，但卻因為充滿水份的燻製墨水，讓文字在羊皮紙上快速暈開，留下了一股有如發酵飲料一般的氣味。>\n\n各位冒險追尋者，以及文物建檔愛好者…\n\n文庫正在號召熱愛尋找答案、渴望探索，以及希望揭開過去，甚至未來秘密的人！\n\n凡是心懷畏懼、意志不堅的人都無法勝任這個任務。\n\n我們只接受充滿好奇心而且無畏無懼的冒險者。\n- 柯莫拉', '', '', '', '', '', '', 47187),
(67006, 'zhTW', '撲滅烈焰', '', '', '', '', '', '', '', '', 47187),
(67005, 'zhTW', '如何訓練元龍', '', '', '', '', '', '', '', '', 47187),
(67004, 'zhTW', '大箱子裡面的好東西', '幫我找到大地守護者的寶箱，如果你可以把它帶回來，我們就可以分享戰利品。', '經過一番努力，我們已經集齊所有必要條件，能夠開啟大地守護者的寶箱。黑曜龍堡下方有好幾個。只要你找到，我就會給你獎勵。\n\n我製作了鎖鍊，這樣移動起來比較容易。如果你把寶箱帶來這裡，我們可以共享財寶。\n\n要注意寶箱可能會被移動過，因為我也派了其他人去找。', '', '', '', '', '', '無論有沒有找到大地守護者的寶箱，都要向熔爐工摩拉斯回報。', 47187),
(67003, 'zhTW', '蒼藍高地彎道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(67002, 'zhTW', '蒼藍高地彎道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66998, 'zhTW', '水火不容', '在噴發洞穴殺死熔岩元素。', '我看管熔岩元素這麼多年來，從沒看過他們出現這樣的行為！我們幾乎沒辦法把他們困在洞裡。\n\n你現在有空嗎？我們負責守住出口，你負責進去裡面削減他們的數量。\n\n來，帶著這個瓶裝水元素。\n\n我在看管熔岩元素的時候，隨身都會帶著幾個瓶裝水元素。天生的死敵最能吸引他們的注意力！', '', '', '', '', '', '', 47187),
(66997, 'zhTW', '育幼指導', '在晶紅生命之池的花園與威洛斯會面。', '看到拉茲塔克接受了幼龍看管者的使命，我覺得相當欣慰！尤其現在有很多小寶貝都開始長牙了。\n\n話說回來，育幼花園的確正在面臨挑戰。不只幼龍覺得壓力很大，看管者更是面臨前所未有的壓力。\n\n求求你，要是你有空的話，請來下面的花園找我。我們需要你的幫忙！', '', '', '', '', '', '', 47187),
(66972, 'zhTW', '老石牙', '到安東尼達斯營地附近擊殺老石牙。', '我有個艱難的任務要交給你，$p。每次殺戮並非都是考驗技術，有些是在考驗良心。\n\n在安東尼達斯營地東邊的森林中，有隻年老的公猛瑪象。我前幾天從遠處觀察牠，不斷聽到牠發出悲傷的鳴叫聲。牠顯然飽受痛苦。\n\n牠開始胡亂破壞下層灌木叢，我擔心牠對其他生物帶來危險。\n\n如果你能讓那個可憐的傢伙安息，也算是好事一樁。幫我把牠的象牙帶回來，我們會給牠應有的哀榮。', '', '一頭遠古公猛瑪象，已經對自己和他人造成危險。', '老石牙', '', '', '在荒僻營地和小赫米特‧奈辛瓦里交談。', 47187),
(66971, 'zhTW', '死亡之顏', '到冬毛谷的北邊獵殺霜顎。', '告訴我，朋友。你看過死神的真面目嗎？\n\n<奈辛瓦里停了一下，製造戲劇效果。>\n\n我在說什麼鬼話？你一定有這種經歷。\n\n畢竟，死神有很多面目。\n\n我從伊姆布的巨牙海民那裡聽到一個故事，據說死神的其中一個面目就住在這裡的山中。光是提到牠的名字，就會召來冰冷殘酷的死神。\n\n霜顎。\n\n<奈辛瓦里小心翼翼地四處張望。>\n\n好了，現在你必須去狩獵牠了，就算是幫我一個忙！', '', '傳奇的冰上死亡惡兆。', '霜顎', '', '', '在荒僻營地和小赫米特‧奈辛瓦里交談。', 47187),
(66970, 'zhTW', '『升空者』邰峰', '', '', '', '', '', '', '', '', 47187),
(66969, 'zhTW', '平原氏族', '在莫魯克向桑索克可汗回報。', '在你等待特使到來時，桑索克可汗很有興趣知道和氏族的會面進行得如何。她派我來找你，通知你到莫魯凱的中央和她會面並討論。', '', '', '', '', '', '', 47187),
(66968, 'zhTW', '削弱雪人族群', '到羅甯之盾附近殺死葉托。', '<奈辛瓦里指向道路的一側。>\n\n看到雪中的那些痕跡了嗎？\n\n雪人的足跡。\n\n一定有什麼東西激怒他們，才會讓他們在這麼靠近大路的地方打獵。看看你能不能殺死他們的首領，我們不希望他們開始伏擊來往的旅人！\n\n如果他性情殘暴，直接把他的頭砍下來。這樣應該能嚇阻其他雪人。', '', '唯一比巨大雪人更糟的東西，就是有朋友的巨大雪人。', '葉托', '', '', '在荒僻營地和小赫米特‧奈辛瓦里交談。', 47187),
(66964, 'zhTW', '落入惡徒之手的神器', '到蒼藍高地的失落廢墟找到雅莉亞‧日翔。', '我們在這裡遇到很多…不對，是根本數不清的問題！\n\n天啊，要先從哪件事說起呢？\n\n祈倫托最近發現碎裂火焰軍的秘密計畫。他們正在尋找名為「瓦烏洛斯」的神器。\n\n它具有無窮的力量，甚至擁有…自己的意識！危險程度簡直破表。\n\n有個叫雅莉亞‧日翔的人，帶著兩個巨牙海民去南邊調查碎裂火焰軍。她現在早該回來了才對。\n\n麻煩你去尋找她的下落，並且阻止碎裂火焰軍取得這個神器！', '', '', '', '', '', '', 47187),
(66963, 'zhTW', '未到貨', '到附近的基地告訴編目員沃福德，他的補給品短時間內不會送達。', '我曾試著告訴維維西，我能把貨車從泥坑拉出來。\n\n但他不聽，堅持要用魔法解決…結果呢，看看他做的好事。\n\n<搬運工班尼特嘆氣。>\n\n在我試著說服維維西的時候，你能不能跑到山丘上的基地，告訴編目員沃福德，他可能需要再從波拉勒斯送一箱相機補給品過來？', '', '', '', '', '', '跟龍鱗基地的編目員沃福德告知壞消息。', 47187),
(66960, 'zhTW', '『卓越者』柯羅吉克', '', '', '', '', '', '', '', '', 47187),
(66958, 'zhTW', '保護與放牧', '到伊斯凱拉東邊獵殺血角。', '我前幾天跟伊斯凱拉的一些獵人聊天，聽說他們遇到一件非常可怕的事。\n\n顯然，那裡有一隻叫血角的嗜殺犀牛一直用犀角攻擊體型較小的麋牛。\n\n麋牛在蒼藍高地的競爭已經很激烈了，不需要再有外來的野獸殺死牠們！\n\n帶牠的角來給我。我想讓巨牙海民的朋友有個好印象！', '', '一頭兇惡的野獸，正在大肆殺害當地的麋牛群體。', '血角', '', '', '在荒僻營地和小赫米特‧奈辛瓦里交談。', 47187),
(66957, 'zhTW', '冰中暗影', '調查安東尼達斯營地上方的冰河頂端。', '在我穿越安東尼達斯營地的時候，我聽到有人在說悄悄話。他們提到冰原上到處都是動物的屍塊，還有一灘灘的血跡。\n\n不管那是什麼，都讓那些法師害怕，讓當地的動物幾乎死絕。\n\n到冰河頂端調查一下。如果我是愛賭博的矮人，我會猜那一定是某個頂級掠食者的地盤。\n\n幫我帶個一部份回來，這樣才能給祈倫托一個交待。', '', '充滿惡意的巨人，很喜歡玩弄獵物。', '霜拳', '', '', '在荒僻營地和小赫米特‧奈辛瓦里交談。', 47187),
(66956, 'zhTW', '獵龍者伊格丹', '', '', '', '', '', '', '', '', 47187),
(66952, 'zhTW', '豺狼人的衣服', '從巨龍群島的豺狼人身上收集20個豺狼人身上的布料，交給沃卓肯協調者的多瑟諾斯。', '豺狼人一直以來都是個威脅，會對遠征隊及巨龍群島的居民發動血腥的劫掠和攻擊。那為什麼他們的衣服那麼乾淨呢？\n\n在你和這些劫掠者作戰後，可以請你收集他們用舊的布料樣本給我分析嗎？', '', '', '', '', '', '', 47187),
(66950, 'zhTW', '巨人之心', '從巨龍群島的山嶺巨人、冰巨人或熔火巨人身上收集5個巨人核心，交給伊斯凱拉巨牙海民的天納宇。', '巨龍群島上有許多不同的巨人，據說他們的核心都裝有美麗的寶石。一般來說，我們不會狩獵島上的生物來取得寶藏，可是這些巨人已經造成了不少混亂。\n\n在清除這些搞破壞的巨人時，我們不如就順便收集這些寶石吧。', '', '', '', '', '', '', 47187),
(66948, 'zhTW', '特使抵達', '在翡翠花園了解情況。', '我要承認我這輩子沒有離開過翡翠花園，因此從來沒遇過半人馬，更不用說大陸來的凡人了。\n\n不過，我來這裡不只是為了拜訪，而是要請求半人馬的援助，一同守護我們的誓言石並保護我們的信念。\n\n很高興看到你也來這裡幫忙。有許多事情需要討論。', '', '', '', '', '', '', 47187),
(66947, 'zhTW', '蒼藍高地飛馳賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66946, 'zhTW', '蒼藍高地飛馳賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66944, 'zhTW', '孔雀顏料', '從巨龍群島的孔雀身上收集8根孔雀羽毛，交給龍鱗遠征隊的諾克林‧異圈。', '巨龍群島上的孔雀擁有一身繽紛的羽毛！我敢說我們一定可以用那些羽毛製作顏料，讓雕銘師調成墨水。', '', '', '', '', '', '', 47187),
(66943, 'zhTW', '書寫用紙', '從巨龍群島的腐朽樹人身上收集15張樹皮紙，交給沃卓肯協調者的多瑟諾斯。', '我們在巨龍群島進行的研究揭曉了許多意料之外的知識。舉例來說，如果樹人遭到腐朽魔法侵蝕，他們身上的樹皮竟然會變得和羊皮紙相當類似。\n\n而且這種奇特的紙材還可以承受更強大的魔法銘文，十分有用！你可以幫我去多收集一些嗎？', '', '', '', '', '', '', 47187),
(66940, 'zhTW', '藥劑實驗', '從巨龍群島的戈洛克身上收集15份戈洛克黏液，交給莫魯克半人馬的杜瑞娥。', '我們的鍊金師最近打算用各種新原料進行實驗。他們最近愛用的東西…該怎麼說…算是有趣吧。\n\n戈洛克的黏液似乎具備一些成分，可以在特定藥劑中發揮正面效果。', '', '', '', '', '', '', 47187),
(66939, 'zhTW', '追捕狩獵大師', '到伊姆布之盾附近獵殺狩獵大師克萊寇。', '我從荒僻營地的一個守衛那裡聽說，有個該死的敗類正在殘殺當地的動物。它自稱「狩獵大師」。\n\n狩獵是一回事，但我無法容忍蓄意虐待生物這種事。\n\n再說，我的貨車也需要一個幸運符。\n\n<奈辛瓦里朝一旁吐口水。>\n\n幫我把它的腳爪帶回來。', '', '從折磨無辜的野生動物中獲得樂趣的邪惡豺狼人。', '狩獵大師克萊寇', '', '', '在荒僻營地和小赫米特‧奈辛瓦里交談。', 47187),
(66934, 'zhTW', '破壞破龍者', '', '', '', '', '', '', '', '', 47187),
(66933, 'zhTW', '空之鏡衝刺賽道道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66931, 'zhTW', '是誰帶來的騷動？', '到晶紅生命聖殿查明騷動的原因。', '這次震動並不尋常。', '', '', '', '', '', '', 47187),
(66929, 'zhTW', '一定要收集全部', '取回尤瑪多姆的套卡。', '$PC，你介意幫我取回我的卡片嗎？\n\n我跟賽托苟莎說，我需要它們才能向其他學生示範《爐石戰記》的玩法。我想要成立一個社團，可是她不願意把卡牌還我！\n\n她一直不太尊重我，但這次實在太過分了。', '', '', '', '', '', '', 47187),
(66921, 'zhTW', '莫魯凱衝刺賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66903, 'zhTW', '淨空密庫', '', '', '', '', '', '', '', '', 47187),
(66901, 'zhTW', '顛覆世界', '', '', '', '', '', '', '', '', 47187),
(66897, 'zhTW', '熔爐燃料', '從巨龍群島的熔岩生物身上收集10個岩漿之核，交給莫魯克半人馬的杜瑞娥。', '要做出最好的刀刃，你需要只有岩漿之核才能提供的高溫。我們隨時都會常備幾個來當作熔爐的燃料來源。最近核心的數量有點少，需要補充一下。\n\n巨龍群島的大多數熔岩生物身上都會有岩漿之核。', '', '', '', '', '', '', 47187),
(66895, 'zhTW', '和老首領一樣', '除掉『預言者』薇佐絲。', '碎界龍人太容易被蒙騙了。這麼多年來，我們追隨了許多不同的首領，每次都相信他們會帶我們迎來暮光之時，見證死亡之翼的回歸。\n\n不過，死亡之翼從未回歸，連暮光的蹤影也見不著。\n\n該換個新首領了，你或許可以幫忙帶來改變。', '', '歷代首領中的最新一任。', '『逐利者』薇佐絲', '', '', '', 47187),
(66893, 'zhTW', '奪還行動', '在滿溢急流治療$1oa隻受傷的角行鳥。', '我或許對水元素一無所知，但我可是非常了解角行鳥！\n\n我調配了一種藥膏，應該可以讓角行鳥保持健康，隨時都能進行戰鬥。我先前從沒機會將藥膏實際用在角行鳥身上，但我已經盡量做了所有研究。\n\n該勇敢面對現實，實際用用看了！', '', '', '', '', '', '', 47187),
(66892, 'zhTW', '洪水困境', '在滿溢急流殺死$1oa個水元素。', '元素生物在殺害角行鳥！我練習過如何跟大型動物搏鬥，但我從沒想到需要跟元素生物正面對決！這些傢伙可不是雷霆蜥蜴寶寶…\n\n<妲薩克蘿思傷心地嘆氣。>\n\n請解決一些元素生物。角行鳥比我們想的還要更有靈性。如果牠們有辦法，一定會反擊的！', '', '', '', '', '', '', 47187),
(66891, 'zhTW', '爆炸粉塵', '從巨龍群島的鳳凰身上收集20份爆炸粉塵，交給龍鱗遠征隊的諾克林‧異圈。', '巨龍群島的熔火鳳凰在死去時，會創造出一種不尋常的灰燼物質。那可以用來改良材料，做出複雜、革命性的機械。不過我大概會用它來做炸藥。', '', '', '', '', '', '', 47187),
(66890, 'zhTW', '遭竊的工具', '為了沃卓肯協調者的多瑟諾斯，從巨龍群島的豺狼人身上收集20個遭竊的工具。', '豺狼人老是打劫我們的補給商隊，讓我們飽受困擾。他們似乎特別中意商隊運送的各種工程學用品。要是讓這些凶狠的強盜學會我們的專業技術，會有很大的風險，而且這些小偷也讓我們的生產進度大幅落後。\n\n要是我們可以拿回一些被搶走的工程學零件，應該就能重新趕上進度。', '', '', '', '', '', '', 47187),
(66886, 'zhTW', '翡翠花園爬升賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66885, 'zhTW', '翡翠花園爬升賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66884, 'zhTW', '防火裝備', '從巨龍群島的加拉登身上收集10件防火裝備，交給伊斯凱拉巨牙海民天納宇。', '加拉登的護甲能夠抵抗熊熊烈火，了解這些裝備使用的材質和附魔可以有效幫助我們對抗他們！\n\n想辦法從加拉登身上收集一些樣品回來。讓我們可以好好研究，在自己的裝備上套用同樣的附魔效果。', '', '', '', '', '', '', 47187),
(66883, 'zhTW', '遠古角環', '將東西交給艾沙里亞。', '<艾沙里亞或許想要這東西。>', '', '', '', '', '', '', 47187),
(66882, 'zhTW', '遺失的戰鬥包', '將這個東西交給利爪潛獵者卡薇雅。', '<利爪潛獵者卡薇雅或許想要這個東西。>', '', '', '', '', '', '', 47187),
(66881, 'zhTW', '峽谷河川賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66880, 'zhTW', '峽谷河川賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66879, 'zhTW', '角行鳥浩劫', '到滿溢急流與妲薩克蘿思會面。', '角行鳥。牠們的鳥嘴可啄斷骨頭，一雙長腳可以讓牠們遠離危險，而且幾乎什麼都吃。\n\n這份工作簡單無比！只有我和我最愛的大鳥一起共度無數時光。要是發生什麼事，我知道如何對付島上的所有小動物。\n\n你願意跟我去一趟北邊的角行鳥高原嗎？我不介意多點人手來幫忙。', '', '', '', '', '', '', 47187),
(66878, 'zhTW', '沼地飛掠賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66877, 'zhTW', '沼地飛掠賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66875, 'zhTW', '保存過往：阿爾蓋薩學院', '在阿爾蓋薩學院向院長取得記憶糾纏的夢境幽光。', '太棒了！阿爾蓋薩學院再一次開放了。能夠回來主持這座學習殿堂，朵拉苟莎院長一定很高興。\n\n距離我上次跟我親愛的老朋友聊天，已經過了很長一段時間。也許你可以去一趟，看看她有沒有空喝個下午茶。你也能趁這個機會報名入學，我聽說它現在招收所有種族的學生。\n\n有鑑於你經常跑來文庫找我，我想你應該會感興趣。', '', '', '', '', '', '', 47187),
(66874, 'zhTW', '保存過往：灌注迴廊', '在灌注迴廊從洪荒海嘯取得立體影像配電盤。', '你知道嗎？在提爾堡的地底深處，有一座超大型設施，名叫…灌注迴廊。太神秘了！太有趣了！太多可能性了！\n\n守衛者提爾將許多秘密藏在那裡。不知道那些秘密到底是什麼？他真的是最聰明的守衛者。\n\n<柯莫拉一臉嚮往。>\n\n不過，洪荒使者正把事情搞得一團亂。如果不阻止他們，他們一定會把守衛者提爾的驚人作品全部毀掉。拜託你，快點除掉他們，別讓他們造成太多損害。', '', '', '', '', '', '', 47187),
(66868, 'zhTW', '保存過往：提爾的遺產', '從奧達曼的時光領主戴歐司身上，取得時佚古幣。', '我一直在瀏覽文庫中的書籍，試圖尋找有關守衛者提爾的情報，令人驚訝的是，所有提及奧達曼的內容都被撕掉了，只剩下半頁提到那裡似乎埋藏著某個秘密。\n\n是不是很有意思啊？我敢說他一定還在那裡藏了其他秘密。也許你能找一些朋友一起進去裡面找找。無論你帶什麼回來，我都會視若珍寶。', '', '', '', '', '', '', 47187),
(66864, 'zhTW', '取回文物：蕨皮谷', '前往蕨皮谷，從『腐朽族母』怒眼身上取得腐朽族母的魔偶。', '啊！我需要你幫忙。蕨皮谷的豺狼人據說開始使用腐朽魔法。在正當之士手中，那能是優秀的工具。但豺狼人可不是正當之士。\n\n我們應該針對這個迫切的問題，進行完善的研究。去蕨皮谷一趟，帶回一點它們使用的魔法，讓我研究…讓我們搞清楚它們到底運用了哪一種力量。\n\n千萬小心，記得帶幫手一起去。蕨皮豺狼人有辦法讓你連骨頭都腐朽。\n\n別落到這種可悲的下場。', '', '', '', '', '', '', 47187),
(66860, 'zhTW', '取回文物：提爾的遺產', '從奧達曼的時光領主戴歐司身上，取得時光沙漏。', '柯莫拉一直要我尋找證明守衛者提爾和奧達曼存在的證據。我一而再、再而三找遍各式各樣的書籍，試著找到她想知道的答案。\n\n幾乎所有相關內容都被撕掉或破壞了。除了這一個…我準備之後拿給她看的部分。奧達曼裡面似乎藏了某種珍貴的東西。我非常希望你能找出來、帶回來給我。\n\n當然是為了協助柯莫拉進行研究。', '', '', '', '', '', '', 47187),
(66848, 'zhTW', '風中預兆', '協助雍‧賽希騰進行儀式。', '雍亞拉不會訴說我們熟知的語言，她的聲音由風承載。我們秘法師受過訓練，能夠感知她的存在、響應她的呼喚、並且解讀她的訊息。\n\n我已經使用你收集的材料，將圖騰連結到這一次的呼喚。請協助我進行儀式，鎖定她的聲音，好讓我解讀她的歌聲。', '', '', '', '', '', '', 47187),
(66847, 'zhTW', '洪荒化身牢獄：噬風者之怒', '進入洪荒化身牢獄，擊敗菈薩葛絲。', '不！我們把化身囚禁起來，就是要保護世界，但現在菈薩葛絲打算把他們都放出來！\n\n$n，我們不能讓她成功。如果你不阻止她的話，艾澤拉斯的所有生命都會受到嚴重威脅！\n\n我要回守護巨龍之座和諾茲多姆討論接下來的計畫。但你別擔心，我不會丟下你。我會派卡雷苟斯和卡德加和你一起深入牢獄冒險。\n\n勇士，祝你好運。', '', '', '', '', '', '在沃卓肯的守護巨龍之座與卡雷苟斯說話。', 47187),
(66846, 'zhTW', '套牌之心', '協助亡魂製作新卡牌。', '我進行最後一次對戰的那天，也是巨龍群島開始陷入沉眠的日子。命運殘酷無比，在我出賽之前，我失去了我最強的卡牌。\n\n果喜的卡牌原本應該是我的。我不知道她的祖先怎麼拿到它的。\n\n唉，我無法說那張牌是我的，因為它已經在她的家族傳承了好幾百年。一切都是因為我犯了一個愚蠢的過錯。\n\n或許你和我可以一起製作卡牌？一張獨一無二的卡牌…是的！你願意幫我嗎？\n\n等你準備好了，就跟我說一聲。', '', '', '', '', '', '', 47187),
(66845, 'zhTW', '傳說卡牌', '找到龍獸鬼魂並取回卡牌。', '昨晚，我躺在我的睡墊上翻來覆去，不知為何，有股異常的寒意瀰漫整個旅店。\n\n然後，有個龍獸鬼魂突然憑空出現！它翻了翻我的行李，然後又憑空消失！\n\n今天早上，我一覺醒來，才發現大事不妙！那個鬼魂一定拿走了我最心愛的卡牌！\n\n你能不能發揮愛心，幫我找回來？那是我最珍貴的財產。', '', '不管有什麼理由，總是有比偷東西更好、更聰明的辦法。', '神秘亡魂', '', '', '', 47187),
(66844, 'zhTW', '偉大的修卡瑞', '殺死天雌狐修卡瑞。', '我在這裡見過的所有動物中，偉大的天雌狐修卡瑞絕對是最有傲氣的。\n\n可惜的是，牠把豺狼人薩滿當成獵物吃了，導致牠現在因為腐朽之息陷入瘋狂。當我看到牠吃了自己的幼狐，就知道事情不對勁了。\n\n我把牠的幼狐給帶走，帶牠們來這裡，可是修卡瑞攻擊了我，把我弄得全身是傷。我差點就回不來了。\n\n有人必須去解決修卡瑞。如果腐朽之息進一步侵蝕牠的心智，牠很快就會來找我們了。', '', '這隻蠍尾飛狐過去是這片森林高貴的統治者，如今卻因腐朽而陷入瘋狂。', '天雌狐修卡瑞', '', '', '', 47187),
(66843, 'zhTW', '倒霉的盧克', '找到盧克的所在位置。', '啊！你看到我的助理盧克了嗎？\n\n那孩子說要去附近勘察一下，不過他已經去了一小時了！\n\n我跟他說過這裡很危險，別跑太遠，不過那孩子頭腦不好，聽不懂人話。\n\n我也不想責怪他。這裡還滿漂亮的，他很喜歡花。\n\n你能替我去找他嗎？我需要駕駛貨車到三瀑布守望！', '', '', '', '', '', '', 47187),
(66841, 'zhTW', '歷史的碎片', '取回文物並交給桑妮莎‧銀綻。', '我看到你在營地進進出出，到處幫忙。你應該也願意幫老甘納的忙吧？\n\n我調查了這個區域，某些東西吸引了我這雙老眼的目光。我認為這是古老陶器碎片或罐子之類的東西，是在這裡正南方的瀑布邊緣發現的。\n\n我並不擅長游泳，我會給你一些跑腿費，請你幫我把發現的東西交給桑妮莎‧銀綻。', '', '', '', '', '', '把文物帶去給桑妮莎‧銀綻。', 47187),
(66840, 'zhTW', '戲水安全', '將三個水樣本帶給曼尼‧李德。', '我最重要的職責就是確保每個人都有乾淨的飲用水。\n\n東邊的豺狼人正在散播腐朽，我得確定營地是安全的。\n\n我不想驚動任何人，於是自己收集樣本，但我覺得還是需要測試一下。\n\n幫我從附近的三個瀑布收集樣本，我會給你豐厚的獎勵。', '', '', '', '', '', '', 47187),
(66839, 'zhTW', '釀造時間到！', '收集血莓、青銅角莓、以及龍箔花。', '我們一群人剛好休假，想喝個幾杯，就一起進來這間旅店。\n\n結果呢？我不能相信！他們居然沒賣酒！這是什麼爛旅店？老闆該不會是那種無趣的老頑固吧！\n\n事到如今，我們只好自己來了！東邊的森林裡有些花卉和草藥，我們可以用那些來釀一些蜜酒。有沒有打算去幫我摘些花啊？我不會虧待你的！', '', '', '', '', '', '', 47187),
(66838, 'zhTW', '這裡好冷', '從厚鬃熊身上收集厚熊皮。', '一個好的旅店老闆需要能夠預測客人的需求。不幸的是，我沒料到這裡的夜晚會這麼冷。真糟糕。\n\n我的客人需要毛毯，保暖的厚毛毯。熊皮好像還不錯的樣子？\n\n在這裡東邊的森林裡，有不少巨熊。要是你幫我帶些熊皮來，我會把它們買下來！\n\n拜託啦？想想那些冒險者，還有他們凍成冰塊的腳…', '', '', '', '', '', '', 47187),
(66837, 'zhTW', '早餐沒東西吃', '在三瀑布守望的南方收集沃昆行者和麋牛的肉。', '我的兄弟瓦多應該要訂購更多補給品的。但現在都過一個禮拜了，什麼東西都沒送來。\n\n我一點也不意外。那個懶惰的傢伙很可能還在睡大頭覺！我們現在食物嚴重不足，但我要處理自己和瓦多的雜事，根本忙到沒時間去打獵！\n\n你能幫我們去打獵嗎？這裡的南邊有沃昆行者和條紋麋牛。牠們的肉能在我抽出時間訂購補給品之前，讓我們不至於斷炊挨餓。', '', '', '', '', '', '', 47187),
(66836, 'zhTW', '光痕叢林環狀賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66835, 'zhTW', '光痕叢林環狀賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66834, 'zhTW', '『博學者』睿倫', '到祭品洞穴中獻出你的祭品，並見證睿倫的所有教誨。', '帶你的貢品來中央巢穴。你將會見證『博學者』睿倫的傳說，據說他讓我們半人馬擁有立足的基礎。', '', '', '', '', '', '', 47187),
(66833, 'zhTW', '悲傷的狨猴', '', '', '', '', '', '', '', '', 47187),
(66831, 'zhTW', '青蛙在哪，家就在哪', '到生命之池與克希琦會面，放生獲救的青蛙。', '全部的青蛙都捉到了，$n！我想我們…呃…先把青蛙送去給阿蔻菈吧。牠們在生命之池會很安全，不久後，角蛙就會覺得無聊，不再煩牠們了。\n\n呃，我們好像沒找到任何能讓阿蔻菈開心的東西。希望她能諒解…', '', '', '', '', '', '', 47187),
(66830, 'zhTW', '充滿角蛙！', '使用克希琦的螢火蟲罐，引誘$1oa隻受到欺凌的青蛙到安全地點。', '喔，那些角蛙讓我好生氣！\n\n<克希琦用力跺腳，把眼鏡弄歪了。>\n\n牠們是又大又貪婪的惡霸！就算這個地方是用牠們的名字命名，並不代表牠們可以到處亂跳，吃掉所有體型比牠們小的生物！\n\n來，給你我的螢火蟲罐，牠是青蛙達人的最佳夥伴。牠會讓青蛙平靜下來，你就可以趁機捉住牠們，然後把牠們送去安全的地方。\n\n如果有角蛙跑出來擋路，別害怕，直接欺負回去！', '', '', '', '', '', '', 47187),
(66828, 'zhTW', '蜷伏谷地', '到角蛙谷與克希琦會面。', '我從沒看過阿蔻菈這麼難過。她通常都跟她的花一樣有朝氣，但她太看重那個傳說了，開口閉口都是那個傳說。嗯…\n\n<克希琦玩弄她的眼鏡。>\n\n我對植物知道得不多，我也不覺得除了我以外，還有誰會因為青蛙而開心…\n\n不過這裡的北邊有個安靜的地方，叫「角蛙谷」，我經常會在那裡想事情。或許我們能在那裡找到讓她開心的東西，或至少想個計畫幫她。', '', '', '', '', '', '', 47187),
(66827, 'zhTW', '開花結果', '從花園四處收集$1oa個成熟的火龍果、$1oa朵芬芳的龍之花和$1oa個飽滿的種子莢，作為獻給龍魂的貢品。', '傳說中，她只會為那些證明自己熱愛生命的生靈歌唱。\n\n我已經照顧這個花園很多年…我覺得我的植物和我都已經準備好了。\n\n我會開始在池邊做準備。請你幫我採收一些東西！\n\n從低矮的灌木叢收集種子莢，從陽光普照的原野收集龍之花，再從樹上收集火龍果。我可以把舊草耙借給你，幫助你採集。請小心一點，有時候葉子也可能會變得很危險！', '', '', '', '', '', '', 47187),
(66825, 'zhTW', '晶紅天職', '到晶紅生命聖殿參加天職儀式。', '$p！你剛好在這裡真是太好了！我們正要開始舉行天職儀式，如果你能提供協助的話我們會深感榮幸。\n\n龍裔的天職是非常特殊的。有些人會成為優秀的園藝師，有些則會照顧特定的野生生物。\n\n這些年輕的龍裔完成了訓練，準備要接受第一次的使命。他們一定也很希望你能參與。等你準備好了，請把桌上這些物品逐一交給他們。', '', '', '', '', '', '', 47187),
(66805, 'zhTW', '忠誠之鑰', '收集$1oa把大型黑曜鑰匙。', '', '', '', '', '', '', '將組好的鑰匙帶去黑曜龍堡給賽柏利安。', 47187),
(66788, 'zhTW', '龍蛋的未來', '協助育母艾莉昂復原場地。', '我簡直不敢相信！發生了這麼多事之後，居然還有黑龍軍團的龍蛋！\n\n可是，看看這地方的情況啊！這樣可不行！這些龍蛋值得最完美的環境。\n\n雖然那兩個愛吹牛的傢伙像小孩子一樣爭吵不休，想要吸引生命守縛者的偏愛，我敢說他們連想都沒想過我們！不過你啊，你不會讓丟下老護蛋者不管的，對吧？', '', '', '', '', '', '', 47187),
(66787, 'zhTW', '翼息環形賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66786, 'zhTW', '翼息環形賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66785, 'zhTW', '最後的護蛋者', '與育母艾莉昂交談。', '我理解你的擔憂，$c，但一切很快就會回到正軌。\n\n歡迎留下來見證接下來發生的事，應該會相當大快人心。\n\n另外，有空的話，記得去和護蛋者談談，她絕對需要援助。', '', '', '', '', '', '與育母艾莉昂交談。', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66784, 'zhTW', '餓死暴風', '殺死洪荒風暴召喚者來關閉風暴迴廊傳送門。', '對於一個只能用兩隻腳平衡的傢伙來說，你打得很好！\n\n只要洪荒使者持續增援，我們的戰績再好都沒用。我們必須關閉那個風暴迴廊傳送門！\n\n請殺出一條血路，進入附近的洞穴，殺死維持傳送門的洪荒風暴召喚者。可以的話，我會助你一臂之力。', '', '', '', '', '', '', 47187),
(66783, 'zhTW', '重建誓言', '協助桑索克可汗、提迦里可汗、大可汗瑪托拉‧薩列斯以及麥琳瑟拉交換禮物。', '許多個世紀以前，我和第一位半人馬許下了友誼及合作的誓言。雖然情況已經改變許多，我覺得我們應該重新許下那個誓言。\n\n我們擬定了一份誓詞，讓後代的半人馬子孫能夠記得他們與綠龍軍團的約定。回應每一段誓詞時，都必須獻上可汗提供的獻禮。我希望半人馬還記得當初的意義。\n\n禮物的選擇非常關鍵。選擇對的獻禮，就能締結我們的盟約。', '', '', '', '', '', '', 47187),
(66781, 'zhTW', '品味問題', '在捕鯨者望角找一顆石頭讓摩迪根‧鐵顎舔。', '那些傢伙真不懂尊重！\n\n兩個臭臭的戈洛克從我們的設備上偷走了一些零件，導致我們得關閉所有的設備…哈！我打從你包尿布的時候就在舔石頭了！不需要花俏的地精玩意兒。\n\n找顆石頭給我，我就會證明給你看！', '', '', '', '', '', '回去見摩迪根‧鐵顎', 47187),
(66780, 'zhTW', '王位繼承權', '與怒西昂的追隨者交談。', '我不斷付出一切努力拯救艾澤拉斯免於毀滅，一次又一次，而這個傻子竟然覺得他可以突然殺出來、然後宣稱自己擁有繼承守護巨龍的資格？想都別想。\n\n去和我的追隨者談談，$n。聽聽他們對我有什麼評價，順道了解我對這個世界做出的貢獻。', '', '', '', '', '', '', 47187),
(66779, 'zhTW', '第一繼承者', '與賽柏利安的追隨者交談。', '凡人，身為奈薩里奧的子嗣以及唯一倖存的黑龍族領袖，我從沒想過，竟然還得跟其他對手爭奪我與生俱來的權利。更沒想過，對手會是一個比你還年輕自滿的小鬼。\n\n儘管如此，要是這些已經極度清楚的證據還是不夠的話，歡迎和我們黑龍軍團的其他成員談一談。在這個議題上，你不需要只聽信我的話。', '', '', '', '', '', '', 47187),
(66778, 'zhTW', '屋克杜魯雲霄賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66777, 'zhTW', '屋克杜魯雲霄賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66737, 'zhTW', '更好的開始', '在$1oa堆肥沃的土壤播下種子，讓它們成長茁壯。', '威洛斯很勤勞，不過幼龍總是到處惹麻煩。我當然不是在說我。我只是在想，並非每一隻巨龍都願意停下來，思索他們的處境到底有多麼危險。\n\n雖然我不鼓勵以室外活動取代念書，不過我會幫你用更有效率的方式守護花園。請收下這些種子，把它們種在附近。等到它們開花之後，就會散發出昆蟲很討厭的香味。\n\n那些園丁可以幫你。要是你夠有禮貌，或許我的青銅龍兄弟也會幫你。', '', '', '', '', '', '', 47187),
(66735, 'zhTW', '修剪一下', '修剪$1oa處雜亂的草叢。', '蜜蜂除了嚇到幼龍，還有帶來其他問題。蜜蜂授粉通常是件好事，但最近蜂群太多，導致植物生長完全失控。\n\n你願意拿起我的園藝剪刀，修剪一下那些植物嗎？有些已經開始催生出危險的鞭笞者，但我希望能阻止更多鞭笞者被催生出來。畢竟，預防勝於治療。\n\n然後我現在…非常需要採取一些預防措施，$n。', '', '', '', '', '', '', 47187),
(66734, 'zhTW', '別打擾蜜蜂', '使用煙霧擴散器迷暈並收集$2oa隻擾人蜂，然後到湖邊放生它們。', '喔，感謝生命守縛者！終於有個閒人了！\n\n這些花園通常是非常適合我們的幼龍玩耍的地方。不過最近百花盛開，導致蜜蜂的數量大增失控。幼龍覺得害怕，成年的龍則是覺得很煩，昨天甚至還有一隻幼龍被螫了…\n\n<威洛斯深吸一口氣，讓自己冷靜下來，然後用懇求的眼光看著你。>\n\n能麻煩你捕捉那些蜜蜂，把它們帶到湖邊放生嗎？拿著這個煙霧擴散器，它能讓蜜蜂平靜下來。', '', '', '', '', '', '', 47187),
(66733, 'zhTW', '頂尖之冠河川賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66732, 'zhTW', '頂尖之冠河川賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66730, 'zhTW', '真正的倖存者', '到蒼藍高地的冰凍湖找老厲牙。', '我們狀況有點慘，但不能忘記我們來這裡的目的。族人的希望都在我們身上，而我不打算讓他們失望。我們必須找個臨時駐地，而我剛好知道一個合適的地方。\n\n別再發牢騷了，快點走吧。', '', '', '', '', '', '到蒼藍高地的冰凍湖，找老厲牙說話。', 47187),
(66728, 'zhTW', '餘燼之流飛行賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66727, 'zhTW', '餘燼之流飛行賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66726, 'zhTW', '野生保育區環狀賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66725, 'zhTW', '野生保育區環狀賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66724, 'zhTW', '微光魚釣者', '取得$1oa隻微光魚，並將牠們放進祭籃中。', '你被捲進這件事裡，我很抱歉，旅行者。\n\n我的兄弟經常…興奮過頭。這只是他最新的天馬行空罷了。可是，這個計畫可能會害死他。\n\n他不會聽我的勸告的。他八成也不會聽你的勸告。\n\n不過，我們的祖先『微光魚釣者』寇莉格是他最執著的對象。或許她幫得上忙。\n\n請捕捉一些微光魚，然後把牠們帶來這裡吧。我要用牠們來通靈，讓我可以和她的靈魂溝通，她的靈魂就在這個石頭之中。', '', '', '', '', '', '', 47187),
(66722, 'zhTW', '野生保育區彎道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66721, 'zhTW', '野生保育區彎道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66719, 'zhTW', '退一步', '保護你自己不受呼喚危害。', '我的朋友，雖然令人悲傷，但我必須說，我很熟悉你們在這些廢墟中面臨的困境。如果你繼續前進，你也一定會屈服於他們的瘋狂之下。\n\n無論它影響的層面是你的精神或本質，你聽到的呼喚都是實質存在的。你有個需要被滿足的渴望。\n\n雖然非常難以啟齒，但我擁有可以供養這個詛咒的方法。一切會變得不太一樣，但你還是能正常活動…至少暫時如此。', '', '', '', '', '', '', 47187),
(66718, 'zhTW', '豺狼人必須死', '', '', '', '', '', '', '', '', 47187),
(66715, 'zhTW', '救援行動', '在蒼藍高地把巨牙海民從雪革營地救出來。', '現在最重要的事是把我們的同胞帶回來。最好都能沒事。\n\n盡管這樣說讓我很痛苦，但我的狀況無法獨自戰鬥。\n\n你還願意幫我們嗎？', '', '', '', '', '', '和霜齧談話，進一步了解巨牙海民獵人。', 47187),
(66712, 'zhTW', '閃霜飛掠賽道 - 進階', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66711, 'zhTW', '黑暗裡的美食', '替哈達利收集$1oa個河螺。', '基於氏族的特性，我們通常會缺乏某些資源。我們沒有多餘的時間去收集這片土地的金屬資源。\n\n前可汗與許多人建立了互利互惠的關係，我也不認為有必要中斷彼此的交流。\n\n附近的河灣放著我們用來捕捉河螺的桶子，對某些鄰居來說，那些河螺可說是珍饈。把牠們交給我的聯絡窗口，我可以用來交易礦石。', '', '', '', '', '', '', 47187),
(66710, 'zhTW', '閃霜飛掠賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66709, 'zhTW', '戰地醫護兵守則', '幫助老厲牙從傷勢中恢復。', '<很難確定這個受傷的巨牙海民獨自躺在森林中多久了，不過，如果放任不管，他很快就會沒命。>', '', '', '', '', '', '', 47187),
(66708, 'zhTW', '雪地騎士', '在蒼藍高地找到失蹤的巨牙獵人。', '你好，$c。這個魔法圓頂真的很驚人，不是嗎？但是即使它保護著我們不受嚴寒和荒野的侵襲，我們還是不能永遠都依靠祈倫托。我們巨牙海民的尊嚴不允許。\n\n幾天前我們有幾個最老練的獵人冒險進入森林搜尋食物和補給品，但是他們一直沒有回來。他們的領頭，老厲牙，是個老練的登山者與獵人，但我還是難免擔心他和他手下的狩獵隊。\n\n你能幫我去找他們嗎？', '', '', '', '', '', '到蒼藍高地尋找失蹤的巨牙海民獵人', 47187),
(66704, 'zhTW', '呣嚕咕嚕咕嚕！', '姆咯咕嘎咯咕！', '姆咕嘎咯咕！咕咕嘎咕嘎！\n\n咕咯嘎咕嘎，咕嘎咕咯，咕嘎，咕咕，咯。姆咕嘎咯咕，咕嘎咕咯，姆咕，嘎咕咯。姆咕咯嘎咕，咕嘎咕咯，咕嘎咕咯，咕嘎咕咯咕，咕嘎咕咯。\n\n姆咯咕咕，嘎，咕咯。\n\n<你不確定對方在說什麼，不過他做出很多戳刺的動作。看來這個魚人希望你能殺死某個東西。>', '', '', '', '', '', '', 47187),
(66703, 'zhTW', '雪球效應', '到蒼藍高地，從雪革薩滿身上取得$1oa個雪革圖騰。', '雪革豺狼人很聰明。他們知道把食物放在冰上，食物就能保存一陣子。不過普通的冰塊不好用。魔法的冰塊才好用！\n\n這是薩滿的工作。而且他們把霜齧留在這裡，好讓他在這堆美味的巨牙海民的肉旁邊餓死。\n\n如果$r想要幫助巨牙海民，必須把握時間。\n\n但是霜齧知道如何破除法術。\n\n為什麼霜齧願意幫忙？因為他也不喜歡薩滿。', '', '', '', '', '', '', 47187),
(66700, 'zhTW', '黑色龍域', '將黑色龍域交給傳送師艾莉琳。', '它真的很迷人，對吧？這個龍域一看就是碎裂火焰軍的風格。不過，在我手中也算是適得其所。很好笑吧。\n\n<艾德奈達搖了搖頭。>\n\n不應如此，這次不一樣，我不會重蹈覆轍。把它拿走吧，那不是我該承擔的責任。\n\n再見，親愛的朋友。', '', '', '', '', '', '', 47187),
(66699, 'zhTW', '詢問當地人', '在安東尼達斯營地到處跟巨牙海民交談。', '卡雷苟斯尋求巨牙海民的建議很明智。他們對這塊土地的經驗累積好幾個世代了。\n\n許多人在前往平原上各個營地的途中會在這裡休息。\n\n到處問問看吧！他們當中一定有人知道當地地脈的情況。', '', '', '', '', '', '', 47187),
(66698, 'zhTW', '數阿戈利羊的數目', '與艾拉格牧羊人交談，將走丟的羊帶回氏族。', '阿戈利羊群是我們的重要財產。每少一隻，對我們氏族而言都是莫大的損失。\n\n有幾隻阿戈利羊與羊群分開，不小心走丟了。我們的牧羊人需要你幫忙找回那些羊。', '', '', '', '', '', '', 47187),
(66696, 'zhTW', 'Tempting Fate: Fate of the Shadowlands', '', '', '', '', '', '', '', '', 47187),
(66692, 'zhTW', '晶紅生命聖殿進階迴圈賽道：', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66690, 'zhTW', '諾庫德進攻據點：最後的先祖', '在諾庫德進攻據點擊敗巴拉卡可汗，並收集先祖勳章。', '你已經證明自己是我們的盟友，對我們的價值觀和生活方式有由衷的興趣。我想要告訴你的還有一個祖先，但這會很危險。\n\n去殺死巴拉卡的族長，叛變的巴拉卡，那個該死的雜種。他一直都會戴著一個珍貴的勳章。把它帶回來給我，我就會永遠欠你這個人情。', '', '', '', '', '', '', 47187),
(66689, 'zhTW', '不只是石頭', '向瓦杜出示風觸裂片。', '<裂片極為光滑，摸起來溫溫的。裂片核心中有閃電火花。>\n\n<或許瓦杜或歐雷克會知道更多內情。>\n\n<想到要將裂片交出時，你突然有股衝動，想將裂片牢牢握在手中，永不分離。>', '', '', '', '', '', '回到松木崗哨找瓦杜。', 47187),
(66688, 'zhTW', '風之痕', '收集風之象徵，並把它們帶到歌唱石附近的祭品容器去。', '當世界真正的洪荒生物，也就是元素向半人馬發出挑戰時，希米亞用我們被賜予的禮物迎戰它們。風。\n\n歌唱石在平原上堅毅地豎立著。你在那裡可以獻上風之象徵來喚起她的記憶。這樣的象徵在我們周圍都可以找到—鳥的羽毛、植物孢子、或是河川蘆葦。', '', '', '', '', '', '', 47187),
(66687, 'zhTW', '頂級掠食者之地', '收集$1oa張暗紡蛛網、$2oa個蠍尾飛狐爪和$3oa個雷脊鱗片。', '你應該聽說過『博學者』睿倫，他給了半人馬在殘酷之地生存的工具。他的記憶需要相對的猛獸祭品才能換取。\n\n小心點，旅人。他們已經不像幾紀元以前那麼危險，但他們依然是平原的頂級掠食者。', '', '', '', '', '', '', 47187),
(66684, 'zhTW', '追逐風暴', '消滅洪荒使者和其風暴魔法的源頭。', '<瓦杜拔出裂片，不斷喘氣。>\n\n我…完全失控了。歐雷克是對的，這個可怕的魔法一定是洪荒使者搞的鬼。拜託你，阻止他們！\n\n我必須把我的兄弟送回營地。', '', '', '', '', '', '', 47187),
(66683, 'zhTW', '最後手段分析', '到松木崗哨詢問有關風觸裂片的事。', '<瓦杜閉上眼睛，雙手抱胸，嘴裡唸唸有詞。>\n\n我被鹿刺傷了，真是不意外。現在變成我只是一個需要照顧的人。我弟弟會受到讚揚感謝，家鄉的族人沒人會感到驚訝。\n\n<瓦杜抬頭一看。> 什麼？你拿著的那個是什麼？發光的石頭？我拿一個研究一下，但最好問問其他人。畢竟我是獵人，不是考古學家。<瓦杜哼了一聲，盯著他的腳。> 也許這是叫我轉職的預兆。去吧，你已經證明自己比我還有用。', '', '', '', '', '', '', 47187),
(66681, 'zhTW', '暴風四起', '到睿冠松林殺死$1oa隻風觸野獸。', '要是你到外面的松林去，請殺掉所有被風暴影響的動物。這是個不情之請，但牠們顯然非常痛苦，完全無法得救，只能成為散播狂暴的溫床。\n\n我懷疑這是洪荒使者搞的鬼，源頭一定是他們附近的據點，我曾看到他們在奇怪的祭壇上舉行儀式。\n\n我要再去調查一下。要是你回來的時候，我還沒回來，斥候瓦杜可以向你進行其他任務的簡報。我們現在急需幫手。', '', '', '', '', '', '', 47187),
(66680, 'zhTW', '數羊', '用食物降低小願的戒心，然後用小願的哨子在睿冠松林拯救$3oa隻迷路的阿戈利羊。', '真讓人沮喪。當我和我的兄弟歐雷克外出偵察的時候，一隻發瘋的雄鹿攻擊我們。\n\n<瓦杜指著他血淋淋的腳，並皺起眉頭。>\n\n你是來這幫忙的嗎？在遭受洪荒使者的攻擊後，我們飼養的阿戈利羊都散落在松林裡。牠們的羊毛和羊奶對於營地的正常運作不可或缺。\n\n請帶著這個哨子，它能夠指揮小願把阿戈利羊趕回來。如果屠夫桑朵需要額外的鼓勵，她可以吃她最愛的零食。', '', '', '', '', '', '', 47187),
(66679, 'zhTW', '晶紅生命聖殿迴圈賽道', '滑翔通過檢查環。', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66676, 'zhTW', '溜回來', '回到雍伊爾溫泉向菈迪亞回報。', '這就是莉茲…我的秘密朋友。自從牠被媽媽遺棄後，我就一直在照顧牠。\n\n情況看起來不太妙，我完全不知道他們對牠做了什麼。我必須帶牠回家，雍或許會讓我禁足到世界末日，不過我一定要救莉茲。我非常感激你的幫忙，$p。很抱歉，增加你預期之外的工作。\n\n如果你不介意再冒險一次…願意跟我一起面對雍的怒火嗎？請回去溫泉那裡找我。', '', '', '', '', '', '回到雍伊爾溫泉找菈迪亞。', 47187),
(66675, 'zhTW', '守護巨龍之力', '在誓言母石協助雅立史卓莎。', '誓言母石是泰坦賜給我們龍族的遠古贈禮。如果我們調查獲得的情報屬實，我或許可以重啟它，藉此恢復我們的守護巨龍之力。\n\n雖然我們無法保證一定可行，但只要這個方法有一絲成功的機會，我就必須嘗試。\n\n$n，如果你願意與我合作，我會很感激的。', '', '', '', '', '', '', 47187),
(66671, 'zhTW', '步入荒野', '在蒼藍高地的荒僻營地與麥迪‧散射會面。', '你看起來是個有熱情、有能力的冒險者！你想不想協助龍鱗遠征隊啊？\n\n我們在一小塊美妙的荒野中有一座可愛的營地。\n\n如果你想去那裡旅行的話，那裡有很多事可以做。\n\n等你到了那裡之後，找我妹妹麥迪談談。她會讓你好好安頓下來。', '', '', '', '', '', '在蒼藍高地的荒僻營地與麥迪‧散射會面。', 47187),
(66660, 'zhTW', '就位…預備…', '回到過去，加入安但丁諾穆及西雅澤拉瑟。', '<諾茲多姆眼神空洞。>\n\n他們穿梭掉落得越遠，移動的速度就越快。而且在時光結構上打穿一個個破洞，產生巨大的漣漪。你必須加快動作趕上他們。\n\n<諾茲多姆的視線重新聚焦，轉向看著你。>\n\n我會派出時光行者協助你在時間之道找到方向，加速你的任務進行速度。避免和各個時空的居民交流，而且在你找到克羅諾穆之前，別停下腳步！\n\n快去吧，我們的時間異常寶貴。', '', '', '', '', '', '', 47187),
(66658, 'zhTW', '諾庫德進攻據點：誰找到就是誰的', '進入諾庫德進攻據點，擊敗蹄拉和莫魯克，然後將他們的武器放入蹄拉凱墓塚。', '在我們阻止喚墓者阿爾班之前，提拉和莫魯克的武器就被拿走了。我們最偉大的祖先有可能再次在這平原上戰鬥…而且是為了諾庫德。\n\n到諾庫德進攻地去。找到莫魯克和蹄拉。在你制伏他們之後，把他們的武器帶回提拉依墓塚。我們會讓他們帶著應有的榮耀再次安息，這次要在我們能更容易守護的地方。', '', '', '', '', '', '', 47187),
(66657, 'zhTW', '要死就死得徹底', '進入墓塚殺死喚墓者阿爾班。', '喚墓者阿爾班躲在最大的墓塚中，那裡是第一批莫魯克祖先安息的地方。阻止阿爾班，不然他就要喚起莫魯克和蹄拉了！', '', '', '', '', '', '', 47187),
(66656, 'zhTW', '絕對是永恆沉睡', '擊敗每個知名的半人馬靈魂，然後使用左里克的安息圖騰釋放它們。', '祖先們被這個黑暗魔法操控，一看到目標就會攻擊。烏克赫復活了我們最勇猛的戰士和獵人，阻止他們絕非易事。\n\n我會一起去幫忙。該是我母親的長矛重出江湖的時候了。\n\n擊敗他們後，使用我製作的這個圖騰，協助被制伏的靈魂找到返回墓塚的路。', '', '', '', '', '', '', 47187),
(66655, 'zhTW', '死靈魔法的破除材料', '從復活的夥伴身上收集$1oa個完整頭骨，並收集$2oa份神聖土壤。', '就算我們把靈魂從烏克赫的掌握中釋放，我擔心他們會沒辦法找到他們的墓碑。\n\n烏克赫族也在喚起祖先的動物夥伴，這些夥伴在生前都會引導和保護他們。\n\n把那些動物的顱骨還有被這些敵人侵擾的聖土拿來給我。只要把這些材料結合，它們應該可以幫助祖先找到寧靜。', '', '', '', '', '', '在永恆墓塚更深處和左里克會面。', 47187),
(66654, 'zhTW', '殲滅褻瀆者', '殺死諾庫德褻瀆者和烏克赫掘墓者，取回他們拿走的先祖武器。', '我的母親生前是位英雄。她值得平靜與安息，而不是…被人奴役！我們的英雄都不該被奴役。\n\n他們得付出代價。我們要讓祖先再次帶著武器和榮耀安息。把武器從褻瀆者的手中奪回來！', '', '', '', '', '', '在永恆墓塚更深處和左里克會面。', 47187),
(66652, 'zhTW', '回去找治癒者', '到附近的墳塚調查烏克赫的儀式。', '我從這裡看不到他們在做什麼，但我擔心他們在褻瀆墓塚。\n\n請你到最近的墓去，看看你能不能阻止他們在進行的儀式。\n\n如果你發現了能得知他們目標的線索，也請帶回來給我。', '', '', '', '', '', '把長矛交給左里克。', 47187),
(66651, 'zhTW', '諾庫無德', '到永恆墓塚找學徒左里克。', '諾庫德和烏克赫族已經佔領了永恆墓塚。他們的肯定有什麼邪惡的目的。我們最崇敬的祖先都葬在那裡。\n\n我之前派出學徒左里克前去調查。他到現在還沒回來。\n\n他的能力不差，但缺乏自信。請助他一臂之力，阻止他們的邪惡行動！', '', '', '', '', '', '', 47187),
(66650, 'zhTW', '命定終章', '擊敗$1oa個不同的命定團隊副本首領。', '<你是冷靜的。這是一種未知的體驗，但對你來說已經不陌生。面對這些難關你已經駕輕就熟，而明朗化是你最終的獎勵。>\n\n<你的思考清晰，最後一次穩健地向前邁進。創造自己的命運，看著它逐漸展開。>', '', '', '', '', '', '', 47187),
(66647, 'zhTW', '元素反集中', '取得元素法器。', '卡雷苟斯跟我在山脈上方的天空中遭到猛烈的攻擊。洪荒使者殘酷無情，他們的軍隊無窮無盡。\n\n很快地，卡雷苟斯跟我就可能被他們的部隊給擊垮。\n\n不過，我有個計畫。\n\n在山腳下有個叫做魯文‧碎石者的暴躁獸人。祈倫托和她決鬥過好幾次。\n\n她有一個裝置，可以吸收並轉移元素能量。\n\n從她手上拿到裝置，然後再深入一點去和我會合。', '', '魯文是強大元素法器的擁有者。', '魯文‧碎石者', '', '', '在瓦瑟洛斯山脈的更深處與卡德加的投影會面。', 47187),
(66646, 'zhTW', '消除因果', '殺死時間元素生物。', '恆龍迫使時間能量變得激進。這下糟了。\n\n在協助克羅諾穆大使的時候，請殺死所有遇到的時間元素生物吧。我會留在這裡，協助她壓制伊特努斯。', '', '', '', '', '', '', 47187),
(66633, 'zhTW', '做出聲明', '將黑龍旗幟插在$1oa具加拉登的屍體上。', '這些加拉登相信黑龍軍團已經玩完了。他們對怒西昂在這裡的威權，既不畏懼也毫無敬意。\n\n我們需要做出聲明，提醒他們黑龍軍團回來了，而且比以往更強大。\n\n殺死加拉登，標記每一具屍體，這樣他們才不會忘記誰才是這裡的老大。', '', '', '', '', '', '', 47187),
(66622, 'zhTW', '任性的工具', '救援$1oa個任性的工具。', '太可怕了！我的…嗝…工具似乎在我不注意的時候跑走了。想到他們…嗝…孤單地在外頭就讓我不忍心，他們一定嚇壞了！\n\n你可以幫我把他們帶回來嗎？記得要有耐心，然後…嗝…盡量安撫他們，我敢說這樣他們就會接近你了！', '', '', '', '', '', '', 47187),
(66612, 'zhTW', '護蟹者的難題', '在崖瀝營地殺死$1oa個戈洛克。', '螃蟹有危險了！\n\n這群螃蟹已經經歷了一個難熬的季節。牠們的上一個棲息地被洪荒使者給洗劫了，所以我就把牠們引到這個地區來，結果牠們又被戈洛克入侵！\n\n我以為牠們在這裡很安全，可是戈洛克只會刺激螃蟹逞兇鬥狠，會讓牠們提早滅絕！\n\n拜託，去擊倒那些戈洛克，讓螃蟹可以逃走吧！', '', '', '', '', '', '', 47187),
(66598, 'zhTW', '夜裔精靈小知識', '在蒼藍高地的安東尼達斯營地找到躍傳法師德蘭卓拉。', '遠古符號不算我的專長。不過…\n\n<塞林翻找他的隨身物，終於拉出一張地圖。羊皮紙頂端寫著安東尼達斯的名字，字體又大又潦草。>\n\n啊哈！在這裡！\n\n要走一段路，但你可以找到幾個古老魔法的使用者…就在這裡。\n\n<指著地圖上的一個點。>\n\n或許他們可以提供些情報。', '', '', '', '', '', '', 47187),
(66597, 'zhTW', '這顆老石頭', '檢視蝕刻遠古石碑。', '我身後的石頭只是一塊我們在群島上碰巧發現的，怎麼說來著…遠古科技。\n\n但問題是，我們還不能完全確定它們是什麼。挺令人困惑的。\n\n我們已經傳遞消息給一些朋友，問他們能否幫上忙。在這期間，或許你可以搞清楚要怎麼用它？', '', '', '', '', '', '', 47187),
(66596, 'zhTW', '風中的低語', '在暴風城與大法師卡德加交談。', '哈囉，$p。好久不見，我很想多跟你分享一下彼此的近況。\n\n不過，我剛剛跟一位老朋友聊過，我覺得深受啟發…不，應該說警兆已現…沒錯，警兆已現。\n\n畢竟啟示有時候總是好壞摻半。\n\n我真的必須告訴你，我剛才得知的事。', '', '', '', '', '', '', 47187),
(66595, 'zhTW', '休眠的發現', '到甦醒海岸的晶紅鱗哨站，向塞林‧暗砧報到。', '<別去想這張奇怪的羊皮紙怎麼跑到你的背包裡的。重要的是訊息的內容。>\n\n致龍鱗遠征隊成員：\n\n現在急需你們出手相助！請立刻前往晶紅鱗哨站報到！\n\n<在看到簽名處之前，羊皮紙上的魔法文字就冒出一陣白煙，分解成藍色的塵埃，只留下空白的紙頁和殘留的甜美花香。>', '', '', '', '', '', '', 47187),
(66589, 'zhTW', '遠征行動', '為巨龍群島探險隊在暴風城各地招募探險者、工匠和學者。', '我叫多蒂，我是龍鱗遠征隊的代表，負責帶領我們這群歡樂的冒險者。詳細的內容稍後再來說明，現在我們得優先召募成員。\n\n每個稱職的探險遠征隊都需要各式各樣的人才，包含學者、工匠，當然還有探險者。\n\n怎麼了？你還站在這裡做什麼？快去召集成員！', '', '', '', '', '', '把你辦好事情的消息告訴暴風港的多蒂‧鬍鬚。', 47187),
(66586, 'zhTW', '提爾的遺產：過往的秘密', '進入荒蕪之地的奧達曼。調查騷動的原因。', '為了阻止菈薩葛絲釋放其他的洪荒化身，必須讓守護巨龍恢復原有的力量。\n\n但這不是一件容易的事情。泰坦們毫無回應，而守護者提爾又逝世已久。\n\n雅立史卓莎女王想出了一個計畫。荒蕪之地的地底深處有座泰坦設施，名為奧達曼。她相信提爾的盟友在那裡藏了一塊圓盤，裡面儲存著他的記憶。\n\n召集盟友和你一同前往奧達曼，為紅龍女王取回圓盤。希望提爾留存的知識可以重新恢復守護巨龍的力量。', '', '', '', '', '', '', 47187),
(66582, 'zhTW', '取得力量', '到安東尼達斯營地，為躍傳法師德蘭卓拉收集容器中的能量。', '在正常情況下，捕捉能量不是什麼問題。不過，我們需要的能量既巨大又不穩定。這個秘能容器就是安全運輸它的方法。\n\n西南方有個地區住著許多充滿能量的生物。這些生物體內的異常能量非常強大，可是很不穩定。\n\n捕捉他們的能量，再回來找我。到時候我們再一起踏上剩下的旅程。', '', '', '', '', '', '', 47187),
(66578, 'zhTW', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'zhTW', '守護巨龍的邀約', '與怒西昂交談，了解議會的討論結果。', '啊，$p，你來得正好！\n\n我剛剛才跟總指揮官圖拉揚和他的盟友見過面，他們決定接受守護巨龍的邀約，前往巨龍群島。\n\n你當然也會一起去吧？要是沒有你，這趟旅程的樂趣肯定會大打折扣！\n\n然後相信你已經注意到，這裡出現了一些陌生面孔。那些有翼生物叫做半龍人。他們剛認識我不久，但已經被我的魅力所折服。\n\n啊，請恕我無禮，我不該一直自誇。', '', '', '', '', '', '', 47187),
(66575, 'zhTW', '任務提供者的物品：藥瓶。', '將該物品交給道路守衛艾薇。', '<在塔拉賽克放滿各種雜物的儲物箱中，有個奇怪的小瓶子，裡面裝滿黏稠的液體，正在不斷冒泡。>\n\n<最好把它拿給艾薇看。>', '', '', '', '', '', '', 47187),
(66559, 'zhTW', '回到營地', '回捕鯨者望角找審查人洛威。', '我看到摩迪根像是被附身似的逃出那裡。我會去追他，確保他安然無恙地回到其他人那裡。\n\n如果你抱住懸崖然後跳下瀑布，應該就能避免再吵到更多的戈洛克。\n\n我們營地裡見。', '', '', '', '', '', '', 47187),
(66558, 'zhTW', '洛威', '找到洛威。', '你是那個和其他人一起從蕨皮回來的人，對嗎？那你大概知道卡加塔發生了什麼事…\n\n自從她沒有跟著布蕾娜和其他人回來，她的兒子洛威就一直很焦慮。我會留在這裡等他回來，但是你能不能去找他？\n\n我猜他跑去東邊那個冰洞穴了。他說了什麼要跟裡頭的雪人戰鬥！', '', '', '', '', '', '', 47187),
(66557, 'zhTW', '學術上的熟人', '在荒僻營地找到另一個熊怪語言的專家。', '是的，就連我都覺得，這個熊怪的冬毛分支非常難以理解。\n\n我在荒僻營地有一些同事，他們或許能幫上忙。我聽說這個地區還有其他的熊怪部族，比對方言的相關筆記或許會有些進展。', '', '', '', '', '', '', 47187),
(66556, 'zhTW', '去那冰洞穴', '調查洞穴。', '嗯，你的口音很糟糕，一萬年的孤立和語言變化也沒讓事情變比較容易，但我好像大概了解意思了。\n\n基本上他們主要說的內容，是有關於「壞洞穴風」或「邪惡風暴洞穴」之類的。不然就是說他們的髒衣服太星期四了？\n\n這可不像學習地精語那樣，肯定會有些翻錯的地方。不過，洞穴的事情我還蠻確定的，我們從這開始著手吧。', '', '', '', '', '', '', 47187),
(66555, 'zhTW', '熊、熊怪、熊怪語', '協助索諾瓦進行翻譯。', '是的，聽起來上頭真的是一團亂…一副暴風雨過境，破壞了整個地方那樣。我懂他們為什麼要武裝自己，可是為什麼要攻擊我們呢？\n\n要是我們可以談談，一切就簡單多了，可是冬毛族口風很緊，這點大家都知道，而且他們似乎不會說任何常見的熊怪話。熊怪語？呃，反正你知道我在說什麼。\n\n你去調查的時候，有和誰聊天嗎？', '', '', '', '', '', '', 47187),
(66554, 'zhTW', '具攻擊性的自衛', '擊敗$1oa個冬毛熊怪。', '冬毛族現在都有點神經兮兮，我不覺得他們會喜歡你在那一帶探頭探腦。\n\n如果他們惹事的話，你儘管保護自己。只要讓他們知道你是玩真的，或許就有辦法讓他們講理一點。\n\n不過，盡量別殺人，好嗎？我知道你們這種冒險家有時候會太激動。', '', '', '', '', '', '', 47187),
(66553, 'zhTW', '山谷線索', '在冬毛谷找出$1oa個線索。', '冬毛族在熊怪中是個特殊案例。\n\n我會把他們歸類為「孤立主義者」。他們是山谷中的鬼魂，他們的毛皮融入在雪景之中。\n\n以前都不太理人，但現在侵略性非常明顯。他們無預警地攻擊了我們的營地！\n\n一定有什麼事不對勁才會驅使他們這樣。我無法問他們發生了什麼事—還不行—可是，或許你可以在他們的村莊裡找到線索？', '', '', '', '', '', '', 47187),
(66550, 'zhTW', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'zhTW', '甦醒海岸拉力賽', '', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66534, 'zhTW', '展翅高飛', '探索奧格瑪。', '我們的到來終究還是引起了注意。或許這些人還有希望。\n\n我會跟隨厄比西昂跟部落領袖，試著緩和情勢。你負責去偵察。\n\n看看這個地方有甚麼樣的資源。畢竟，我們可能要在這裡待一陣子。\n\n等你偵察完，就來找我們。希望到時候我們能大致掌握這裡的情況。', '', '', '', '', '', '', 47187),
(66529, 'zhTW', '千言萬語', '拍攝德維希安與元龍骸骨的合照。', '了解這裡過去發生的事後，我認為應該留下一點紀念再離開。\n\n你能不能幫我跟這個元龍化石拍張合照？', '', '', '', '', '', '', 47187),
(66528, 'zhTW', '無冠之王', '調查元龍骸骨。', '這隻古老元龍生前一定是非常霸氣的生物，也許是這個野生保育區有始以來體型最大的生物。\n\n但是，不只如此，要是你更仔細觀察骸骨，我們或許能還原它死前的遭遇。', '', '', '', '', '', '', 47187),
(66527, 'zhTW', '專業攝影', '使用垂直增強器，拍攝沉睡元龍的照片。', '我從沒訓練過像你這麼優秀的攝影師…而且還活得好好的。這其實是一份危險的工作。\n\n說到危險，我們的最後一個目標是一隻巨大的元龍，我們認為牠很可能成為這個保育區的下一個頂級掠食者。讓我們幫牠拍張個人特寫照吧！', '', '', '', '', '', '', 47187),
(66526, 'zhTW', '保育工作', '釋放5隻被捕獲的元龍幼龍或被捕獲的元龍。', '野生保育區是少數幾個能讓元龍繁衍生息的地方之一。不過，洪荒使者派人去捕捉元龍和牠們的幼龍來進行實驗，把牠們的築巢地搞得雞飛狗跳。\n\n別對他們手下留情。找到那些洪荒使者的盜獵者，除掉他們，並且釋放他們捕獲的獵物。元龍種族的安危全繫於此。', '', '', '', '', '', '', 47187),
(66525, 'zhTW', '競賽攝影', '拍攝灌能元龍蛋和灌能元龍的照片。', '既然你已經拍了一些入門級的照片，現在不如稍微提高一下難度吧？\n\n我發現在我們後面的區域，有隻很漂亮的元龍正在飛行。牠有著美麗的角，鱗片還不斷發出電光！這應該是洪荒使者的傑作，不過藝術就是藝術！\n\n看看你能不能拍到那隻元龍和牠的龍蛋的照片。你可能需要爬到高一點的地方，才能拍到好照片！', '', '', '', '', '', '', 47187),
(66524, 'zhTW', '業餘攝影', '為元龍拍照。', '你想成為像我這樣老練的編目員？你來對地方了！\n\n野生保育區到處都是等著被發現和建檔的知識！你問我是怎麼辦到的？當然是利用我的生態記錄器3000型巨龍群島版，這一版還改進了動態捕捉功能！\n\n為了讓你多點經驗，請去拍攝一些照片，包含元龍蛋、學飛的幼龍，還有狩獵中的元龍。然後到這裡西邊的古老元龍骨架旁找我，我會對你的照片給予評價。', '', '', '', '', '', '', 47187),
(66523, 'zhTW', '照看熔爐', '聚集熔爐所需要的材料：在安東尼達斯營地附近收集角蛙皮、惰性餘燼錐和崩裂核心。', '如果你要找某位講師，我只能說…啊，你不是學徒！真抱歉。請讓我自我介紹。\n\n我是管理者維娜苟斯，負責管理這些廢墟。更具體地說，讓這裡恢復過往的榮光，就是疲備不堪的我必須肩負起的任務。\n\n你能夠幫幫我嗎？我需要的施法材料都在這附近：冰元素核心、餘燼錐、角蛙皮…\n\n都是些很常見的東西。', '', '', '', '', '', '返回安東尼達斯營地去見管理者維娜苟斯。', 47187),
(66517, 'zhTW', '新的武器來源', '從巨龍群島的碎裂火焰軍身上收集25個完整的半龍人武器，交給莫魯克半人馬氏族的杜瑞娥。', '這些碎裂火焰軍對我們的邊界構成了嚴重的威脅，而他們持用的武器尤其讓人擔心。盡你所能收集他們的武器，讓我們可以仔細研究這些武器的弱點，甚至用來加強我們的防禦。\n\n外來者，我對你有信心。只要你好好完成這個任務，我會把我們的鍛造技術傳授給你。', '', '', '', '', '', '', 47187),
(66516, 'zhTW', '普通寶石？我不這麼認為！', '從巨龍群島的加拉登身上收集25個「普通」寶石，交給龍鱗遠征隊的諾克林‧異圈。', '真是浪費，這裡的加拉登把強大的寶石當作一般珠寶裝飾品而已！寶石可是有很多用處的，望遠鏡、鏡子、聚焦指示器，更不用說它們具備的無數魔法特性。\n\n我們必須改正這個情形，探險者。拿走那些加拉登的寶石，帶回來給我，我會讓它們發揮更好的作用。不過要小心，加拉登都是勇猛的戰士。', '', '', '', '', '', '', 47187),
(66513, 'zhTW', '展翅高飛', '探索暴風城。', '要是這座城市會變成我們的新家，也許應該先稍微了解一下，例如偵察任務什麼的。\n\n去看看這個地方的生活機能。我會跟著怒西昂，盡我的力量幫助他。\n\n非必要的話，就別去招惹當地人。對了，我認為他們應該不常看到有龍出現在他們的街道上。\n\n等到你弄清楚狀況後，再回來找我們。', '', '', '', '', '', '', 47187),
(66511, 'zhTW', '伊斯凱拉巨牙海民名人', '在伊斯凱拉與慕里克交談。', '你持續向我們證明你是我們不可或缺的一份子。\n\n為了向這份羈絆致敬，請到伊斯凱拉找我，我準備了一袋補給品要送你。', '', '', '', '', '', '', 47187),
(66509, 'zhTW', '偏執1', '', '艾古拉派我來這裡，摘些治療我的焦慮症的花，不過我好怕這裡的怪物。', '', '', '', '', '', '', 47187),
(66504, 'zhTW', '晶化的法力裂片', '把水晶帶去交給拉索斯。', '<藍色的小水晶被碰觸到的時候會微微顫動，然後發出一種低頻的聲音，就像遠方傳來的歌聲。你在腦中可以聽見話語的回音，就像柔和的旋律那樣。>\n\n拉索斯或許會覺得這很有意思。', '', '', '', '', '', '把水晶帶去交給拉索斯。', 47187),
(66503, 'zhTW', '為了他人的愛', '調查安東尼達斯營地的廢墟高塔頂端。', '啊，我看到我的學徒們把你拉進了他們的小遊戲。\n\n<諾麗可輕笑。>\n\n看來他們跟你，在偶然間發現了什麼東西。這些廢墟背後的目的正在慢慢向我們展露出來，不只是現在看到的褪色圖案和歌曲…\n\n這座塔的塔頂上面有什麼在呼喚著。\n\n我在你眼裡看到了好奇的光芒。去吧，我准許你前往。\n\n看看你會發現什麼。', '', '', '', '', '', '返回安東尼達斯營地去見諾麗可。', 47187),
(66500, 'zhTW', '觀看的方式', '在安東尼達斯營地發掘古老的影像。', '我們什麼都沒做！我們什麼都沒做！\n\n等一下…\n\n你好像是個非常重要的$r…想知道一個秘密嗎？\n\n那就是，廢墟裡面好像有某種魔法。而且我們看得見它！\n\n<斯克朗比驕傲地挺起胸膛。>\n\n我可以教你怎麼樣才看得見！只是…要先對諾麗可保密。', '', '', '', '', '', '', 47187),
(66493, 'zhTW', '送信！', '在安東尼達斯營地把包裹丟給祈倫托學徒。', '<你聽到從傳送門的另一端傳來沉悶的低語。>\n\n喂！對，就是你！\n\n我有些信件要給我們的學徒：家裡寄來的包裹、禮物、還有他們透過魔法信差下訂的東西。\n\n就是些常見的東西。\n\n你可以幫我一個忙，把它們分發出去嗎？', '', '', '', '', '', '', 47187),
(66489, 'zhTW', '鞏固防禦', '在安東尼達斯營地中強化蒼藍防衛者。', '管理者辛雷苟斯和我剛剛正在討論，洪荒使者的攻擊行動對進攻鈷藍集會的計畫造成什麼影響，對此我有個想法。\n\n<瑟莉絲蒂從長袍的口袋抽出魔杖。>\n\n帶著我的魔杖，強化他們的武器！\n\n只要來點火焰應該就沒問題了…', '', '', '', '', '', '', 47187),
(66488, 'zhTW', '懸賞：弗利葛魯斯', '到安東尼達斯營地附近殺死弗利葛魯斯。', '<頁面上的文字發出柔和的藍光。>\n\n元素生物弗利葛魯斯以前是瑪里苟斯最喜歡的玩物，但處於無主狀態已經很久了。\n\n這座過去充滿歡笑的據點，現在卻是一片斷垣殘壁。受到肆虐這片土地的邪惡力量影響，這個粗魯、愛搗蛋的生物也變得乖戾且扭曲。\n\n請務必將其消滅，並且注意安全。\n\n成功之後，請告知管理者辛雷苟斯。', '', '', '弗利葛魯斯', '', '', '', 47187),
(66473, 'zhTW', '大地甦醒', '在蓋利奇爾瞰臺擊敗原初之怒及原初冰雹。', '這個洞穴裡面的怪物太多了，我應付不來。\n\n<莎奈克思重重咳了一下。>\n\n我已經見識過你的能耐。\n\n我需要你殺死這些元素生物，別讓它們恢復全部力量。我們不能讓洪荒使者掌控提爾堡！', '', '', '', '', '', '', 47187),
(66472, 'zhTW', '洪荒清單', '把一捆洪荒使者命令交給蓋利奇爾瞰臺橋上的指揮官薩德蘇斯。', '關閉傳送門、殺死元素生物，阻止洪荒使者…就算只是暫時的也好。\n\n<莎奈克思笑了笑。>\n\n$c，還有什麼事我們辦不到嗎？我猜只有時間才能告訴我們了。\n\n把計畫書帶回去給指揮官。我們得到的斬獲，一定能讓他非常高興。', '', '', '', '', '', '在蓋利奇爾瞰臺的橋上和指揮官薩德蘇斯交談。', 47187),
(66471, 'zhTW', '首要規劃', '在蓋利奇爾瞰臺的上層露臺，從附近的洪荒使者身上收集$1oa個洪荒使者命令。', '指揮官命令我建立前線基地，並且消滅所有反抗者。但是，直到我消滅所有反抗者後，我才意識到一些事。\n\n<莎奈克思發出長長一聲嘆息。>\n\n洪荒使者曾經提到提爾堡。\n\n除非你非常擅長審問，不然我會需要你查清楚他們的計畫。', '', '', '', '', '', '在蓋利奇爾瞰臺的洞穴外和莎奈克思會面。', 47187),
(66470, 'zhTW', '向前的推力', '取得霧感、土靈及冰鑄傳送門之石，並關閉$7oa座元素傳送門。', '<莎奈克思抓抓她的下巴。>\n\n指揮官說得對。洪荒使者正在向元素位面求援。\n\n<莎奈克思得意地笑。>\n\n如果他們的傳送門出了什麼事，一定很可惜，$c。', '', '', '', '', '', '在蓋利奇爾瞰臺的洞穴外和莎奈克思會面。', 47187),
(66468, 'zhTW', '失而復得', '擊敗佔據蓋利奇爾瞰臺的洪荒使者。', '<在你靠近時，薩德蘇斯發出譏笑。>\n\n$c，你是個有行動力的凡人，還是你要讓路給我們？\n\n在那上面，那些洪荒使者讓我失去不少優秀的士兵。\n\n我們知道他們有什麼打算，但我們必須先剷除敵人，然後拯救那些為我效命的人。', '', '', '', '', '', '在蓋利奇爾瞰臺和莎奈克思交談。', 47187),
(66467, 'zhTW', '藝術源於生活', '殺死大型毒芽。', '上次我到這個洞穴來時，我描繪了一種巨大的花，那種花上面流出一種噁心的黏稠花液。那是我最好的繪畫作品之一，就算我想忘也忘不了。\n\n花液就是那些塔拉賽克長矛上塗的東西，我很肯定。他們一定已經開始採收它，用來毒化他們的武器。\n\n植物本身很美麗，要殺死它會很可惜。然而，我們不能讓塔拉賽克一直採收它。$n，請把植物切斷，阻止這場混亂吧。', '', '', '大型毒芽', '', '', '', 47187),
(66465, 'zhTW', '儲存與釋放', '摧毀$1oa根藏起來的毒矛。', '就算塔拉賽克的領袖死了，他們也不太可能因為我們禮貌請求，就放棄使用沾有毒藥的長矛。我不能冒險讓他們把這種武器用在毫無戒心的旅行者身上。\n\n我們需要摧毀它們全部。如果你在池邊的貯藏處沒有看到，那燼牙很有可能把他們的長矛存放在靠近源頭的地方。\n\n我不能再讓別人因為我的大意而受傷。進入洞穴，摧毀你能找到的武器庫存。', '', '', '', '', '', '', 47187),
(66464, 'zhTW', '殘暴野地：狩獵大師！', '擊敗王牌獵手俄瑪阿。', '就是這樣。你和你的夥伴成名了。一場和冠軍本人王牌獵手俄瑪阿的對決。先別急著慶祝。她兇狠無比。我們下輩子見。\n\n在她殺死你之後，你的東西可以給我嗎？', '', '', '', '', '', '', 47187),
(66463, 'zhTW', '殘暴野地：元素生物復仇回合！', '殺死洪荒使者勇士。', '我們臨時要更換出場名單。某個洪荒使者大佬想要加入競賽來挑戰你。而我可不會拒絕一頭憤怒的元素龍。\n\n你一定不會有事的。萬一有事，那…嗯，你簽了免責聲明對吧？', '', '', '', '', '', '', 47187),
(66462, 'zhTW', '殘暴野地：在夢境中迷失！', '擊敗夏雷斯及塔瑞西。', '我跟你說，雖然這裡叫巨龍群島，但我看過的龍其實不多。不過，我們確實有接到兩名龍類的要求，說要一起報名這項競賽。\n\n他們似乎很積極想要證明自己的實力，所以祝你好運！', '', '', '', '', '', '', 47187),
(66461, 'zhTW', '殘暴野地：來自火山的敵人！', '擊敗和平奪取者席加。', '這場競賽的第一個志願者來自甦醒海岸。是一個很大的加拉登族，他沒有他的族人那麼憤怒。\n\n他似乎單純享受戰鬥的過程。嘿，正好是我想看的。', '', '', '', '', '', '', 47187),
(66460, 'zhTW', '殘暴野地：凋零之王！', '擊敗夜腐。', '我想找那些兇狠的豺狼人來參加挑戰。可惜的是，我的同事全都不知道要怎麼跟他們溝通。\n\n不過，我們確實成功抓到了他們創造的怪物，應該會是很不錯的對手！等你想開始第二輪比賽時，就跟我說吧！', '', '', '', '', '', '', 47187),
(66459, 'zhTW', '殘暴野地：恐怖的沼澤巨獸！', '擊敗馬尼特。', '歡迎各位來到殘暴野地！\n\n雖然這個決鬥場是用來舉辦傳統活動，但和藹的半人馬給了我許可，在賽季外可以做我的生意。他們說，這可以測試他們的力量並帶來榮耀。\n\n你想要把冠軍的頭銜帶回家嗎？那麼，你準備好就跟我說吧，你就可以參加入門競賽。', '', '', '', '', '', '', 47187),
(66458, 'zhTW', '提爾的遺產：過往的秘密', '進入荒蕪之地的奧達曼：提爾的遺產，然後取回圓盤。', '為了阻止菈薩葛絲釋放其他的洪荒化身，必須讓守護巨龍恢復原有的力量。\n\n問題在於，泰坦們現在分身乏術，而守護者提爾又逝世已久。\n\n雅立史卓莎女王提出一個計畫。荒蕪之地的地底深處有座泰坦設施，名為奧達曼。提爾的盟友似乎在那裡藏了一塊圓盤，裡面儲存著他的記憶。\n\n但據說那個地方已經被穴居怪佔據。請召集你的盟友前往奧達曼，為紅龍女王取回圓盤！', '', '', '', '', '', '', 47187),
(66457, 'zhTW', '結束藍色時期', '殺死藍鱗。', '燼牙全部都追隨一個巨大的蠻卒，我為他取名為藍鱗。他一直都是很兇猛的類型，不過他以前都會讓他的拾荒者手下不要到主要道路來。他們確實有領域性，可是敵意？那是最近才有的。\n\n藍鱗必須對這個突然升溫的情勢負責。找到他，然後把他打倒。', '', '燼牙的領袖。沒有什麼商量的餘地。', '藍鱗', '', '', '', 47187),
(66456, 'zhTW', '有毒的調色盤', '收集8個毒化長矛。', '我或許不太擅長我的工作，不過，至少在我學習怎麼做事時，我很認真在聽。每個有點本事的守道者都知道怎麼製作合格的解毒劑。我只需要足夠的毒藥來適當混合。\n\n諾里說，攻擊她的塔拉賽克拿著塗有這個的長矛。去找到他們，然後把他們的長矛拿來給我。如果我的直覺沒錯，我應該有辦法用矛尖的殘毒做出解毒劑。\n\n我只希望我們來得及。', '', '', '', '', '', '', 47187),
(66449, 'zhTW', '拯救幼龍行動', '拯救$1oa隻瀕危幼龍，同時消滅$2oa個灼爪鳳凰和縛灰者托那奇。', '喀拉希縛塵者正試著囚禁我們的幼龍。他們的領袖似乎打算利用他們做些邪惡的勾當。我們不能讓這種事發生！\n\n不過加拉登不是這裡唯一的敵人。鳳凰也在追蹤我們的幼龍，帶來了更多危險。\n\n你必須保護幼龍，剷除威脅他們的敵人。歐索莉亞會協助你。', '', '很危險的對手，擅長操控灰燼和煤煙。', '縛灰者托那查', '', '', '', 47187),
(66448, 'zhTW', '任性的道路守衛', '找到道路守衛艾薇。', '自我有記憶以來，道路守衛就開始為旅行者維護薩爪祖斯的道路安全了。這是一個我的家族世世代代都引以為榮的職責。\n\n哎呀，我的妹妹艾薇最近似乎對這個榮耀不感興趣。她每天早上都應該到這來向我報到的，可是我已經超過一天沒有她的消息了。\n\n如果你在東邊找到一頭做著白日夢的青銅龍獸，我請你引導她來見我。不然，我就得親自去找她了。', '', '', '', '', '', '', 47187),
(66447, 'zhTW', '屏障之後', '在生命寶庫遺跡中調查生命寶庫。', '既然屏障已經解除，我們就來探索密庫吧！', '', '', '', '', '', '', 47187),
(66445, 'zhTW', '榮耀逝者', '從加拉登身上取回以下東西。', '加拉登不屑一顧地褻瀆堡壘或我們族人的屍體！他們折斷死者的骨頭，還拿走他們的私人物品當成紀念品。\n\n這種惡行深深傷了每個驕傲黑龍的心。必須讓死者得到應有的榮耀。\n\n取回加拉登從戰死的屍體上奪走的物品。', '', '', '', '', '', '', 47187),
(66442, 'zhTW', '理論分析', '協助以元素球對生命寶庫遺跡的泰坦屏障進行測試。', '我們現在一共有四種元素球！讓我們來看看到底哪個假說才是對的。', '', '', '', '', '', '', 47187),
(66441, 'zhTW', '精煉努力', '到生命寶庫遺跡東方的洞穴殺死愛司奎恩。', '洪荒石之球是很有利的發現，不過艾卡蒂雅和泰夏拉針對屏障提出的假說相互衝突。\n\n我有我自己的假說。或許有了更多元素球後，真相就會更加清楚。\n\n有一個探險者在附近的洞穴中看到一個超大的水元素。擊敗那個水元素後，或許就能找到其他的元素球。', '', '斥候回報說，這個元素生物的尺寸正在迅速成長。', '愛司奎恩', '', '', '', 47187),
(66439, 'zhTW', '急速射擊計畫', '到角蛙谷，從洪荒部隊的成員身上收集洪荒烈焰碎片。', '元素之球，是嗎？既然有土元素的，那就一定有火元素的！\n\n角蛙巢穴附近的洪荒使者正在利用熔岩重塑整片土地。如果要說誰會對洪荒烈焰之球感興趣，非他們莫屬！\n\n把它們解決掉，看看能不能找到有用的線索！', '', '', '', '', '', '', 47187),
(66438, 'zhTW', '崇高的目標', '到角蛙谷找斥候利妥爾。', '空氣是非常強大的元素。它會切開岩石，吹動風帆，帶我們前往非去不可的地方。\n\n根據我的假設，想要解除這個屏障，空氣將會是最有效的媒介。做法很簡單，真的。\n\n我的斥候回報說，他們已經找到洪荒強風之球。斥候利妥爾可以帶你過去。他們目前駐紮在角蛙谷附近。快點出發！', '', '', '', '', '', '', 47187),
(66437, 'zhTW', '關鍵要素', '回到生命寶庫遺跡，將洪荒石之球交給元素師泰暘。', '<這個大地之球隨著能量釋放發出嗡鳴聲。>\n\n<元素師泰暘或許知道它的用途。>', '', '', '', '', '', '', 47187),
(66436, 'zhTW', '出土的麻煩精', '到生命寶庫遺跡殺死$1oa個土元素。', '土元素不只想把我們趕走，同時也在摧毀文物和設備！彷彿它們被指示要摧毀跟泰坦相關的一切…\n\n我們暫時抵擋住它們的攻勢了，但只要它們還在，我們的研究就無法進行下去。請你幫我們擊退它們，我們才有探索的空間！', '', '', '', '', '', '', 47187),
(66435, 'zhTW', '拯救據點', '到生命寶庫遺跡救出$1oa個受困的探險者。', '我身為薩滿跟許多元素合作過，但我從未遇過這麼有攻擊性的元素生物！\n\n遠征隊在這裡發現了泰坦遺址，不過有個屏障把內廳封鎖起來。在我們試著要消除屏障時，我想我們觸發了某種保全系統…憤怒的元素生物突然到處都是！\n\n在那些元素生物攻擊時，很多探險者都還在挖掘場工作。許多人都被困住了，但裡面沒有人是戰士。\n\n請你到挖掘場去，協助他們撤退！', '', '', '', '', '', '', 47187),
(66429, 'zhTW', '我會記住', '在荒僻營地外和瑞南會面。', '我…我需要一點時間，拜託。\n\n回到荒僻營地去吧，$p。我在那和你會合。', '', '', '', '', '', '', 47187),
(66428, 'zhTW', '理所當然的友誼', '使用R.A.D.D.E.R.E.R解除秘法屏障。', '好了！R.A.D.D.E.R.E.R已經校正完成，隨時可以使用…由你來用！\n\n為什麼不是我來用呢？非常簡單！\n\n你必須想像跟考慮所有的可能性才行。\n\n我們假設它爆炸好了。如果我受傷、昏迷或死亡，誰會去修好它呢？你能想像嗎？\n\n去吧，解除屏障，我們才能回到營地把拉索斯治好。我負責…遠距離觀測。', '', '', '', '', '', '', 47187),
(66427, 'zhTW', '迫近的威脅', '殺死莎瓏。', '秘法對我造成的傷害無法在戰場上治好。我的傷勢太嚴重，恐怕無法進行戰鬥。\n\n$n，我需要請你再幫我一個忙。\n\n你必須找到莎瓏，並且阻止她，別讓更多控制臺超載。\n\n這麼做可以為瑞南爭取到一點寶貴時間，讓他校正R.A.D…還是R.A.D.D.E.R…隨便他現在叫什麼。\n\n或許這樣能阻止碎裂火焰軍的計謀。', '', '任何事物都無法阻止碎裂火焰軍的首領將卡恩薩爾廢墟的力量收為己用。', '秘法操縱者莎瓏', '', '', '', 47187),
(66426, 'zhTW', '沒時間了', '抵達東塔。', '我感覺得到，正當我們說話的時候，秘法波動也在加劇。\n\n我懷疑過不了多久，廢墟就會讓瑞南的J.A.M.看起來像是夜空中遙遠的一顆星。\n\n我們必須去那裡阻止它發生。\n\n$p，請小心一點。\n\n到東塔跟我們會合。我們到那裡再評估現況。', '', '', '', '', '', '在東邊高塔旁與瑞南和拉索斯碰面。', 47187),
(66425, 'zhTW', '秘法超載', '協助瑞南驅除秘法氣泡。', '好了！完成了！\n\n讓我為你獻上…R.A.D.D.E.R！\n\n登、登、登！\n\n我把它和巨龍控制臺周圍的能量校對到同個頻率，而且刻上了驅散魔法的雕紋。\n\nR.A.D.D.E.R.可以驅散秘法能量並關閉巨龍控制臺，可是雕紋在每次使用後都會減弱。\n\n是不是很方便啊？\n\n在我們附近，我一共偵測到四個控制臺。去把它們關了！', '', '', '', '', '', '', 47187),
(66423, 'zhTW', '擔憂與證實', '找出關於廢墟來歷的線索。', '這些碎裂火焰軍的死，再一次證明卡恩薩爾廢墟有多麼危險。\n\n不過，瑞南認為，對R.A.D.進行一些調整後，應該還是可以壓制這裡的能量。\n\n但這樣做，還是治標不治本。\n\n在廢墟中尋找線索，看看你能不能分辨出它們原有的功能。盡量快點，$n。我們的時間恐怕不多了。', '', '', '', '', '', '', 47187),
(66422, 'zhTW', '探險繼續進行！', '在高塔旁與瑞南和拉索斯碰面。', '古老的遺跡、動機不明的組織，還有瑞南的R.A.D和它的分析…\n\n這一切都讓我的探險者之魂蠢蠢欲動。\n\n我們必須進一步調查這裡出了什麼事。\n\n南邊有階梯可以通往塔頂，我們應該去一探究竟。', '', '', '', '', '', '', 47187),
(66421, 'zhTW', '風暴裂口', '', '', '', '', '', '', '', '', 47187),
(66419, 'zhTW', '效忠一主', '', '', '', '', '', '', '', '', 47187),
(66412, 'zhTW', '請繼續，巴席爾頓', '在花園裡和巴席爾頓談話。', '在你離開之前，我這頭老龍獸還有一件事情想拜託你。\n\n當年巴席爾頓領主和我初次相遇的時候，我們會一起進行各式各樣的冒險。我覺得這就是他走失的原因，因為他想念冒險的感覺。\n\n我現在沒辦法帶他這樣做了。但是你可以！我看得出來，你可以帶他去看我連作夢都沒想過的地方。\n\n不過，我們是應該先問問巴席爾頓的意思。', '', '', '', '', '', '', 47187),
(66391, 'zhTW', '朝廢墟出發！', '在卡恩薩爾廢墟和瑞南及拉索斯會面。', '你有興趣聽我介紹我發明的R.A.D嗎？沒有？\n\n不管怎樣，我還是要說—因為它發現了一些東西。\n\n今天，它偵測到卡恩薩爾廢墟有秘法能量的巨大脈衝。拉索斯認為這是碎裂火焰軍搞的鬼。這是展示R.A.D.的完美機會！\n\n要一起來嗎？一定會很精彩的。', '', '', '', '', '', '', 47187),
(66369, 'zhTW', '大地結界', '啟動大地結界。', '我已經使用你收集的戒指強化了一個結界。它收集了附近土地上的石頭，創造出一個活生生的土靈防衛者來保護這個領地。\n\n去測試一下大地結界，確保結界正常運作。', '', '', '', '', '', '', 47187),
(66368, 'zhTW', '風暴中的島嶼', '除掉$1oa個熾炎靈體和熔融者伊格涅斯。', '休息的時間少之又少，元素生物的威脅卻永不停歇！\n\n真希望能稍微休息一下，讓我能夠製作更多結界，加強我們的防禦。\n\n請盡你所能，減少外圍地區受到的攻擊。', '', '', '熔融者伊格涅斯', '', '', '', 47187),
(66364, 'zhTW', '放風箏', '從巨龍群島的各種元龍身上收集10個新鮮的元龍翼，交給伊斯凱拉巨牙海民的天納宇。', '讓我跟你說一個機會吧。\n\n元龍的翅膀有驚人的運動範圍，而且牠們的翼骨啊，伸縮範圍非常廣！我們通常會使用繃緊的皮革來做風箏。既然元龍到處造成災情，不知道你可不可以把牠們的翅膀帶來給我？這樣我就可以做出讓全族羨慕的風箏。', '', '', '', '', '', '', 47187),
(66363, 'zhTW', '石化蜥蜴扣環', '從巨龍群島的蜥蜴身上收集20個堅硬鱗皮，交給莫魯克半人馬的杜瑞娥。', '相連的鱗片是阻止箭頭的關鍵。我們做的圓盾是整個平原最好的，可是我的蜥蜴皮不夠用了，無法完成下一個訂單。\n\n我看你對我們的手藝很有興趣。在巨龍群島收集蜥蜴的皮，我願意幫你說明我們的工藝訣竅。', '', '', '', '', '', '', 47187),
(66356, 'zhTW', '鐵樹', '', '', '', '', '', '', '', '', 47187),
(66354, 'zhTW', '點燃爐火', '重組受損的誓言石碎片。', '熔爐已經就緒。現在只差爐火。\n\n把受損的誓言石碎片放在熔爐上，怒西昂會點燃火花，開始重組過程。', '', '', '', '', '', '', 47187),
(66353, 'zhTW', 'R.A.D.異象', '使用R.A.D.驅散三個秘法異象。', '這裡有超級龐大的秘法能量…\n\n但是！R.A.D.可以幫上忙！它是超讚的裝置，就像它的名字一樣：「瑞南的超讚裝置」！它可以偵測並驅散秘法能量。\n\n來…拿著它！你感覺到手中的無窮力量了嗎？沒有？\n\n好吧，裝置交給你了，帶著它去驅散那些異象吧！', '', '', '', '', '', '', 47187),
(66352, 'zhTW', '敵人的情報', '找到碎裂火焰的文件，然後交給拉索斯。', '我們必須判斷碎裂火焰軍來這些廢墟的目的，以及它如何跟秘法波動產生關聯。\n\n我們會用老方法來做到這點：偵察和滲透。\n\n廢墟裡到處都是碎裂火焰軍的狂信者，他們某些成員身上一定有命令文件，說明他們神秘的目的。\n\n採取一切必要手段，取得那些文件。', '', '', '', '', '', '', 47187),
(66351, 'zhTW', '山峰上的煙霧', '找到探路者伊普思的飛機。', '<探路者傑布看向營地外的山峰，同時嗅了嗅。>\n\n我不喜歡這樣。探路者伊普思幾天前就應該到這裡了。他早就該來協助我，和我一起教導這群新人怎麼安全攀爬石柱的。\n\n現在我又看到遠處有煙。\n\n我一點都不喜歡這樣。', '', '', '', '', '', '', 47187),
(66349, 'zhTW', '訓練石頭', '移除$1oa顆岩石', '移除這些岩石！', '', '', '', '', '', '', 47187),
(66344, 'zhTW', '乘風飛去', '與蓋瑞瑟斯和麥琳瑟拉同行。', '所以說，洪荒使者和諾庫德氏族結盟來擴大他們的勢力。\n\n我們在這之前都成功地抵擋了洪荒使者的攻擊，可是諾庫德族帶來了新武器：屠龍弩砲。蘇列瑟斯恐怕不會是最後一頭遭到這武器的邪惡風暴魔法所害的龍。\n\n來吧。我會把你帶到巨龍休息的林蔭聖所去。在大可汗瑪托拉召集她的部隊前，你可以跟我說你對諾庫德族有什麼了解，我們得準備好下一步。', '', '', '', '', '', '', 47187),
(66340, 'zhTW', '進入蒼藍', '在叉河路口與『智者』瑪蘇德會面。', '我們已經做了我們該做的。不過我必須留在這裡，觀察誓言石的情況，並領導綠龍軍團，請帶著我們的感恩和信賴踏上旅途。\n\n只要朝南走，就能在蒼藍高地找到藍龍軍團。請協助他們復原他們的誓言石，這樣我們距離治癒艾澤拉斯就又更近一步了。\n\n去找祈倫托的帕奇娜和『智者』瑪蘇德。他們會提供進一步指示。祝你旅途平安，夜夜好夢，$n。', '', '', '', '', '', '', 47187),
(66339, 'zhTW', '諾庫德進攻據點：風屬於天空', '到諾庫德進攻據點擊敗巴拉卡可汗，並救出雍亞拉。', '$n，你要告別了嗎？還是你願意再幫我們一次？\n\n我的斥候回報說，巴拉卡已經撤退到他的城塞，雍亞拉就是被他囚禁在那裡。簡直天理不容！\n\n在此同時，他的諾庫德劫掠者傾巢而出，在平原上到處製造混亂。我們跟劫掠者交戰的時候，你可以趁機潛入諾庫德城塞、救出雍亞拉。你意下如何？', '', '', '', '', '', '', 47187),
(66337, 'zhTW', '破颶者', '擊敗科蘿洛絲。', '$n，來我這裡！勝利近在眼前！\n\n洪荒使者已經潰不成軍，看來大勢已去。一切戰果是否會化為泡影，全取決於我們與洪荒使者首領科蘿洛絲之間的最後一戰。\n\n該為一切畫下句點了，我們一起並肩作戰。出擊吧，$G兄弟:姐妹;！', '', '這個洪荒使者的首領企圖毀滅綠龍的聖所。', '科蘿洛絲', '', '', '', 47187),
(66336, 'zhTW', '翡翠之島', '到遠古枝幹與麥琳瑟拉會面。', '我沒有忽略你在這其中的貢獻，凡人。我們能夠成功擊敗洪荒使者，你的勇猛占了很大的功勞。\n\n我已經邀請了半人馬到遠古枝幹下加入我。我們歡迎你以及大可汗瑪托拉與她的人民進入我們的家園。\n\n沿著這條路徑，穿越橫跨水面的拱門，進入另一邊的樹林。我會在那邊等你。', '', '', '', '', '', '', 47187),
(66335, 'zhTW', '瓦解額外的水晶塔', '使用附魔種子標記洪荒使者水晶塔。', '在摧毀那些邪惡武器後，綠龍軍團終於可以正式出擊了。\n\n我們比較熟悉地面上的狀況。我們需要標示目標，好讓麥琳瑟拉和巨龍能從上面攻擊。\n\n麥琳瑟拉給了我這些附魔種子。把它們放在洪荒使者水晶塔附近。我們會用它們的光線來指引飛天巨龍的攻擊。', '', '', '', '', '', '', 47187),
(66333, 'zhTW', '為蘇列瑟斯討回公道', '殺死$1oa個諾庫德好戰者並摧毀$2oa個屠龍弩砲。', '只要有一隻綠龍還沒斷氣，這些洪荒使者就別想輕鬆染指遠古枝幹。\n\n我們迫不及待想加入這場戰鬥，但是，只要那些屠龍弩砲還在戰場上，我們就無法出擊。現在有諾庫德最強悍的戰士在看守弩砲，所以你也得去打倒那些戰士。\n\n請解決那些弩砲和諾庫德好戰者。消除這個威脅，那麼綠龍就能扭轉頹勢。', '', '', '', '', '', '', 47187),
(66331, 'zhTW', '洪荒使者前線', '在風暴裂口和斥候托姆爾、亞莉及蓓莉卡、雍‧賽希騰以及麥琳瑟拉談話。', '大可汗瑪托拉捎來消息說，她和她的部隊已經抵達翡翠花園了。他們已經找到科蘿洛絲和她的洪荒使者。看來大量的敵人正在北方的海灘上集結並準備入侵。\n\n明智的她派了許多斥候監視著戰場附近的戰略地點。去收集他們的報告，然後到前線和我與部隊會合。在戰鬥中爭取榮耀，在勝利後報仇雪恨。', '', '', '', '', '', '', 47187),
(66329, 'zhTW', '吹響號角', '見證巴拉卡和科蘿洛絲的計畫。', '他們為什麼會把雍亞拉帶來這裡？除非…\n\n$n！我不認為巴拉卡打算摧毀號角。我覺得這是陷阱！我們必須想辦法穿過這陣風，要快點！', '', '', '', '', '', '', 47187),
(66328, 'zhTW', '綠龍有難', '在水池和大可汗瑪托拉會面。', '那些龍往下落到平原的西邊去了。我們必須搶在諾庫德族前找到他們。\n\n我們可不希望巴拉卡的行為讓他們覺得所有的莫魯克人都是敵人。', '', '', '', '', '', '', 47187),
(66327, 'zhTW', '追風', '聽取斥候托姆爾的報告。', '我們必須暫停一下，思考我們的戰略。\n\n我們需要雍亞拉的祝福，才能吹響德魯沙之角來召喚綠龍。沒有他們的援助，我們無法打贏這場戰。諾庫德族的數量已經比其他氏族多了，現在他們的勢力又得到洪荒使者的加持。而且現在科蘿洛絲還抓了我們的疾風之母！因此，在諾庫德族發起最後攻擊並包圍莫魯凱前，我們必須找到雍亞拉。\n\n我會立刻派所有的斥候出去。我只希望我們能及時找到她。', '', '', '', '', '', '', 47187),
(66326, 'zhTW', '工欲善其事', '收集$4oa個精準鱗片重錘、$3oa個黑曜丁字砧、$2oa把黑鋼鉗和$1oa個龍爪衝床。', '這種火力的熔爐需要能夠承受高度熱能的特殊工具。\n\n但加拉登把這個地方搜刮一空，偷走很多我們工作所需的工具。\n\n可以的話，請從他們身上取回這些工具，好讓我們繼續為盟友打造武裝。', '', '', '', '', '', '', 47187),
(66324, 'zhTW', '永遠銘記', '從支援育所內帶回物品和倖存者。', '解毒劑準備好了，快帶去找支援育所的倖存者。動作快點，因為藥效無法持續太久，你可能需要重新補充。\n\n如果對方還有呼吸，請救救他們。\n\n如果已經斷氣，就請你回收他們的犄角璽戒，讓後人能夠緬懷他們。\n\n在裡面的時候，你或許能發現相關證據，指出發生這個慘況的原因。', '', '', '', '', '', '', 47187),
(66320, 'zhTW', '時間的流動', '前往時光沙地和克羅米交談。', '時間的流動就像河水，有彎彎曲曲的河道與支流，而且有時候它的流向也是可以改變的。但是，任何未解決的異象也都可能害我們的命運走偏、導向錯誤的時間線。\n\n我們正在快速接近一個這樣的異象。我已經派克羅諾穆到時光沙地，調查與糾正可能會干擾真實時間線的問題。\n\n而且我預見，你的協助會極為寶貴。\n\n請出手協助我們，和克羅諾穆會面。', '', '', '', '', '', '', 47187),
(66308, 'zhTW', '助長火焰', '收集$1oa個灰燼裂片煤炭。', '透過大地守護者的熔爐打造的新武器和護甲，將會確保我們在與加拉登的戰爭中，取得最終的勝利。\n\n不過我們必須持續為熔爐的烈焰添加燃料。灰燼裂片煤炭能提供最強的火力，在鑄造武器時不可或缺。\n\n你可以從灰燼裂片地層的礦床和元素生物身上取得灰燼裂片煤炭。', '', '', '', '', '', '', 47187),
(66299, 'zhTW', '期待的炸蛋', '殺死嘯翔巢母。', '我們的原型成功了！太棒了！\n\n現在該上主菜了。而且這一次，你就是主廚。\n\n只要一些必要的調整，你就可以再次穿上偽裝。然後，你就要把我們的傑作「炸蛋」泡在這個腐臭的燉菜，再到上頭的巢母洞穴，把它裝盤擺放好，然後滑翔下來，引發身後的爆炸！\n\n如果一切都照計畫，她一定會被烤熟的。因為爆炸的緣故。爆炸會把她燒到烤熟。', '', '隱居的嘯翔鷹身人巢母！能否請你用啾諷的炸藥、或是你自己的血肉來滿足她貪婪的食慾？', '巢母阿維提拉，嘯翔鷹身人的領袖', '', '', '', 47187),
(66279, 'zhTW', '初來乍到', '把懷錶帶去花園交給奧力茲姆。', '不過沒錯，這個懷錶屬於其中一個幫我照顧花園的管家。\n\n他是諾茲多姆的同族。好像叫奧力茲姆？這些孩子我老是記不清楚他們的名字。他大部分時間都站在雅立史卓莎的樹旁邊的沙漏那裡。一動也不動，連眼都不眨。\n\n要我說啊，我覺得諾茲多姆他們那族的成員都很奇怪。不過，要是你把這拿去給他的話，他應該會很感激的。', '', '', '', '', '', '把懷錶帶去花園交給奧力茲姆。', 47187),
(66278, 'zhTW', '一個龍獸的廢物', '把懷錶帶去花園交給古爾佩奇。', '<許多的垃圾堆中躺著一個閃閃發光的懷表。或許古爾佩奇會知道該怎麼做。>', '', '', '', '', '', '把懷錶帶去花園交給古爾佩奇。', 47187),
(66270, 'zhTW', '痛扁豺狼人', '擊敗潛在督軍。', '噢，聖光啊…還有更多！怎麼會發生這種事？\n\n我縝密計畫了那麼多！在這座腐臭的湖躲藏了那麼久！安排那麼多暗殺！\n\n這本來應該讓他們陷入混亂、使他們的聚落瓦解的，但我們連拖延時間都稱不上！\n\n或許…或許你說的對，$n。我一直以來都做錯了…\n\n不！這不可能！反正我們現在來不及回頭了。\n\n去吧…處理這些新冒出來的傢伙。我需要時間整理思緒。', '', '', '', '', '', '', 47187),
(66269, 'zhTW', '保險起見', '殺死$1oa個風牙元素師。', '只要…殺死任何看起來像是有魔法的傢伙就好。或是有組織能力的。或是看起來野心太大的。\n\n說真的，這一次就交給你自己判斷了。\n\n你「自己判斷」就是不要再跟我說話？別鬧了，$c！他們…很顯然在策畫邪惡的計謀！', '', '', '', '', '', '', 47187),
(66268, 'zhTW', '神奇的第三次', '殺死血爪。', '什麼？又有一個掌權了？為什麼就這麼厭惡空窗？至少也等一段哀悼的時間以表尊重，表面上做做樣子才對吧？\n\n難道他們沒有禮儀嗎？不懂分寸嗎？不會尊重精心打造的計畫嗎？我還做了圖表耶！\n\n去處理這個叫血爪的傢伙。我需要冷靜一下。\n\n別在一旁冷嘲熱諷，謝謝！', '', '是誰死了讓他當上領軍的？', '血爪', '', '', '', 47187),
(66267, 'zhTW', 'M.E.T.A.', '釋放$1oa隻受虐動物。', '那些惡魔！劫掠和謀殺是一回事，但是虐待動物？我無法忍受。\n\n豺狼人設置了陷阱，要捕捉動物來餵給他們那些口水直流的土狼。想辦法放走那些毛茸茸的俘虜，讓這些無賴見識一下，法師是怎麼道德對待動物的！\n\n考慮到我最近的行動，這當然還是符合道德規範啦。你到底想要暗示什麼？', '', '', '', '', '', '', 47187),
(66266, 'zhTW', '骯髒的雜種', '殺死$1oa隻土狼族母和$2oa隻雜種土狼。', '那些豺狼人培育的的骯髒雜種土狼必須消失！牠們一點修養也沒有…你不會相信我曾經看過牠們在哪裡排泄…而且儘管我的幻象非常完美，牠們可能還是嗅得出我的位置。\n\n幫這個有修養的世界一個忙，讓牠們從這世界上消失吧。', '', '', '', '', '', '', 47187),
(66265, 'zhTW', '下一個是誰？', '殺死碎牙。', '啊哈！好啊，看來有另一個豺狼人站出來發號施令了。完全如我所料。對。\n\n讓一個能夠信賴的副督軍來確保政權的延續，似乎非常合理，對吧？我們只能再加把勁打擊他們，把他們的官僚體制搞垮，是吧？\n\n什麼？我該用這個機會來反思，我是不是太快就批判這些豺狼人？荒唐！他們可是豺狼人啊！\n\n快點快點！殺死碎牙，打鐵要趁熱，不然他們可能就要舉辦選舉了！', '', '一個豺狼人到底能養幾隻土狼啊？', '碎牙', '', '', '', 47187),
(66264, 'zhTW', '繳械且溫馴', '取得$1oa個嚙骨武裝。', '說實在，在上面那裡有太多武器被拿來揮來揮去了。把一些武器拿走應該能讓整個狀況平靜下來。至少我的神經會平靜一點。\n\n畢竟沒了武器他們還能怎麼做？空手攻擊你嗎？哈！', '', '', '', '', '', '', 47187),
(66263, 'zhTW', '精準的做法', '殺死剝拳。', '豺狼人是很糟糕的生物。很臭。總是在抓癢和嘲笑你。這裡有一整群，而且還有更多一直來。你就算把他們當麥子一樣收割個好幾天，都沒辦法減少數量。他們在這裡沒人受得了。\n\n我們必須直搗問題的核心！殺死他們的領袖，他們就會因為失去方向陷入絕望、動彈不得了。\n\n你問我們這麼做的理由是什麼意思？不是很明顯嗎？他們可是豺狼人啊！還需要其他理由嗎？', '', '少了他們敬愛的領袖，他們還能有多少機會呢？', '剝拳', '', '', '', 47187),
(66262, 'zhTW', '汙水清理', '從湖中清除$1oa個腐物堆。', '首要任務：我們需要把我的作戰基地奪回來！這裡有這麼多元素生物在亂竄，讓人連找個立足點都很困難。\n\n這都是那些卑鄙豺狼人的錯。\n\n豺狼人把好多垃圾、臟器和聖光才知道什麼鬼東西丟進河裡，當地的元素生物都是因為這樣才暴動。\n\n請你好心幫忙清理一些最噁心的髒東西，別讓情況變得無法收拾。最重要的是要趕在我的長袍沾上洗不掉的汙漬之前！', '', '', '', '', '', '', 47187),
(66261, 'zhTW', '一個小挫折', '找到戴崔。', '啊，冒險者！你正是我希望能遇見的全副武裝的流浪戰士。\n\n我來到這個荒煙漫草的地方是為了處理重要的祈倫托業務。在開始設置營地的時候，我卻被骯髒粗魯的豺狼人追趕了。\n\n事實上，這附近聚集的豺狼人多到堪憂。數量夠多的話，就會威脅到整個高地。\n\n但是不用擔心，因為我有一個計畫！到那邊的湖跟我會合，我會解釋一切給你聽。', '', '', '', '', '', '', 47187),
(66259, 'zhTW', '壞消息風暴', '去向莫魯凱的大可汗瑪托拉報告。', '$n，我們需要把發生的事都告訴大可汗瑪托拉，包含雍亞拉被捉的事。\n\n你必須盡快趕去莫魯凱。你得自己過去。我在墜落時受了傷，只會拖累你。\n\n不用擔心我。我之後會趕上的。去吧！', '', '', '', '', '', '', 47187),
(66258, 'zhTW', '喔不，雍亞拉！', '在波庫試圖釋放雍亞拉時，擊敗來犯的敵人。', '洪荒使者正在束縛雍亞拉，但效果有限。她似乎沒有注意到我們。\n\n提迦里可汗會說：「就連微風都能推倒搖搖欲墜的石頭。」如果我可以稍微干擾她的法術，雍亞拉可能就會有辦法掙脫。\n\n我有個主意，你去讓守衛分心。', '', '', '', '', '', '', 47187),
(66257, 'zhTW', '邪惡巫術', '使用波庫的風圖騰來摧毀諾庫德貨車。', '據說，雍亞拉將自己的力量注入了我們的祖先莫魯克長矛之中。巴拉卡可汗一定把這個傳說跟洪荒使者說了。\n\n他們從雍亞拉的孩子身上偷走了魔法，用風暴妖術汙染了它，再把它注入弩箭之中。為什麼諾庫德族會需要這樣的武器？\n\n我們不能放任他們去用這武器。他們把這些風暴之箭放到貨車上進行運輸。把我的圖騰拿去，遇到貨車的話就放一個上去。我的風魔法會把它們擊成碎片。', '', '', '', '', '', '', 47187),
(66256, 'zhTW', '一視同鷹', '在風頌高地釋放$1oa個雍亞拉之子並擊殺$2oa個洪荒使者。', '我們已經發現諾庫德族收集秘法圖騰的原因了。他們用圖騰來困住雍亞拉之子。雖然諾庫德族是出力的人，不過洪荒使者才是這個瀆神之舉的指使者。\n\n雍亞拉之子是我們最神聖的歐胡納鷹，是受過疾風之母親自祝福的。$n，請你釋放所有你找到的歐胡納鷹！然後，如果你遇到任何洪荒使者…\n\n<波庫話沒有說完，但他的表情帶著冷酷的決心。>', '', '', '', '', '', '', 47187),
(66254, 'zhTW', '悲觀秘法師', '把強化圖騰放在波庫周圍。', '戰爭？巨龍？你需要我連絡雍亞拉？\n\n我做不到！我完全聽不到雍亞拉。我只是名學徒，而雍亞拉似乎把我身上的祝福收回去了。或許是我不夠優秀…\n\n<波庫開始翻找他的包包。>\n\n在我的導師指派我到這個氏族來時，她把這些小圖騰贈與給我。她說如果我有一天懷疑自己，它們就會給我力量。\n\n你願意幫我放置圖騰嗎？我要再呼喚雍亞拉一次。', '', '', '', '', '', '', 47187),
(66252, 'zhTW', '報到', '返回沃卓肯並向卓萊恩隊長回報。', '洪荒使者的威脅已經得到削弱，$n。來自沃卓肯的部隊很快就會進去，清除殘留的餘黨。\n\n你應該回到城裡，把剛才發生的事通知卓萊恩隊長。她會有興趣知道這裡和伊拉諾格指揮官的事。\n\n再次感謝你所做的一切，$n。', '', '', '', '', '', '', 47187),
(66251, 'zhTW', '滅火鬥士', '殺死熔岩爪。', '伊拉諾格指揮官背叛了我們，任憑這頭野獸為所欲為。\n\n你已經幫了我許多忙，可是以我目前的情況，我實在沒辦法應付那頭怪物。\n\n拜託，再幫我最後一個忙，確保鎮南要塞的大門不會落入洪荒使者的手中。\n\n我們必須殺死他們的領袖！\n\n$n，請你幫幫我。', '', '攻擊鎮南要塞大門的洪荒使者領袖。', '熔岩爪', '', '', '', 47187),
(66250, 'zhTW', '長官在哪裡？', '在鎮南要塞大門陪伴守護者維洛米爾並檢視暸望塔。', '$n，堡壘只剩這裡我們還沒搜索過。如果伊拉諾格指揮官還活著，肯定就在這邊。\n\n<維洛米爾望向附近的門口。>\n\n我們走吧，去看看到底是什麼狀況。', '', '', '', '', '', '', 47187),
(66249, 'zhTW', '掃蕩天空', '操控攻城蠍，擊落空中的熔誓真裔。', '你做得很好，收集到這些長矛和繩索。有了它們，就可以確保那些傲慢的洪荒使者不再霸佔天空！\n\n樓梯上方有個平台，上面有好幾個攻城蠍。綁上繩索當弓弦、長矛當箭矢，應該就可以把那些熔誓者的龍從空中打下來！\n\n這樣就能清出一條安全通往塔上的路，讓我們繼續搜尋伊拉諾格指揮官的下落。', '', '', '', '', '', '在鎮南要塞大門的暸望塔上和守護者維洛米爾會面。', 47187),
(66248, 'zhTW', '綑綁在一起', '收集$1oa個沉重繩索。', '這捆沉重的繩索看起來狀況很好。\n\n守護者維洛米爾說過要留意有用的材料。也許你可以再找幾捆過來，他可能會用得上。', '', '', '', '', '', '', 47187),
(66247, 'zhTW', '稍微使用過的武器', '收集$1oa個熔誓長矛。', '這把長矛的前任主人已經不行了，但是長矛本身的狀況倒還不錯。\n\n守護者維洛米爾說，要留意任何有用的資源。或許你可以從熔誓者那裡多取得幾支這樣的長矛。', '', '', '', '', '', '', 47187),
(66246, 'zhTW', '戰爭迷霧', '在鎮南要塞大門尋找守護者維洛米爾的小隊成員。', '洪荒使者毫無預警，突然發動攻擊。我的小隊想要聯絡伊拉諾格指揮官，但我們還沒抵達要塞的另一側就被攔截了。\n\n戰鬥相當激烈，我的領隊塔里克士官獨自對付三位洪荒使者，而卡歐拉、米寇爾和我則在他身邊跟別的敵人戰鬥。\n\n在我倒下之前，慘叫是我最後聽到的聲響。\n\n拜託你，$r。要是你看到我的小隊成員，讓我知道他們出了什麼事。', '', '', '', '', '', '', 47187),
(66245, 'zhTW', '勿忘亡者', '收集$1oa個鎮南要塞璽戒。', '我有好多同袍戰死了。\n\n拜託…幫忙收集可供辨識身分的璽戒，這樣他們的名字才不會被遺忘。', '', '', '', '', '', '', 47187),
(66244, 'zhTW', '前往沃卓肯', '前往沃卓肯，並與『生命守縛者』雅立史卓莎會面。', '多虧有你，我們才能驚險地避開一場大災難。\n\n不過，我們應該和其他守護巨龍會商、跟大家分享這裡發生的事。\n\n請在沃卓肯內的守護巨龍之座與我會面。菈薩葛絲和她的洪荒使者打算做什麼，我很肯定其他人會有他們的見解。\n\n這裡的北部偏東有個通往薩爪祖斯的岔口。這趟飛行的景色很優美，但別耽擱太久了。', '', '', '', '', '', '', 47187),
(66242, 'zhTW', '天氣控制', '殺死$1oa個颶縛精華和$2oa個風暴召喚者學徒。', '這個不自然的風暴充滿魔法。這樣看來，諾庫德在學習操控風頌高地的神聖精華來製造風暴元素。有些人的成果斐然，比起其他人…\n\n<波庫指向附近可憐的諾庫德學徒，他因為閃電灼傷依然冒著煙。>\n\n$n，我們不能讓他們繼續這樣。', '', '', '', '', '', '', 47187),
(66241, 'zhTW', '薩爪祖斯拉力賽', '', '飛行穿過標記賽道路線的檢查環。', '', '', '', '', '', '', 47187),
(66239, 'zhTW', '散播腐朽', '去貿易哨站見布蕾娜。', '<布蕾娜用她厚厚的手不斷翻轉著卡格波的圖騰。>\n\n卡格波只是棋子。他不是這個腐敗的根源。在腐朽之息進一步擴散前，我們必須找到它。\n\n最靠近這裡的巨牙海民是個貿易哨站，過了往伊斯凱拉的那座橋就是了。\n\n我們應該去跟他們確認一下…而且要快。', '', '', '', '', '', '', 47187),
(66237, 'zhTW', '精神上的盟友', '與指揮官交談。', '我們出現在此，一定會引人注目。\n\n在進去之前，先讓我跟他們談談。我認識一些議會成員。\n\n之後有機會再介紹給你們認識。', '', '', '', '', '', '', 47187),
(66236, 'zhTW', '捕風', '到風頌高地與波庫會面。', '諾庫德族在收集圖騰。洪荒使者在捕捉歐胡納鷹。而雍亞拉也陷入沉默。\n\n無論諾庫德族的計畫是什麼，我們必須阻止他們。你和波庫要到風頌高地去。我們的敵人很有可能已經在那了。\n\n到那裡去尋找雍亞拉。如果她的子民身處險境，她一定會前去找他們，而我們必須幫忙。疾風之母非常強大，但我害怕洪荒使者的能耐。', '', '', '', '', '', '到風頌高地與波庫會面', 47187),
(66232, 'zhTW', '到鹽為止', '在戈洛克海岸收集$1oa塊水晶薄片。', '雖然沒人問，但我們不介意在我們的小地方招待你和你的朋友，不過你願不願意當個好鄰居，在你去溫泉的時候幫我帶回一些水晶薄片呢？水晶薄片能讓我們保存各種東西。這是這一帶保存食物的重要方法。\n\n比較大隻的戈洛克身上都蓋滿了這種東西。或許你能從他們身上拿一些回來？', '', '', '', '', '', '', 47187),
(66230, 'zhTW', '速寫要求', '取回艾薇的「分類帳」並交還給道路守衛艾薇。', '塔拉賽克奪走了他們的利爪能拿到的所有東西，包含我的偵查分類帳。\n\n這些體型過大的蜥蜴會大量囤積飾品和戰利品。我敢說他們把我的分類帳藏到某個地方去了。在你通過關口時，可不可以順便幫我找找? \n\n噢，還有$n？如果你真的找到了，請不要看裡面。裡面的內容有點…私人。', '', '', '', '', '', '', 47187),
(66228, 'zhTW', '安東尼達斯營地', '在安東尼達斯營地與全憶者諾麗可會面。', '祈倫托已經在這裡的南邊設立主要營地，叫做安東尼達斯營地。\n\n諾麗可和卡德加目前都在那裡，他們在召募願意協助卡雷苟斯復原蒼藍誓言石的冒險者。\n\n如果你有意助我們一臂之力，請去那裡一趟。', '', '', '', '', '', '在安東尼達斯營地與全憶者諾麗可會面。', 47187),
(66227, 'zhTW', '好好釣魚', '在庫瑞的釣場釣到$3oa尾藍尾小鯉。', '又來了一個幫手！我需要幫忙補到足夠的魚好帶回家做飯。\n\n祈倫托的人似乎很擔心那些稱為魔法異象的東西…天曉得那是什麼。\n\n不過只要你努力貢獻自己的力量，這裡永遠歡迎你們。\n\n拿起魚竿開始釣魚。幫手一多事情就簡單了！', '', '', '', '', '', '', 47187),
(66226, 'zhTW', '情感支持夥伴', '到嶺水靜地，從諾庫德手中救出可憐的生物。', '請別傷害我…\n\n什麼？你是來幫忙的？你得救救那些動物！\n\n諾庫德無預警地攻擊了我們。我們全都拚命地逃跑！我跳進湖中，驚險地躲過一劫。\n\n那些動物！牠們被我們留在原地。拜託，我求求你，拯救那些動物。誰知道諾庫德會用什麼樣的殘忍方式對待牠們呢。', '', '', '', '', '', '', 47187),
(66225, 'zhTW', '搬運圖騰', '在嶺水靜地向諾庫德族取回$1oa個圖騰。', '波庫問我為什麼要捎訊息召喚所有的秘法師到嶺水靜地去。\n\n但我沒有送出這樣的訊息。巴拉卡故意把我的秘法師引入陷阱中，要打擊雍伊爾氏族。\n\n不過也可能有其他原因。諾庫德族在收集所有他們能取得的秘法圖騰。這些圖騰受過雍亞拉的祝福。\n\n諾庫德這麼做的動機依然不明，但我們不能讓他們奪走雍亞拉的贈禮。盡你所能奪回越多圖騰越好。', '', '', '', '', '', '', 47187),
(66224, 'zhTW', '神秘的秘法師', '和波庫會面並前往嶺水靜地。', '很抱歉，我對雍亞拉的通靈失敗了。你需要找別人來完成大可汗瑪托拉的要求。\n\n幾天前，我的秘法師同行收到提迦里可汗的緊急召喚，都到嶺水靜地去了。他們應該還在那裡。\n\n到城鎮的外側見我。至少我能為你帶路。', '', '', '', '', '', '', 47187),
(66223, 'zhTW', '我們可以養牠嗎？', '把$1oa條凍寒魚帶去給尼洛，可從伊斯凱拉的商人那獲得，或是在巨龍群島的任何海水域捕魚獲得。', '他只想要吃掉我們，因為他太餓了！\n\n魚！沒有人能拒絕美味、冰涼的生魚！\n\n凍寒魚是世界上最好吃的。在海洋四處都可以釣到這種魚！就算你一條都釣不到，伊斯凱拉的金酷杜也一定能賣你一些。\n\n多帶點魚來給我，要多到他不再感到飢餓才行！', '', '', '', '', '', '', 47187),
(66222, 'zhTW', '風暴前的寧靜', '向蹄拉凱的居民傳達杰柏泰的命令。', '諾庫德極為強大，而且盟友眾多。我們需要傾盡全力，才能跟他們一戰。\n\n$n，你得到大可汗瑪托拉的信賴。她的命令是召集我們的朋友，並讓族人做好準備。\n\n我需要你的協助。去找賀津，叫他動員剩下的可汗禁衛。向遊俠昆亞古示警，說諾庫德可能會入侵。通知艾古拉準備接收傷患，然後告訴堅賽把糧食準備好。\n\n至於秘法師，我記得他們最近剛離開。我會看看是否還有人留在蹄拉凱。', '', '', '', '', '', '', 47187),
(66221, 'zhTW', '繼續前進', '到沃卓肯的守護巨龍之座與雅立史卓莎交談。', '既然青銅誓言石已經恢復，雅立史卓莎可以繼續她的計畫了。\n\n去沃卓肯吧，$n。她一定想知道你的好消息。', '', '', '', '', '', '', 47187),
(66218, 'zhTW', '亂跑的小淘氣', '找到尼洛和納烏。', '又見面了。\n\n可以幫我和諾魯克一個忙嗎？我們的孩子，尼洛和納烏，跑去玩了。他們應該知道現在該回來了才對。\n\n可是我走不開，拜託你幫忙去找他們。他們知道怎樣照顧自己，可是我擔心他們遭到了危險。', '', '', '', '', '', '', 47187),
(66217, 'zhTW', '尋賞：海岸徘徊者克洛傑', '殺死海岸徘徊者克洛傑。', '我們注意這條叫做克洛傑的大鯊魚好多年了，等著獵捕牠的最佳時機。\n\n牠的狩獵範圍漸漸地離海岸越來越近。這代表時機已經到了。集合你的狩獵隊，一定要補到牠！', '', '海岸徘徊者曾經是當地生態系的主要成員，現在他們的狩獵場有點太靠近伊斯凱拉了。', '海岸徘徊者克洛傑', '', '', '', 47187),
(66213, 'zhTW', '編織故事', '跟波雅長老說個魚的故事。', '我親愛的妻子，波雅，她很會說故事。\n\n但是已經三十年了，她不斷地重複講同一個故事！拜託你，$c，去跟波雅聊聊，讓她有新的故事可以說。\n\n你說什麼？告訴她你的冒險故事嗎？別開玩笑了，我才不想聽這種東西！最棒的故事絕對都跟魚有關。跟她說一個魚的故事，就算要用編的也行！', '', '', '', '', '', '', 47187),
(66212, 'zhTW', '釣魚：副翼海蛾魚', '到巨龍群島各地，從海裡釣起$1oa隻副翼海蛾魚。', '這年頭已經沒人知道怎麼好好捕魚了嗎？\n\n<魯克圖盧生氣地扭動他的鬍鬚。>\n\n你這個傢伙，去捕些魚來給我。要是好魚。還有，別抓葛藍勾魚！', '', '', '', '', '', '', 47187),
(66211, 'zhTW', '蕨皮谷：前往源頭', '進入蕨皮谷，面對『腐朽族母』怒眼。', '我們非常感謝你幫助擊退蕨皮豺狼人。\n\n但是他們還在繼續聚集，從蕨皮谷深處的某個來源積蓄惡濁的腐朽魔法。更糟的是，我們已經好幾個星期沒有那個區域的巨牙海民的消息了！\n\n我擔心那裡發生了什麼可怕的事。我們必須保護我們的家園。拜託你，集合你的部隊，找到我們的同胞，並試試看阻止到處的腐化！', '', '', '', '', '', '', 47187),
(66210, 'zhTW', '家人團聚', '到伊斯凱拉附近收集$1oa個火葬儀式祭品，然後將其放入殯葬船。', '你的朋友卡雷苟斯想要聊聊地脈的事，不過喪禮的準備工作也不能拋開。\n\n當我跟他會面的時候，你能不能去伊斯凱拉附近收集一些祭品，然後放在親愛的老波諾里亞的殯葬船中？\n\n另外，我也希望你能稍微逛逛這個村莊！我的族人會熱情地歡迎你，更何況你還幫我們對抗蕨皮。', '', '', '', '', '', '', 47187),
(66201, 'zhTW', '戰爭之蹄', '將大可汗瑪托拉的訊息傳達給蹄拉凱的可汗禁衛杰柏泰。', '巴拉卡會領軍出征。我也會這麼做，但我們寡不敵眾。\n\n巨龍曾向我們求助，我們或許可以借他們的力量來扭轉劣勢。為了向巨龍盟友求援，我必須吹響德魯沙之角，但我需要雍亞拉的祝福。你願意幫我嗎？\n\n去蹄拉凱一趟，將我的宣戰布告交給我的副官杰柏泰。他會派出我的部隊，並且指引你去找侍奉雍亞拉的秘法師。', '', '', '', '', '', '將大可汗瑪托拉的訊息傳達給蹄拉凱的可汗禁衛杰柏泰。', 47187),
(66196, 'zhTW', '求助呱呱', '將被泡泡困住的小鴨子帶回生態學家的營地。', '<這隻小鴨子在泡泡裡瘋狂掙扎，發出恐懼的叫聲。>\n\n<也許生態學家會知道如何幫助牠？>', '', '', '', '', '', '將被泡泡困住的小鴨子帶回生態學家的營地。', 47187),
(66187, 'zhTW', '瘋狂摩迪根與水晶國王', '在戈洛克海岸使摩迪根‧鐵顎去水晶化。', '外圍我都偵察過了。摩迪根很可能在這座洞穴裡面。\n\n<從洞穴入口傳出沉悶的詛咒和咒罵回音。>\n\n他絕對就在這座洞穴裡。\n\n魯西說這些水晶有著危險的脫水特性。看你能不能把他跟他的…地質發現分開來。盡量別讓他傷得太嚴重。\n\n他在這個領域裡蠻受到敬重的。', '', '', '', '', '', '與艾爾娜拉交談。', 47187),
(66177, 'zhTW', '一個矮人都不能少', '跟隨摩迪根‧鐵顎在戈洛克海岸的路徑。', '這裡的鹽分超乎想像的多！我們需要找到摩迪根，把他救出那裡。他現在一定嚴重脫水。\n\n他不見也才兩小時而已。看看你能不能判斷那個暴躁的矮人走了哪條路！', '', '', '', '', '', '在戈洛克海岸找到艾爾娜拉。', 47187),
(66176, 'zhTW', '元素實驗', '在戈洛克海岸進行$1oa項元素生物實驗。', '去對騷擾戈洛克的水元素進行實驗！', '', '', '', '', '', '幹得好！', 47187),
(66175, 'zhTW', '田調實驗品', '在捕鯨者望角幫助魯西進行測試。', '多虧了你，我們的地質勘察效率幾乎快來到96%了！\n\n<魯西皺起眉頭。>\n\n這是新手的數字。\n\n幫我把你收集到的樣本放進地形掃描器289-07裡分析。它應該能給出一個基數，讓我們知道高原究竟發生了什麼事。', '', '', '', '', '', '在捕鯨者望角與魯西‧輪裔談話。', 47187),
(66169, 'zhTW', '快意復仇', '在鎮南要塞大門殺死$1oa個熔誓洪荒使者。', '洪荒使者出奇不意偷襲了我們。\n\n<維洛米爾厭惡地吐口水。>\n\n我的守衛同伴都被這些怪物無情殺害了。要不是你剛剛及時出現，恐怕我也會和他們一起死去。\n\n我聽見遠處依然有交戰的聲音。說不定還有其他生還者，甚至是伊拉諾格指揮官。\n\n請你幫我分散他們的注意力，這樣我才能偷溜到比較近的地方。\n\n最好的辦法，就是殺掉幾個稱作熔誓者的傢伙。', '', '', '', '', '', '', 47187),
(66167, 'zhTW', '南方曝光', '前往鎮南要塞', '根據你的調查結果，我懷疑洪荒使者正在攻擊伊拉諾格指揮官的鎮南要塞。可是我不能帶我的誓鱗者離開城市，因為那正是洪荒使者樂見的結果。\n\n$n，我又需要你的協助了。\n\n去鎮南要塞一趟，看看我們面對的是什麼樣的部隊。如果可能的話，試試看聯絡那裡的要塞衛兵。', '', '', '', '', '', '', 47187),
(66166, 'zhTW', '耳目並用', '在沃卓肯找到線索。', '洪荒使者一直在對沃卓肯的居民散播他們的惡毒理念。\n\n我們的敵人十分狡猾，在我的誓鱗者面前什麼都不會透露。不過，或許你有辦法靠近去偷聽他們的對話，看看能不能得到什麼寶貴的情報。\n\n我已經在你的地圖上標示了幾個地點供你調查。\n\n還有，把這個魔法石拿去。只要你把它拿在手中，我們就有辦法和彼此溝通。\n\n你準備好了嗎？', '', '', '', '', '', '', 47187),
(66164, 'zhTW', '盜竊漁人', '在戈洛克海岸取回$1oa個失竊的零件。', '既然摩迪根不再舔石頭了，我們現在可以解決問題的癥結了…\n\n那些背信棄義的魚人，他們偷走了我的零件！\n\n我們在這個小不拉幾的村莊才不過一小時，結果！戈洛克就蜂擁過來。洛威在大喊、艾爾娜拉在尖叫，我也在揮著扳手像個瘋地精！\n\n看看你能不能挽回局面，幫我拿回一些零件！', '', '', '', '', '', '', 47187),
(66163, 'zhTW', '無處可躲', '在沃卓肯殺死$2oa個洪荒使者奸細。', '歡迎來到沃卓肯，$r。\n最近城裡烏雲密布，但我說的可不是天氣。\n\n有洪荒使者在暗中活動，煽動城裡居民的不滿。\n\n我們的敵人十分狡猾，他們偽裝成城裡的普通居民來躲過誓鱗者的追查。他們很擅長躲避衛兵，可是他們應該不會對外來者起疑。\n\n帶著這顆龍瞳石，它可以幫助你看穿他們的偽裝。\n\n去識破那些奸細，殺死他們！', '', '', '', '', '', '', 47187),
(66159, 'zhTW', '最可怕的消息', '在沃卓肯的守護巨龍之座和雅立史卓莎談話。', '在你到來之前，卡雷苟斯絕口不提蒼藍高地發生了什麼事。\n\n但不管是什麼事，我都感受到了一股強烈的不祥徵兆，$n。', '', '', '', '', '', '', 47187),
(66156, 'zhTW', '龍鱗遠征隊名人', '在龍鱗基地與編目員潔可思交談。', '你的一舉一動都有人注意，你不斷在證明自己是個知名的探險者！\n\n回去龍鱗基地，我準備了補給品給你，可以幫助你繼續努力工作。', '', '', '', '', '', '', 47187),
(66155, 'zhTW', '盧里克的激流泛舟', '搭乘秋步號順流而下。', '我沒有想到我兄弟會認同…但我還是很樂見這樣的發展。\n\n時候到了！看看我們的努力有沒有得到回報吧！\n\n和我一起搭上秋步號吧，$n，讓我們一起順流而下，沿路為伊斯凱拉捕魚！', '', '', '', '', '', '', 47187),
(66154, 'zhTW', '唾液樣本', '在戈洛克海岸收集$1oa份唾液樣本。', '<憔悴的不死族捏了捏鼻梁，然後重重嘆了口氣。>\n\n這會讓我的表現看起來非常糟糕。不知怎麼搞的，我們在一天內就激怒了當地的戈洛克、弄丟了一半的裝備，還少了一個矮人。\n\n根據程序，在這種情況下，我們得發揮出最高效率。去削減那些凸牙敵人的數量，然後把牠們的唾液帶回來給我做進一步的研究。\n\n我只要好東西喔。', '', '', '', '', '', '', 47187),
(66152, 'zhTW', '無處可去', '在荒僻營地和加茲會面。', '我們不能待在這裡。\n\n我不知道該怎麼做…接下來要去哪裡…\n\n我們要返回你的荒僻營地。巨牙海民應該會知道鏽松出了什麼事。\n\n如果我們講述並傳承我們的故事，或許這就不會再發生…', '', '', '', '', '', '', 47187),
(66151, 'zhTW', '他的石心', '殺死石心。', '我們為我們的酋長傷悲地哭嚎，但他還活著。\n\n現在的石心就在前面的洞穴中。許多人試著和他講道理。\n\n他把他們都殺了—還差點殺了納恩。\n\n他是頭怪物！這就是洪荒使者的目的。他們會把我們變成石頭來為他們做事。\n\n他的體內已經沒有鏽松精神了。他必須被摧毀，不然其他人就會面臨一樣的命運。', '', '洪荒使者的贈禮將鏽松酋長的身體變成了冷硬的石頭。', '石心', '', '', '', 47187),
(66150, 'zhTW', '拯救拉札', '拯救拉札‧雷爪。', '拉札‧雷爪是我們的靈魂保管人。她保存我們的傳統及歷史。\n\n洪荒使者的信念和我們氏族的完全背道而馳。我就知道她會違抗石心！\n\n石心會不計代價來讓她服從。少了拉札的祝福就稱不上是酋長！\n\n納恩說酋長的守衛卡加爾‧五牙正試著要擊垮她。如果拉札死了，我們的氏族也會一起死去。\n\n去援助她，$n，而且要有覺悟。他可不會乖乖地讓她走。', '', '', '', '', '', '去鏽松巢穴見拉札‧雷爪。', 47187),
(66149, 'zhTW', '元素影響', '摧毀$1oa個洪荒使者地縛圖騰，然後更深入鏽松巢穴找納恩。', '納恩說不是所有的鏽松氏族都自願跟隨石心與洪荒使者。\n\n有些抵抗者被強制束縛。石塊及泥土從圖騰中流出，困住他們…強迫他們屈服。\n\n將圖騰打碎。讓他們重獲自由！', '', '', '', '', '', '去鏽松巢穴見納恩。', 47187),
(66148, 'zhTW', '前熊怪家族', '殺死$1oa個鏽松熊怪及元素生物，然後更深入鏽松巢穴找納恩。', '洪荒使者來過。他們向我們提供新的力量：對元素的掌握。\n\n我沒想到石心會接受他們的禮物。我們的氏族不需要力量。他完全沒考慮到代價。\n\n他錯誤的決定無法挽回。魔法已經腐化了我的氏族—如疾病腐爛樹根一般。\n\n我的心碎了，可是削弱腐化之力是唯一的辦法。', '', '', '', '', '', '去鏽松巢穴見納恩。', 47187),
(66147, 'zhTW', '水中晶體', '在戈洛克海岸收集$1oa個水晶樣本。', '我們現在看起來可能不像，但我們可是專業人士。遠征隊委託我們在這個區域找一批稀有水晶…這可以算是地質勘察。\n\n我還沒有從戈洛克的攻擊中回神。你能好心幫我去找那些水晶嗎？可以的話，請帶回樣本。', '', '', '', '', '', '', 47187),
(66141, 'zhTW', '破碎的傳統，破碎的身體', '在前往鏽松巢穴的路上和加茲與納恩見面。', '我親愛的熊怪行為很反常。他們做了…壞事。他們變得更壞了。\n\n熊怪之間以前從來沒打過仗！\n\n我和弟弟成功逃了出來。我來這是為了找人幫忙。他留在我們氏族的巢穴附近。\n\n幫幫我們，不然我們的氏族就要滅亡了！', '', '', '', '', '', '', 47187),
(66139, 'zhTW', '終於烈焰', '在花園中使用濃縮水精華來擊敗熾熱煉獄元素。', '好吧，小傢伙，我已經幫你把所有的水元素精華放到這個罐子裡了。\n\n只要把罐子朝最大的那個丟過去，應該就行了。畢竟水有什麼時候打不過火呢？這計畫萬無一失。\n\n呃，不過高溫對我的關節不好，所以我會在這裡等著。你一定沒問題的。\n\n祝你好運，小傢伙！', '', '', '', '', '', '', 47187),
(66138, 'zhTW', '如沙漏裡的流沙', '在花園裡收集$1oa堆風捲時沙。', '和花園的其他部分一樣，諾茲多姆的沙漏也受到不平靜的元素生物摧殘。猛烈的風元素生物經過這裡，把裡面的魔法沙撒得到處都是。\n\n沒有這些沙，諾茲多姆在這裡的影響力會被大幅削弱。\n\n身為一個管家學徒，我被交代要無時無刻看守著沙漏。如果你願意代替我收集沙，我會永遠感激你的。', '', '', '', '', '', '', 47187),
(66137, 'zhTW', '斬草除根', '在花園裡除掉$1oa個入侵的殞命花和鞭笞者嫩草。', '我敢說魔花人不是唯一在那邊作亂使壞的野生動植物。\n\n雅立史卓莎之樹一直都是我的眼中釘。她的生命魔法會吸引各式各樣的植物和動物，有的好、有的壞。猜猜看，誰必須對付那些壞的動植物啊？正是老古爾佩奇！\n\n守護巨龍保佑我，我老到無法應付這種事了。\n\n管家並沒有接受戰鬥訓練，所以，處理生命守縛者的雜草問題就交給你了。', '', '', '', '', '', '', 47187),
(66136, 'zhTW', '元素萃取', '在花園裡收集$1a個含水精華。', '一個巨大的火元素幾天前摧毀了一個池塘。我覺得它就是這場騷動的主因，可是它太大了，我們打不過。我們需要想辦法削弱它。\n\n不過，先別說老古爾佩奇派不上用場，我有個計畫！\n\n水元素決定待在藍龍軍團的露臺那裡。只要你能從他們身上收集足夠的精華，或許就能用那些魔法來對付他們。\n\n以火剋火，對吧？嗯，應該是以水剋火。\n\n總之，你趕快開始吧。', '', '', '', '', '', '', 47187),
(66135, 'zhTW', '園丁的學徒', '在花園棚裡清理成堆的垃圾，以找出巴席爾頓領主。', '巴席爾頓！巴席爾頓領主，你在哪裡？ \n\n我的行政助理兼學徒，巴席爾頓領主走失了！他很喜歡四處探索，可是他保護自己的能力比我還差。我是個園丁，不是戰士！\n\n可以拜託你去找那個小懶鬼嗎？我需要他在這幫我，我才能夠思考。他通常都在棚子裡翻一堆堆的垃圾。\n\n不過要小心就是了，他一開始可能會有點不友善。', '', '', '', '', '', '', 47187),
(66134, 'zhTW', '艾澤拉斯害蟲控管', '在花園裡殺死$1oa個激動的幼苗。', '那邊那位小傢伙！\n\n幫我個忙吧？我的植物要被那些魔花人破壞光了！\n\n各式各樣的元素生物入侵了花園，他們似乎對野生動植物造成了…某種影響。元素能量好像激怒了魔花人，讓他們更瘋狂！\n\n這三個就夠我忙了。拜託你！不然魔花人就要把我的花園搞得一團亂了。', '', '', '', '', '', '', 47187),
(66133, 'zhTW', '忠誠之鑰', '收集$1oa把大型黑曜鑰匙。', '', '', '', '', '', '', '到黑曜龍堡繳交組好的鑰匙。', 47187),
(66131, 'zhTW', '揭開我們的過去', '收集$1oa把組好的鑰匙', '將組好的鑰匙交給我', '', '', '', '', '', '將組好的鑰匙交給黑龍堡壘內的任何陣營。', 47187),
(66130, 'zhTW', '揭開我們的過去', '收集$1oa把組好的鑰匙', '將組好的鑰匙交給我', '', '', '', '', '', '將組好的鑰匙交給黑龍堡壘內的任何陣營。', 47187),
(66129, 'zhTW', '揭開我們的過去', '收集$1oa把組好的鑰匙', '將組好的鑰匙交給我', '', '', '', '', '', '將組好的鑰匙交給黑龍堡壘內的任何陣營。', 47187),
(66126, 'zhTW', '揭開我們的過去', '收集$1oa把組好的鑰匙', '將組好的鑰匙交給我', '', '', '', '', '', '將組好的鑰匙交給黑龍堡壘內的任何陣營。', 47187),
(66124, 'zhTW', '勝利退場', '與管理者瑟利思特拉一起逃離閃霜營地。', '就我看來，龍后已經撤退到荒野孵化所。那是可以監視當地元龍的哨站…我只希望那裡的防禦足夠堅固。\n\n我們必須立刻前往那裡！', '', '', '', '', '', '', 47187),
(66123, 'zhTW', '斬首行動', '在閃霜營地擊敗加茲葛絲。', '加茲葛絲是菈薩葛絲底下的邪惡副官之一，正大搖大擺地率領這裡的洪荒使者。\n\n我們來讓他們見識一下，與我們為敵會有什麼下場。', '', '菈薩葛絲的副官會帶來許多麻煩，必須阻止她。', '加茲葛絲', '', '', '', 47187),
(66122, 'zhTW', '交戰元龍', '在閃霜營地擊敗$2oa隻元龍。', '這些元龍很厭惡我們。他們認為我們是龍族的扭曲版，受到泰坦的操弄和束縛。他們都不懂。\n\n這就是為什麼他們派部隊到我們的城牆下卻不害怕。\n\n他們錯了。\n\n帶著這把長矛，$p。殺死我們的敵人。', '', '', '', '', '', '在閃霜營地與管理者瑟利思特拉會面。', 47187),
(66121, 'zhTW', '搶救龍蛋', '從閃霜營地搶救4顆蛋。', '洪荒使者偷了我們的龍蛋，用來舉行邪惡的儀式！一定要阻止他們。\n\n幫我們及時取回龍蛋，以免發生憾事。$p，你找到蛋後，就在上面標記。我會確保它們安全送離這個地方。', '', '', '', '', '', '在閃霜營地與管理者瑟利思特拉會面。', 47187),
(66119, 'zhTW', '晶紅生命之池：洪荒使者入侵', '進入晶紅生命之池，並阻止洪荒使者攻擊。', '洪荒使者一路直搗我們的家園。面對如此猛烈的攻擊，我們猝不及防…讓幾個敵人闖了過去。\n\n其中一個龍獸跟在他們後面追進去，但是一直沒回報他的發現，他可能遭遇不測了。\n\n我會保持警戒，只要我們還沒斷氣，絕不會再放任何敵人過去，不過你必須阻止那些已經闖入的敵人。\n\n去吧！', '', '', '', '', '', '', 47187),
(66118, 'zhTW', '土元素襲擊', '在閃霜進攻地消滅$1oa個暴怒的岩靈。', '菈薩葛絲和她的洪荒使者召出巨大的土元素攻擊我們的防禦牆。一定要阻止他們！', '', '', '', '', '', '', 47187),
(66117, 'zhTW', '清空戰場', '', '', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66116, 'zhTW', '主要威脅', '到閃霜進攻地找指揮官萊薩納克。', '有太多脆弱的龍蛋需要保護。如果敵人突破防線，一切就都完了！\n\n我很確定我們的守衛正在戰場上集合，準備把他們趕回去。請去找指揮官萊薩納克，他會讓你的力量發揮最大的效用。', '', '', '', '', '', '', 47187),
(66115, 'zhTW', '紅龍的使命', '到晶紅生命聖殿與看管者交談。', '我們的使命是關懷及憐憫。我們援助其他軍團不只是為了他們，也是為了整個龍族。\n\n和晶紅生命聖殿這裡的龍裔談話，或許能讓你進一步了解我們。', '', '', '', '', '', '', 47187),
(66114, 'zhTW', '為了龍后', '與管理者瑟利思特拉一同前往晶紅生命聖殿。', '我們保護了珍貴的龍蛋，守護了所有龍群的未來。洪荒使者的所作所為不只帶來種種苦難。\n\n他們還想把我們趕盡殺絕。\n\n我必須馬上告訴龍后。', '', '', '', '', '', '', 47187),
(66112, 'zhTW', '別忘了製作', '收集洪荒大地核心和洪荒熔火核心。', '你以前看過這麼強大的元素生物嗎？\n\n<古朗歡呼。>\n\n我聽守衛抱怨說為什麼要一直跟那些元素戰鬥，但他們沒注意到一點…元素生物越大，就代表製作素材也越大！\n\n不管是為了安全還是其他理由，你到外面去清除元素生物的時候，記得要撿起最大的素材，這樣我就能用那些素材製作一些東西！', '', '', '', '', '', '', 47187),
(66111, 'zhTW', '入侵的元素', '到翼息大使館殺死$1oa個洪荒元素生物。', '龍鱗遠征隊的工匠、技師和探險者根本無力接受戰火的洗禮。\n\n但你和我並非如此，$p。\n\n在巨龍群島上，讓我們利用那股力量，保護那些無法保護自己的人。\n\n清除從北邊入侵的元素生物，讓遠征隊能夠專心追求他們崇高的目標。', '', '', '', '', '', '', 47187),
(66110, 'zhTW', '給和平一個機會', '向聯盟代表自我介紹。', '祝福你與你的同伴，$p。\n\n這場遠征受到了部落與聯盟雙方的保護。我們收到的指示很明確，要協助龍鱗遠征隊的任何成員，不管他們效忠哪一邊。\n\n聯盟代表， 蓋瑞克船長和她的兒子亨利，在營地的另一邊守衛。\n\n我和蓋瑞克船長一起打過天譴軍團。她是可敬的人，對這場遠征會很有助益。\n\n去對她表示你願意協助。讓她知道部落會遵守當初的協議。', '', '', '', '', '', '在翼息大使館和蓋瑞克船長交談。', 47187),
(66108, 'zhTW', '攻城戰鎚解決法', '殺死『濕喉大王』索咕沫咕和『風鰭大王』烏咕噶咕。', '雖然我很高興薩魯終於明白我的觀點，但我也很感激他在我耍龜毛的時候，請你去救那些野生動物。\n\n情況比我們原先預期的還要棘手，幸好他能及時採取行動。根據我們調查的結果，在我們解決戈洛克之前，這場元素暴動恐怕都不會平息。\n\n如果我是薩魯，我覺得最好的辦法應該是直接去找它們的首領。只要沒有帶頭作亂的人，紛爭自然會平息，再也不會威脅到濕地。', '', '', '', '', '', '', 47187),
(66107, 'zhTW', '救援野生動物', '拯救躁動濕地的野生動物。', '就算不是生態學家，也能看出那片濕地出現很大的麻煩。\n\n伊斯卡叫我們在這裡檢驗死去的生物，但我們真正該做的，應該是阻止生物繼續死亡！紅龍軍團的職責是守護生命，不是解剖！\n\n我很尊敬伊斯卡，他本身的才能也很出色，但要是我們等到他做完又臭又長的調查，就來不及拯救濕地了。\n\n我來處理他想太多的問題。你負責進入濕地，一步一腳印地救出一些野生動物。', '', '', '', '', '', '', 47187),
(66106, 'zhTW', '貝道而馳', '分別從濕喉戈洛克和風鰭戈洛克身上收集$1oa個注水貝殼和$1oa個注風貝殼。', '我實在太蠢了，伊斯卡覺得事有蹊蹺的時候，居然還懷疑他。要不是他總是比我多想兩步，他也不可能成為我的研究夥伴。\n\n事到如今，我們還是可以採取行動…為他做出補償。如果元素會暴走都是因為貝殼，那麼你何不潛入它們的營地，從它們黏滑的手上搶走那些貝殼？\n\n帶來成堆的注水貝殼和注風貝殼，讓伊斯卡足以證實他心中的想法。', '', '', '', '', '', '', 47187),
(66105, 'zhTW', '解剖刀解決法', '殺死$1oa個狂暴的水和$1oa個狂暴的風。', '我認為我們在這裡能夠安全地收集足夠的數據，可是…\n\n薩魯是位傑出的生態學家，比較希望我們能採取行動。不過，生態系是很脆弱的，如果我們不小心的話，可能會傷害到它。然而，我的確同意我們沒多少時間。\n\n他的做法並非一無可取。應該吧。\n\n消滅一些狂暴元素應該可以幫我們爭取到更多時間，又不會妨礙到我們的研究。記得消滅的元素數量必須相等—我們不希望看到失衡的情況進一步惡化。', '', '', '', '', '', '', 47187),
(66104, 'zhTW', '法醫生態學', '解剖戈洛克的屍體。', '我有點拿不定主意，$n。薩魯和我已經差不多調查了所有屍體，現在只差臨門一腳，那就是我們無法在方法學上達成共識。要是他能聽我的話就好了！\n\n<生態學家伊斯卡嘆氣。>\n\n現在我們兩個都承受很大的壓力。我甚至還沒提出可信的假說。\n\n你的胃看來挺強壯的。你能不能接手解剖最後兩個戈洛克？我的解剖刀可以借你用。', '', '', '', '', '', '', 47187),
(66103, 'zhTW', '精進實力', '到黑曜壁壘考驗$1oa個黑爪刺客和黑爪復仇者的身手。', '我們需要更多部隊協防黑曜龍堡。既然我們已經有了立足之地，接下來就必須確保我們有足夠的新血承擔各種工作。\n\n我們在黑曜壁壘駐紮了其他預備部隊，可以作為我們的生力軍。\n\n他們受過良好訓練，但要是有像你這樣的高手考驗他們的實力，他們一定會獲益良多，我們也能知道他們準備好了。', '', '', '', '', '', '在黑曜壁壘與『無情』法傲見面。', 47187),
(66101, 'zhTW', '登高望遠', '使用勘測員的圓盤，彈跳到空中，偵測附近區域。', '多蒂和娜蕾迪亞求立即提交有關周圍地區的勘察報告。\n\n幸好，我拿到一副魔法望遠鏡和勘測員的圓盤，我們可以安全地從天上偵察附近區域。\n\n不幸的是，我有嚴重的懼高症，根本不可能踏上那個裝置。\n\n你沒有懼高症，對吧？', '', '', '', '', '', '', 47187),
(66100, 'zhTW', '補給重量', '收集$1oa袋道路守衛補給品。', '我這次真的搞砸了。我只不過是離開營地一下，但一回來就看到塔拉賽克搶走所有我沒有釘住的東西。\n\n那些補給品很昂貴，而且我也不能再請人送更多過來！我姊姊諾里已經覺得我很無能了。\n\n如果你確定要到山谷去，你可以幫忙注意一下有沒有無主的補給品嗎？', '', '', '', '', '', '', 47187),
(66087, 'zhTW', '關閉時間', '在時光沙地協助時光行者，殺死時佚敵人、強化青銅龍盟友、歸還失落的文物，並且關閉時空裂隙。', '這些意外將這個時間軸的韌性推到了極限，甚至有可能破裂。要是整個小隊的時光行者都在就好了！\n\n雖然你還是使用法杖的新手，我聽說你依然成功提供我們許多幫助。只要再多加油一下，相信你可以進一步協助我們完成使命。\n\n通常，我會讓你接受完整的訓練，不過現在的時節…非比尋常。把這個進階知識卷軸拿去，然後用它把入侵者趕回去！不過動作要快，這些效果有時限。', '', '', '', '', '', '', 47187),
(66085, 'zhTW', '要是我們能逆轉時光', '在時光沙地和西雅澤拉瑟合力關閉時間裂隙。', '盡責的時光行者永遠不會半途而廢。既然我們已經擁有需要的工具，何必繼續乾等和研究呢？\n\n既然你有我本來的法杖，我找到一把備用的來用。它的主人不會想找它的。我的計畫就是，我們合力處理那些裂隙，然後化解今天的危機！事實上，還有其他天的危機。抱歉，時間的事情我還不算完全了解。\n\n你覺得如何？這個任務應該很簡單吧？', '', '', '', '', '', '', 47187),
(66084, 'zhTW', '這樣的時光', '從時光沙地的時佚敵人身上收集$1oa個時光殘渣。', '雖然在訓練中發生了那場小意外，我相信你已經做好足夠準備，可以在這裡援助我們。\n\n山谷裡的扭曲正在使不同的年代和我們的年代交錯。我們不確定這些時間線連接起來的原因，這使人相當警戒。我們需要更多情報。\n\n請你去了解一下那些從不同時間線湧入的生物。它們經過的路徑一定會留下某種殘留的物質。透過研究那樣的物質，我們就有可能找到方法來應對這場危機。', '', '', '', '', '', '', 47187),
(66083, 'zhTW', '彷彿第一次', '與安但丁諾穆交談並參加時光行者訓練。', '引導時間之道是個危險的職責。\n\n雖然你不是時光行者，但克羅諾穆大使認為你可以幫上很多忙。不過，為了確保你的安全，我們必須好好訓練你。\n\n很不幸的是，我們全部的指導員依然下落不明。我會盡我所能幫忙，就一起看看我們彼此的表現吧。我知道克羅諾穆大使指望我們兩個來做這件事。', '', '', '', '', '', '', 47187),
(66082, 'zhTW', '瓶中時間', '在薩爪祖斯的浮動森林裡，從殺死的時空充能野生生物身上收集時間能量。', '好極了！時光行者法杖毫髮無傷！但它的能量已經耗盡。\n\n我知道了！你可以利用凝聚在野生動物周遭的時間能量來為它重新充能。不幸的是，這代表你必須擊敗森林裡受影響的生物。動盪的能量害牠們變得既危險又不穩定，而且我們必須想辦法削減數量…\n\n有時候，為了更大的利益，你必須做出犧牲。你可以幫忙嗎？我還需要一點時間。', '', '', '', '', '', '', 47187),
(66081, 'zhTW', '時間緊迫', '在薩爪祖斯的浮動森林收集$1oa個時光收集石。', '青銅神殿遭到攻擊，時間能量已經滲漏到各處。\n\n時光行者在這座森林各個地方放置了收集石，試著收集那些四散的魔法。任何收集到的魔法都可以成為額外的力量！這是件好事，這場危機要把我們的資源都耗盡了。\n\n我應該要負責取回收集石的，但我還需要一點時間喘口氣。\n\n你可以幫我把它們拿來嗎？', '', '', '', '', '', '', 47187),
(66080, 'zhTW', '時光障礙', '在薩爪祖斯的浮動森林找到失蹤的新兵。', '你好，$c。你來得正是時候！\n\n神殿那邊發生了一些意外，讓時間之道變得不穩定，並且擴大到整座山谷。不僅如此，還有一大堆時光行者都失蹤了！\n\n我們已經請求額外的支援，可是有一位新招募者還沒抵達。\n\n你可以去找她嗎？不過要小心，山谷一帶的時間處於相當不穩定的狀態。沒人知道會發生什麼樣的危險！', '', '', '', '', '', '', 47187),
(66079, 'zhTW', '怒西昂等著你', '在黑曜壁壘與怒西昂見面。', '這些蛋象徵著龍群的下一代，需要得到妥善的保護和孵育。只是…我的心好痛，而且我很擔心怒西昂。他的固執恐怕會鑄下大錯。\n\n多年來，你一直是值得信任的朋友，$n。或許你可以代替我，去幫他一把。\n\n到黑曜壁壘去找他。還有拜託，請看好他。他們那一族已經所剩無幾了。', '', '', '', '', '', '在黑曜壁壘與怒西昂見面。', 47187),
(66078, 'zhTW', '實力的考驗', '考驗$1oa個黑爪刺客和黑爪復仇者的身手。', '我已經精心培植黑爪部隊多年，教導並鼓勵他們向你看齊。\n\n他們或許還不能達到和你一樣的高度，但他們也憑一己之力做出一番成就。我為他們感到自豪。\n\n只要你考校他們一下，就能知道他們的不凡之處。我想你會發現他們身上都有你的影子。', '', '', '', '', '', '', 47187),
(66076, 'zhTW', '遠古角蛙', '', '', '', '', '', '', '', '', 47187),
(66074, 'zhTW', '洪荒鐮螳螂女王', '', '', '', '', '', '', '', '', 47187),
(66071, 'zhTW', '飛翔大鵬', '援助$1oa隻受傷的藍羽大鵬。', '我是哈爾琳‧啾諷教授，聲名遠播的非凡鳥類學家！我來這裡是為了研究巨龍群島神秘的藍羽大鵬，不過我們目前好像有更急切的鳥類問題要處理。\n\n我敢說，這些鷹身人一定是在群島開放的時候，從卡林多飛來的。他們極具侵略性，吃東西的時候簡直就像一群在污水賭場吃到飽的巨魔。\n\n讓我們給這裡的原生種大鵬一個對抗鷹身人的機會吧。帶著這個醫療箱，用它讓受傷的大鵬重新振作起來。', '', '', '', '', '', '', 47187),
(66070, 'zhTW', '亮刃的骸骨', '', '', '', '', '', '', '', '', 47187),
(66057, 'zhTW', '重塑誓言', '復原黑曜誓言石。', '四散的碎片已經重組，我們可以開始復原誓言石了。\n\n去吧，協助怒西昂完成修復的工作。', '', '', '', '', '', '在黑曜王座與怒西昂見面', 47187),
(66056, 'zhTW', '打造新的未來', '備妥大地守護者的熔爐。', '在現存的所有巨龍熔爐中，大地守護者的熔爐是威力最強大的。我們的先人用它打造出強大的武器和護甲，用來保衛艾澤拉斯。\n\n而且它的爐火蘊藏的力量，也是重組誓言石碎片不可或缺的。\n\n走吧，我們得去備妥熔爐，做好準備工作。', '', '', '', '', '', '將灰燼裂片煤炭帶去給鍛造大師巴贊圖。', 47187),
(66055, 'zhTW', '破碎的過去', '取回$2oa個誓言石碎片。', '誓言石受到損害，有些部分不見了。\n\n盡你所能取回那些碎片吧…或許會有修復誓言石的方法！', '', '', '', '', '', '', 47187),
(66049, 'zhTW', '黑曜誓言石', '找到黑曜誓言石。', '奈薩里奧成為大地守護者時，他曾發誓保護這個世界，$n。誓言的內容包含守護地底深處，以及與黑龍軍團一起成為艾澤拉斯的防衛者。黑曜誓言石就代表他許下的誓言。\n\n我們必須啟動那顆誓言石，讓整個巨龍群島知道黑龍軍團回來了！\n\n跟我來，$n。', '', '', '', '', '', '', 47187),
(66048, 'zhTW', '最佳計畫與意圖', '與怒西昂部隊的成員一起重新審視計畫。', '進攻掌控黑曜龍堡的加拉登絕不是什麼容易的事。就算有怒西昂和他的黑爪部隊，這仍會是一場激戰。怒西昂看起來信心十足，不過…我並沒有那麼樂觀。\n\n也許我們可以跟那些協助制定策略的人談談，看看能不能找到任何改善的空間。', '', '', '', '', '', '在黑曜壁壘向怒西昂回報你的發現。', 47187),
(66044, 'zhTW', '奪下城牆', '解決掉三座攻城強弩和加拉登的勇士丘魯克。', '賽柏利安和其他的龍正在阻擋加拉登。我們必須快點奪下防禦塔，確保我們的勝利。\n\n你和我應該清除從上方對我們造成威脅的攻城強弩。\n\n準備好的時候告訴我一聲。', '', '', '', '', '', '與怒西昂會面', 47187),
(66040, 'zhTW', '回到未來', '保衛你的盟友不受黑暗帝國攻擊，直到時光傳送門被創造出來為止。', '我們總算停止無限的時空穿梭了，可是我們在很久遠的過去。非非非常久以前的過去。是「泰坦還沒來到艾澤拉斯」這麼久以前。要回家的話會很…麻煩。\n\n不過我們巨龍辦得到！\n\n但是我們需要你來阻止那些黑暗帝國手下，讓他們不要來攻擊我們。這應該不會花太久時間！\n\n應該吧。\n\n大概吧。\n\n別擔心！你專心阻擋那些詭異的怪物，其他的讓我們來！簡單！', '', '', '', '', '', '', 47187),
(66039, 'zhTW', '克羅米時光', '找到克羅米，並完成時光穩定儀式。', '這…這裡是黑暗帝國。我們真的穿越到很早以前的過去了。\n\n看那邊！是克羅諾穆大使和伊特努斯！我們得快點行動，趕快完成儀式。\n\n雖然我的好奇心很強，但就連我也不希望看見他們接下來要穿梭到哪個時間去。', '', '', '', '', '', '', 47187),
(66038, 'zhTW', '飛速穿越時間！', '飛速穿越時間，追上克羅米和伊特努斯。', '$n，我們必須快速行動才能趕上克羅諾穆大使，而且真的要很快才行！\n\n澤拉跟我會盡可能加速我們的進度，但重要的是必須盡量避免和這個時空有所糾纏，否則會拖慢我們的速度。假如這樣的話，在諾茲多姆的魔法影響克羅諾穆大使之前，我們很有可能追不上她。\n\n我們現在分秒必爭！\n\n|cFF0000FF(接受這個任務會啟動計時器)|r', '', '', '', '', '', '', 47187),
(66037, 'zhTW', '返回現實', '回去找現在的諾茲多姆。', '我們成功提高克羅諾穆大使和我們時空之間的連結強度了。我敢說等我們再次找到她的時候，就有辦法完成儀式了。\n\n在那之前，讓我們回到現在的時空，那裡的…魚人少多了。', '', '', '', '', '', '', 47187),
(66036, 'zhTW', '呣嚕咕嚕咕嚕！', '姆咯咕嘎咯咕！', '姆咕嘎咯咕！咕咕嘎咕嘎！\n\n咕咯嘎咕嘎，咕嘎咕咯，咕嘎，咕咕，咯。姆咕嘎咯咕，咕嘎咕咯，姆咕，嘎咕咯。姆咕咯嘎咕，咕嘎咕咯，咕嘎咕咯，咕嘎咕咯咕，咕嘎咕咯。\n\n姆咯咕咕，嘎，咕咯。\n\n<你不確定對方在說什麼，不過他做出很多戳刺的動作。看來這個魚人希望你能殺死某個東西。>', '', '', '', '', '', '', 47187),
(66035, 'zhTW', '魚人微粒', '汲取$1oa個時空微粒。', '一個魚人的平行時間軸？！\n\n抱歉我有點自私，不過在你尋找克羅諾穆大使時，可以順便帶一些散落的時光能量微粒嗎？\n\n你只需要走進它們就好，剩下的就交給你的法杖。我等等會再檢驗數據。你知道的，等我們不再忙著穿梭於艾澤拉斯各種現實的時候。', '', '', '', '', '', '', 47187),
(66033, 'zhTW', '前往…過去？', '進入傳送門，去亞茲莫洛斯見安但丁諾穆。', '很遺憾我們沒辦法讓克羅諾穆穩定下來，但我們或許還能在另一個地點追上她，讓她停止穿梭時空。\n\n<諾茲多姆皺眉。>\n\n我一生中見識過無數光怪陸離的事，但我瞥見的這條過去時間線…還是十分怪異。\n\n$n，提高警覺。我不確定你會遇到什麼，但它非常強大，而且…似曾相識。', '', '', '', '', '', '進入傳送門，去亞茲莫洛斯見安但丁諾穆。', 47187),
(66032, 'zhTW', '回到現今時間點', '回去找現在的諾茲多姆。', '這個時間軸既黑暗又混亂，而且擾動非常嚴重。我想我會在這裡待上一陣子，幫忙撫平可能出現的漣漪。\n\n回去找諾茲多姆。讓他知道我們成功了，即使事情並沒有我們希望的那麼成功。', '', '', '', '', '', '', 47187),
(66031, 'zhTW', '創造時間', '為生存者的營地收集元素精華。', '我想我不該對自己在這裡感到太驚訝。\n\n這不是我想要的艾澤拉斯，但這是我僅有的。我們在努力保存剩下的東西，想辦法把世界奪回來，可是你的到來造成了一些問題。\n\n我們會利用外面那些元素的精華，為我們的保護裝置提供能量來確保我們的安全。看到那個護盾了嗎？我們只能依靠它，讓我們不被發現和遭到殲滅，而你把我們的資源用光了。去帶一些精華回來，或許我們就能再撐一天。', '', '', '', '', '', '', 47187),
(66030, 'zhTW', '反抗並非無用', '在洪荒使者未來治療反抗軍鬥士。', '時光漣漪為這裡的人帶來了麻煩。敵人會出現在之前沒出現的地方，或是比原本還要強大。這些改變雖然微小，但還是可能會造成災難。\n\n我希望你能幫助這裡的反抗軍鬥士。治療他們的傷口，讓他們能夠再次戰鬥。將他們的時間軸重置到正確的軌跡上，就像永遠不曾和我們互動過一樣。這只是小事，但卻是我們可以出力的地方。', '', '', '', '', '', '', 47187),
(66029, 'zhTW', '時間調整', '在洪荒使者未來對克羅米及伊特努斯使用時空水晶，阻止他們繼續在時間當中無限墜落。', '克羅諾穆和伊特努斯正在不斷穿梭時空，但我能感知到他們偶爾會停下來。這些短暫的片刻正是唯一能找到他們的機會。\n\n<諾茲多姆召喚出一塊小的時空水晶。>\n\n這個水晶注入了我的力量，它會和我產生時光共鳴。他們到了一個…相當棘手的可能未來。找到他們，然後使用水晶。希望這可以在他們又再次轉移之前，固定住他們的時空座標。', '', '', '', '', '', '回去找現在的諾茲多姆。', 47187),
(66028, 'zhTW', '前往未來！', '前往洪荒使者未來。', '我追蹤到克羅諾穆和伊特努斯在一個潛在的未來裡。我不知道你會在那裡找到什麼，我只知道那裡既黑暗又混亂。\n\n索芮朵蜜帶了幾個時光行者去穩定那個未來與這個時空的連結。要讓傳送門維持開啟需要大幅耗用她的力量，所以她得依靠足智多謀的你來助她一臂之力。\n\n見到索芮朵蜜以後，她會給你更多指示。\n\n$n，快點去找克羅諾穆。', '', '', '', '', '', '在洪荒使者未來和索芮朵蜜交談。', 47187),
(66027, 'zhTW', '召回藍龍', '見證卡雷苟斯召回藍龍軍團。', '$n，我不能再對藍龍軍團重新團結一事恐懼下去了。我們應該要重新團聚為家人…而不是繼續孤守破碎的自我。\n\n就算我無法復原誓言石，我還是能用它的力量對所有藍色巨龍發出訊息。\n\n他們應該收到消息了…收到來自他們守護巨龍的訊息。', '', '', '', '', '', '', 47187),
(66026, 'zhTW', '需要立即的行動', '去蕨皮見布蕾娜。', '這些攻擊行動的源頭一定是蕨皮豺狼人。\n\n我們跟蕨皮豺狼人打了好幾代，但在這之前，他們都只是個討厭的存在。\n\n面對這些豺狼人，除了採取緊急行動，我們別無選擇。他們邪惡的腐朽之息會摧毀蒼藍高地，連你在找的東西也不例外。\n\n在蕨皮外圍跟我們碰面。我們需要手頭的每一分助力。', '', '', '', '', '', '', 47187),
(66025, 'zhTW', '諾庫德威脅', '討論後續行動。', '諾庫德氏族的軍隊正在佔領莫魯凱。\n\n讓我們在可汗會議廳裡討論接下來的行動吧。我們必須保護莫魯克人的安全。', '', '', '', '', '', '', 47187),
(66024, 'zhTW', '蓋住他們的尾巴', '殺死守衛巴依爾。', '諾庫德著迷於我們族類在遠古時的戰爭故事。事實上，他們只是弱小又愛玩家家酒的孩子。而隨著一道閃電的打擊，他們切斷了與雍亞拉的連結。\n\n那好！如果他們要走上腐敗之路來尋求戰爭，那我們就讓他們去吧。\n\n當然，巴依爾被留下來指揮，來掩護他逃走。她的血必須染紅泥土。', '', '被巴拉卡留下來當替死鬼後，巴依爾等這一刻已經等很久了。', '守衛巴依爾', '', '', '向大可汗瑪托拉‧薩列斯回報。', 47187),
(66023, 'zhTW', '打破休戰者', '殺死$1oa個諾庫德部隊的成員。', '巴拉卡抹黑了自己的氏族。他對權力的渴望蒙蔽了他的雙眼，讓自己的族人加入風暴的行列。\n\n他們的背叛暴露了自身的脆弱。殺了他們。', '', '', '', '', '', '', 47187),
(66022, 'zhTW', '大可汗瑪托拉', '向可汗禁衛阿卡托回報，參加潔米薩思與大可汗瑪托拉的會面。', '我無法在半人馬土地逗留，我必須盡快返回花園。\n\n大可汗瑪托拉已經同意要聽取我們的求援請求。她在莫魯凱中央的建築物可魯塔的頂端等待我的到來。\n\n雖然我必須先親自與她談話，但我也非常歡迎你加入我們。', '', '', '', '', '', '', 47187),
(66021, 'zhTW', '不歡迎外來者', '擊敗$1oa個諾庫德半人馬。', '哈！你看看你。太軟弱了。就像你帶來這裡的那些弱雞獵人一樣。\n\n你想了解諾庫德？我們交流的方式就是戰鬥。\n\n我們的戰鬥儀式叫做「塔巴爾」。我們會訓練，我們會比劃，我們藉此變強。現在，我們的氏族中沒有半個弱者。\n\n談得夠多了。來較量一下吧。', '', '', '', '', '', '回去找斥候托姆爾。', 47187),
(66020, 'zhTW', '預兆與薰香', '收集$1oa朵蜜香花，將其磨碎製成蜜香薰香，然後協助雍‧賽希騰舉行儀式。', '我和提迦里可汗分享了我們進到莫魯凱以前收到的預兆。她表示擔憂，因為她也覺得風很寒冷。\n\n我們在這裡種植特定的花，磨碎這些花並燃燒就能引發沉思般的效果。我們可以用來加深和預兆的連結。\n\n我希望你去收集一些花來，我們才能做燃燒用的薰香。有了可汗的幫忙，或許我們可以更了解雍亞拉的困境。', '', '', '', '', '', '', 47187),
(66019, 'zhTW', '榮耀我們的先祖', '協助卡琳‧多圖準備獻給祖先的菜餚。', '我們的祖先在雍亞拉之風中與我們並肩而行，指引並保護我們。無論是逝者還是生者，所有的莫魯克人都會為了庫拉爾休戰並齊聚一堂。\n\n這頓飯的香味會將祖先呼喚到我們的火來。在他們抵達時，庫拉爾就開始了。', '', '', '', '', '', '', 47187),
(66018, 'zhTW', '諾庫德氏族', '陪同托姆爾去找守衛巴依爾。', '<桑索克可汗嘆了口氣，歐奇爾隨即為可汗發聲。>\n\n諾庫德氏族是最近才興起的氏族。他們的前任可汗「賈康」建立起一支大軍，重新奪回祖先擁有的地盤。這就是他們一族的做法。\n\n賈康靠自己贏得應有的尊敬，他的兒子卻不是如此。巴拉卡殺死自己的父親，接管了整個氏族。從那之後，他們一族就變得越來越封閉。不過，想要了解莫魯克，就必須了解他們。', '', '', '', '', '', '到諾庫德營地與斥候托姆爾會面。', 47187),
(66017, 'zhTW', '雍伊爾氏族', '到秘法師水池與雍‧賽希騰會面。', '<桑索克可汗嘆了口氣，歐奇爾隨即為可汗發聲。>\n\n在這片土地，像雍‧賽希騰這樣的秘法師都是雍伊爾氏族的一員。維繫這個氏族的並不是家族血脈，其成員都從平原各地精心挑選，天生就能與雍亞拉溝通的半人馬。他們終其一生都在加深與雍亞拉的聯繫，磨練自己的能力。他們最終會被派往各個氏族，為他們提供建議，同時保護我們的土地。\n\n雍‧賽希騰去跟她的可汗談談她看到的預兆。請跟她一起去，了解有關雍伊爾的事。', '', '', '', '', '', '到秘法師水池與雍‧賽希騰會面。', 47187),
(66016, 'zhTW', '蹄萊氏族', '向卡琳‧多圖回報。', '<桑索克可汗嘆了口氣，歐奇爾隨即為可汗發聲。>\n\n蹄萊氏族是大可汗瑪托拉所在的氏族。他們是傳統的守護者、故事的訴說者，也是我們祖先的直系血脈。\n\n想要了解莫魯克半人馬，就必須了解蹄萊氏族。大可汗瑪托拉有個女兒叫卡林‧多圖，她正在準備獻給祖先的供品。請幫她準備，她應該會向你介紹我們一族。', '', '', '', '', '', '向卡琳‧多圖回報。', 47187),
(66015, 'zhTW', '藍龍誓約石', '伴隨卡雷苟斯復原蒼藍誓約石', '蒼藍高地暫時穩定下來，然後也有更多藍龍趕來了。\n\n該返回蒼藍文庫復原誓言石了。\n\n我想要求你前往那裡，$n，在這場災難當中，你一直是個帶來好運的存在。', '', '', '', '', '', '', 47187),
(66011, 'zhTW', '紀念伊瑟拉', '再次找到塞拉莫斯。', '喔不！我現在終於理解了。塞拉莫斯…他想念伊瑟拉，但她卻無法回來。\n\n來吧！我大概知道他去了哪裡。我們不會再去打擾他，但我們應該向他道歉，並且讓他得到想要的個人空間。\n\n我們為了彼此而在這裡，在大自然的懷抱裡。', '', '', '', '', '', '', 47187),
(66009, 'zhTW', '保衛瓦瑟洛斯', '擊敗『毀滅者』寇索斯', '$n，是時候了。你處理掉地面上的東西以後，空中的洪荒部隊數量也正在減少。\n\n多虧有你，菈薩葛絲正在召喚她其中一名副官來增援他們的部隊。\n\n我需要你去對付這頭怪物，我則向前推進，去和菈薩葛絲戰鬥並協助卡德加。\n\n你戰鬥的時候，我會盡我所能地使用魔法幫你。\n\n該讓菈薩葛絲見識魔法之王的怒火了！', '', '菈薩葛絲底下的副官，一心想消滅藍龍。', '『毀滅者』寇索斯', '', '', '在瓦瑟洛斯更上面的地方和卡德加交談。', 47187),
(66007, 'zhTW', '自由的空氣', '摧毀$1oa座熔岩信標。', '洪荒使者利用這裡的巨大球體阻擋了卡雷苟斯。\n\n照這樣下去，卡雷苟斯很快就會因傷勢太重而無法繼續飛行。要是他倒下，我就無法抵擋菈薩葛絲了。\n\n利用你手中的強化寶石，應該可以偽裝成元素生物，然後趁機偷溜進去。\n\n然後使用寶石摧毀球體，這樣一來，卡雷苟斯應該就有機會釋放他的力量。\n\n我會持續集中精神，抵擋菈薩葛絲對高塔的攻擊。', '', '', '', '', '', '在瓦瑟洛斯峰的洞穴內與卡雷苟斯會面。', 47187),
(66006, 'zhTW', '回去找羅沙', '將補給品還給蹄鐵匠羅沙。', '巴巴沒事了，羅沙的補給品也拿回來了。我們現在回去，她應該不會再生氣了。\n\n離開的時候，帶一些箱子走。剩下的我會派戰士來搬。', '', '', '', '', '', '', 47187),
(66005, 'zhTW', '過世朋友的勳章', '把過世朋友的勳章帶回去交給卡沙爾。', '<這塊嚴重磨損的金屬原先是美麗的裝飾品，對席卡半人馬而言意義重大。\n\n卡沙爾或許知道它的主人是誰。>', '', '', '', '', '', '把一名過世朋友的勳章帶回去交給卡沙爾。', 47187),
(66004, 'zhTW', '高葛瑞希', '', '', '', '', '', '', '', '', 47187),
(66003, 'zhTW', '戒指束縛著它們', '收集$1oa個縛火戒指。', '這裡的加拉登族變大膽了，竟然會束縛烈焰元素並讓它們在這地區肆虐。野生動物四處逃竄，元素生物現在離我們營地太近，會造成危險。\n\n幸好，我已經建造了一個小石堡，來阻擋加拉登族釋放的火焰浪潮…我們不會被擊倒的！\n\n請收集束縛這些烈焰元素的魔法戒指。我們要用它們來強化我們的防禦工事，抵禦烈焰元素。', '', '', '', '', '', '', 47187),
(66001, 'zhTW', '最後的希望', '搶救最後一顆灌能的龍蛋。', '一整窩的幼龍，消失了…\n\n<仙卓克絲重新打起精神。>\n\n還有一個地方我們還沒去看。就是那隻元龍放下龍蛋的大型儀式場所。\n\n讓我們一起突破他們堅固的防禦，$p，盡全力搶救龍蛋。', '', '', '', '', '', '', 47187),
(66000, 'zhTW', '雅立史卓莎的圖書館', '搶救$1oa本重要的文化著作。', '<這本書的書頁變得焦黑。\n\n洪荒使者似乎在焚燒在這裡找到的遠古典籍，讓龍群的歷史傳承陷入危險。就像洪荒使者想把龍群從歷史上抹去一般。\n\n請盡可能搶救典籍。>', '', '', '', '', '', '', 47187),
(65999, 'zhTW', '染紅的齒爪', '殺死$1oa個洪荒使者入侵者。', '指揮官萊薩納克警告過我們這些新兵，他已經接到報告說，噬風者菈薩葛絲從囚禁中逃脫了。看來她的僕從在那之後也跟隨著她，對我們珍視的一切造成威脅。\n\n他們動作很快。在上一次的巡邏中，這些廢墟還處於廢棄狀態。\n\n我們必須阻止這裡的洪荒使者。\n\n為了生命守縛者，為了所有龍群！', '', '', '', '', '', '', 47187),
(65998, 'zhTW', '龍群的未來', '搶救晶紅龍蛋。', '每個龍獸結業的時候，都清楚誓死守護每一顆龍蛋，是我們最崇高的職責。\n\n這是我們訓練的理由，也是我們存在的理由。\n\n我再也不能躲在一旁袖手旁觀，$p。洪荒使者偷了這些龍蛋，將力量注入其中，等同威脅到整個龍群的未來！\n\n雖然敵眾我寡，但你願意跟我並肩作戰嗎？你願意為了拯救龍群而戰嗎？', '', '', '', '', '', '', 47187),
(65997, 'zhTW', '追逐仙卓克絲', '到生命守縛者存護所廢墟尋找仙卓克絲。', '見習生仙卓克絲不久前來過這裡。\n\n她轉達了指揮官萊薩納克的命令，要求所有龍獸回到生命之池集合。過了不久，我們整支防守兵團就朝那個方向移動了。\n\n不過我們的斥候當時正在那些古老廢墟中巡邏，所以她就去了那裡，準備召集他們。', '', '', '', '', '', '到生命守縛者存護所與仙卓克絲會合。', 47187),
(65996, 'zhTW', '精英援軍', '協助受傷的守衛並找到仙卓克絲。', '指揮官萊薩納克一向足智多謀，想要化解他們的威脅，我們需要最老練的守衛相助。召集他們的任務最適合交給像仙卓克絲這樣的年輕見習生，不過她可能需要支援。\n\n仙卓克絲已經前往西邊執行任務，但這個新生的威脅可能已經危及那個地方。他們同樣需要援助。請帶著這個混合物去支援他們。', '', '', '', '', '', '在存護所哨站與仙卓克絲會面。', 47187),
(65995, 'zhTW', '黑曜龍堡', '將喀拉希計畫書交給怒西昂。', '<乍看之下，這似乎是加拉登營地之間的內部通信。\n\n「黑曜龍堡」一詞映入眼簾。\n\n怒西昂也許會對這東西感興趣。>', '', '', '', '', '', '', 47187),
(65994, 'zhTW', '加拉登正義', '', '', '', '', '', '', '', '', 47187),
(65993, 'zhTW', '掃興', '到碎鱗者要塞殺死絞肉手索托可。', '啊，沒錯。\n\n我來了之後不久，就看到這些巨人的首領剛剛結束戰鬥回來。她正在營地的某處慶祝他們的勝利。\n\n只可惜，他們開心不了多久了，你不覺得嗎？', '', '攻擊龍心哨站的罪魁禍首。', '絞肉手索托可', '', '', '在碎鱗者要塞中與怒西昂會面。', 47187),
(65992, 'zhTW', '黑爪情報', '與怒西昂派入碎鱗者要塞的間諜交談。', '正當我和瑟利思特拉從上方吸引他們的目光時，陰影已經滲透了他們的防禦。\n\n整座要塞都在我的黑爪密探的監控之下，找到他們，告訴他們你是我們這邊的人。他們會給你有關敵人的珍貴情報。', '', '', '', '', '', '在碎鱗者要塞中與怒西昂會面。', 47187),
(65991, 'zhTW', '清算時間到', '到碎鱗者要塞與怒西昂和管理者瑟利思特拉會合。', '見習生仙卓克絲已經把管理者的計畫告訴我了。謝謝生命守縛者願意伸出援手。他們的干涉為我們爭取到寶貴的時間，將傷患送回生命之池接受治療。\n\n我希望我能派人支援瑟利思特拉，但我的守衛必須保護傷患。前往敵人的要塞，跟他們會合。\n\n要是有別的辦法可以對付加拉登，我一定會去做。只可惜一直都沒有…\n\n你必須盡你所能。', '', '', '', '', '', '', 47187),
(65990, 'zhTW', '讓幼龍逃離魔掌', '從龍心哨站救出$1oa隻哀號的幼龍。', '他們突然發動襲擊，我們根本來不及反應。我的守衛盡全力擋住敵人，我們則設法撤離年幼和需要幫助的族人，但恐怕還有更多族人還困在哨站那裡。\n\n請越過那座橋，搜尋倖存者。', '', '', '', '', '', '', 47187),
(65989, 'zhTW', '加拉登入侵者', '到龍心哨站殺死$1oa個加拉登。', '我們或許無力奪回哨站，但我們絕對不能不戰而降。\n\n讓他們知道，我們可不是好惹的。', '', '', '', '', '', '', 47187),
(65977, 'zhTW', '找回祈倫托法師', '拯救$1oa名瀕死的法師。', '洪荒使者攻擊我們遠征隊的時候，我就擔心我們有很多法師已經遭到毒手了。\n\n他們似乎被洪荒使者帶走，在我們說話的同時，他們飽受敵人折磨！\n\n拜託你，你必須救出被留在這裡的法師。他們或許無法成為這場戰鬥的戰力，但是也不能拋下他們！', '', '', '', '', '', '往瓦瑟洛斯山脈的深處前進，與卡德加的投影會面。', 47187),
(65962, 'zhTW', '永遠不是最終的倒數', '準備好就與克羅米談話。', '真想不到我竟然要解除我們用來保護神殿的安全措施，才有辦法拯救它，但看來非做不可了！\n\n既然我們已經清除了時光元素，也釋放了時光行者，還讓守望者做好了準備，現在終於該解除最後一個靜滯泡泡，處理伊特努斯了。\n\n等你準備好就跟我說一聲。有你陪著我，事情絕對不會出錯的。', '', '', '', '', '', '', 47187),
(65958, 'zhTW', '洪荒力量', '使用元素法器，從殺死的洪荒使者和元素生物身上汲取元素能量。', '我恐怕越來越難維持我的鏡像了。洪荒使者正在集中他們所有武力要把我從空中打下來。\n\n別擔心…我有計畫。\n\n我需要你用取得的球體，從殺死的洪荒使者身上收集元素魔法。\n\n我們在前方會需要用提升的元素能量，把他們的部隊從我這裡引開。', '', '', '', '', '', '往瓦瑟洛斯山脈的深處前進，與卡德加的投影會面。', 47187),
(65957, 'zhTW', '無需英雄', '殺死莫達克‧焰噴、『穿刺者』季格拉和熔火歐菲斯。', '從我們觀察到的結果來看，加拉登是個崇尚武力的種族。最強者會身先士卒，激起其他同伴的戰意。\n\n在下方的部隊中，共有三個實力最為強大的加拉登…他們就是你的目標。\n\n$n，你需要獨自解決他們。這樣應該能對他們的士氣造成沉重打擊。', '', '', '', '', '', '', 47187),
(65956, 'zhTW', '猛爪攻擊', '瓦解加拉登的防禦。', '在你的幫助下，我的黑爪刺客會清除防守外圍地帶的加拉登。用小型昏迷炸彈標記目標，他們就會前去支援。\n\n請快點行動，消除可能妨礙我們進攻的所有障礙。', '', '', '', '', '', '', 47187),
(65955, 'zhTW', '半人馬最好的朋友', '解救卡沙爾，然後到洞穴找他。', '$p，一直待在空曠處不安全。\n\n巴巴是我的狩獵夥伴，牠被戈洛克追趕，跑進東邊的洞穴。\n\n救我出來，然後我們一起去救巴巴。清出一條路後，我會在那個洞穴跟你會合。', '', '', '', '', '', '', 47187),
(65954, 'zhTW', '關門放狗', '解救席卡巴卡犬。', '我聽到熟悉的嚎叫聲和吠叫聲，都是來自從營地失蹤的巴卡犬。\n\n我們親愛的狗狗被關在籠子裡，等著被那些…那些傢伙屠宰。\n\n我們有責任救出我們的夥伴。放出牠們，然後見證席卡巴卡犬真正的實力！', '', '', '', '', '', '', 47187),
(65953, 'zhTW', '先知先絕', '從戈洛克薩滿身上收集$1oa個圖騰。', '這個戈洛克村子的情況未免太瘋狂了，而且最瘋狂的就是那些戈洛克薩滿。\n\n他們邪惡無比，毫無節制地濫用風暴魔法，完全沒在管後果。\n\n我們一定要終結他們的瘋狂行徑。殺死他們，把他們的圖騰帶來給我。我們的秘法師應該會有興趣。', '', '', '', '', '', '', 47187),
(65952, 'zhTW', '傳奇酋長', '殺死鰭爾伽美什酋長。', '這個沼地的戈洛克曾經是很單純的生物。或許有點煩人，但永遠不會做出劫掠、偷竊或吃狗肉的事。\n\n都是他們的酋長鰭爾伽美什搞的鬼，害他們越來越偏離單純的本性。\n\n了結他的性命，戈洛克就再也不會對我們構成威脅。', '', '鰭爾伽美什是最厲害的戈洛克。除了他自己的絕望以外，已經沒什麼東西能征服了。', '鰭爾伽美什酋長', '', '', '', 47187),
(65951, 'zhTW', '唯一供應商', '搜索樹林，尋找卡沙爾。', '可憐的羅沙！她任勞任怨地幫商隊做事，結果她的補給品居然被那些卑鄙的戈洛克偷了。\n\n她失去了太多。我正在盡我所能幫助她。\n\n卡沙爾大概自己跑去追回那些補給品，而且沒告訴任何人。他老是這樣。不過這次他一直都沒回來，很多狗也跟著失蹤了。\n\n$p，可以麻煩你去找一下卡沙爾和那些狗嗎？', '', '', '', '', '', '在淤鰭村和卡沙爾交談。', 47187),
(65950, 'zhTW', '偷竊的戈洛克', '到淤鰭村找回遭竊的補給品。', '蹄鐵匠羅沙受邀加入商隊了嗎？沒有！但誰要提供蹄鐵給商隊？蹄鐵匠羅沙。而且淤鰭從誰身上偷東西？還是蹄鐵匠羅沙。哼。\n\n我想叫卡沙爾去，但誰知道他現在跑去哪裡閒晃？\n\n找到我的補給品，給那些該死的小偷一點教訓，讓他們知道別偷到蹄鐵匠羅沙身上。\n\n去吧！', '', '', '', '', '', '在淤鰭村和卡沙爾交談。', 47187),
(65949, 'zhTW', '鞋底治癒者', '將勳章還給蹄鐵匠羅沙。', '當我們與雍亞拉一起隨風而逝時，我們會留下這些勳章。\n\n雖然我幫忙製作了這個勳章，但我並不是它真正的主人。\n\n你應該把它交給羅沙，這是她未婚夫的遺物。\n\n把勳章還給她，她或許就能好好哀悼，然後走出來。', '', '', '', '', '', '', 47187),
(65948, 'zhTW', '時間裂隙', '利用東邊和西邊的水晶，進一步強化時光行者法杖。', '在神殿封鎖的時候，守望者也和神殿的門一起給封印了。我們需要打破那個靜滯泡泡，把他們救出來！不幸的是，需要能量全滿的時光行者法杖才能這麼做…\n\n我知道了！你可以從平台上的那些水晶汲取力量！那些能量應該夠你的法杖用了。\n\n水晶本身就有靜滯力場，只要將其抽離出來，就能用法杖吸收其中的能量。\n\n如果水晶碎裂也不用太擔心，就算它化成碎片，力量還是在！', '', '', '', '', '', '', 47187),
(65947, 'zhTW', '時間暫停的時光行者', '從時間泡泡中解放$1oa個時光行者。', '真高興你來了！在但丁和澤拉幫我制住恆龍朋友的同時，我需要你來處理平台上的狀況。\n\n伊特努斯企圖奪取我們誓言石的時候，神殿的防衛機制緊急啟動將她困在靜滯泡泡中。不幸的是，其他的時光行者也遭到波及、被安全措施困住了。\n\n你的時光行者法杖應該可以釋放他們。只是要小心應付跑出來的憤怒小時光元素！', '', '', '', '', '', '', 47187),
(65944, 'zhTW', '熔岩爆發', '摧毀$1oa顆熔岩球。', '洪荒使者撕裂了這座山脈，派出大批部隊湧向瓦瑟洛斯！\n\n我在最初的走廊上發現了一些他們用來散播元素混沌的熔岩球。\n\n摧毀它們，減緩他們的前進速度。我會在上面這裡盡我所能的協助卡雷苟斯。', '', '', '', '', '', '在瓦瑟洛斯山脈的更深處與卡德加的投影會面。', 47187),
(65943, 'zhTW', '洪荒攻擊', '在瓦瑟洛斯擊敗$1oa名洪荒使者。', '我跟卡德加正在努力抵擋空中的洪荒使者，但是我們沒辦法往高塔推進。\n\n我們需要你削弱他們的地面部隊，好讓我們靠近菈薩葛絲，在一切太遲之前阻止她。\n\n打倒前方的洪荒使者。如果我能保持專注，會有另一個鏡像在那裡等你。', '', '', '', '', '', '在瓦瑟洛斯山脈的更深處與卡雷苟斯的鏡像會面。', 47187),
(65940, 'zhTW', '破碎之路', '與席卡的商隊同行，前往河流渡口。', '我想你不會介意弄濕你的腳，在接下來的旅程中，我們必須渡過兩條河。\n\n雍‧賽希騰會很樂意跟你分享我們受祝福的看守者「雍亞拉」的故事。你們兩個接下來要好好相處喔。', '', '', '', '', '', '', 47187),
(65939, 'zhTW', '信念的勇氣', '攻下黑曜龍堡上層。', '下一場戰鬥無疑是一場惡戰，不過我們有勇氣、有決心，絕對能以少勝多。\n\n我想有了你出色的戰力，一定能帶領部隊贏得勝利。\n\n等你準備好了，我們就會開始進攻。', '', '', '', '', '', '', 47187),
(65938, 'zhTW', '曾經與未來的隊伍', '利用你的時光行者法杖，打破神殿大門的靜滯泡泡。', '來吧！我們得把神殿大門周圍的靜滯泡泡打破，救出我們的守望者！你準備好跟時間拔河了嗎？\n\n用力拉扯大門那裡的泡泡，就像之前對水晶做的那樣。小心一點，釋放出來的時間能量一定會全部朝你襲來。我不知道會冒出什麼，但無論如何，至少獲救的守望者一定會站在你這邊。\n\n祝你好運，$n！', '', '', '', '', '', '', 47187),
(65937, 'zhTW', '疏忽的證據', '找到紫丁香之地出問題的證據，然後拿給塞拉莫斯看。', '我們不能放棄。他得知道這裡發生了什麼事！如果他不願離開洞穴，我們就直接展示給他看。\n\n不管什麼證據都可以，反正反常的東西太多了，像是腐化的植物，或是充滿敵意的野生動物！', '', '', '', '', '', '', 47187),
(65935, 'zhTW', '趕上克羅米', '到時光合流平台與克羅米會合。', '你幫助我們重新掌控了這片沙地，但是我感應到神殿平台上似乎發生了不得了的大事。我們得趕緊起飛，到那邊和克羅諾穆大使會合。\n\n老話一句，時間寶貴。', '', '', '', '', '', '', 47187),
(65930, 'zhTW', '與風和水的搏鬥', '在寇莉格微光水灣附近挑戰風之靈克勞諾特。', '現在，我們應該就可以和神靈對決了。\n\n盧里克沒有提到嗎？根據我們部族的傳統，我們必須和神靈戰鬥，才可以向祂們祈求恩惠。祂們的祝福的力量取決於你在祂們心中留下的印象。\n\n或許這就是微光魚釣者堅持我們要合作的原因。\n\n如果你挑戰風之靈克勞諾特，盧里克和我就會對付水之靈歐圖洛克。\n\n祂們就住在附近瀑布後的洞穴中。我們在那裡會合吧，冒險者。', '', '古怪且淘氣的風之靈，位於寇莉格微光水灣周圍地區。據說很喜歡接受那些想證明自己的年輕巨牙海民的挑戰。', '克勞諾特', '', '', '', 47187),
(65929, 'zhTW', '破冰', '在寇莉格微光水灣附近從寒冰中打破冰凍之水。', '我就知道先祖會同意！\n\n我對神靈知道得不多…考吉才是薩滿。不過我們必須先取悅偉大的風之靈和水之靈，祂們才會為我們現身。\n\n大家都能看到，山上的水元素正在慢慢結凍。這不是自然的結凍現象。最近，寒冷從山上傳下來的現象比以往都嚴重。如果不管的話，我們的整條河都可能結冰。\n\n將他們從冰獄中釋放出來吧！', '', '', '', '', '', '', 47187),
(65928, 'zhTW', '任性的風', '在寇莉格微光水灣附近的躁動狂風身上收集$1oa個躁動狂風微粒。', '啊！她說要合作？\n\n可是…如果微光魚釣者相信，我們有機會可以幫上其他部族的忙…那我們就必須試試看。\n\n為了讓風之靈克勞諾特認可我們，我們必須先處理祂的元素。在大地開始甦醒時，附近的風元素生物就已經被侵擾了。\n\n在我檢視你們兩個做的船的時候，你去和他們戰鬥並卸除他們的武裝，然後把躁動微粒帶來給我。這樣應該可以讓這個區域恢復平靜。', '', '', '', '', '', '', 47187),
(65926, 'zhTW', '應對瀑布', '協助盧里克建造秋步號。', '你聽說過微光魚釣者的故事嗎？她建造了一艘無比堅固的船，成功穿過瀑布下方！\n\n那瓦長者最喜歡說這個故事。\n\n我想，如果我們用翁塔克猛瑪象的屍體再次打造這樣的船，它們的尊貴靈魂勢必也會引以為傲。\n\n我的兄弟並不同意，可是，只要我們成功，就能帶魚給我們的姊妹部族了，他們最近都過得不太好。\n\n你已經證明了你的手藝和熱忱！只要我們聯手，一定可以打造出偉大的成品。', '', '', '', '', '', '', 47187),
(65925, 'zhTW', '排除外患', '在寇莉格微光水灣附近殺死寒冰滑行者和寒冰鑽孔者。', '那些巨蟲不屬於這裡。我不知道牠們為什麼會從地下巢穴被吸引到這裡來，可是我們現在沒辦法幫助牠們。\n\n我們不能讓牠們繼續摧毀這裡的自然生態。\n\n殺死巨蟲，$n。你要的話可以收集牠們身上的資源，完成之後再來微光水灣找我。', '', '', '', '', '', '到寇莉格微光水灣見盧里克。', 47187),
(65921, 'zhTW', '瑞夫提懲戒', '到提爾堡蓄水池殺死洪荒使者，並拯救瑞夫提倖存者。', '$p，我的腦海都是這個念頭。有那麼多姐妹慘遭殺戮！生命有如草芥一般…絕對要讓殺死他們的傢伙付出代價！\n\n我的士兵一路追蹤洪荒使者，他們說還有一些姐妹活著。\n\n我們必須救出他們，然後讓每個洪荒使者都知道我有多憤怒！', '', '', '', '', '', '', 47187),
(65920, 'zhTW', '為了結界！', '使用遺失的鑰石修復蓄水池的結界，然後啟動控制臺。', '我們終於能修復結界了。就算我們遭受到極大的損失，但我們還是必須要完成這個任務。\n\n$p，我們再一次需要你的協助。請將每個鑰石帶到正確的地方，讓結界再次完整。\n\n完成之後就回來，到時候我們就能啟動控制臺，恢復蓄水池的秩序。', '', '', '', '', '', '', 47187),
(65918, 'zhTW', '預防性維護', '在提爾堡蓄水池殺死$1oa個無縛元素。', '洪荒元素正在無止境地增生。原本我和我的姐妹會解決它們，但我們現在無力與它們交戰。有不少士兵陣亡了。\n\n此外，我們這些倖存下來的少數人也都背負著各自的任務。\n\n<祖提奇痛苦地皺了臉一下。>\n\n$p，現在就是你能出手的時候。你能解決那些元素生物嗎？', '', '', '', '', '', '', 47187),
(65916, 'zhTW', '我們不和洪荒使者協商', '到提爾堡蓄水池殺死洪荒使者的首領科裘，並取回遺失的鑰石。', '洪荒使者以為他們能夠壓制提爾的力量。他們錯了。\n\n我的瑞夫提手下追查洪荒使者的行蹤，發現他們藏身在離這裡不遠的洞穴裡。如我所料，遺失的鑰石就在他們手中。\n\n勇士，如果我們要修復蓄水池，就必須取回那些鑰石。\n\n此外還必須殺死他們的首領，他們才不會再度發動攻擊。', '', '', '', '', '', '', 47187),
(65914, 'zhTW', '猛瑪象很重要', '在寇莉格微光水灣附近，從死亡的翁塔克猛瑪象身上收集翁塔克毛皮碎塊及翁塔克獠牙。', '我們的部族已經飼養翁塔克猛瑪象群好幾代了。這是我們引以為傲的事蹟，但是現在牠們…卻都死了。\n\n經過這樣的大屠殺，牠們的靈魂因為憤怒而徘徊不去。我們必須妥善運用牠們的屍體，讓牠們的生命得到尊重。\n\n但是數量太龐大，光憑我們根本收集不完。拜託你，從小象和母象身上收集還可以用的材料，然後到寇莉格微光水灣來見我。', '', '', '', '', '', '到寇莉格微光水灣見盧里克。', 47187),
(65913, 'zhTW', '看啊，是看守者？', '前往提爾堡蓄水池，從洪荒使者手中解救看守者瑪拉。', '感謝泰坦！$C，我們需要你的協助！\n\n洪荒使者不久前開始進攻。我和我的姐妹雖然成功守下，但卻傷亡慘重…\n\n但先確保我的看守者安全之後，再來悼念吧！交戰的過程中，有群洪荒使者趁亂逃脫，我發誓，要是他們膽敢傷害我們的看守者…\n\n你必須去幫她，否則就來不及了！', '', '', '', '', '', '', 47187),
(65911, 'zhTW', '蒼藍連線', '返回蒼藍文庫去見卡雷苟斯。', '這個群體的情感連結…他們所共享的友誼與家庭。\n\n我…從未有過。藍龍軍團從未有過。或許那是因為我們從未有過這種機會。\n\n現在正是時候。我必須召集我的族人。\n\n到蒼藍文庫和我會合。還有很多事要做。', '', '', '', '', '', '返回蒼藍文庫去見卡雷苟斯。', 47187),
(65907, 'zhTW', '最愛的水果', '從雍伊爾噴泉收集野生灌木果，並餵給$1oa個懶洋洋的踏泥獸。', '秘法師訓練無聊透頂。我有一半的時間都在觀察水的形態。我的兄弟們都已經到野外去狩獵飛龍跟洪荒使者，為這個世界帶來改變。\n\n總之，我保證過會給你看很酷的東西！你知道踏泥獸喜歡灌木果嗎？它就長在附近的噴泉那裡。去摘一些來，我們可以一起餵牠們。', '', '', '', '', '', '', 47187),
(65906, 'zhTW', '不滿的學徒', '到雍亞拉平原的雍伊爾溫泉，與學徒菈迪亞交談。', '我收到一封來自雍伊爾溫泉的有趣的信。\n\n至於信的內容，裡面提到恐怖的監禁生活、控制狂導師，還有極度無聊的一切。它的正式簽名是學徒菈迪亞留下的。這裡還有張插圖，畫著一隻老鷹…把一個名叫梅倫的半人馬踢下懸崖。\n\n這個嘛。我想這應該是求救信，要是你有興趣的話，可以親自去看看。老實說，我想菈迪亞應該沒事。她很常寄這種信給我。', '', '', '', '', '', '到雍亞拉平原的雍伊爾溫泉，與學徒菈迪亞交談。', 47187),
(65905, 'zhTW', '不只是雜草', '清除紫丁香之地的藤蔓和怪物。', '也許我們最好給塞拉莫斯一點空間，\n\n但我們也不能無所事事。林地正在快速自我毀滅！請幫幫我們。', '', '', '', '', '', '', 47187),
(65904, 'zhTW', '真的夠了', '將紫丁香之地出問題的證據交給塞拉莫斯。', '不管他是不是怪人，塞拉莫斯都該盡到自己的本分。要是他一直躲在裡面，就看不到他消失之後所帶來的後果。\n\n我們一起去吧，把證據給他看。', '', '', '', '', '', '', 47187),
(65903, 'zhTW', '毛茸茸最讚', '捕捉$1oa隻林地跳兔。', '可憐的塞拉莫斯。我有個想法，或許能讓他開心點！\n\n拿著這張網子去捉幾隻土生土長的跳兔，牠們性格溫順，動作卻很快。海岸附近有不少跳兔出沒。\n\n只要把牠們送給塞拉莫斯，那毛茸茸的絕佳觸感，應該能讓他精神一振！', '', '', '', '', '', '', 47187),
(65902, 'zhTW', '要食物還是毛茸茸', '將香料龜肉和林地跳兔交給塞拉莫斯。', '看看這個多汁又好吃的香料龜肉！當然，我是從客觀的角度發言。畢竟我可是個素食主義者。\n\n上吧！他今天應該什麼都沒吃。', '', '', '', '', '', '', 47187),
(65901, 'zhTW', '偷溜', '到雍伊爾溫泉放置風之圖騰，然後通知菈迪亞。', '我被永久禁足了！難道我的雍不知道，我明年春天就要滿16歲了嗎？我應該可以想離開就離開才對。\n\n看來你可以幫我的忙。我確實有個逃跑計畫：透過引導這些圖騰，我可以凝聚空氣並製造不小的擾動。不過，我沒辦法把它們放到定位，因為我一直在強風的監視之下。就連托苟都幫不了我。\n\n不過，要是有你幫忙…拜託了！我保證會給你看很酷的東西。', '', '', '', '', '', '到空之鏡找菈迪亞。', 47187),
(65900, 'zhTW', '可疑調味肉排', '收集$1oa份完美鮮嫩的龜肉、$2oa份爬蟲類蛋殼和$3oa朵酸味花。', '她的想法很有意思，不過塞拉莫斯需要的是真正能讓他振奮起來的東西。\n\n也就是要特大份量的酸味花。我們能把它弄成糊狀，塗在他最喜歡的龜肉上！\n\n你願意幫我收集食材嗎？', '', '', '', '', '', '', 47187),
(65899, 'zhTW', '找到塞拉莫斯', '搜索附近的洞穴，尋找塞拉莫斯。', '$R！你是來拜訪美麗的紫丁香之地的嗎？它現在這麼狼藉真抱歉。我發誓它平常沒有這麼雜亂！\n\n花園的園丁塞拉莫斯今天應該要跟我們見面來一起處理問題的。維護讓他最近有點忙不過來，所以菲莉娜和我在幫忙他。但我們沒辦法做完全部的事。\n\n你可以幫我們四處找找他嗎？或許他忘記了。', '', '', '', '', '', '回去找瑟琳娜‧脆葉。', 47187),
(65898, 'zhTW', '元龍問題', '取得龍域並擊敗保護它的元龍。', '我對碎裂火焰軍沒什麼好感，但我也無法眼睜睜地看著他們像這樣死於非命。這一切都讓人太熟悉了。\n\n無論這個龍域是什麼，比起被他們得到，還是我們手中比較安全。沿著屍體鋪成的道路走，我想應該就能找到它。\n\n一定要小心，$p。我擔心事情有變，那個巢穴說不定沒有廢棄。', '', '', '', '', '', '', 47187),
(65896, 'zhTW', '修復關係', '協助治療暴風城的居民。', '你以為自己能神不知鬼不覺地踏進這座城市嗎？不！\n\n我先前果然沒看錯你們這些傢伙，我絕對不會讓巨龍再次摧毀我的家園。\n\n這裡曾是充滿歡樂與和平的地方。然後你們的先輩「死亡之翼」來了。喔，沒錯，我對他一清二楚。\n\n他造成的破壞還遺留至今，你自己去看看。那些痛苦如今仍在街道上徘徊。', '', '', '', '', '', '', 47187),
(65895, 'zhTW', '競爭夥伴', '收集有關碎裂火焰軍的情報。', '呸！這些工人殺得再多，對我們也沒有什麼幫助。\n\n應該去找他們的工頭，他們之中一定有人知道我們需要的情報。\n\n對了，$n，這次先聽他們把話說完，再殺了他們。你可能會得到有用的情報。', '', '', '', '', '', '到廢墟上層附近找艾德奈達。', 47187),
(65893, 'zhTW', '文物疑問', '收集$1oa個奈薩贊文物碎片。', '碎裂火焰軍跑來這裡了。他們名字裡寫著碎裂！怎麼能信他們經手貴重的文物？\n\n當然不行。儘管如此，我們必須知道他們來這裡的目的，才知道下一步要怎麼走。從他們身上收集任何找得到的東西，然後帶著東西來找我回報。\n\n比起我們在地底找到的東西，這個謎題還有更多拼圖要找。', '', '', '', '', '', '', 47187),
(65892, 'zhTW', '真正碎裂', '', '', '', '', '', '', '', '', 47187),
(65891, 'zhTW', '長篇大論的工具', '對$1oa個礫石堆使用附魔工具。', '很好。我正想要找你這樣的冒險者幫忙，既強壯，又結實，還願意幫人處理一些雜事。\n\n簡直就像我用意志力把你召來，我實在太能幹了。這些廢墟似乎引來不少人的注意。我們不能期待他們會小心翼翼地挖掘，他們很可能會汙染樣本！\n\n拿著這個。到廢墟各處，把它部署在值得關注的文物周圍。它有魔法，可以執行所有必要工作。', '', '', '', '', '', '', 47187),
(65890, 'zhTW', '奈薩贊廢墟', '到奈薩贊廢墟找青空書記艾德奈達。', '龍鱗遠征隊需要你出手相助。\n\n我派了青空書記去廢墟蒐集情報。那裡應該毫無人煙，不過我卻在這裡聽見他的慘叫。\n\n他的聲音居然傳了這麼遠，他一定是遇到極大的危險。\n\n這次遠征，不管遇到多麼棘手的情況，我們都要照顧同伴。請找到他，協助他脫離險境。', '', '', '', '', '', '', 47187),
(65887, 'zhTW', '前往山脈', '在瓦瑟洛斯山脈的底部與卡德加及卡雷苟斯的鏡像會面。', '卡德加和卡雷苟斯正在空中對抗洪荒使者，這景象真是壯觀啊！\n\n他們召喚了幾個自己的鏡像，幫助你通過洪荒使者創造出來的巨洞。\n\n有一對現在在山腳下。\n\n如果狀況開始變糟…我們會把消息傳遞出去讓蒼藍高地中的其他夥伴知道。', '', '', '', '', '', '在瓦瑟洛斯山脈的底部與卡德加及卡雷苟斯的鏡像會面。', 47187),
(65886, 'zhTW', '前往羅甯之盾', '在高塔瞰台與卓克‧刺軸者會面。', '菈薩葛絲和洪荒使者正在向瓦瑟洛斯發動全面攻擊，我們絕不能讓她得逞。\n\n我跟卡德加會從空中支援那裡的戰況。\n\n在這段期間，你去羅甯之盾，這個區域裡面最後的祈倫托營地之一。\n\n你從文庫最上層騎龍應該能更快抵達那裡。\n\n確保那裡的祈倫托成員都沒事，然後再去瓦瑟洛斯。\n\n就靠你從地面支援我們了。', '', '', '', '', '', '在羅甯之盾與卓克‧刺軸者會面。', 47187),
(65875, 'zhTW', '龍的休息日', '為瓦札莉亞找到各種飲料。', '一輩子在外域…總是不停在戰鬥。根本沒時間放鬆！\n\n有時候，一頭龍需要的只是放一天假到海邊玩，享受一杯超級冰涼的飲料。\n\n嘿，或許你可以幫我放鬆！幫我一個忙，看看你能不能找到這些飲料，為我們的補給品帶來一點新意。', '', '', '', '', '', '', 47187),
(65873, 'zhTW', '影爪集團領袖', '殺死卡格波並取回他的圖騰。', '在森林的這一邊，卡格波是豺狼人真正的領袖。我們…過去曾經有一些過節。\n\n但這一次不同。他帶著一個奇怪的圖騰，那似乎扭曲了他整個人。\n\n必須要阻止卡格波，然後取回那個圖騰。我擔心豺狼人正在攪和一件比我們所能想像還要黑暗的事情。', '', '卡格波一直都心懷不軌，可是在他開始攜帶邪惡圖騰後，他變得更有侵略性了。', '惡臭的卡格波', '', '', '', 47187),
(65872, 'zhTW', '有病的豺狼人', '在卡格波的巢穴殺死$1oa隻影爪豺狼人。', '我聞到風中有一股奇怪的味道。有些事情不太對勁…\n\n哈努說這個洞穴裡的豺狼人很奇怪…而且生病了。我們應該深入瞭解造成這種情況的原因。\n\n別放鬆你的警戒。儘管他們看起來病得很重，但請記得他們還是跟原來一樣危險狡詐。', '', '', '', '', '', '', 47187),
(65871, 'zhTW', '豺口餘生', '救援諾魯克和其他$1oa名被俘虜的巨牙海民。', '我已經追蹤到被擄走的巨牙海民，還有我丈夫諾魯克，他們都在這個洞穴裡。\n\n諾魯克時常沒注意到自己的安危，所以這個責任就落到我身上了。但我也不會拉不下臉來求助。\n\n請救救他們！', '', '', '', '', '', '', 47187),
(65870, 'zhTW', '有補給品！', '取回狩獵用品。', '大樹山丘找不到我們被偷的狩獵用品。一定是在那個洞穴裡。\n\n張大眼睛注意有沒有補給品箱子，然後做好應對任何情況的準備。\n\n我不相信豺狼人會讓那些物品沒人看守。', '', '', '', '', '', '', 47187),
(65869, 'zhTW', '另一次伏擊', '跟阿基恩交談，並檢視$2oa具附近的屍體。', '這是個悲劇。而且或許是更多悲劇的開端。\n\n調查阿基恩知道的資訊，然後檢查一下所有在攻擊中死去的人。\n\n我對這裡發生的事情有個預感。我們來看看有沒有線索能支持我的理論吧。\n\n在那同時，我會努力安撫我那嚇到的朋友。', '', '', '', '', '', '', 47187),
(65868, 'zhTW', '那些不能嚼', '找回$1oa個葬儀祭品。', '我找到一個波諾里亞的葬儀祭品，被這些影爪豺狼人濫用過後丟棄…上面都佈滿了咬痕！\n\n伊斯凱拉酋長最近去世了，他的追悼儀式需要這個東西和其他類似的祭品。\n\n這麼神聖的東西卻被當成了磨牙玩具，實在太侮辱人了。請幫我們留意，找出其他的祭品。', '', '', '', '', '', '在大樹山丘的卡格波的巢穴入口與哈努會面。', 47187),
(65867, 'zhTW', '大樹山丘的嚎叫', '殺死杜剛、科沃和巴克拉。', '攻擊我們商隊的豺狼人由三名副官所領導。\n\n杜剛的側翼有十幾隻土狼護衛。\n\n科沃設置了許多危險的陷阱。每當我們想去追擊他、結果卻觸發陷阱時，他就會發出瘋子一樣的笑聲。\n\n巴克拉則會無情地嘲弄我們。\n\n為了找回被偷走的東西，必須殺死他們。', '', '', '', '', '', '在大樹山丘的卡格波的巢穴入口與哈努會面。', 47187),
(65866, 'zhTW', '觸發陷阱', '觸發$1oa個鋸刃陷阱。', '前方的山丘佈滿了陰險的陷阱。\n\n你有銳利的視力，應該可以找出它們的位置。請用巨牙海民的老方法，也就是一根長棍子，來解除陷阱。請注意，雖然踏上去也是解除陷阱的一種方式，但這種方法我不建議。\n\n等你拆掉夠多陷阱之後，去找哈努。我跟波雅長老會盡快趕上。', '', '', '', '', '', '在大樹山丘的卡格波的巢穴入口與哈努會面。', 47187),
(65864, 'zhTW', '追上商隊', '在大樹山丘附近追上布蕾娜。', '你應該追上布蕾娜，她的商隊才剛通過這裡不到幾個小時。\n\n為了舉行喪禮紀念已故的酋長，他們正在收集他最珍貴的財產。\n\n商隊運載的貨物非常多，她應該不可能走得太遠。', '', '', '', '', '', '', 47187),
(65855, 'zhTW', '幫助蒼藍高地', '回到安東尼達斯營地找全憶者諾麗可。', '我們得先修復蒼藍高地的地脈，不然無法復原誓言石的能量。\n\n有些地脈只有透過卡雷苟斯才能靠近…但是你還是能派得上用場。\n\n去找巨牙海民，他們可能還活著。在巨龍還在的時代，他們就住在這裡，對這片土地有非常深入的了解。\n\n與我們的其中一個秘法助手交談，回到你的盟友身邊。', '', '', '', '', '', '在安東尼達斯營地與全憶者諾麗可談話。', 47187),
(65854, 'zhTW', '復原誓言石', '見證卡雷苟斯復原蒼藍誓約石', '做得好，朋友。看來我們成功修復蒼藍文庫裡的地脈了。\n\n當藍龍軍團還團結一致的那時候，我告訴我的兄弟姐妹，永遠不要懷疑凡人的力量。\n\n到南邊的誓言石那裡找我。我會復原它，然後出發去薩爪祖斯。', '', '', '', '', '', '與辛德拉苟莎交談。', 47187),
(65852, 'zhTW', '登上頂端', '從一袋實用物品裡找出秘法墊腳石，然後用它抵達蒼藍文庫的頂端。', '塔頂似乎有東西正在緩慢吞噬秘法能量。\n\n既然你已經讓下面這裡的能量恢復穩定，你應該能夠「駕馭」那裡的秘法魔法。\n\n找找你的背包，裡面應該有稱為「秘法墊腳石」的東西。使用它，然後到上面跟我會合。', '', '', '', '', '', '在蒼藍文庫的頂端與卡雷苟斯會面。', 47187),
(65850, 'zhTW', '海洋的循環', '和布蕾娜交談，見證喪禮儀式。', '謝謝你，$n。我已經從新朋友那裡得知我目前需要的資訊。\n\n為他們酋長舉辦的喪禮儀式就快開始了。伊斯凱拉對我們展現友好與熱情，我們也應該在啟程回蒼藍文庫之前參加這場儀式。\n\n和布蕾娜交談，讓她知道我們等他們準備好就過去。', '', '', '', '', '', '', 47187),
(65849, 'zhTW', '前往伊斯凱拉', '在伊斯凱拉與布蕾娜會面。', '感謝你的諸多協助，$n。多虧了你，我的家人安全了。\n\n現在，我們終於能回到伊斯凱拉，見證老波諾里亞回歸大海。他曾經是很棒的酋長，也是我的導師。\n\n拜託，加入我們的行列吧！所有人都能跟我們一起慶祝海洋的循環。', '', '', '', '', '', '在伊斯凱拉與布蕾娜會面。', 47187),
(65848, 'zhTW', '秘典結界束縛', '與卡雷苟斯交談，打開傳送門，接著利用他召喚出的東西，解決蕨皮腐爛者，然後消滅扭曲的古樹。', '我們必須阻止那棵樹！有了這些脈能水晶，我總算能幫忙了。\n\n準備好了，就跟我說一聲。我會打開通往蒼藍文庫的傳送門，試著召出一些有用的東西。\n\n後退一點，傳送門可能會有點不穩定。', '', '', '', '', '', '在地脈水晶洞穴內與卡雷苟斯談話。', 47187),
(65847, 'zhTW', '重整', '專注於脈能水晶，然後摧毀3個腐朽感染點。', '至於這條地脈。看來我擔心的事成真了，腐朽之息已經滲透到地脈中。\n\n我們需要淨化腐朽之息，並盡可能加快整個治療過程，但是光憑我的鏡像，我無法引導足夠的能量來治療地脈。\n\n讓你的精神專注於這裡的脈能水晶。透過我與你的連結，我的本體可以傳送到這裡，我就會有足夠的力量。', '', '', '', '', '', '在蕨皮外圍找到卡雷苟斯。', 47187),
(65846, 'zhTW', '發臭脈能', '在蕨皮谷外圍收集$1oa顆脈能水晶。', '地脈就在這裡，我感覺得到！\n\n不過，我們必須先阻止豺狼人。那棵古樹一定是他們的王牌。\n\n豺狼人已經收集了一些脈能水晶。幸好，他們似乎還不了解水晶蘊藏的力量。\n\n請把水晶帶來給我，越多越好。水晶可以強化我的鏡像，還能讓我從文庫召喚一些有用的東西，用來打倒那個怪物！', '', '', '', '', '', '', 47187),
(65845, 'zhTW', '亡者的回音', '將布蕾娜的圖騰放在$1oa具巨牙海民的屍體附近，聯繫他們的靈魂。', '這裡有巨牙海民！我的朋友，我的族人，也是我的家人。他們不到一週前，才出發去打獵。\n\n他們現在卻已經腐朽到連收屍都沒辦法。\n\n他們的靈魂還在這裡。因為憤怒和後悔而徘徊不去。卡加塔、魯托克、圖尤奇…\n\n求求你，$n，把這圖騰拿去放在他們的遺體旁邊。它會聯繫他們的靈魂…並幫助他們安息。', '', '', '', '', '', '', 47187),
(65844, 'zhTW', '切除腐化', '殺死$1oa個腐敗樹人和$2oa個蕨皮擲腐者。', '這些豺狼人的大腦還有身體一定早就腐朽了！\n\n儘管豺狼人只會到處破壞，但他們跟我們一樣，都是這片土地的原住民。\n\n不過，我們已經看到他們把腐朽散播到大樹部族。照這樣下去，他們會吞噬整個高地，走向自我毀滅。\n\n我們不能讓這種事發生。雖然很殘忍…但他們留不得。', '', '', '', '', '', '', 47187),
(65842, 'zhTW', '繳械之舉', '除掉武器大師沃達珂並收集$1oa件碎界武器。', '我對那些碎界使徒一點好感都沒有。他們冥頑不靈深信死亡之翼總有一天回歸，而且不願協助我們守護黑曜王座。\n\n武器大師沃達珂曾經發誓效忠黑龍王子，結果卻偷走了很多在黑曜龍堡製作的武器，轉交給碎界使徒。我不能容許這樣的竊賊、不能容許這等背叛。\n\n前往悶燃之巔取回那些武器…必要時亦可動武。', '', '', '武器大師沃達珂', '', '', '', 47187),
(65841, 'zhTW', '停止擴散', '', '', '', '', '', '', '', '', 47187),
(65838, 'zhTW', '突破蕨皮', '調查蕨皮谷外圍。', '如果這裡的豺狼人發現了腐朽魔法，就代表地脈和這片土地本身都面臨重大危機。\n\n我的鏡像現在不太穩定，無法承受森林裡面的元素干擾。請進入森林調查腐朽之息的源頭。\n\n我會跟我們的巨牙海民新朋友合作，找到一個可以維持鏡像的地方，與你在更深處會面。\n\n我們必須阻止這一切！', '', '', '', '', '', '在蕨皮刺藤與卡雷苟斯談話。', 47187),
(65837, 'zhTW', '松林的麻煩', '在雍亞拉平原的松木崗哨和哨兵歐雷克談話。', '席卡高地發生了一場洪荒使者攻擊。\n\n如果你有相關情報，或是覺得自己可以幫上忙，就前往松木崗哨去找歐雷克。告訴他，你是我派去的。<特然輕笑。>我真希望塵蹄還記得我。\n\n記得沿著道路走，$p。在這麼多改變發生後，平原不像以往那麼平靜了。', '', '', '', '', '', '在雍亞拉平原的松木崗哨和哨兵歐雷克談話。', 47187),
(65836, 'zhTW', '風暴現身', '到睿冠松林與瓦杜會合。', '<瓦杜輕鬆地站了起來，彷彿他的傷已經好了。>\n\n我…我把裂片插進自己身體，然後再也不痛了。我感覺很好，好極了。非常好。\n\n歐雷克還沒回來，一定是出事了。他當初不該拋下我自己去！', '', '', '', '', '', '', 47187),
(65834, 'zhTW', '殺死女王', '殺死顫網蛛后。', '就是這樣！一點正規教育、一點聰明的猜測、然後再把符文重刻一下，我們就做出魔法抽出器啦！還是叫反注器？還是吸取器？\n\n隨便啦！我可以確定的是，我們這樣做一定會讓那個蛛后不開心。如果我們想要阻止這場威脅，就必須除掉她。捏死小隻的只能減緩牠們的擴張，你必須從源頭消滅牠們才行。', '', '絕對不能有蜘蛛女王。', '顫網蛛后', '', '', '', 47187),
(65833, 'zhTW', '洪荒使者破壞行動', '取回三位喚霜者的符石。', '洪荒使者不斷地把元素寒冰注入蜘蛛體內，還把牠們當作突擊部隊，想要突破龍族在高地的防線。我們不能讓他們得逞。\n\n那三個看起來冷冰冰的傢伙就是老大。把他們殺了，然後把他們用來集中原始魔法的符石帶來給我，我們就可以試著切斷那股流動的力量。', '', '', '', '', '', '', 47187),
(65832, 'zhTW', '矮人防凍劑', '找到$1oa瓶矮人防凍劑。', '我遇到了一點小麻煩，$U小夥子:小姑娘;。洪荒使者那群舔冰塊的渾蛋把我困在這塊巨大的冰塊中，我還沒凍成冰塊的唯一原因就是我私藏的好貨。\n\n可惜的是，有個混蛋小偷突襲了我，偷走了我藏得沒那麼好的貨，現在我已經快沒了！\n\n你可不可以幫幫我這矮人，幫我拿幾瓶防凍劑來，不然我的血液就要結冰啦。\n\n噢，還有啊，$U小夥子:小姑娘;，如果你不得不從蜘蛛的重要部位取出來，千萬別告訴我。我寧願被蒙在鼓裡。', '', '', '', '', '', '', 47187),
(65806, 'zhTW', '莫魯凱', '進入莫魯凱。', '<桑索克可汗嘆了口氣，歐奇爾隨即發聲。>\n\n莫魯凱就位在這片林地的後方，依山而建。我們的旅程即將結束。\n\n庫拉爾對莫魯克來說是一個休戰的時期，可是雍‧賽希騰的預言令人擔憂。我們必須保持警覺。', '', '', '', '', '', '', 47187),
(65805, 'zhTW', '連上雍亞拉', '從河岸收集$1oa份河川蘆葦、$2oa簇鳥禽尾羽和1個薩曼瑟螈心臟。', '這裡的風變得更加不安，$n。雍亞拉正在求救，我必須回應她的呼喚。\n\n我需要一些施法材料才能舉行儀式：生長在河岸的蘆葦、綠頭鴨的尾羽，還有薩曼瑟螈的心臟。去河邊收集這些材料，讓我能夠傾聽她的聲音。', '', '', '', '', '', '', 47187),
(65804, 'zhTW', '為了食物和競爭者', '到漫遊者草原，從野生動物身上收集$1oa份新鮮的獸肉。', '莫魯克會從平原各處聚集而來，參加庫拉爾，而這個聚會會持續好幾天的時間。\n\n要餵飽那麼多半人馬可不是容易。席卡氏族的獵人會為所有共享的聚餐提供肉品。在前往莫魯凱的路上進行狩獵是我們的傳統。\n\n這時候你也要出點力。', '', '', '', '', '', '', 47187),
(65803, 'zhTW', '往城市出發', '與席卡的商隊同行，前往漫遊者草原。', '舉行庫拉爾時，不同氏族會一起討論事情，分享故事。雖然平原上散居著很多半人馬氏族，不過我們全都是莫魯克。\n\n車隊隨時都能出發。因為前往莫魯凱的路途有點遙遠，所以途中會休息一下。\n\n等你準備好出發時，就到車隊找我。別讓我們等太久。', '', '', '', '', '', '', 47187),
(65802, 'zhTW', '旅程補給品', '在木階哨站周圍收集$1oa份營地補給品，在附近的樹林收集$2oa個野花莢。', '<桑索克可汗嘆了口氣，歐奇爾隨即為可汗發聲。>\n\n在你和我們同行時，你必須盡一份力。戈洛克最近一直肆無忌憚地掠奪我們的醫療用品，所以我們得補充庫存。到哨站附近去收集橘色花朵，這樣我們才能做更多膏藥。\n\n哨站附近也有補給品，需要有人把它們拿到商隊去。在你到外頭去的時候，我希望你能收集它們。\n\n等到你收集齊了，就交給托姆爾。', '', '', '', '', '', '向斥候托姆爾回報。', 47187),
(65801, 'zhTW', '彼此介紹', '向席卡氏族的成員介紹你自己。', '<桑索克可汗嘆了口氣，歐奇爾隨即為可汗發聲。>\n\n像你這樣的外來者上次來我們的土地已經是好幾世代前的事了。現在洪荒使者在我們的土地上到處遊走，散播禁忌魔法，我的族人當然非常警戒。\n\n如果你想要和我們同行，就必須讓大家認識你。向我的氏族成員介紹你自己吧。', '', '', '', '', '', '向斥候托姆爾回報。', 47187),
(65798, 'zhTW', '見機行事', '在諾庫德大道取回武器並殺死諾庫德部隊。', '席卡氏族已經在北方形成一道對抗諾庫德族的進攻前線。雖然我不喜歡降格去拾荒，可惜的是，這對我們的補給品來說是必要之惡。勇敢前去戰場並帶回武器，我就會為你的努力提供獎勵。\n\n如果你可以把這樣的努力集中在諾庫德族的攻擊線上，或許祖先審判我時就不會那麼嚴厲。', '', '', '', '', '', '', 47187),
(65796, 'zhTW', '最好的防禦…', '殺死『碎牙者』席雷娜。', '我們的下一條路要穿過諾庫德的地盤。在過去，我們與他們的氏族關係不好不壞，不過現在情況改變了。\n\n如果我們不先展開行動，就等於讓敵人來決定我們的生死。我的斥候回報說，發現他們的其中一個將領出現在龍族集合地附近。直接向她主動開戰，別讓她有機會召集部隊、在我們移動時偷襲我們。', '', '', '', '', '', '', 47187),
(65795, 'zhTW', '平原的下一步', '到晶紅鱗哨站與陶拉莎大使會面。', '綠龍軍團現在需要你的援助，英雄。我姊妹的女兒和她的夥伴進入了翡翠夢境，嘗試強化他們自己的誓言石。不過，自從他們開始沉睡之後，我們已經一陣子沒有聽到任何新的消息。\n\n去找統治雍亞拉平原的半人馬。想要喚醒綠龍，你可能會需要借助他們的力量以及那塊土地的精魂。\n\n他們既高傲又極度重視捍衛領土，無法容忍任何羞辱。去和我們的大使談話，他會為你做好準備的。', '', '', '', '', '', '到晶紅鱗哨站與陶拉莎大使會面。', 47187),
(65794, 'zhTW', '守護龍族', '見證黑龍蛋重入生命之池。', '感謝你，$c。同時我也很抱歉，你必須應付那兩位那麼久。\n\n紅龍軍團負責保存和培育所有的真正龍族，即使是偶爾會使我們厭煩的也不例外。\n\n如今黑龍軍團的龍蛋終於也回到這裡，龍族在過去萬年之間從沒未如此團結過。我們的使命總算達成，這應該能夠再次修復晶紅誓言石。\n\n當你準備好將龍蛋送往黑曜生命之池的時候，就來和我說一聲。', '', '', '', '', '', '', 47187),
(65793, 'zhTW', '黑龍貨運', '護送龍蛋前往生命之池。', '隨著誓言石再次充滿力量，我們得將黑龍族的未來運送到生命之池，每個巨龍軍團的成員都有這樣的權利，讓這裡的水孕育他們的龍蛋。\n\n很不幸的是，由於我們已經暴露了行蹤，敵人一定會密切監視天空的動靜。為了躲過他們的耳目，我們最後一段旅程最好改以地面徒步的方式完成。\n\n到黑曜壁壘附近和我會面，$c。生命守縛者的勇士，很高興你能和我們一起同行。', '', '', '', '', '', '到晶紅生命聖殿與賽柏利安交談。', 47187),
(65792, 'zhTW', '加倍奉還', '與托路金一起殺死$1oa隻岩牙獸。', '幾天前，托莉奇宣稱她在沒有任何幫助的情況下，獨力殺了岩牙獸。有鑑於我們的靈魂相互連結，我不想說她是騙子。所以…\n\n我要向她證明，向大家證明，我比她更厲害！最近的岩牙獸位在這裡的東北方，我們在那裡碰面！', '', '', '', '', '', '', 47187),
(65791, 'zhTW', '生命守縛者的職責', '在晶紅誓言石旁和雅立史卓莎會面。', '生命之池很快就會再次盈滿。\n\n謝謝你的參與，$n，我心中的感激難以言喻。\n\n去吧，到誓言石那邊找生命守縛者。告訴她，我們準備好迎接龍蛋了。', '', '', '', '', '', '在晶紅誓言石旁和雅立史卓莎會面。', 47187),
(65789, 'zhTW', '河流沉睡之處', '到泥木沼池收集施法材料。', '泥木那裡有重要的施法材料，經常用來與先祖溝通。只可惜，淤鰭部族佔據了那個地方，讓我們很難去那裡搜尋材料。\n\n如果你能去沼地裡摘一些花朵，再順便收集淤鰭特有的資源，我會非常感激。', '', '', '', '', '', '', 47187),
(65783, 'zhTW', '歡迎來到我們的營火', '到木階哨站與斥候托姆爾會面。', '你與我們的獵人並肩作戰，獲得坐在營火旁的資格。\n\n我們的可汗正位於我們在沼澤的狩獵據點，為我們即將離開的商隊做準備。我會告訴她你的來意。\n\n你一定找得到路的。', '', '', '', '', '', '到木階哨站與斥候托姆爾會面。', 47187),
(65782, 'zhTW', '鎖頭與鑰匙之下', '取得碎界牢籠鑰匙，釋放阿雅桑絲。', '當我們聽到死亡之翼教團的謠言時，管理者瑟利思特拉命令我將這些從前的鱗裔帶回去。我們希望那單純是誤解。\n\n顯然，我們錯了。\n\n必須要解決他們的首領。不過我得先離開這個牢籠。找到鑰匙並帶來給我。', '', '', '', '', '', '', 47187),
(65780, 'zhTW', '證明自己', '殺死熾炎元龍。', '來自龍族的禮物或許可以讓一些半人馬覺得驚豔，不過席卡氏族還是必須看看你的狩獵能力。\n\n我們的一支狩獵隊伍剛把一頭帶有烈焰之力的元龍打下來。請幫忙殺掉元龍，證明你的能耐。', '', '在年輕的半人馬成年時，族人通常會期許他參與第一次的元龍狩獵。', '熾炎元龍', '', '', '', 47187),
(65779, 'zhTW', '進入平原', '到雍亞拉平原與席卡斥候會面。', '綠龍軍團已經返回他們在附近平原的花園。雅立史卓莎希望你能和『夢境之龍』麥琳瑟拉聯絡。\n\n那些平原上的半人馬是凶猛的獵人。要抵達翡翠花園，你必須先和他們建立外交才行。\n\n記得尊敬他們，但別暴露弱點。', '', '', '', '', '', '去雍亞拉平原見席卡斥候。', 47187),
(65778, 'zhTW', '嘯翔帶餐聚會', '穿上你的偽裝，並對巢母的私人主廚使用原型「蛋」。', '準備好發揮你精湛的演技了嗎，$n？\n\n什麼？你沒有任何演技可言？還好，我用你剛剛收集的所有材料做了這個無懈可擊的嘯翔偽裝給你！\n\n賽佳莉亞跟我還需要一點時間才能完成那顆用來殺死巢母的最後的「蛋」，不過我已經做了一個小型的原型試用版，可以讓你在主廚身上測試。\n\n而且不要擔心！身上有這麼多的羽毛，你的安全性足足提高了12%！', '', '', '', '', '', '', 47187),
(65777, 'zhTW', '沾滿淤泥的項鍊', '尋找精通平原狩獵和手工藝品知識的人。', '<項鍊上的遠古印記難以辨識，不過它的製作材料似乎是動物皮革和雕刻的骨頭碎片。\n\n也許你該找個見多識廣的獵人來幫你鑑識這件物品的價值。>', '', '', '', '', '', '', 47187),
(65770, 'zhTW', '一諾千金', '向學徒菈迪亞保證會幫她保密。', '動物覺得待在你身邊很自在。這代表你是個好人。\n\n老實說…你能不能幫我保密？我想把你介紹給我朋友，其他人都不知道她的存在。\n\n你必須先向我發誓，你會保密這件事。要是我的導師發現的話，她一定會把我逐出平原。', '', '', '', '', '', '和歐胡納鷹戈多洛托談話。', 47187),
(65769, 'zhTW', '寒冰絲網', '在顫網谷解救$1oa個繭縛的生存者。', '在蜘蛛和牠們的洪荒使者主人攻擊的時候，許多我的朋友和同事都被抓走了。\n\n我看到他們被冰凍的蛛網纏住後拖走了，我都不敢想像他們的下場。\n\n拜託你了，想辦法解救他們吧！', '', '', '', '', '', '', 47187),
(65761, 'zhTW', '比想像中更多冒險', '與戈多洛托合作，找到並拯救菈迪亞。', '<戈多洛托的眼神十分銳利，充滿責難。她恫嚇你。>\n\n<也許歐胡納鷹可以幫你找到菈迪亞，並救她出來。>', '', '', '', '', '', '', 47187),
(65760, 'zhTW', '前來報到', '跟隨仙卓克絲前往龍心哨站。', '我以前只有在書中看過加拉登。\n\n龍族的古老死敵，擅長操控大地和熔岩的強大巨人…一心一意想將龍族殺到滅絕。\n\n<仙卓克絲皺起眉頭，看著遠處的火山。>\n\n我的老師說過，自從龍族離開後，他們就在大地深處沉睡，再也沒人見過他們。\n\n要是他們已經甦醒，群島上的所有幼龍都會有危險！\n\n跟我來，我們去找龍心哨站的指揮官萊薩納克。', '', '', '', '', '', '和龍心哨站的指揮官萊薩納克對話。', 47187),
(65758, 'zhTW', '探險者葛朗吉', '找到葛朗吉‧鐵口。', '$N！跟我合作的探險者協會成員叫葛朗吉‧鐵口，他不在獲救的行列中。他原本已經努力獲得自由，可是在看到逃出來的人很少時，他立刻轉身往回走了！而且是自己一人！\n\n那個呆瓜雖然勇敢但也很衝動，而且不應該遭受到這樣的命運。\n\n拜託你，去找他吧！', '', '', '', '', '', '', 47187),
(65752, 'zhTW', '秘法煩擾', '殺死$1oa隻吸能龍鰻。', '大量的法力龍鰻正在吸食源自文庫的原始秘法魔法。\n\n它們吸食的數量太過龐大，導致地脈失去平衡…我們也因此無法復原蒼藍誓言石。\n\n我會使用你收集的不穩定的秘能，凝成類似鉤子的東西。\n\n請用它來殺死龍鰻。我應該能趁牠們吸食量暫時減少的這段時間，在下面調整能量。', '', '', '', '', '', '', 47187),
(65751, 'zhTW', '平台調整', '在蒼藍文庫頂端驅散$1oa道不穩定的秘法能量。', '看來最後的秘法干擾就在上面。\n\n我會繼續調整地脈能量。使用你回收的秘能，解除這裡的干擾。', '', '', '', '', '', '', 47187),
(65750, 'zhTW', '八腳怪', '在顫網谷殺死$1oa個顫網伏行蛛或顫網爬行蛛，以及$2oa個洪荒使者馴蛛者。', '$C！\n\n要是你願意的話，我需要你的幫助…\n\n這個聯合遠征隊的目的是研究棲息在這個區域的獨特蛛形生物，不過如你所見，我們的計畫出了差錯。\n\n我們原先以為會是演化適應的現象，實際上卻是洪荒使者對自然秩序的扭曲。\n\n我一向很重視我身為保育學家的職責，不過現在已經不是研究活體的好時機了。我們不能讓被他們扭曲的生物擴散出去，我們事情結束之後再研究牠們的屍體。\n\n你願意幫我們嗎？', '', '', '', '', '', '', 47187),
(65711, 'zhTW', '救出莉茲', '在凱汗營地殺死風暴抽取者，並救援雷脊蜥蜴莉茲。', '是你！感謝雍亞拉。我剛剛正在裝病，打算騙過下一個闖進來這裡的蠻卒。呃…那些舐蹄者對我施放了某種束縛法術。我自己可以解開。\n\n他們把莉茲抓到洞穴裡面，拜託救救她。我會想辦法自救。\n\n去做你得做的事吧。', '', '', '', '', '', '', 47187),
(65709, 'zhTW', '修整秘法', '從一袋實用物品中找出地脈權杖，然後用它修復2座平台。', '我們得先疏理這裡失控的地脈能量，不然無法啟動蒼藍文庫裡的誓言石。\n\n控制誓言石的三枚龍符文當中，有兩個因為不穩定的秘能而發生故障。\n\n很抱歉，由於卡德加分身乏術，再加上這裡沒有其他藍龍，因此只能由你來做。\n\n在你的那袋實用物品中，應該有地脈權杖。\n\n請用權杖修復附近的符文。', '', '', '', '', '', '', 47187),
(65702, 'zhTW', '逼瘋', '找回$1oa份不穩定的秘法能量。', '蒼藍文庫過去是藍龍聚在一起討論魔法的地方。\n\n現在這裡卻只剩下我一隻藍龍。\n\n這個地方控制著蒼藍高地地底的地脈，只是文庫本身和文庫的僕人都失控了。\n\n我相信，只要讓這個地方恢復正常，我就能順利復原蒼藍誓言石。\n\n傀儡和元素都充滿了不穩定的秘法能量，這些能量都需要重新導向。\n\n摧毀他們，想辦法收集不穩定的秘法能量。', '', '', '', '', '', '', 47187),
(65701, 'zhTW', '護存或破滅', '選擇專精。', '如果這些龍說的都是真的，就代表我們即將迎來一場大戰。喚能師，我們需要你保存精力和體力。\n\n該選擇你的戰鬥專精了。你希望救死扶傷，或是殲滅敵人？\n\n想要不斷專精你的戰鬥能力，請選擇破滅。\n\n想要發揮最大的治療潛能，請踏上護存之道。\n\n任一專精都能讓你有所成長。還有，請記得你之後也能更改或調整專精。', '', '', '', '', '', '', 47187),
(65691, 'zhTW', '龍翼下的陰影', '迎戰『奈薩里奧之聲』賽堅諾斯。', '奈薩里奧之聲就在下方，在他的信徒之間散播謊言。\n\n他看起來是像我一樣的龍裔，可是他的龍語很生疏，一點都不像龍族。\n\n我懷疑他是冒牌的，或許是個幻象。如果我們能制伏他的話，真相肯定會水落石出。', '', '任命自己的奈薩里奧之聲，以及碎界使徒的首領。', '賽堅諾斯', '', '', '', 47187),
(65690, 'zhTW', '教徒的擔憂', '到灼燃棲所找到阿雅桑絲。', '昨天有另一個外來者到來。她自稱是紅龍軍團的「特使」，要求覲見我們的首領「奈薩里奧之聲」。\n\n但奈薩里奧之聲突然發狂，他表示，大地守護者正在考驗我們，我們必須處決她！\n\n我知道我們不應該相信外來者，但我們沒必要殺了他們！拜託，幫我救她出來。', '', '', '', '', '', '在灼燃棲所和阿雅桑絲談話。', 47187),
(65689, 'zhTW', '千變萬化的卡雷苟斯', '使用透亮水晶塔前往蒼藍文庫。', '很高興與你正式會面，$n。我的名字是卡雷苟斯，我是祈倫托大法師，也是藍龍的守護巨龍。\n\n我在修復蒼藍文庫時遭遇阻礙，因此無法復原蒼藍誓言石。多個人，就多一份力。\n\n我目前在文庫裡面，我可以重新啟動外面的水晶塔，讓你上來這裡。', '', '', '', '', '', '在蒼藍文庫與卡雷苟斯談話。', 47187),
(65688, 'zhTW', '與卡雷苟斯會面', '取得一袋實用物品，然後去蒼藍文庫的底層見卡雷苟斯。', '我們恐怕得分心去處理其他事情，洪荒使者在東邊造成的威脅需要妥善因應。\n\n我請求你代替我去蒼藍文庫一趟，協助卡雷苟斯復原蒼藍誓言石。\n\n你應該帶點補給品，才能因應任何可能的意外。\n\n與我們的傳送門軍需官談談，他應該會有些東西可以派上用場。\n\n祝你好運，$n。卡雷苟斯一定會很感激你。', '', '', '', '', '', '在蒼藍文庫的底部與卡雷苟斯會面。', 47187),
(65687, 'zhTW', '拳打腳踢', '殺死$1oa個碎界龍人。', '其他的追隨者有的…非常惡毒。\n\n<錠塊揉揉他鼻子上的新傷口。>\n\n以前不是這樣的，可是在賽堅諾斯來之後，他說我們應該把力量擺在其他事物之前。現在，大家成天都在打架。\n\n我試過要反擊，可是他們的皮太厚…而我的個子又太小。\n\n但你不一樣！你一定整天在和惡霸打架。或許你可以幫忙？', '', '', '', '', '', '', 47187),
(65686, 'zhTW', '前往蒼藍高地', '在蒼藍高地與受祝者葛蘭妮亞會面。', '你好，$n！\n\n帕奇娜和我謹代表祈倫托，尋求你們的協助。\n\n祈倫托正努力守護遍布整個蒼藍高地的原始秘法魔法。\n\n藍龍的守護巨龍兼祈倫托領導者，卡雷苟斯，也需要有人幫忙復原那裡的蒼藍誓言石。\n\n如果你願意幫忙，請繼續沿著路前進，就能見到受祝者葛蘭妮亞。\n\n她能告訴你哪裡最需要你的幫忙。', '', '', '', '', '', '在蒼藍高地內與受祝者葛蘭妮亞會面。', 47187),
(65615, 'zhTW', '秘法入侵', '調查那個信標。', '在我們被囚禁起來的時候，我確定當時還沒有前方那個信標。\n\n法術不是我的專長，可是我認得出那是秘法魔法，就跟育所那頭藍龍使用的魔法一樣。\n\n他說了一個名字…瑪里苟斯。聽起來很熟悉，可是大地守護者教給我們的知識現在都變得好零碎、好遙遠。\n\n假如是這位瑪里苟斯讓我們陷入靜滯，那麼樹立了這個秘法信標的可能也是他。\n\n調查這個區域然後回報。要確定敵方無法使用信標號召增援部隊。', '', '', '', '', '', '', 47187),
(65613, 'zhTW', '經典的龍人造型', '轉化為人形態。', '我敢說在你抵達奧格瑪時，你有引起當地居民的注意。一定有些人對你的存在感到比較自在，有些則不然。\n\n在我還是頭年輕的龍時，我選擇了你現在看到的凡人形態。那使我得以成為高嶺的牛頭人的盟友，並生活在他們之間。\n\n雖然你的道路和我的不一樣，然而龍族的本質也在你身上流動，$p。或許那會使你有辦法獲得自己的人形態。\n\n我們一起走吧。', '', '', '', '', '', '', 47187),
(65606, 'zhTW', '莫魯克名人', '在莫魯凱與亞加莉交談。', '你為我們氏族謀取福利的作為，我都看在眼裡。\n\n外來者，回莫魯凱吧。我會備妥一些補給品，協助你進一步與我們合作。', '', '', '', '', '', '', 47187),
(65595, 'zhTW', '一顆爛蘋果', '殺死腐朽根鬚。', '腐爛會讓豺狼人挨餓。\n\n腐爛傷害朋友。\n\n我們現在就殺死腐爛。這是大王該做的。', '', '這個可惡的樹人一直教豺狼人腐朽魔法。還有糟糕的衛生習慣。', '腐朽根鬚', '', '', '', 47187),
(65594, 'zhTW', '泥水登山', '摧毀$2oa個腐朽圖騰。', '愚蠢的腐朽覺得自己是老大，但我才是老大。我們去殺掉它。我把黏液變成朋友了。', '', '', '', '', '', '', 47187),
(65490, 'zhTW', '爆炸排泄', '裝滿啾諷教授的自動排泄物收集器。', '那些鷹身人是個很棒的驚喜，不過我到這個山區來是有目標的，而且只有一個目標：糞便！\n\n準確來說，已經被蟲吃掉並消化過的藍羽大鵬糞便。聖甲蟲的胃液會將爆炸性的氮含量提高十倍！至少十倍！\n\n來，把這個啾諷自動排泄物收集器拿去。把在洞穴地上爬的聖甲蟲踩扁，然後用收集器來採收獎勵。\n\n裝滿後帶回來，我們就可以開始重頭戲：爆炸！', '', '', '', '', '', '', 47187),
(65486, 'zhTW', '完美照片', '和芙蘭一起搭乘編目員的木筏，並拍攝當地野生動物的照片。', '很抱歉讓你久等了。使用望遠鏡的時候，我常常很入迷。\n\n你有發現隔著一點距離之後，世界會更容易理解嗎？沒有任何干擾，大自然可以在沒有我們的情況下自在發展…\n\n<編目員亞昆達嘆了口氣。>\n\n我看到柯拉莉把相機給你了，很好。\n\n跟著芙蘭順流而下，拍攝野生生物在自然棲地的相片，帶回來讓我研究。', '', '', '', '', '', '返回編目員亞昆達的營地找她。', 47187),
(65475, 'zhTW', '在尖嘯中翻滾', '到藍羽崖把嘯翔卷軸交給哈爾琳‧啾諷。', '<你從嚼鵬者黏稠、沾滿血的囊袋抽出一張羊皮紙。你勉強看出是鷹身人吞食巨蛋的圖案。\n\n你很肯定，這些難以理解的粗爪痕在你最喜歡的資深鳥類學家哈爾琳‧啾諷眼中一定有豐富的含意。>', '', '', '', '', '', '到藍羽崖把嘯翔卷軸交給哈爾琳‧啾諷。', 47187),
(65453, 'zhTW', '原始害蟲', '在荒野海岸殺死$1oa隻洪荒元龍。', '<辛德瑞翠絲充滿戒心地瞥向在她身後山脊上悄悄移動的元龍。>\n\n我敢發誓我每次轉身的時候，那些元龍都會更靠近營地一點…\n\n那些不是厄比西昂邀請我們來這裡見的龍。\n\n元龍是殘忍的掠食者，而且根本無法溝通。所以我們也無須對牠們手下留情。\n\n必須削減牠們的數量，才不會讓牠們的野心太過膨脹，否則這場探險在還沒開始之前就會結束了。', '', '', '', '', '', '在翼息大使館與龍隊指揮官辛德瑞翠絲見面。', 47187),
(65452, 'zhTW', '遇險的探險者', '在荒野海岸拯救3名龍鱗遠征隊成員。', '$p，別因為我們熱愛學術研究，就誤以為遠征隊的人都是膽小鬼。\n\n我們並非只會待在高塔上埋首苦讀的隱士。\n\n我們是冒險者！我們會親自走訪艾澤拉斯的每個角落，獵取第一手的知識！\n\n但是這股冒險的熱情往往會讓我們陷入危險的處境，尤其是少數成員高估了自己能力的時候…', '', '', '', '', '', '在翼息大使館與娜蕾迪亞見面。', 47187),
(65451, 'zhTW', '練習材料', '收集$1oa片洪荒元龍幼龍鱗片。', '這些元龍跟我之前在艾澤拉斯看過的不同。\n\n他們的鱗片似乎具有天然的抗火特性，比鋼鐵強韌，而且加工後也不會失去彈性。真是驚人。\n\n我所有的工匠都搶著想要拿到幾片龍鱗來加工看看。\n\n先從幼龍開始好了。牠們的鱗片應該比較柔軟，很適合做為加工的練習材料。', '', '', '', '', '', '在翼息大使館與瑪果爾老大見面。', 47187),
(65444, 'zhTW', '前往巨龍群島！', '從奧格瑪外的飛艇塔搭乘頑強龍鱗號前往巨龍群島。', '我們派遣的第一支探險隊已經登陸巨龍群島。\n\n謝謝你和那些勇敢的龍鱗遠征隊成員的努力，我們已經在巨龍群島建立一個安全的登陸地點，並且成功聯絡到龍族的使者。\n\n你是否已經準備好跟我們展開新的旅程，前往巨龍群島？', '', '', '', '', '', '在巨龍群島的海岸與娜蕾迪亞‧河光見面。', 47187),
(65443, 'zhTW', '遠征行動', '為巨龍群島探險隊在奧格瑪各地招募探險者、工匠和學者。', '我是娜蕾迪亞，很高興見到你！\n\n受邀前往巨龍群島實在太讓人興奮了！你不覺得嗎？\n\n聖匣守護者已經和遠征隊的相關單位共同合作，幫忙協調彼此的行動。身為龍鱗遠征隊的一員，很榮幸能夠接待你！\n\n我們的第一項任務是召集更多成員，一起展開旅程。你準備好開始了嗎？', '', '', '', '', '', '在奧格瑪外面的飛艇高塔和娜蕾迪亞會面。', 47187),
(65439, 'zhTW', '風中的低語', '在奧格瑪城外與大法師卡德加交談。', '哈囉，$p。好久不見，我很想多跟你分享一下彼此的近況。\n\n不過，我剛剛跟一位老朋友聊過，我覺得深受啟發…不，應該說警兆已現…沒錯，警兆已現。\n\n畢竟啟示有時候總是好壞摻半。\n\n我真的必須告訴你，我剛才得知的事。', '', '', '', '', '', '', 47187),
(65437, 'zhTW', '守護巨龍的邀約', '與厄比西昂交談。', '你來得正好，$p。\n\n我剛剛結束與部落議會的會面，他們已經接受守護巨龍的邀約，準備前往巨龍群島。\n\n邀請的對象也包含你在內。\n\n然後你應該也注意到了，奧格瑪出現一些陌生面孔。那些「半龍人」才剛來不久，在接下來的旅程中，你會有更多機會跟他們互相交流。\n\n我們有時間再繼續聊吧。', '', '', '', '', '', '', 47187),
(65436, 'zhTW', '巨龍群島等著你', '在暴風城和怒西昂會面。', '大好的消息啊，朋友！巨龍群島甦醒了！\n\n在大崩裂之後，我的同胞離開故土、讓它陷入沉睡。可是現在，經過漫長的歲月，我們終於感受到了家鄉的呼喚。\n\n雖然巨龍群島充滿許多奇觀美景，但也同樣危機四伏。我們需要凡人盟友的協助，才能順利回歸我們的傳承之地。\n\n到暴風城找我。我必須把守護巨龍的邀請正式提交給聯盟。', '', '', '', '', '', '', 47187),
(65435, 'zhTW', '巨龍群島等著你', '在奧格瑪與厄比西昂會面。', '部落的英雄，我前來傳達消息：巨龍群島甦醒了！\n\n在大崩裂之後巨龍群島便陷入沉眠。經歷漫長光陰，現在它正在呼喚我們龍族返回故鄉。\n\n儘管巨龍群島充滿許多奇觀美景，但也同樣危機四伏。我們需要凡人盟友的協助，才能順利回歸我們的傳承之地。\n\n我準備將守護巨龍的邀約正式傳達給奧格瑪的部落議會。在那裡與我會合，屆時便能知道部落的回覆。', '', '', '', '', '', '', 47187),
(65422, 'zhTW', '獵取寶藏可不簡單', '拿取攀岩裝備、找到支撐點，然後，在不失手的情況下攀爬到山的頂端！', '我在你的眼中看到了！你有想要爬到山頂的衝動、想知道上面有什麼！\n\n我們攀爬者都有這種直覺、能夠認出同好。可不能讓高山什麼的小看了我們，你說是吧？\n\n所以說，你走運了。我帶了很多攀爬裝備，去拿一組來用，然後找路攀上山頂吧！', '', '', '', '', '', '在山頂上與娧姿‧光鏈交談。', 47187),
(65421, 'zhTW', '攀爬每座山峰', '拿起攀岩裝備，找到支撐點，然後爬上懸崖去拯救探路者伊普思！', '$c，希望你學得很快。因為我可沒時間慢慢教你！\n\n拿起背包，然後找路攀到山頂吧。\n\n等你到了上面，把這個降落傘丟給我們的夥伴伊普思。那些風元素讓我們墜機以後，那個可憐的孩子就卡在藤蔓裡了！\n\n快點行動，然後我們趕快離開這裡！', '', '', '', '', '', '', 47187),
(65417, 'zhTW', '連結在一起', '', '', '', '', '', '', '', '', 47187),
(65402, 'zhTW', '辨識藍圖', '', '', '', '', '', '', '', '', 47187),
(65374, 'zhTW', '拔毛時間到', '拔取$1oa個幼雛羽毛。', '哈爾琳跟我說，她在幫你製作偽裝！太讓人興奮了！不過，她會需要一些大鵬幼雛的羽毛來完成這套裝備。\n\n幸好，我才剛修好羽毛拔除器3300型！\n\n嘯翔鷹身人正在下方的懸崖捕捉大鵬幼雛，要自己撫養和繁殖牠們。使用拔除器來讓幼雛脫離危險，同時它也會自動幫你拔一些牠們的羽毛！\n\n這簡直就是「一拔二鳥」啊！', '', '', '', '', '', '', 47187),
(65373, 'zhTW', '拔取零件', '取回4個羽毛拔除器3300型零件。', '噢，不…我犯了一個大錯。\n\n哈爾琳把她一個超棒的發明交給我保管：知名的羽毛拔除器3300型！\n\n我原本打算到南方的洞穴去拔鵬鳥羽毛給她研究，可是鷹身人突襲了我，在我逃跑的時候機器就壞掉了。\n\n請你取回那些零件吧！它們八成散落在洞穴的地板上，就像掉落的鱗片一樣。\n\n我可以把它重新組裝。絕對可以。呃，應該可以…吧。', '', '', '', '', '', '', 47187),
(65371, 'zhTW', '屬於自己的巢', '收集$1oa個嘯翔鷹爪、$2oa個嘯翔護杖以及$3oa個源生者之核。', '你找到的卷軸是一個命令，表示所有的藍羽鳥蛋都要帶去給鷹身人廚師佛萊耶利。顯然，嘯翔巢母不願意吃任何沒有經過精心準備和調味的食物。\n\n所以我們要自己帶一個特別的蛋去給她。一個爆炸性好吃的蛋…而且當然…會在她吃的時候爆炸。\n\n要怎麼把它送過去？透過偽裝！\n\n殺死懸崖下方的生物，收集這個清單上的東西，我就能幫你變出整套的羽毛裝扮。', '', '', '', '', '', '', 47187),
(65313, 'zhTW', '大鵬胃口', '殺死霍西亞‧嚼鵬者。', '賽佳莉亞似乎還不賴，很擅長使用一些小裝置，可是她太容易恐慌了。\n\n舉例來說：在我派她去正南方的洞穴時，她很快就被一隻大得不尋常的鷹身人追著跑出來，而且那個鷹身人似乎也會給其他同伴下命令。\n\n會不會是這群鷹身人的巢母呢？還是指揮官？到裡面幫忙查清楚吧，$n\n\n然後，不用害怕惹毛他們，你懂我的意思吧。', '', '一隻特別巨大的嘯翔鷹身人，對藍羽鵬鳥的骨頭有著恐怖的胃口。', '霍西亞‧嚼鵬者', '', '', '', 47187),
(65307, 'zhTW', '人道優先', '治療受傷的半龍人和龍獸。', '在育所施放的劇毒幾乎殺死了我們所有人。現在做好解毒劑了，我需要你找到受傷的人加以治療。\n\n是的，就連藍色龍獸也不例外。當其他人受苦的時候，治療之翼絕不會袖手旁觀。', '', '', '', '', '', '', 47187),
(65306, 'zhTW', '牧腐者', '從衰敗的腐爛收集$1oa個發臭的軟泥。', '腐爛噁心、臭臭又好痛。有點子，可是需要黏液。給我黏液！', '', '', '', '', '', '', 47187),
(65302, 'zhTW', '王國的鑰匙', '取得鑰匙，並用它來打開武器箱。', '計畫需要武器。有好武器，可是鎖起來了。豺狼人鑰匙留在營地…保護武器箱。\n\n拿最尖的棍子。那些上面沾了最多鮮血。', '', '', '', '', '', '', 47187),
(65287, 'zhTW', '分離蛋黃', '收集$1oa個藍羽鳥蛋。', '我已經解讀了卷軸，大驚喜：是壞消息！\n\n嘯翔鷹身人吃藍羽鵬鳥不只是為了覓食。事實上，他們已經找到了一些法術，能在吃大鵬的時候同時將原生力量轉移到自己身上。尤其是蛋！\n\n從這裡到懸崖下，盡可能拯救越多大鵬的蛋越好。這樣就能拖延鷹身人的時間，讓我有機會執行我的計畫。\n\n還有，小心狂暴的元素生物。詛婦的法術效用已經激怒了它們！', '', '', '', '', '', '', 47187),
(65286, 'zhTW', '龍人的人緣', '進入暴風城。', '一般來說，這段旅程的飛行時間會非常長。不過，當青銅龍的守護巨龍親自幫你加速的時候，就能把旅程的時間縮到…\n\n<咳咳>…非常短。\n\n喔，那些帶著銳利武器的士兵？別擔心，只是形式上的東西。\n\n在你和埃祖拉瑟熟悉環境的時候，我會試著安排你們與總指揮官會面。\n\n幸好，我在這座城市還蠻有影響力的。', '', '', '', '', '', '和埃祖拉瑟談話。', 47187),
(65279, 'zhTW', '皇家敕令', '在溪牙巢穴殺死$1oa名蕨皮戰士和$2oa名蕨皮薩滿。', '笨蛋豺狼人不懂皇冠。只懂暴力。打扁他們，不然我就吃掉你。', '', '', '', '', '', '', 47187),
(65267, 'zhTW', '打成亂飛的羽毛', '殺死$1oa個嘯翔凋萎者和$2oa個嘯翔巫爪。', '我對這些奇怪的有翼生物很好奇，試著向他們自我介紹。但要不是有啾諷教授和她的大型機械鳥，我早就被吃掉了！\n\n你可以幫我們處理這些「嘯翔鷹身人」嗎？當地的藍羽大鵬被迫只能忙著守護自己的巢。\n\n而且我也不希望別人在自我介紹的時候，也遭遇到我經歷過的事情…', '', '', '', '', '', '', 47187),
(65133, 'zhTW', '如何與龍一起善用動能', '俯衝通過檢查環，然後在目標地點降落。', '那麼，要是途中出現障礙物呢？\n\n只要飛行技巧夠好，你就能節約動能，並在俯衝後爬升一定的高度。\n\n這次在你俯衝之後，你會發現飛行路徑會讓你飛往比降落區域稍低的位置。但只要善用動能，就能在飛行末段拉高高度，順利降落在目標地點。\n\n如果你困住了，就使用青銅計時器，賽洛姆會讓你重新開始。', '', '', '', '', '', '', 47187),
(65120, 'zhTW', '如何與龍一起俯衝', '先俯衝再滑翔通過檢查環，然後在目標地點降落。', '滑翔能讓你抵達想去的地方。不過，要是你想更快抵達目的地呢？\n\n從高處一躍而下進行俯衝，就能加快飛行速度。\n\n穿越檢查環，然後前往目標地點。\n\n如果你困住了，就使用青銅計時器，賽洛姆會讓你重新開始。', '', '', '', '', '', '', 47187),
(65118, 'zhTW', '如何與龍一起滑翔', '滑翔通過檢查環，然後在目標地點降落。', '先從基礎的部分開始。\n\n如果你直直地飛，馬上就會讓自己筋疲力盡。所以應該借助重力，以稍微朝下的方式，才能飛越一大段距離。透過檢查環，就能得知進行基礎滑翔時，應該使用的角度。\n\n首先，呼喚你的龍。\n\n然後穿越檢查環，接著在目標地點降落。\n\n如果你困住了，就按一下青銅計時器，賽洛姆會讓你重新開始。', '', '', '', '', '', '', 47187),
(65101, 'zhTW', '經典的龍人造型', '呈現你的人形態吧。', '你一現身暴風城，就立刻成為眾人矚目的焦點，$p。不用懷疑，比起其他人，某些居民會更加願意…接納你。\n\n為了能與其他種族好好交流，我們巨龍都會幻化成人形態，就像你面前這位這樣。這樣不只能讓盟友比較自在，也能避免在進出門口的時候，弄壞大門。\n\n顯然，半龍人身上也有龍族的特質，我覺得你應該也能幻化成人形態。\n\n陪我散個步吧。', '', '', '', '', '', '向怒西昂露出你的人形態。', 47187),
(65100, 'zhTW', '最後的命令', '安排禁忌之境的撤離行動。', '菈薩葛絲召來的風暴太強大了，我們不得不從我們唯一的家園撤離。\n\n可以命令我們的大地守護者已經不在了。有始以來，我們第一次可以自由做出選擇，追尋自己的命運。\n\n在這個新時代，無論你去了哪裡，我都會祈禱你找到值得結交的盟友，把我們的故事告訴他們。\n\n至於我，我會留在這裡尋找倖存者。在這個過程中，我或許會能為我們的過去找到答案。\n\n願我們都能心想事成，$p。', '', '', '', '', '', '向龍隊指揮官回報。', 47187),
(65098, 'zhTW', '勇敢的後果', '找到厄比西昂。', '謝謝你幫我治療，$n。希望我們正在加深彼此的信賴。\n\n<怒西昂聳聳肩。>\n\n噬風者。我從來沒有跟擁有這種原始元素力量的龍戰鬥過。要是還有其他像她這樣的傢伙…\n\n等等…厄比西昂在哪裡？他還活著嗎？你必須找到他！', '', '', '', '', '', '與安珀莎交談。', 47187),
(65097, 'zhTW', '快跑！', '撤退！', '風暴即將來襲！非撤退不可了！\n\n能救多少就救多少。還有，找到那些黑龍！', '', '', '', '', '', '與怒西昂交談。', 47187),
(65087, 'zhTW', '內有大獎', '保衛密庫。', '洪荒使者想要這裡面的東西？\n\n<沙卡瑞斯瞇起雙眼。>\n\n叫他們放馬過來。\n\n讓他們見識見識，半龍人多不好惹！', '', '', '', '', '', '', 47187),
(65084, 'zhTW', '霜石密庫', '前往霜石密庫。', '看看這裡的另一邊！洪荒部隊正在霜石密庫集結。\n\n絕不能讓他們打算召出的風暴越雷池一步。\n\n<安珀莎瑟縮了一下，試著重整破碎的記憶。>\n\n我們以前跟這些敵人戰鬥過。我們勝利了。奈薩里奧下令要我們看守寶庫，但我…不記得為什麼…\n\n沒時間回想了。跟沙卡瑞斯和黯鱗龍隊一起到寶庫集合。確保敵人不會破壞寶庫！', '', '', '', '', '', '向霜石密庫的龍隊指揮官沙卡瑞斯回報。', 47187),
(65075, 'zhTW', '治療之翼', '與安珀莎交談。', '喚能師，感謝你在我們最危急的時候對我的龍隊提供援助。\n\n等我們恢復體力後，治療之翼會與其他部隊會合。\n\n辛德瑞告訴我，安珀莎的龍隊成員全數陣亡，我恐怕無能為力撫平這樣的傷痛。\n\n安珀莎或許性格堅忍，但這次的損失絕對讓她很傷心，$n。請告訴她，我很快就到。', '', '', '', '', '', '與安珀莎交談。', 47187),
(65074, 'zhTW', '簡單的獵物', '殺死 $1oa 個鐮螳螂。', '這個育所附近的荒野是鐮螳螂的棲地，牠們是非常貪吃的蟲型生物，有很強的領土意識和攻擊性。\n\n這些受傷的人很容易成為那些生物的獵物。我不希望治癒者在恢復的時候受到攻擊。\n\n在我照料維利迪亞的時候，請去削減牠們的數量。\n\n她…非常勇敢。', '', '', '', '', '', '', 47187),
(65073, 'zhTW', '劇毒的問題', '收集$1oa個毒素腺體。', '你恢復得很快，$n。很好。\n\n從我的育所裡逃出來的那些人正在好轉，但其他人還被困在裡面。要是你毫無準備地衝進去救他們，又要連累我去把你拖出來。\n\n有不少甲蟲在火山口周圍築巢，利用牠們的毒素腺體，或許能反制那種劇毒的效果。\n\n我的狀況不適合親自去採集，所以只能靠你了，喚能師。', '', '', '', '', '', '', 47187),
(65071, 'zhTW', '救命！', '拯救小柯', '我需要幫忙。\n\n我正在四處探索，因為這是我擅長的事，但是我不知道我的妹妹小柯跟著我出來，我需要你幫忙找到她，她有麻煩，請幫忙，幫幫我好嗎？\n\n她進入了洞穴，但她不像我，她不擅長躲藏，我們的父母離這裡太遠，幫不上忙。\n\n你可以幫忙找她嗎？趕在怪物之前先找到她？', '', '', '', '', '', '將孩子送回他們父母身邊。', 47187),
(65063, 'zhTW', '進入巢穴', '跟隨辛德瑞翠絲去尋找維利迪亞。', '不管出現在這個育所的劇毒是什麼，這種毒性就連我們最好的治療者都抵擋不了。\n\n這對我們兩人來說都不是什麼好事，$n。\n\n無所謂。半龍人被困在裡面，所以不管風險有多高，我們都必須進去。\n\n深呼吸，然後跟我一起衝！', '', '', '', '', '', '與維利迪亞交談', 47187),
(65060, 'zhTW', '治癒者火山口', '去治癒者火山口與辛德瑞翠絲見面', '你從秘法信標看到的畫面顯示，還有半龍人被困在自己的育所裡，我們不能再讓自己的族人出現任何傷亡。\n\n<安珀莎停了一下，眉頭深鎖。>\n\n治療之翼是我們當中最出色的醫療者，他們的育所就位在治癒者火山口，辛德瑞翠絲知道路。\n\n務必把他們都救出來，喚能師。', '', '', '', '', '', '在治癒者火山口和辛德瑞翠絲交談。', 47187),
(65057, 'zhTW', '向安珀莎報到', '向安珀莎報告。', '戰鬥已經結束，而你要我去向安珀莎報到，所以埃祖拉瑟希望我聽她的命令嗎？\n\n想都別想。\n\n黯鱗龍隊只會聽令於大地守護者。到目前為止，我還沒接到奈薩里奧的任何命令。\n\n<沙卡瑞斯怒氣沖沖。>\n\n不過，我也沒有忽視這些洪荒使者帶來的威脅。我很肯定以前曾跟他們戰鬥過，不過…\n\n等到我的人復原了，我們會到訓練場集合。你可以離開了，喚能師。', '', '', '', '', '', '', 47187),
(65052, 'zhTW', '黯鱗龍隊', '找到龍隊指揮官沙卡瑞斯。', '我們成功阻止了來襲的洪荒使者，現在我們必須進入育所。\n\n龍隊指揮官沙卡瑞斯還是跟以前一樣強悍，他的龍隊會堅守陣線。不過，有條龍讓黯鱗龍隊分身乏術。\n\n該是我們加入戰局的時候了！\n\n帶路吧，等我們一靠近那條龍，就發出信號。我們會盡全力攻擊它。\n\n小心埋伏的敵人，我有不好的預感。', '', '這是把黯鱗部隊困住的遠古野獸。', '艾克拉薩索', '', '', '和龍隊指揮官沙卡瑞斯交談。', 47187),
(65050, 'zhTW', '召喚而來的軍隊', '殺死$1oa個召喚的元素生物。', '這些洪荒使者正在召喚一支元素大軍。我們必須預設他們打算用元素大軍對付我們的部隊。\n\n不過，他們別想得逞。\n\n殺光他們，喚能師！從這裡燒死那些元素生物，並且除掉他們的咒術師，別讓他們繼續召喚。', '', '', '', '', '', '在風裂火山口找到埃祖拉瑟。', 47187),
(65049, 'zhTW', '與塔拉賽克一戰', '殺死$1oa隻塔拉賽克。', '塔拉賽克捉摸不定，而且十分野蠻。應該就跟原始龍獸的情況差不多。\n\n在奈薩里奧心中，他們的地位只比食物好一點，當成我們訓練時使用的標的物。但是，他們是狡猾的獵食者，而且如果他們集體行動，他們就會變得非常危險。\n\n要是讓他們從洪荒使者那裡獲得元素的力量，他們還會變得更危險。\n\n我們不能讓這種事發生，$n。請削減他們的數量。', '', '', '', '', '', '在風裂火山口找到埃祖拉瑟。', 47187),
(65046, 'zhTW', '洪荒使者', '尋找有關洪荒使者的起源和意圖的線索。', '因為靜滯的緣故，我的記憶還是有點模糊，不過我很肯定，我們以前就遇過這些洪荒使者。\n\n<德維希安咬緊牙根。>\n\n還是行不通。強行去回憶，就像是在追逐夢境的碎片。\n\n或許你能做得更好。尋找相關線索，了解是什麼或是誰在驅使這些入侵者。', '', '', '', '', '', '在風裂火山口找到德維希安。', 47187),
(65045, 'zhTW', '風裂火山口', '去風裂火山口見埃祖拉瑟。', '德維希安的報告讓我很不安。敵軍自稱洪荒使者，他們已經入侵風裂火山口，把黯鱗龍隊困在圍城育所。\n\n這些入侵者召喚出狂暴的元素生物，還招募了凶殘的塔拉賽克加入他們的行列。\n\n埃祖拉瑟正在火山口，他需要你的幫忙。不論用翅膀還是利爪，拯救我們的族人。\n\n等到黯鱗龍隊平安脫困，請他們的指揮官來見我一面。提醒你一點，沙卡瑞斯非常…難纏。', '', '', '', '', '', '和風裂火山口的埃祖拉瑟交談。', 47187),
(65036, 'zhTW', '訓練視同作戰', '練習飛騰。', '透過跳圈圈，你可以更容易確定自己的位置，不過訓練視同作戰，我們是不會放水的。\n\n上吧，試著到處飛騰，直到你覺得自己已經精通這項技巧為止。當然，你必須留意當地的野生動物，同時戒備任何可能的威脅。畢竟，這正是我們練習的原因。\n\n覺得準備好了，就向安珀莎回報。祝你好運！', '', '', '', '', '', '可以繼續的時候，與龍隊指揮官安珀莎交談。', 47187),
(64873, 'zhTW', '舒展你的翅膀', '練習施放飛騰。', '看到那麼多人順利逃離戰爭育所，我覺得很振奮。我自己的龍隊…就沒那麼幸運。\n\n<安珀莎沉默了一陣子。>\n\n禁忌之境還有其他育所，裡面也有陷入危機的半龍人。需要強健的翅膀才能抵達他們所在的地方。\n\n專心一點。別忘記你的訓練，再一次去感受那陣風。你必須找回自己的力量，飛到其他育所。\n\n沒時間休息了。', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(64872, 'zhTW', '體內的烈火', '學習火焰之息並練習強化攻擊。', '$n，你是位喚能師。你是高手中的高手，半龍人軍隊中最爐火純青的優秀士兵。\n\n我很看好你。\n\n儘管你的記憶變得模糊殘破，但你血液中仍流淌著龍族的力量。駕馭它。\n\n你最有力的一項武器，就是你的吐息攻擊。你吸氣的時間越長，你體內的火焰就越強大。\n\n這些爬滿訓練場的蟲群是很好的目標。', '', '', '', '', '', '', 47187),
(64871, 'zhTW', '門口的龍', '擊敗拉比沙苟斯並逃出戰爭育所。', '那條藍龍會弄垮育所，把我們困在裡面！\n\n他自稱是瑪里苟斯的手下。那個名字很耳熟，但…巨龍為什麼會想把我們關起來？\n\n聽著，$p。我們所受的訓練是要與巨龍並肩作戰，而不是對抗他們。但是，我們已經別無選擇。\n\n現在我們應該為所當為，喚能師。', '', '他阻礙了你逃跑。', '拉比沙苟斯', '', '', '', 47187),
(64866, 'zhTW', '進入大熔爐', '準備好離開育所。', '喚能師，我們需要你的技能。\n\n育所正在崩毀，而且我們的補給品不足。我們必須趕緊離開此處，可是我們得先通過這道秘法屏障。\n\n外頭應該還有需要協助的半龍人。照料他們的傷勢，並且消滅任何阻撓你的敵人。\n\n$n，這可能是我們最後一次並肩走在這裡了。好好加油。', '', '', '', '', '', '', 47187),
(64865, 'zhTW', '整裝出發', '取得武器、護甲和補給品。', '敵人已經入侵，而我們的部隊卻受困於魔法靜滯，育所面臨崩壞的危險。\n\n$n，這正是我們艱苦訓練的目的。心有懷疑時，先退回你熟知的領域。\n\n先把最要緊的事情辦好：武器、護甲和補給品。我會去統整部隊，你來收集並裝備所有你能找到的東西。\n\n然後我們去找大地守護者，奈薩里奧一定擁有我們要的答案。', '', '', '', '', '', '', 47187),
(64864, 'zhTW', '半龍人，甦醒吧', '喚醒其他半龍人。', '<你彷彿從永無止境的睡眠中醒來，所有記憶都只剩下模糊的片段。\n\n你面前的半龍人毫無反應，被不知名的魔法凍結在原地。而你旋即察覺，自己體內擁有解開夥伴束縛的力量。\n\n育所內可能還有其他半龍人處於靜滯狀態。\n\n你必須喚醒他們。>', '', '', '', '', '', '與龍隊指揮官埃祖拉瑟交談。', 47187),
(64863, 'zhTW', '秘法守護者', '擊敗$1oa隻守護者或魁儡。', '那些在育所巡邏的傀儡並非由大地守護者的魔法活化。\n\n<德維希安瞇起雙眼。>\n\n不能讓敵人潛伏在我們之中。\n\n摧毀他們，清出安全的前進路線。', '', '', '', '', '', '', 47187),
(63948, 'zhTW', 'Seeking the Seeker\'s Staff [PH]', '找回斷裂法杖的三段碎塊。', '我們原本正在研究俗稱為斷裂法杖的神器的特性。\n\n那個法杖被拆成三段，因為如果不這麼做，這個法杖會變得極不穩定。\n\n我並不認為那群入侵者是來這裡尋找這個法杖的，他們可能也不曉得法杖的特性是什麼，但是他們發現那幾段碎塊。各一段分別由不同的淵誓者成員保管。\n\n我們必須盡快奪回。\n\n他們早晚會發現，這些東西組合起來會變成一把危險的武器。', '', '', '', '', '', '', 47187),
(63947, 'zhTW', 'Raiders in the Ruins [PH]', '擊敗$1oa個入侵的淵誓者。', '我痛恨暴力，面對衝突的時候，我喜歡以理性的方式解決，但這次的情況讓我別無選擇。\n\n我們必須阻撓攻擊者，才能夠平安逃脫。對入侵羅朵蒙的淵誓者痛下殺手。\n\n擊敗敵軍。', '', '', '', '', '', '', 47187),
(62265, 'zhTW', '全新冒險等著你', '返回奧格瑪，展開新的冒險。克羅米的魔法會在你達到60級的時候失效，並將你送回奧格瑪。', '$n！現在的世界需要你。事情變得…嗯，你最好親自回去看。\n\n我會接手並完成你手頭上的事然後再趕回去。我快要沒辦法讓你繼續待在過去的世界了！', '', '', '', '', '', '返回奧格瑪，展開新的冒險。', 47187),
(62250, 'zhTW', '全新冒險等著你', '回到暴風城，展開全新的冒險。克羅米的魔法會在你達到60級的時候失效，並將你送回暴風城。', '$n！現在的世界需要你。事情變得…嗯，你最好親自回去看。\n\n我會接手並完成你手頭上的事然後再趕回去。我快要沒辦法讓你繼續待在過去的世界了！', '', '', '', '', '', '回到暴風城，展開全新的冒險。', 47187),
(61620, 'zhTW', '鍛造：傲慢鐐銬', '', '', '', '', '', '', '', '', 47187),
(61619, 'zhTW', '鍊金術：謙遜藥劑', '', '', '', '', '', '', '', '', 47187),
(61603, 'zhTW', '剝皮：厚重果姆皮', '', '', '', '', '', '', '', '', 47187),
