(61447, 'zhTW', '珠寶設計：微光藍晶石項鍊', '', '', '', '', '', '', '', '', 47187),
(61446, 'zhTW', '銘文學：重責祈願', '', '', '', '', '', '', '', '', 47187),
(56013, 'zhTW', '符鎖寶箱', '', '', '', '', '', '', '', '', 47187),
(53832, 'zhTW', '反制破壞', '', '', '', '', '', '', '', '', 47187),
(53211, 'zhTW', '阿拉希捐獻：濱海治療藥水', '幫波拉勒斯港的雀爾希‧史傳德收集$1oa瓶濱海治療藥水。', '我收到一些消息，有些盟友打算為即將到來的戰爭儲存一些補充品。如果你剛好找到幾瓶濱海治療藥水，我會很樂意將它們加入我們的存貨。', '', '', '', '', '', '', 47187),
(53159, 'zhTW', '阿拉希捐獻：粗製皮革', '在波拉勒斯港捐獻$1oa張粗製皮革給夏琳。', '我們現在該扼殺這樣的競爭了，你不覺得嗎？在你的協助下，我們可以確保盟友獲得必要的貨物和護甲，準備即將到來的戰爭。\n\n讓們保證我們的盟友能準備萬全。', '', '', '', '', '', '', 47187),
(52164, 'zhTW', '酒後狂暴！', '', '', '', '', '', '', '', '', 47187),
(43609, 'zhTW', '懸賞：厄運領主卡茲洛克', '', '', '', '', '', '', '', '', 47187),
(43091, 'zhTW', '危險：阿坎諾至高者', '', '', '', '', '', '', '', '', 47187),
(42820, 'zhTW', '危險：埃吉爾‧碎浪者', '', '', '', '', '', '', '', '', 47187),
(42757, 'zhTW', '靈魂之喉：海洋威脅', '', '', '', '', '', '', '', '', 47187),
(37924, 'zhTW', '有用的裝備', '用旗幟標示$1oa個補給箱。', '如果你能在解決那些人的同時，把較大的補給箱標記起來，速度就會快很多。$b$b只要把這面旗幟丟在上面，很快就會有人過去處理了！', '', '', '', '', '', '', 47187),
(37484, 'zhTW', '上尉之哨', '為安妮‧敦沃希帶來100枚文物碎片以取得上尉之哨。', '', '', '', '', '', '', '', 47187),
(37483, 'zhTW', '上尉之哨', '為安妮‧敦沃希帶來100枚文物碎片以取得上尉之哨。', '', '', '', '', '', '', '', 47187),
(37114, 'zhTW', '克魯娜', '', '', '', '', '', '', '', '', 47187),
(37113, 'zhTW', '黎沙莉‧烏鴉', '', '', '', '', '', '', '', '', 47187),
(34213, 'zhTW', '綁架案', '找到柯爾奇牢籠的鑰匙，放他出來。', '求求你，$p！幫我一個忙好嗎？我收到一封信，鋼鐵部落裡有個腐敗又粗野的獸人在勒索我。$b$b我兒子在他手裡！$b$B他還畫了好幾張圖，表示要是我不付贖金的話，他會怎樣對付我兒子。他一定是覺得我們可以憑空變出金子來要是我想自己去把兒子救出來，我們兩個都別想活命。$b$b你能幫我跑一趟格羅姆卡，幫我把兒子救出來嗎？$b$b他叫柯爾奇。', '', '', '', '', '', '', 47187),
(31762, 'zhTW', '岩石巨獸', '殺死嘯天巨獸。', '魔古成功地驅動了一座巨大的岩石雕像，並派它來對付我們。$B$B作為反制，我打算派你去對付它。$B$B它正從黃金階梯那裡逼近。把它解決掉...', '', '', '', '', '', '', 47187),
(31756, 'zhTW', '高降雨機率', '摧毀風暴召喚者之杖。', '魔古正在黃金階梯上召喚某種危險的風暴。一般來說，魔古和閃電加在一起不會是種令人愉快的組合。我們最好能阻止他們。$B$B有那些巨大的閃電從它們身上噴出來，你應該很簡單就能找到他們的風暴召喚者法杖。幫我把它們打倒或打爛一類的，可以嗎?那樣我肯定能睡得好些。', '', '', '', '', '', '', 47187),
(31685, 'zhTW', '四風峽', '傳送到四風峽並和士兵提姆‧P‧奧拉瑞談話。', '呀啊啊，翠玉林正在積極重建中，但四風峽那裡仍充滿了探險機會。準備好過去時就和我說，我有辦法送你一程。在另一邊和我的同僚講話，他會給你一些對旅途有幫助的裝備。', '', '', '', '', '', '', 47187),
(31644, 'zhTW', '血色修道院挑戰模式 - 白銀勳章(第N次)', '', '', '', '', '', '', '', '', 47187),
(30442, 'zhTW', '白蘭琪的轟隆酒', '幫忙創造轟隆酒。如果酒桶著火，趕快撲滅它!', '保衛酒桶，以釀造白蘭琪的轟隆酒。', '', '', '', '', '', '', 47187),
(30312, 'zhTW', '第二次機會', '治療6個受傷的防衛者。', '一支愚蠢的分隊試著從東邊的小徑攻上黃金階梯，結果受到砲火的轟炸。有命回來的傷勢都十分嚴重，還有更多傷患仍在戰場上。$B$B這裡有些繃帶。用這些繃帶或你所具有的治癒技能，幫助我們受傷的防衛者回到安全之處。$B$B請你儘快，時間不多了。', '', '', '', '', '', '', 47187),
(30308, 'zhTW', '硬石麒麟獸', '殺死6隻花崗麒麟獸。', '利文總是說只有死麒麟獸才是好麒麟獸，而我非常同意。你來這裡幫忙的嗎?', '', '', '', '', '', '', 47187),
(30307, 'zhTW', '永久警戒', '在金輝臺殺死8個嘯天魔古。', '$c，有你跟我們在一起真好。如果你要參與戰鬥，我需要更多人到黃金階梯上的戰場，把駐守在那裡的魔古清理乾淨。$B$B我能倚重你嗎?', '', '', '', '', '', '', 47187),
(27637, 'zhTW', '只剩你和馬迪亞斯', '到暮光高地的暮光城塞找馬迪亞斯‧肖爾。', '那真是對我們的一大打擊。該死的丘加利!$B$B幸好小隊指揮官和你說了馬迪亞斯‧肖爾的確切所在。', '', '', '', '', '', '', 47187),
(27608, 'zhTW', '四顆腦袋總比沒有好', '收集札布羅克斯和嗶啵馮德的四顆頭。', '我們即將對暮光之門發動攻擊，但還是有最後一件事需要處理:丘加利的侍徒札布羅克斯和嗶啵馮德。$B$B根據情報，他們位於大門西南邊一個名為侍徒藏匿處的小巨魔洞穴。$B$B你願意回去那裡殺了他們嗎？', '', '', '', '', '', '', 47187),
(27588, 'zhTW', '攻擊信號', '在暮光之門其中一座塔的頂端使用攻擊信號。', '你將『高山』碎顱者誘離了暮光之門，是時候發出信號，呼喚你在勝利者崗哨的部隊發動攻擊!', '', '', '', '', '', '', 47187),
(27308, 'zhTW', 'The Elements Cry Out', 'Speak to Earthmender Norsala in Orgrimmar.', 'Do you feel it, $c?  The elements are uneasy. We members of the Earthen Ring have struggled to find the cause of the unrest.  Thus far we have been unsuccessful and now turn to others that may aid us.  Speak with Earthmender Norsala in Orgrimmar and see what tasks she may have for you.', '', '', '', '', '', 'Speak to Earthmender Norsala in Orgrimmar.', 47187),
(26903, 'zhTW', '進口商威利克斯', '護送進口商威利克斯到剃刀沼澤的出口。', '終於，幫助抵達了!$b$b你絕對不懂我在這裡被拘禁了多久。我已經記不起上次看見外面的世界時是什麼樣的狀況。$b$b你知道，我是個企業家。永遠在滾錢，像他們說的。我聽到風聲說那些豬人在市場裡的價錢高得驚人。我想那會是個輕鬆幹輕鬆閃的任務。而你能知道，我有點搞錯了!$b$b總之，如果你好心幫助我離開這裡，我不會讓你吃虧的。', '幫助進口商威利克斯逃出剃刀沼澤', '', '', '', '', '和進口商威利克斯說話。', 47187),
(25289, 'zhTW', '往前一步...', '測試急行用機械坦克的機動性。', '既然彈射系統有用，我想接下來應該要測試一下行動能力了。這台坦克上配備了一項特殊功能:自動迴避動作!$b$b我要你去檢查一下左腿、右腿、和自動迴避動作系統的電動機。$b$b這項工作沒啥難度，應該花不了多少時間。', '', '', '', '', '', '', 47187),
(14276, 'zhTW', '穩固射擊', '達到等級3來習得穩固射擊。在血牙狼人身上練習使用穩固射擊2次。', '我有好消息也有壞消息。$B$B壞消息就是在樹林裡有比這裡還多的狼人...所以我們真的沒有安全的地方可去。$B$B好消息則是你變得越來越熟練了。隨著你的經驗增長，你會開始學會一些新技巧。$B$B當你學會第一項新能力，就在我們西邊的血牙狼人身上練練手吧。', '', '', '', '', '', '', 47187),
(14086, 'zhTW', '在奧格瑪學習騎術', '到奧格瑪的榮譽谷，把這本小手冊繳回給基爾達。', '這本介紹著騎術訓練與購買坐騎的小手冊是基爾達送來的。$B$B基爾達就在奧格瑪的榮譽谷。', '', '', '', '', '', '', 47187),
(13914, 'zhTW', '炎鵬羽毛', '你的毒皮小暴掠龍要你帶給牠5片炎鵬全羽。', '小暴掠龍看了你一會兒，彷彿在思考你是否會瞭解。牠在沙地上畫了一對羽毛，然後用爪子指著要黏在牠的肘部和膝蓋。$B$B牠看起來不太餓，那羽毛是要做什麼?$B$B牠一定是想要用它來裝飾自己，就像你看過的其他迅猛龍一樣。炎鵬有著最大最華麗的羽毛，它們大多盤據在塔納利斯西部，灌木谷的東北邊，那些大型生物的骨骸附近。', '', '', '', '', '', '', 47187),
(13247, 'zhTW', '死亡證明:地脈守護者伊瑞茍斯', '達拉然的大法師朗達拉克要求你，帶回一個地脈調諧器。$B$B這個任務只能在英雄難度中完成。', '奧核戰爭的烽煙四起，我們得想個法子扭轉劣勢!你願意飛往戰事的中央嗎$n?$B$B瑪里苟斯正抽取著艾澤拉斯的地脈能量化為己用，而地脈守護者伊瑞茍斯正是此地的看守者，如果能夠擊敗他，無疑對敵方將是一大打擊。$B$B請幫我帶回一個地脈調諧器，我們便可以加以研究。', '', '', '', '', '', '', 47187),
(13244, 'zhTW', '泰彌亞在你的未來預見了泰坦鋼先鋒!', '達拉然的大法師泰彌亞預見你必須殺死7個泰坦鋼先鋒。', '艾澤拉斯如今已是危急存亡之秋。瘋狂的神衹洛肯將其據於手中，以其之威能終結一切事物!$B$B在雷光大廳的地疆瞭望塔內，屹立的泰坦鋼先鋒若繼續行洛肯之惡事，將導致無數受害者。$B$B余已洞察未來，$n。汝將為救萬民於水深火熱中之人!', '', '', '', '', '', '', 47187),
(12776, 'zhTW', '艾克索達', '主教拉札利爾要你把聖光灌注神器送去給艾克索達的費倫。', '我們的祈禱得到了回應!我們利用來自撒塔斯那魯的聚合聖光，以及虔誠信徒所獻上的祈禱，創造了擁有深奧力量的神聖法器。這些法器將會成為我們對抗巫妖王陰謀的武器。$B$B帶著這個，$n。看緊它，然後將它送到艾克索達。把它送到聖光地窖的預言者費倫手上，他才能使用這東西的力量對抗北方邪惡的力量。', '', '', '', '', '', '', 47187),
(11488, 'zhTW', '博學者殿堂', '破碎之日會所的主教雷索爾要去你搜尋博學者殿堂，找到提里斯，一個血精靈間諜。', '歡迎來到太陽之井，$c。盡快把你自己安頓下來，還有很多事情等著我們!$b$b我?是的，我有些小事等你去做，不過我很懷疑你能不能勝任。$b$b我們有個線民潛伏在博學者殿堂收集情報，但他最近失去音訊，我開始有點擔心。$b$b殿堂就在東邊的高處。他收集的情報對我們的任務來說非常重要。$b$b你認為你能解決嗎，$r?', '', '', '', '', '', '', 47187),
(9673, 'zhTW', '野獸訓練', '和銀月城的海德尼斯談談。', '除了和你選擇的寵物合作之外，你還必須學會一套照顧和訓練它的學問。為此，銀月城的野獸訓練師海德尼斯可以指引你的道路。$b$b只要我的學生對他展現最大的敬意，他也會尊敬他們。別讓我失望。', '', '', '', '', '', '', 47187),
(3784, 'zhTW', '協助大德魯伊符文圖騰', '與雷霆崖的大德魯伊哈繆爾·符文圖騰談話。', '打擾一下，$c，如果可能的話，我想佔用你一點時間。$B$B雷霆崖的塞納里奧議會希望能找到像你這樣經驗豐富的冒險家來幫助他們進行一項重要的研究項目。雖然我不知道詳細的情況，但是我可以告訴你，正是哈繆爾·符文圖騰親自負責這項研究。$B$B要是你感興趣的話，請直接去雷霆崖的長者高地找他談談。', '', '', '', '', '', '', 47187),
(1359, 'zhTW', '給金格的貨物', '將狼心樣品交給幽暗城的藥劑師金格。', '你拿來我的狼心具有與眾不同的特質。從中提煉出的特殊毒素甚至可以毒死長著這種心臟的狼!$B$B這讓我感到非常驚訝，所以我們必須對此進行深入的研究。把這幾份心臟樣本送到我的同事藥劑師金格那裡。你應該可以在幽暗城的鍊金房裡找到她。', '', '', '', '', '', '', 47187),
(1183, 'zhTW', '哥布林贊助商', '把燃料調節器的藍圖帶給閃光平原的普茲克。', '你現在就趕快出發吧。替我向普茲克問好，順便告訴他，如果他需要什麼東西，就儘管跟我說。我期待著他能馬上打破記錄!', '', '', '', '', '', '', 47187),
(828, 'zhTW', '瑪高茲', '和瑪高茲談話。', '有個名叫瑪高茲的薩滿對於燃刃氏族的墮落頗有瞭解。他說在奧格瑪外面的山裡有個叫骷髏石的山洞，有一大批燃刃祭司藏匿在那裡。$B$B在你前往骷髏石之前，去和瑪高茲談談吧。他十分睿智，會給你一些有價值的建議。$B$B瑪高茲就住在東北方的海岸和枯水谷中間。$B$B你要聽從瑪高茲的建議，但是不管他怎麼說，$n，我都要求你幹掉那些燃刃祭司!', '', '', '', '', '', '', 47187),
(804, 'zhTW', '薩科斯', '將哈納祖目前的狀況告訴大獸穴內的高內克。', '看見你為我這麼一個素不相識的可憐傢伙做了這麼多事情，我突然又堅強了起來。我絕不能就這麼輕易地死在這種地方!我得堅持下去!$b$b可現在我還是不能自己回到大獸穴去。$n，請你再幫個忙，回大獸穴向高內克報告一下我現在的情況。', '', '', '', '', '', '', 47187);
